INSERT INTO `deals` (`id`, `title`, `image`, `address`, `lat`, `lon`, `pin`, `expiry_date`, `short_description`, `description`, `category_id`, `business_id`, `price`, `promo_code`, `how_to_redeem`, `status`, `created_at`, `updated_at`) VALUES
(1, '60-Minute Squash Court Hire: One ($15), Five ($45) or Ten Sessions ($75) at Focus Health & Fitness (Up to $250 Value)', '1641029987.deal2.png', '35 Carrick Dve, Tullamarine, VIC 3034', -37.700196, 144.8827096, '3034', '2022-01-08', '<p>$15 for one 60-minute squash court and racquet hire for two people (total value up to $25)</p><p>$45 for five 60-minute squash court and racquet hires for two people (total value up to $125)</p><p>$75 for ten 60-minute squash court and racquet hires for two people (total value up to $250)</p>', '<p><strong>HOW BEST TO USE THIS DEAL:</strong>• In light of ongoing government advice regarding social distancing, and restrictions placed upon public gatherings and non-essential services, please visit&nbsp;<a href=\"https://www.australia.gov.au/\">https://www.australia.gov.au/</a>&nbsp;for the latest rules and regulations• Please check the expiry date for this deal on your Voucher under My Groupons (if you\'ve already bought this deal) or the Fine Print on this page (if you haven\'t already bought this deal), for blackout periods which may apply (outside of government regulations), and for full terms and conditions• Please also contact the merchant directly, where possible, to understand any additional measures they may have in place which may help indicate when and how you can redeem this voucher• Limit of 1 voucher per person• Purchase up to 5 additional as gifts• Not valid on Thu 5pm-10pm•&nbsp;<strong>New customers only</strong>• Valid for one one-hour court hire per day• Each voucher valid for two people to play in each court•&nbsp;<strong>Additional surcharge of $5 to be paid directly to the merchant for peak times</strong>•&nbsp;<strong>Peak times are as follows: Mon-Wed 5pm-8pm</strong>• All visits must be completed within validity period• Valid at Tullamarine only</p>', 8, 1, '125', 'DEAL', '<p>•&nbsp;<strong>Expiry: 4 months from purchase</strong>• Phone to book:&nbsp;<a href=\"tel:(03) 9338 6418\">(03) 9338 6418</a>• State Voucher and Security Code at time of booking• Present printed or smartphone voucher on arrival• Download free Groupon app for&nbsp;<a href=\"http://gr.pn/16v6p9C\">Android</a>&nbsp;and&nbsp;<a href=\"http://gr.pn/10xvNXr\">iOS</a></p>', 1, '2022-01-01 04:09:47', '2022-01-01 04:54:41'),
(2, '60-Min Trackman Session for 1 ($65) or Training Pkg for 2 Ppl ($300) at Golftec Australia Melbourne (Up to 419.90 Val)', '1641031096.deal3.png', '325 Collins St, Melbourne, 3000', -37.8166399, 144.9613611, '3000', '2022-01-09', '<p>$65 for a 60-minute Trackman session for one person (total value up to $90)</p><p>$130 for a 60-minute Trackman session for two people (total value up to $180)</p><p>$150 for a 30-minute lesson, 60-minute Trackman session and swing locker for one person (total value up to $209.95)</p><p>$300 for a 30-minute lesson, 60-minute Trackman session and swing locker for two people (total value up to $419.90)</p><p>&nbsp;</p><p>Highlights</p><ul><li>Get valuable insights into swing technique and ball flight such as carry distance, swing speed, ball speed, accuracy, swing path, face angle at impact</li><li>Add a 30-min lesson with a coach</li><li>Enjoy 1-year access to a swing locker hosting videos and analysis data</li></ul>', '<p>• Limit of 1 voucher per person• Purchase up to 3 additional as gifts• Limit of 1 voucher per transaction• Only available at Melbourne branch• Cannot be used for member lessons• Additional spend is paid directly to the merchant• Lessons not available on Sun, simulator not available Sat-Sun• Government restriction may apply, merchant will keep a waiting list•&nbsp;<a href=\"http://www.groupon.com.au/universal-fine-print\">Standard fine print for all deals</a></p>', 8, 1, '65', 'DEAL1', '<p>•&nbsp;<strong>Expiry: 6 months from purchase</strong>• Email to book:&nbsp;<a href=\"mailto:sam@golftec.com.au\">sam@golftec.com.au</a>• State your name, contact details, and preferred times• State Voucher and Security Code at time of booking• Present printed voucher on arrival</p>', 1, '2022-01-01 04:28:16', '2022-01-01 04:54:54'),
(3, 'Little Cupcakes', '1641032037.deal4.png', '4/118-126 Queen St, Melbourne, VIC, 3000', -37.8156612, 144.9591239, '3000', '2022-01-09', '<h4 class=\"title-in-pitch\">$9.90 for a box of six mini cupcakes and one coffee (total value up to $20.80)</h4>\r\n<h4 class=\"title-in-pitch\">$18.90 for a box of 12 mini cupcakes and two coffees (total value up to $38)</h4>\r\n<h4 class=\"title-in-pitch\">$36 for a box of 24 mini cupcakes and two coffees (total value up to $68)</h4>', '<div id=\"about-deal\" class=\"description\" data-bhw=\"WhatYoullGet\" data-bh-viewport=\"respect\" data-bhw-path=\"FeaturedDeal|deal:5e2175e5-2c99-4f4e-84c7-70f5bbaa7fed|DealWriteUp|WhatYoullGet\">\r\n<section id=\"deal-pitch\">\r\n<h3>Highlights</h3>\r\n<ul>\r\n<li>Available at a choice of three locations</li>\r\n<li>Ideal for birthdays, events or work functions</li>\r\n<li>Each cupcake is freshly baked and hand-decorated with frosting or rich ganache</li>\r\n<li>Choose from a range of 17 different flavours</li>\r\n<li>Enjoy a cup of coffee to go with the sweets</li>\r\n<li>See the flavour and colour&nbsp;<a href=\"https://littlecupcakes.com.au/collections/our-flavors\">brochure</a></li>\r\n</ul>\r\n<p>Menu items may be subject to seasonal change.</p>\r\n</section>\r\n</div>\r\n<div id=\"fine-print\" class=\"t-pod fine-print \" data-bhd=\"\" data-bhw=\"DealFinePrint\" data-bh-viewport=\"respect\" data-bhw-path=\"FeaturedDeal|deal:5e2175e5-2c99-4f4e-84c7-70f5bbaa7fed|DealWriteUp|DealFinePrint\">\r\n<h3>Fine Print</h3>\r\n<div>\r\n<div>\r\n<div><span class=\"fine-print-description\"><strong>HOW BEST TO USE THIS DEAL:</strong><br />&bull; In light of ongoing government advice regarding social distancing, and restrictions placed upon public gatherings and non-essential services, please visit&nbsp;<a href=\"https://www.australia.gov.au/\" target=\"_blank\" rel=\"noopener\" aria-label=\"https://www.australia.gov.au/\">https://www.australia.gov.au/</a>&nbsp;for the latest rules and regulations<br />&bull; Please check the expiry date for this deal on your Voucher under My Groupons (if you\'ve already bought this deal) or the Fine Print on this page (if you haven\'t already bought this deal), for blackout periods which may apply (outside of government regulations), and for full terms and conditions<br />&bull; Please also contact the merchant directly, where possible, to understand any additional measures they may have in place which may help indicate when and how you can redeem this voucher<br /><br />&bull; Limit of 2 vouchers per person<br />&bull; Purchase up to 1 additional as a gift<br />&bull; Valid for small regular coffee<br />&bull; Valid for pick-up only<br />&bull; Valid for choice of minis - 17 flavors<br />&bull; No substitutions<br />&bull;&nbsp;<a href=\"http://www.groupon.com.au/universal-fine-print\" target=\"_blank\" rel=\"noopener\">Standard fine print for all deals</a></span></div>\r\n</div>\r\n</div>\r\n</div>', 6, 1, '19', 'DEAL2', '<p>&bull;&nbsp;<strong>Expiry: 90 days from purchase</strong><br />&bull; No booking required<br />&bull; Present printed or smartphone voucher on arrival<br />&bull; Download free Groupon app for&nbsp;<a href=\"http://gr.pn/16v6p9C\" target=\"_blank\" rel=\"noopener\">Android</a>&nbsp;and&nbsp;<a href=\"http://gr.pn/10xvNXr\" target=\"_blank\" rel=\"noopener\">iOS</a><br />&bull;&nbsp;<strong>Valid hours:</strong><br />Degraves Street: Mon-Fri 8am-5.30pm; Sat 9am-5.30pm<br />Queen Street: Mon-Fri 8am-5pm<br />William Street: Mon-Fri 8am-4pm</p>', 1, '2022-01-01 04:43:57', '2022-01-01 04:43:57'),
(4, 'Curry Vault indian Restaurant', '1641032353.deal5.png', '18-20 Bank Place, Melbourne, VIC 3000', -37.8164226, 144.958263, '3000', '2022-01-09', '<p>Duos can sip on wine on wine and enjoy a choice of curry like fish masala or chicken rogan josh, served with rice and naan to share</p>', '<div id=\"about-deal\" class=\"description\" data-bhw=\"WhatYoullGet\" data-bh-viewport=\"respect\" data-bhw-path=\"FeaturedDeal|deal:ffa1cbd9-74d5-40ee-ac03-ef1e74e42c4c|DealWriteUp|WhatYoullGet\">\r\n<section id=\"deal-pitch\">\r\n<h4 class=\"title-in-pitch\">$45 for an Indian meal with a glass of wine each for two people (total value up to $70)</h4>\r\n<ul>\r\n<li>Choice of curry each</li>\r\n<li>Glass of house wine each</li>\r\n<li>Rice to share per two</li>\r\n<li>Naan to share per two</li>\r\n<li>See&nbsp;<a href=\"https://www.curryvault.com.au/wp-content/uploads/2018/02/Dine-in-amd-take-away-menu-proof.pdf\" target=\"_blank\" rel=\"noopener\">the full menu</a></li>\r\n</ul>\r\n<h4 class=\"title-in-pitch\">$89 for an Indian meal with a glass of wine each for two people (total value up to $140)</h4>\r\n<p>Menu items may be subject to seasonal change.</p>\r\n</section>\r\n</div>\r\n<div id=\"fine-print\" class=\"t-pod fine-print \" data-bhd=\"\" data-bhw=\"DealFinePrint\" data-bh-viewport=\"respect\" data-bhw-path=\"FeaturedDeal|deal:ffa1cbd9-74d5-40ee-ac03-ef1e74e42c4c|DealWriteUp|DealFinePrint\">\r\n<h3>Fine Print</h3>\r\n<div>\r\n<div>\r\n<div><span class=\"fine-print-description\">If you make a reservation through Groupon, you may cancel or change your reservation up to 24 hours before its start time. After this point you are not entitled to a cash refund or to reschedule your reservation. Valid for curry up to the value of $23.50. Wine can be swapped for beer or soft drink each. Only valid for lunch: Mon-Friday lunch 11.30-2.30.&nbsp;<a href=\"http://www.groupon.com.au/universal-fine-print\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">Standard fine print for all deals</a>.</span></div>\r\n</div>\r\n</div>\r\n</div>', 6, 1, '89', 'DEAL4', '<p><br />Purchase voucher and book online via&nbsp;<a href=\"https://www.groupon.com.au/reservations/\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">https://www.groupon.com.au/reservations/</a>. If you received your voucher as a gift, sign in or register for a Groupon account then click on the \'Received a gift? Book Now\' link in the top right. Select date of booking and enter details. You\'ll receive an email to confirm reservation details. Present printed or smartphone voucher on arrival. Download free Groupon app for&nbsp;<a href=\"http://gr.pn/16v6p9C\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">Android</a>&nbsp;and&nbsp;<a href=\"http://gr.pn/10xvNXr\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">iOS</a>&nbsp;No walk-ins or phone bookings allowed. Limit 5 per person, may buy 5 additional as gift(s). Limit 1 voucher per booking. BYOB prohibited. Expires 3 months after purchase.</p>', 1, '2022-01-01 04:49:13', '2022-01-01 04:49:13'),
(5, 'Essence Restaurant at Melbourne Marriott', '1641032601.deal6.png', 'Cnr Exhibition & Lonsdale St, Melbourne, VIC 3000', -37.8100554, 144.9675117, '3000', '2022-01-09', '<p>Sip on a glass of bubbly while nibbling on sweet and savoury treats such as finger sandwiches, pies and macaroons</p>\r\n<h4 class=\"title-in-pitch\">$90 for a high tea experience for two people</h4>\r\n<h4 class=\"title-in-pitch\">$110 for a high tea experience with sparkling for two people</h4>', '<h3>Highlights</h3>\r\n<ul>\r\n<li>Enjoy three plates of decadent desserts and flavoursome savouries</li>\r\n<li>Nibble on an array of finger sandwiches</li>\r\n<li>Sink teeth into freshly baked pastries</li>\r\n<li>Opt to include a glass of sparkling wine per person</li>\r\n</ul>\r\n<h3>Menu</h3>\r\n<h4 class=\"title-in-pitch\">Selection of cold dishes:</h4>\r\n<ul>\r\n<li>Tasmanian salmon, dill cr&egrave;me fraiche on rye bread</li>\r\n<li>Buttermilk fried chicken sliders</li>\r\n<li>Cucumber, tomato and brie cheese sandwich (V)</li>\r\n</ul>\r\n<h4 class=\"title-in-pitch\">Selection of warm savoury dishes:</h4>\r\n<ul>\r\n<li>Chicken and Chardonnay pie</li>\r\n<li>Mini spinach and ricotta quiche</li>\r\n<li>Gourmet mini sausage roll</li>\r\n</ul>\r\n<h4 class=\"title-in-pitch\">Selection of handmade pastries and desserts:</h4>\r\n<ul>\r\n<li>Kaffir lime pannacotta with fresh berries</li>\r\n<li>Mini chocolate eclair</li>\r\n<li>Bite size sous filled with cr&egrave;me patisserie</li>\r\n<li>Mini boutique cakes</li>\r\n<li>Macaroons assortment</li>\r\n<li>Scone served with preserve, Yarra Valley pure cream</li>\r\n</ul>\r\n<p>*All menus are subject to change without notice.</p>', 6, 1, '90', 'DEAL5', '<p>Purchase your voucher and book online via&nbsp;<a href=\"https://www.groupon.com.au/reservations\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">groupon.com.au/reservations</a>. If you received your voucher as a gift, sign in or register for a Groupon account then click on the \'BOOK A GIFT\' button. Select date of booking and enter details. You\'ll receive an email to confirm reservation details. Present printed or smartphone voucher on arrival. Download free Groupon app for&nbsp;<a href=\"http://gr.pn/16v6p9C\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">Android</a>&nbsp;and&nbsp;<a href=\"http://gr.pn/10xvNXr\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">iOS</a>. Limit of 4 vouchers per option Limit of 2 vouchers per booking. Valid to: 31/01/2022.</p>', 1, '2022-01-01 04:53:21', '2022-01-01 04:53:21'),
(6, 'Essence Restaurant at Melbourne Marriott', '1641032601.deal6.png', 'Cnr Exhibition & Lonsdale St, Melbourne, VIC 3000', -37.8100554, 144.9675117, '3000', '2022-01-09', '<p>Sip on a glass of bubbly while nibbling on sweet and savoury treats such as finger sandwiches, pies and macaroons</p>\r\n<h4 class=\"title-in-pitch\">$110 for a high tea experience with sparkling for two people</h4>', '<h3>Highlights</h3>\r\n<ul>\r\n<li>Enjoy three plates of decadent desserts and flavoursome savouries</li>\r\n<li>Nibble on an array of finger sandwiches</li>\r\n<li>Sink teeth into freshly baked pastries</li>\r\n<li>Opt to include a glass of sparkling wine per person</li>\r\n</ul>\r\n<h3>Menu</h3>\r\n<h4 class=\"title-in-pitch\">Selection of cold dishes:</h4>\r\n<ul>\r\n<li>Tasmanian salmon, dill cr&egrave;me fraiche on rye bread</li>\r\n<li>Buttermilk fried chicken sliders</li>\r\n<li>Cucumber, tomato and brie cheese sandwich (V)</li>\r\n</ul>\r\n<h4 class=\"title-in-pitch\">Selection of warm savoury dishes:</h4>\r\n<ul>\r\n<li>Chicken and Chardonnay pie</li>\r\n<li>Mini spinach and ricotta quiche</li>\r\n<li>Gourmet mini sausage roll</li>\r\n</ul>\r\n<h4 class=\"title-in-pitch\">Selection of handmade pastries and desserts:</h4>\r\n<ul>\r\n<li>Kaffir lime pannacotta with fresh berries</li>\r\n<li>Mini chocolate eclair</li>\r\n<li>Bite size sous filled with cr&egrave;me patisserie</li>\r\n<li>Mini boutique cakes</li>\r\n<li>Macaroons assortment</li>\r\n<li>Scone served with preserve, Yarra Valley pure cream</li>\r\n</ul>\r\n<p>*All menus are subject to change without notice.</p>', 6, 1, '110', 'DEAL5', '<p>Purchase your voucher and book online via&nbsp;<a href=\"https://www.groupon.com.au/reservations\" target=\"_blank\" rel=\"noopener\" aria-label=\"TEXT\">groupon.com.au/reservations</a>. If you received your voucher as a gift, sign in or register for a Groupon account then click on the \'BOOK A GIFT\' button. Select date of booking and enter details. You\'ll receive an email 