INSERT INTO `events` (`id`, `title`, `image`, `address`, `lat`, `lon`, `pin`, `start_date`, `end_date`, `start_time`, `end_time`, `description`, `category_id`, `business_id`, `contact_email`, `contact_phone`, `website`, `language_id`, `format_id`, `is_paid`, `price`, `is_recurring`, `no_of_followers`, `status`, `created_at`, `updated_at`) VALUES
(1, 'NGV Architecture Commission: Pond', '1641014917.event1.jpg', 'National Gallery of Victoria 180 St Kilda Rd Melbourne 3006', -37.8225899, 144.9667391, '3006', '2022-01-01', '2022-01-07', '10:00', '17:00', '<p>A beautiful architectural installation, replete with a pink pond evocative of Australia’s inland salt lakes, has been selected as the winner of the NGV’s 2021 Architecture Commission in the Grollo Equiset Garden at NGV International.</p><p>Designed by a Melbourne-based team comprising architecture firm Taylor Knights in collaboration with artist James Carey, the installation, entitled pond[er], offers a space for visitors to cool off during the summer months and reflect on their relationship with the environment.</p><p>Referencing Sir Roy Grounds’s open-air courtyards in the original design of NGV International, this architecture and landscape installation comprises two key design elements: a body of indigenous plants and a body of water. The body of water is coloured pink, making direct reference to the many inland salt lakes in Victoria and highlighting the scarcity, importance and political implications of water as a natural resource.</p>', 4, 1, 'info@business.com', '+61 (0)3 8620 2222', 'https://www.ngv.vic.gov.au/exhibition/2021-ngv-architecture-commission/', 1, 1, 1, 99, 0, 0, 1, '2021-12-31 23:58:37', '2022-01-01 02:01:30'),
(2, 'Open Arcade: Gaming for Everyone', '1641016374.event2.jpg', 'Queensbridge Square 3 Queens Bridge St Southbank 3006', -37.8212693, 144.9600735, '3006', '2022-01-01', '2022-01-07', '7:00', '20:00', '<p>This summer, come and play one of four digital games outdoors on a big screen. The fun, inclusive, free and safe initiative was selected as a pilot in the Reimagining the City Challenge, and people of all ages and abilities are invited to play.</p><p>No equipment is required – simply step into the game zone to trigger the start of play. Each game runs for about five minutes, and there are four games to choose from.</p>', 4, 1, 'smartcities@melbourne.vic.gov.au', '03 9658 9658', 'https://participate.melbourne.vic.gov.au/emerging-tech-testbed/open-arcade', 1, 6, 0, 0, 1, 0, 1, '2022-01-01 00:22:54', '2022-01-01 02:01:38'),
(4, 'Thai Town Melbourne', '1641021995.event3.jpg', 'Thai Town Melbourne Shop 25 Artemis Ln QV Shopping Centre Melbourne 3000', -37.8106016, 144.9640362, '3000', '2022-01-03', '2022-01-09', '12:00', '21:00', '<p>Thai Town is a place where Thai people, especially students, can find a taste of home, with the look of a hawker market but offering table service.</p><p>Head to a different area depending on what you feel like eating – maybe boat noodles, the frying areas or the dessert station. There\'s even a mini Thai grocer at the front.</p><p>With live music nightly from around 9pm this place is popular with students, especially on Friday nights.</p>', 6, 1, 'info@thaitownqv.com.au', '03 9654 1555', 'https://www.thaitownqv.com.au/', 1, 3, 1, 199, 0, 1, 1, '2022-01-01 01:56:35', '2022-02-09 13:39:54'),
(5, 'YOI Indonesian Fusion', '1641022230.event4.jpg', 'YOI Indonesian Fusion 1/155 Franklin St Melbourne 3000', -37.8087177, 144.9572144, '3000', '2022-01-03', '2022-01-09', '11:00', '21:00', '<p>Through dishes using bold flavours, intense spices and soulful, traditional dishes, YOI’s series of Indo brunches give diners a sense of that tropical Bali holiday every Aussie plans for.</p><p>From Nasi Bali, Nasi Padang to Martabak and a selection of Padre coffee (with an Indo twist), diners will be transported to a culinary retreat.</p><p>For only $45 diners will share an Indonesian-inspired brunch designed for two people over the course of two hours, with a choice of two mains, a dessert and two Indo-inspired coffees.</p><p>Bookings can be made by phone or email.</p>', 6, 1, 'info@yoirestaurant.com.au', '03 9043 1530', 'https://yoirestaurant.com.au/', 3, 3, 1, 299, 1, 0, 1, '2022-01-01 02:00:30', '2022-01-01 02:00:30'),
(6, 'Spring Street Grocer', '1641023518.event5.jpg', 'Spring Street Grocer 157 Spring St Melbourne 3000', -37.8110016, 144.9705334, '3000', '2022-01-03', '2022-01-09', '10:00', '18:00', '<p>Spring Street Grocer is a temple for the worship of fine food, offering gelato, groceries, pantry essentials, coffee beans and cheese all under one roof.</p><p>Gelateria Primavera serves up cold-pressed juice, coffee and hand-churned Italian gelato, in a range of exotic spices and flavours. The menu changes daily but regular favourites include the famous pistachio di Bronte, and salted caramel.</p><p>Inside, the grocer is stocked with charcuterie, local fruit and vegetables, and gourmet pantry essentials. There\'s a wide range of take-home meals made in-house with a selection of paninis and toasties on offer for lunch.</p><p>The grocer also features Australia’s first underground cheese maturation cellars, headed up by a team of cheesemongers. The cellar aims to inspire and educate cheese lovers while offering the finest selection of cheese in the country.</p><p>Stop by Spring Street or shop online for delivery or pickup.</p>', 6, 1, 'info@springstreetgrocer.com.au', '03 9639 0335', 'https://springstreetgrocer.com.au/', 1, 4, 0, 0, 0, 0, 1, '2022-01-01 02:21:58', '2022-01-01 02:21:58'),
(8, 'Test event', '1646702381.home-banner2.jpg', 'Test Address in test lane', 0, 0, '3000', '2022-03-15', '2022-03-22', '10:00', '21:00', '<p>test event</p>', 6, 1, 'test@testmail.com', '+91123456789', 'http://business.com', 1, 4, 1, 120, 0, 0, 1, '2022-03-07 19:49:41', '2022-03-07 19:52:57');
