INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(1, '2170', 'While you\'re only 28km out of Sydney, there\'s loads to do in 2170! The diverse range of age groups and cultures mean you can go from work to play and find plenty to do, whatever your interests. There\'s loads going on in the shops and cafes around 2170 whether you\'re in Liverpool, Lurnea, or elsewhere, with plenty of green spaces and parks to keep the kids happy, too. A city outside of the city, find things to do around 2170 and keep both yourself and the whole family entertained!', NULL, 1, NULL, NULL),
(2, '4350', 'The 4350 neighbourhood is so beautiful that you can easily fill your time doing nothing but exploring the outdoors. With stunning views of the surrounding area, gorgeous parkland, and quiet streets ideal for a bike ride with the kids, a real outdoor lifestyle is on your doorstep. There\'s so much going on beyond, too! Whether it\'s historically significant sites, art galleries, or charming cafes, there\'s always loads going on in Toowoomba and the entire 4350 neighbourhood that will interest the whole family!', NULL, 1, NULL, NULL),
(3, '3030', 'Although you\'re just a short ride up the freeway from the centre of Melbourne, 3030 is filled with plenty to see and do while also being one of Victoria\'s best places to live if you love to just kick back and relax. Whether you live beside the lake and love outdoor activities around Point Cook and Sanctuary Lakes, or prefer to spend your time in the shops and cafes around 3030\'s several retail enclaves, you\'ll always find plenty going on without the hassle of driving into the city.', NULL, 1, NULL, NULL),
(4, '3029', '3029 has everything you need locally, with great transport links for those times you do need to travel into the city. Close to home, you can lose yourself in outdoor pursuits, with miles of walking tracks and nature trails for birdwatching and other activities. If you don\'t mind travelling a little further from Hopper\'s Crossing and Truganina, the lake and the suburbs of 3030 are just past your doorstep, too. Closer to home, it\'s easy to find things to do, with shops, eateries, and cinemas found in several locations, there\'s plenty of things available to keep yourself entertained.', NULL, 1, NULL, NULL),
(5, '3977', 'There are many benefits from living in a neighbourhood like 3977! Cranbourne and its surrounding suburbs are far enough from the city to be outside its limits but close enough to get into, while there is also plenty to do locally. With a wide range of community facilities and initiatives found nearby, including The Casey Complex and Cranbourne Multicultural Community centre, you can enjoy your hobbies, find new friends, and keep the kids entertained in several ways. With parkland, recreation reserves, and a handful of top-quality golf courses, 3977 really does have something for everyone!', NULL, 1, NULL, NULL),
(6, '6210', '6210 is renowned for being one of the most laid-back locations in Australia, but where you live is anything but boring! Whether you enjoy waterfront living or are in a more rural location, you know stress is for those up in Perth, especially if you work there yourself! From walking the dog and hanging out with the kids to eating in places that make it feel like you\'re on vacation around Mandurah, or checking out the latest museums, 6210 is filled with opportunities to achieve a perfect mix of relaxation and enjoyment.', NULL, 1, NULL, NULL),
(7, '4740', '4740 is one of the most beautiful neighbourhoods in all of Australia. Whether you live in and around Mackay itself or further out in the suburbs of 4740, there\'s loads for you and the family to enjoy. Take a boat trip to the nearby section of the Great Barrier Reef, visit the rainforest and see the koalas on the St. Bees, or closer to home you can enjoy the beach, waterpark, and national park. The suburbs of 4740 are also filled with amazing places to eat and to find other things to do with friends and family.', NULL, 1, NULL, NULL),
(8, '2560', '2560 is the perfect neighbourhood for a convenient commute up to Sydney while being a gateway to escape to Australia\'s amazing outdoors at the weekend. Campbelltown is busy while maintaining a relaxed vibe, while further south the Appin Valley area is an ideal gateway to the coast or some stunning national parks. Back in town you\'ll find plenty to do, with a diverse mix of established retail brands alongside charming independent stores, cafes, and amenities to interest those keen on performing arts. 2560 is a wonderful neighbourhood with something for everyone!', NULL, 1, NULL, NULL),
(9, '2145', 'On the western outskirts of Sydney, 2145 is a great neighbourhood when you want the city on one doorstep and the beautiful outdoors on the other. With stunning views out towards the Blue Mountains, you have everything you need around Pendle Hill and Wentworthville without needing to venture into the city if you don\'t want to. Immerse yourself in the wealth of outdoor activities on offer whether you are a tennis player a basketballer, or enjoy the speciality shops that fill 2145\'s streets and shopping centres.', NULL, 1, NULL, NULL),
(10, '3064', 'Located to the north of Melbourne, 3064 is ideal for those who enjoy both the hustle and bustle of the city, as well as the peace and beauty of the outdoors. If you want to fill a weekend, why not check out Craigieburn’s shopping centres and cafes, and explore the Greenvale Reservoir in Roxburgh Park? Or, if you prefer to immerse yourself in culture, feel free to mosey around the local art gallery at Hume Global Learning Centre. With so much on offer in 3064, it’s little wonder why so many new and established families gravitate to its suburbs.', NULL, 1, NULL, NULL),
(11, '4670', '4670 is a neighbourhood with something for everyone, especially if you love the outdoors! Around 4670 we have botanic gardens, parkland, and coastline, with state forest and national parks on the edge of the neighbourhood, with many more just a short drive beyond your postcode. Around Bundaberg you\'ll find everything from shops and cafes to entertainment amenities like cinemas and theatres. Bundaberg Distillery and the Hinkler Hall of Aviation stand among some of the most popular visitor locations across the whole state, too.', NULL, 1, NULL, NULL),
(12, '2250', 'Whether you live by the water around Gosford and Erina or are further inland and upstate, there\'s loads going on around 2250. Your neighbourhood is rich in culture, with the shops and eateries across 2250 reflecting the diverse nature of your population. 2250 is a hugely relaxed neighbourhood with something for everyone, with Sydney and Central Coast within easy daily commuting distances. Outside of the built up areas, you have access to some of the greenest neighbourhood in Australia, with forests, national parks, and a whole host of other things to do right on the doorstep.', NULL, 1, NULL, NULL),
(13, '4305', 'A neighbourhood fast growing in its sophistication and style, Ipswich and the surrounding 4305 area gives easy access into Brisbane while also being a desirable city in its own right. Whether you live close to the central waterfront or further out, there\'s always loads to do around the local shopping malls and retail parks. The streets of 4305 continue to undergo a makeover with cool eateries complementing the long-standing heritage of the city, with new improvements taking the best of Australia\'s big cities and putting a unique 4305 slant on them!', NULL, 1, NULL, NULL),
(14, '3350', '3350 is an amazing neighbourhood with loads to do around Ballarat and the surrounding suburbs. On top of the fantastic amenities in the city, we\'ve got Sovereign Hill, the Ballarat Wildlife Park, Kryal Castle, and the Ballarat Botanical Gardens to name but a few of the brilliant things to do. Venturing a little further afield takes us to miles of walking and cycling trails across the highlands of Victoria. Whether you want to hit the outdoors or immerse yourself in the culture and history of your neighbourhood, you\'ll find plenty of opportunity to do this and much more around 3350.', NULL, 1, NULL, NULL),
(15, '2261', 'You already know why living in 2261 is so great. With so much to do around Central Coast but with Sydney and Newcastle just an hour away, what more could you want? Wherever you live in the neighbourhood, you have easy access to beautiful beaches whether you want to surf, walk, or simply kick back and relax. Around the city itself there\'s something for everyone whether you want to shop, eat, or learn more about the history of where you live. With lush parkland and national parks on the doorstep, you\'ll find loads going on around 2261 to keep yourself and your family entertained.', NULL, 1, NULL, NULL),
(16, '4551', 'You might live in the gateway to the Sunshine Coast but living in 4551 you fast learn there\'s lots to do around Caloundra and the neighbourhood\'s surrounding suburbs. The most obvious thing to do might be to hit the beach, but that\'s far from all you can do from Currimundi down to Pelican Waters. Enjoy the boardwalks and local parks, visit local heritage sites, and venture inland check out the racecourse and other outdoor pursuits around Bells Creek and Little Mountain.', NULL, 1, NULL, NULL),
(17, '2770', 'On the western outskirts of Sydney on the doorstep of the Western Sydney Parklands, Mount Druitt and its surrounding suburbs are among the most diverse in Australia. You can enjoy access to heritage listed buildings, parklands, or enjoy the local food and multicultural experiences on offer, while also having the Blue Mountains on the doorstep and the ability to venture further out into Blacktown. Make the most of everything going on around 2770 and check out what\'s happening locally today.', NULL, 1, NULL, NULL),
(18, '4870', 'While 4870 and Cairns is the gateway to the Great Barrier Reef for many, to those of you who live there, it\'s so much more. While the beaches, rainforest, and nature parks abound, alongside attractions like the Kuranda Scenic Railway, there are loads going on in the urban areas and suburbs, too. There\'s shopping and entertainment on offer in the city, with parkland centrally as well as across the suburbs. You can even use the Kuranda Scenic Railway to get out to suburbs like Freshwater, Stratford, and Redlynch. Whether you love the outdoors or want to hang around the city, you can always find something to do around 4870.', NULL, 1, NULL, NULL),
(19, '6112', '6112 is a great neighbourhood for its proximity to Perth while having loads going on around Armadale and the surrounding neighbourhoods. Your neighbourhood is filled with opportunities to immerse yourself in the culture at places like the Aboriginal Interpretation Centre and Vintage Machinery Museum, as well as being filled with outdoor attractions like the Old Jarrah Tree and numerous parks. Around 6112 you\'ll also find vintage tea rooms, cafes, and a mix of chain and independent stores, as well as having a gateway to the southern regions of Western Australia via the rail interchange.', NULL, 1, NULL, NULL),
(20, '2650', 'Whether you live in Wagga Wagga itself, one of the city\'s surrounding suburbs, or further out in 2650, you\'ll never be short of things to do. Whether you enjoy the shops and eateries of Baylis Street in the city centre, or enjoy spending time in the fast-developing suburbs on the outskirts of Wagga Wagga like Glenfield Park, 2650 has something for the whole family. Suburbs like Lake Albert feature the country club and other amenities, while when you wish to venture further afield you\'ll find the forest and national parks to the south and east.', NULL, 1, NULL, NULL),
(21, '4655', '4655 is one of Queensland\'s most unique coastal neighbourhoods, being right on the waterfront but not necessarily being most famous for its beaches. Your beaches are great, especially from Point Vernon around to Urangan, but there\'s plenty of cultures to be found around Hervey Bay, Pialba, and Torquay, too. The Discovery Sphere and Regional Gallery are great attractions around the neighbourhood, while back on the beachfront Pialba\'s Esplanade and Main Street are packed with places to shop and eat. With water parks and miles of parkland ideal just for hanging out, 4655 is a coastal neighbourhood with a difference!', NULL, 1, NULL, NULL),
(22, '3150', 'There is often a buzz about the busy streets of 3150’s suburbs. Browse the stores in Brandon Park Centre and the Wheelers Hill Shopping Center, or eat something you’ve never had before in Glen Waverley. With one of the widest selections of cuisines available outside the big cities, Glen Waverley can offer visitors everything from delicious Mediterranean food to meals from east Asia and eastern Europe. But that’s not to say that there’s nowhere to get away from the hustle and bustle of 3150. In these well-connected suburbs, green space is just a stone’s throw away.', NULL, 1, NULL, NULL),
(23, '3023', 'Over at the western border of Melbourne is 3023, a place perfect for outdoorsy types. With plenty of parks to amble about in, outdoor swimming centres, and nature reserves, it’s easy to pass the time in the peaceful surroundings of 3023. But, while there are the much quieter suburbs of Burnside and Cairnlea, there are more energetic areas, too, such as Deer Park. Here, you can spend your day shopping over at Brimbank Shopping Centre and finish it off with a slap-up meal at the Deer Park Hotel.', NULL, 1, NULL, NULL),
(24, '3216', 'Situated on the outskirts of Geelong, 3216 is a scenic neighbourhood that offers plenty to do without the need to venture into the city itself. The views of the surrounding area from Grovedale and Wandana Heights are excellent, while a walk around Highton reveals much in the way of shopping, eateries, and culture. 3216 has plenty of opportunities to enjoy sporting pursuits, too, with open public fields, specific facilities such as tennis courts and football ovals, and play equipment for children widespread around the neighbourhood.', NULL, 1, NULL, NULL),
(25, '6065', '6065 is in an ideal location in the northern suburbs of Perth. It\'s close enough to the city to ensure an easy commute, and while development around 6065 has accelerated over the last 30 years, it still retains a rural feel and its agricultural roots despite being on Perth\'s doorstep. The annual Wanneroo Agricultural Show is just one of many examples of this. Around the suburbs of Wanneroo, Sinagra, and Madeley there\'s plenty to discover whether you live in the neighbourhood yourself or with your family.', NULL, 1, NULL, NULL),
(26, '6164', '20km south of the city centre, 6164 is filled with the amenities and activities to keep the whole family entertained while being just a stone\'s throw from Perth. Whether you live in the main localities like Cockburn Central and Success or elsewhere in the neighbourhood, there\'s always something going on in the local shops, eateries, and entertainment centres. As well as offering easy access to Perth, as a 6164 resident, you can take advantage of having a forest and national parks on your eastern doorstep, while having a short journey down to Rockingham or Mandurah, too.', NULL, 1, NULL, NULL),
(27, '3199', 'Whether you live there or you’re just passing through, you can rest assured you’ll find enough to fill your days in 3199. Conveniently located between the city and the seaside, the major suburbs of Frankston and Frankston South are laidback and charming. With an eye-catching beach that’s busy year-round, Frankston in particular is perfect for those hoping for a bit of breathing room. There’s a thriving cultural scene for you to check out, too. While away the hours in the award-winning art galleries, check out 3199’s many historical attractions or do some shopping at Frankston’s Sunday Market.', NULL, 1, NULL, NULL),
(28, '4680', 'With beautiful Gladstone Central and surrounding picturesque suburbs, 4680 is a wonderful place to live and you\'ll always find plenty to do here. Living on the coast speaks for itself, but 4680 is so much more than a coastal city. History lovers will find six heritage-listed properties on Goondoon Street alone while venturing into the primary residential suburbs like New Auckland and Barney Point will enable you to access charming shops and eateries as well as access facilities for outdoor pursuits.', NULL, 1, NULL, NULL),
(29, '6163', 'The neighbourhoods around Perth offer a fantastic combination of city living aligned with access to the coast or rural areas depending on your passions and interests. In that regard, 6163 is no different. Areas like Spearwood are filled with commercial and recreational opportunities whether you want to shop, catch a movie, or let the kids burn off some energy. Bibra Lake is great for relaxing in the picturesque surroundings while thrillseekers can head to Adventure World with the kids. You can enjoy leafy surroundings and relax around North Lake, too.', NULL, 1, NULL, NULL),
(30, '2148', 'Stretching from Kings Park to Prospect, through Blacktown, and into the Western Sydney Parklands and Prospect Nature Reserve, 2148 is a beautiful neighbourhood that\'s ideal for commuting into central Sydney while having a feeling of detachment from the big city. Blacktown\'s commercial district combines shopping centres filled with major brands with independent shops and a huge variety of places to eat and drink, driven by the multicultural nature of this suburb city. 2148 offers plenty of opportunities for outdoor pursuits too, whether you want to be competitive or just hang out with your family and friends.', NULL, 1, NULL, NULL),
(31, '3073', 'For those on the lookout for some green space, 3073 has just what you need. Home to only the low-key suburb of Reservoir, there are some truly lovely parks for you to visit. At the heart of the suburb is the gorgeous Edwardes Lake Park, often frequented by picnickers, joggers, and even the occasional wedding party! And there’s more to see if you take a look further afield, with classic shopping strips full to the brim with unforgettable bakeries and charming cafes.', NULL, 1, NULL, NULL),
(32, '2259', 'The neighbourhoods around 2259 combine the benefits of living on the northern shores of the Central Coast with the ability to head north into Newcastle or inland to the dense forests and parkland. 2259 has everything you need if you don\'t want to venture far, too, with the Westfield complex in Tuggerah offering shopping, food and drink, entertainment opportunities, and other local attractions throughout the neighbourhood such as parks offering plenty to do for outdoor lovers.', NULL, 1, NULL, NULL),
(33, '3037', 'An ideal place for adults and children alike, you’re sure to find something to suit everyone in 3037. Go shopping at the Watervale Shopping Centre in Taylors Hill, get a relaxing massage in Hillside, or take the kids to one of Delahey’s many playgrounds. There are places for you to go golfing and walking, too, if you fancy doing some gentle exercise. But no matter what you do, don’t forget to take a look at 3037’s most notable landmark. Affectionately nicknamed “The Golf Ball” by locals, the distinctive water tower in Hillside can be seen from several kilometres around.', NULL, 1, NULL, NULL),
(34, '3175', 'An up-and-coming area that is making its mark, 3175 might be removed from the major cities but it’s still bursting with vitality. Clean and relatively quiet, 3175’s suburbs are quickly expanding to keep up with the growing population of young residents. With a shopping complex and recreation centre in Dandenong and a wide variety of restaurants in Bangholme, there’s plenty to keep you occupied. To really get a feel for what 3175 is all about, though, you should make a visit to the iconic Dandenong Market, where the multicultural roots of the area can most clearly be seen.', NULL, 1, NULL, NULL),
(35, '4300', 'Stretching from Goodna in the north down to Springfield Lakes in the south, 4300 is a great neigbourhood for getting into Brisbane while being able to enjoy a more laid back way of life outside the city. Your neighbourhood is designed for an outdoor way of life, with vast open spaces alongside lakes and creeks for those who enjoy watersports. In most locations around 4300 you\'ll be able to walk to the shops or the cinema and leave the car at home, whether you live in a waterfront location or a more urban location in the neighbourhood.', NULL, 1, NULL, NULL),
(36, '3021', 'If you want to really explore an area, there’s plenty of opportunity in 3021 to do just that. You can admire striking views while strolling along the 400-metre long Maribyrnong Viaduct Bridge near Kealba, or go to one of the many parks that will always be in close proximity when you’re in 3021. There’s also no shortage of restaurants in either Kealba or the nearby suburb of St Albans, so you can fill your boots after a long day of looking around.', NULL, 1, NULL, NULL),
(37, '2444', 'Port Macquarie and the surrounding 2444 region is everything that a coastal neighbourhood should be. There\'s something for everyone in the town itself, from museums and galleries to even being able to visit the local Koala Hospital. The Town Beach offers miles of sands to enjoy relaxation or active pursuits, with shops and places to eat filling the town centre when it\'s time to relax. On the doorstep of 2444 you\'ll find nature reserves and forest parks for outdoor experiences away from the beach, while a short drive onto the Pacific Highway can be your gateway to the surrounding parts of New South Wales.', NULL, 1, NULL, NULL),
(38, '3805', 'The friendly suburbs of 3805 are charming and peaceful. But don’t let the area’s quietness fool you. Mainly inhabited by families with kids and retirees, there is plenty for people to do here. Head to Berwick Springs for a picturesque walk round the central lake or spend an afternoon at Westfield Fountain Gate in Narre Warren, the second largest shopping centre in Australia. 3805 is well-connected, too. With good transport links and access to the nearby M1, it’s easy to get to the nearby beach suburbs and even the Central Business District.', NULL, 1, NULL, NULL),
(39, '7250', 'Whether you\'re in Launceston, Riverside, or another suburb around 7250, there are loads to do throughout the year thanks to your temperate climate and the diverse nature of your neighbourhood. Enjoying four distinct seasons means there are times throughout the year when you can capitalise on the chance to walk, cycle, or enjoy outdoor pursuits like golf, and times when you\'ll want to head indoors to enjoy the shops and opportunities to eat and drink from a rich variety of cultures.', NULL, 1, NULL, NULL),
(40, '2153', 'On the north-western outskirts of Sydney, the suburbs around Baulkham Hills, Bella Vista, and the surrounding 2153 neigbourhoods are filled with activities and enjoyment for the whole family. Enjoy the outdoors with plenty of parks and recreation opportunities, including koala spotting, or head to the local eateries where you\'ll find foods from around the world as well as good old Australian eats. 2153 gives you all of this, keeping you entertained while still only being a short distance away from the centre of Sydney.', NULL, 1, NULL, NULL),
(41, '2540', 'Like much of New South Wales, life in 2540 revolves around time at the beach for most of you. Whether you\'re right on the waterfront at Culburra and enjoying fresh seafood and the surf, or a little inland down at St. George\'s Basin, there\'s always plenty to see and do even outside of tourist season. With a handful of nature reserves and conservation parks in your postcode area, combined with the beach you\'ll never be short of things to do outdoors, but the built-up areas of 2540 are also filled with quirky stores and eateries with plenty to see and do.', NULL, 1, NULL, NULL),
(42, '2750', '2750 is one of the best neighbourhoods across Australia, let alone in the Sydney region. Penrith and its nearby neighbourhoods like Emu Plains and Emu Heights are packed with things to do, with Sydney within easy reach for commuters, the Blue Mountains on the doorstep, and stunning views available depending on where you live. Penrith itself has everything you need to live your best life, from sports facilities and a national park to shopping centres, museums, and places to practice and enjoy experiencing the performing arts.', NULL, 1, NULL, NULL),
(43, '4701', 'On the outskirts of Rockhampton and sitting on the banks of the Fitzroy River, 4701 offers plenty to do across its suburbs like Berzerker, Norman Heights, and Koongal, as well as having the main city on the doorstep. The neighbourhood is filled with shopping opportunities and places to eat and drink, while outdoors there are several parks, sports clubs, and outdoor pools for those who enjoy keeping active. Outdoor lovers can enjoy having most of Mount Archer National Park within the postcode area, a great day out that offers stunning views of the surrounding area and beyond.', NULL, 1, NULL, NULL),
(44, '2340', 'Tamworth and the surrounding neighbourhoods around 2340 are responsible for a lot of firsts in Australia, and even today attract visitors from across the country and even from overseas to events like the country music festival and those held at the Equine and Livestock Events Centre. The central business district is where most of your neighbourhood\'s residents congregate, with shopping outlets, entertainment experiences, and a range of places to eat and drink that you can enjoy with friends and family.', NULL, 1, NULL, NULL),
(45, '4209', 'Situated on the northern edges of the Gold Coast but within commuting distance to Brisbane, Coomera, Upper Coomera, and Pimpama are the main built up locales within the 4209 postcode. A neighbourhood filled primarily with tourist attractions, it\'s a great place to live, too. Whether you live on the waterfront itself in Coomera or further inland in Pimpama, this is definitely a place to make the most of an outdoor lifestyle, with amusement parks in the neighbourhood and the coast a stone\'s throw away.', NULL, 1, NULL, NULL),
(46, '2166', 'Found in the western suburbs of Sydney, 2166 is a wonderful neighbourhood comprising the Cambramatta and Canley Heights suburbs. You have loads to do in your neighbourhood, while also enjoying a short commute into the centre of Sydney, additional activities in neighbouring Liverpool, and the Blue Mountains out to the west. The neighbourhood itself is one of Sydney\'s most diverse, with a substantial Vietnamese and Chinese population reflected locally in everything from the Freedom Plaza\'s Friendship Arch to the shops and eateries that fill 2166\'s streets.', NULL, 1, NULL, NULL),
(47, '3020', 'The residential suburbs of 3020 are welcoming and buzzing with vitality. Home to a whole mix of people from different age groups and cultures, 3020 is a real melting pot! It’s also an important hub in Melbourne’s west. The beautiful suburb of Sunshine is one of the area’s major retail centres, with plenty of shops, cinemas, and restaurants to try. It also provides crucial public transport connections between the surrounding postcodes and the Central Business District, as do Sunshine West and Albion.', NULL, 1, NULL, NULL),
(48, '6230', 'The coastal region of Bunbury and the neighbourhoods in the 6230 area are homage to the people who live there and through the years have transformed the city in their own image. And you\'re one of them! Whether it\'s street art, public sculptures, or a trip to the regional performing arts centre, you\'re never short of cultural opportunities in Bunbury. In addition to these, you have the chance to walk miles of coastline looking out over the Indian Ocean, rip it up in the surf, or walk into the water to meet the local population of bottle-nosed dolphins!', NULL, 1, NULL, NULL),
(49, '2615', 'While your neighbourhood around 2615 is mostly a residential district on the northwestern edge of Canberra, there\'s still much to discover without needing to travel into the city. Outdoor lovers can find parks across the neighbourhood, with those in Latham and MacGregor benefitting from the Gininnderra Creek running through them. 2615 also has plenty of playing fields and other open spaces, with a wide range of shops and places to eat and drink meaning you can enjoy life on the edge of the city to its fullest.', NULL, 1, NULL, NULL),
(50, '3810', 'There are plenty of small and sleepy rural suburbs in 3810, but significant investment in Pakenham, in particular, is on its way. While Rythdale, Pakenham Upper, and Pakenham South all have pretty small populations, the suburb of Pakenham has become a major growth area. It doesn’t yet have a cinema, and options for nightlife are limited beyond pubs and restaurants. But, new housing developments and a large shopping centre are all in the pipelines, making 3810 an area to watch out for. And, despite its up-and-coming status, Pakenham and the surrounding suburbs are managing to maintain their country charm.', NULL, 1, NULL, NULL),
(51, '6061', 'On the northern outskirts of Perth city centre, the areas around Balga, Westminster, and the rest of the 6061 are mainly residential but also offer you plenty of commercial and recreational activities without needing to venture into Perth itself. The 6061 neighbourhood is characterised by smaller parks and reserves where families can enjoy nature or hang out and play. There are plenty of places to shop and eat, too, with State Route 3 running through the neighbourhood to connect you easily to the rest of the city or further afield.', NULL, 1, NULL, NULL),
(52, '4207', 'On the southern edges of Brisbane and also within easy reach of the Gold Coast, 4207 offers everything from coastline to woodland and parkland for residents who love the outdoors. If you prefer exploring culture and the arts, towns around the neighbourhood like Beenleigh have traditional and open-air museums as well as theatres and other entertainment attractions. The nearby Edens Landing and Mount Warren Park also offer plenty to do as well as acting as a staging post on a trip into the big city.', NULL, 1, NULL, NULL),
(53, '3806', '3806 has plenty of history, which is plain to see in the old buildings that still line the streets of Berwick. Some of these buildings are now fully intertwined with the contemporary culture of 3806, with a historic primary school having been converted into a café and the Berwick Inn still up and running after more than 150 years. Nearby, the suburb of Harkaway has a far smaller population than Berwick, but that doesn’t mean it doesn’t have much to offer. With plenty of green space and lots of options for eating out, there’s so much to love about 3806.', NULL, 1, NULL, NULL),
(54, '2747', 'The suburbs of 2747 right on the western edge of Sydney offer breathtaking views out towards the Blue Mountains. Although the neighbourhood is mainly residential, there are plenty of opportunities to shop and find other entertainment options as well as spend time outdoors around localities such as Werrington and Jordan Springs. As the whole neighbourhood continues to develop more people find themselves working here without the need to travel into central Sydney. As well as offering much for singles, couples, and families in the neighbourhood, 2747\'s location makes it easy to head into Penrith and western Sydney\'s other great places.', NULL, 1, NULL, NULL),
(55, '5108', 'Incorporating Paralowie and the Salisburys, 5108 is a great neighbourhood offering easy means of getting into Adelaide while offering plenty to do in its own right. With parkland and outdoor pursuits whether you want to relax with friends, enjoy a competitive sport, or simply get the kids running around, you\'ll never be short of something to do outside around 5108. Your neighbourhood is also loaded with attractions like museums and historic sites, with plenty of places to shop, eat, and drink when all you want to do is relax.', NULL, 1, NULL, NULL),
(56, '3136', 'A hidden gem that is on its way to being discovered, 3136 is currently benefitting from financial investment. Suburbs such as Croydon Hills were previously farmlands and orchards, so there are plenty of well-kept parks to walk around and unwind in. Croydon North and Croydon South are known for being similarly green, but also have the benefit of more extensive shopping strips that attract tourists and residents from neighbouring communities. For those who want all the advantages of the city, including restaurants, shops, and good transport links, without having to compromise on the view, 3136 is an ideal spot.', NULL, 1, NULL, NULL),
(57, '4053', 'Everton Park and the surrounding suburbs that make up the 4053 neighbourhood are great place to live just north of the centre of Brisbane. Historic Mitchelton, with its numerous historic buildings and rich heritage, is also filled with popular stores and independent outlets, while the scenic parks and reserves can be found throughout 4053, with those around Stafford being particularly popular. The neighbourhood is also rich with shops and places to eat and drink, while only being a stone\'s throw from Brisbane if you need to head there for work or play.', NULL, 1, NULL, NULL),
(58, '2830', 'Dubbo and the wider 2830 area are known as a centre point for the wider Orana Region and bring in visitors from across this part of New South Wales. Famous for its shopping, you can spend your whole life living in Dubbo and still guarantee you\'ll discover something new. The neighbourhood also has a rich history with numerous sites worth visiting, while the architecture around the area is diverse and interesting, too. There\'s plenty of parks to keep the kids occupied, and who doesn\'t love a day out at the zoo?', NULL, 1, NULL, NULL),
(59, '6155', 'Canning Vale and Willetton, on the southern edge of Perth and on the doorstep of Jandakot Airport, combine sprawling industrial areas with charming residential localities within both neighbourhoods. As well as having quick access to the centre of Perth, as a resident of 6155, you can enjoy a wealth of shopping and leisure opportunities around your neighbourhood both indoors and outside. These suburbs are particularly rich in sporting opportunities, with a number of recreational facilities available in the immediately neighbouring areas as well as around 6155.', NULL, 1, NULL, NULL),
(60, '3550', 'Bendigo and the surrounding 3550 region is a thriving city with something to benefit anyone, no matter their living circumstances or their lifestyle. Parks and recreational areas can be found throughout the city centre and throughout the surrounding suburbs of Bendigo, while culture enthusiasts can enjoy the local museums and art galleries. There\'s also a wonderful experience to be had at the Central Deborah Gold Mine. Bendigo is also rich in architectural heritage, and as a resident, you\'ll learn something every time you take a walk around the city!', NULL, 1, NULL, NULL),
(61, '4034', 'On the northern edge of Brisbane, the neighbourhoods of 4034 are around 30 minutes drive from the city centre and feature everything you need to entertain yourself and the family without the need to travel into Brisbane itself. Shopping and entertainment opportunities abound, especially in Aspley, while Boondall is home to Brisbane entertainment centre as well as an ice rink and environmental and bird protection projects, while also offering easy access to the coast. Both Aspley and Geebung enjoy a rich history and offer plenty of opportunities to take in local heritage and culture.', NULL, 1, NULL, NULL),
(62, '3174', 'Located just 25km South-East of Melbourne Central Business District, the neighbourhoods of 3174 are just minutes from multiple public amenities; such as the Waverley Gardens Shopping Centre, just 9 minutes drive away. 3174 is surrounded by Noble Park, Springvale, and Waverley Park to name just a few suburbs. The surrounding neighbourhoods are multicultural, and with easy access to suburban railways, buses, and bicycle trails, the rest of Australia is not too hard to access. 3174 has a number of local schools within the catchment area, including Oakwood School-Noble Park Campus, and Silverton Primary School.', NULL, 1, NULL, NULL),
(63, '3630', 'A town rich in history and culture, Shepparton and the surrounding 3630 regions has something for everyone. History lovers will be able to discover something new by observing the local architecture every time you venture out into the city, while the thriving arts and culture scene always has something new and exciting to engage residents, whether it\'s a sculpture or performing arts show. Shepparton also has plenty to offer outdoor enthusiasts, whether it\'s sporting clubs and activities for the kids or something competitive or recreational for adults to throw themselves into.', NULL, 1, NULL, NULL),
(64, '6107', 'The family-friendly suburb of 6107 is ideal for habitants of all ages, inundated with shopping centres such as the Westfield Carousel, diverse places of worship, and repair centres. Located a short journey from Perth, 6107 has excellent travel connections, ideal for commuters. Wilson welcomes an abundance of students who can easily access Curtin University. Both nature lovers and families can enjoy the great outdoors when visiting the scenic Canning River Regional Park, occupied with biking tracks and seated café spaces. Areas such as Kenwick hold tremendous historical sites, homing an early farming community, Swan River Colony, and the immaculate Brixton Street Native Wetlands.', NULL, 1, NULL, NULL),
(65, '4814', 'Located towards the coast of Queensland, 4814 is a picturesque area, surrounded by rich farmlands. Cranbrook, one of its suburbs, is situated against Western Australia’s only Mountain range. Along with other suburbs; Vincent, and Aitkenvale, Cranbrook is just three hours south from Perth. 4814 has multiple shopping amenities within quick access, including Stockland Townsville Shopping Centre, and Riverside Shopping Centre. As well as this, there are multiple beautiful areas surrounded by nature, including Canara Park, Anderson Park Botanical Gardens, and The Palmetum, which houses multiple endangered palm tree species.', NULL, 1, NULL, NULL),
(66, '2176', 'Located in New South Wales, and only 41 minutes away from Central Sydney by car, 2176 is a convenient location to live. Populated largely by families and independent youth 2176 is a metropolitan area with strong ties to the larger Sydney area. Suburbs include Bossley Park, St. John’s Park, and Abbotsbury, which are themselves surrounded by plentiful amenities and attractions, including Sydney Zoo, Flat Rock Beach, and Royal Botanical Gardens. Areas like Bossley Park offer a suburban lifestyle with easy access to larger city life, due to its close proximity to the greater Sydney area.', NULL, 1, NULL, NULL),
(67, '2800', 'Famous for its wine-making suburb Orange, 2800 is a wonderful area of Australia located within the New South Wales area. Populated largely by families, Orange, and its nearby suburb Bletchington is a perfect place to raise a family, with multiple schools falling into its catchment areas. These include Bletchington Public School, Canobolas Rural Technology High School, and Orange East Public School. Residents also have easy access to Orange Central Square Shopping Centre, as well as attractions such as the Orange Botanic Gardens, which feature playgrounds, and themed plantings.', NULL, 1, NULL, NULL),
(68, '6110', 'Located just 20 kilometres South-east of Perth Central Business District, 6110 is home to the thriving city of Gosnells. Within Gosnells City are the suburbs of Southern River and Gosnells, home to many families, and elderly couples. Raising a family is easy within 6110, with multiple catchment area schools, including Southern Grove Primary School, Bletchley Park Primary School, and Southern River College. Local attractions include the highly popular Central Maddington shopping centre, Honeyeater Hollow, a wonderful nature area, and the Old Barrington Quarry.', NULL, 1, NULL, NULL),
(69, '6030', 'Located just 37 kilometres North of Perth’s Central Business District, 6030 covers a wide variety of quaint and comfortable suburbs. Merriwa, just 36 km from Perth, is populated largely by families and maturing and elderly people, and even contains two RAAF retirement villages. Another local suburb, Ridgewood, is also highly populated by families, and elderly couples, with many single dwellings, and multiple duplexes making up its landscape. Amenities are located in close proximity, including Merriwa Plaza, Brighton Village, and Quinn’s Shopping Village.', NULL, 1, NULL, NULL),
(70, '2026', 'Home to the suburbs of Bondi and North Bondi, both Coastally-based Eastern suburbs of Sydney, in New South Wales. 7 Kilometres East of Sydney Central Business District. Both suburbs are within very easy access of the World-famous Bondi beach, a very popular location for both tourists and locals. Both Bondi and North Bondi are popular with young independent people, seeking to live in a metropolitan area bursting with life and culture. With access to multiple coastal walks and the North Bondi Rocks, there is never a lack of things to do in 2026.', NULL, 1, NULL, NULL),
(71, '2450', 'On the Mid-North Coast of New South Wales and over 390 kilometres South of Brisbane, 2450 is home to the densely populated suburb of Coffs Harbour. With two popular University campuses for the University of New South Wales and Southern Cross University and three major shopping centres, Park Beach Plaza, Coffs Central, and Jetty Village Shopping Centre, Coffs Harbour boasts a thriving urban population. Local attractions include the Big Banana Fun Park, which hosts multiple family-fun activities, including a water park, a skating rink, and even a large walk-through banana.', NULL, 1, NULL, NULL),
(72, '2168', 'Thriving with family life, 2168 is positioned with excellent city links at just 38KM away from the west of Sydney’s central business district. It has easy access to the Hoxton Road leading directly into the city of Liverpool. 2168 unites neighbourhoods through popular community sports located at parks across Ashcroft and Busby; this is a superb opportunity for the kids to stay active and meet new friends. Miller is facilitated with exceptional tennis amenities; McGirr Park offers both team and one-to-one coaching sessions.', NULL, 1, NULL, NULL),
(73, '4510', '4510 is a rapidly developing neighbourhood with the perfect mix of bustling city life and beaming coastal communities. Teeming with life, Caboolture Square lets you enjoy some retail therapy and a bite to eat, plus quick and comfortable travel links to the state capital, Brisbane. Historical museums are based across 4510, where the widely recognised Abbey Medieval Festival is hosted. The coastal town of Beachmere sits on the doorstep of an urbanised Upper Caboolture; feel free to take in the scenic views while soaking up some Australian sun.', NULL, 1, NULL, NULL),
(74, '2165', 'The suburbs of Sydney offer an abundance of activities for the whole family! Business is always thriving throughout 2165, where commercial and residential development opportunities are highly accessible. Rich in culture, Fairfield is one of Australia’s most multicultural cities where residents can make full use of green spaces such as Endeavor Sports Reserve, shopping malls, and cinemas. With an array of delicious cuisine, you’ll be spoilt for choice when it comes to choosing a restaurant. Take in some fresh air with the kids at parks located within Fairfield Heights, positioned approximately 66-131ft above sea level!', NULL, 1, NULL, NULL),
(75, '3337', 'You won’t be short of things to do when you’re in 3337. A rapidly growing suburban area, 3337 is full to bursting with excellent facilities, luscious green parks, sports, and recreational centres, and a large shopping centre in Melton West. Here and further afield in the most populous suburb of Melton, residents can boast of clean streets, an affordable cost of living, and a community buzz about the place. And, while smaller, Kurunjang is also considered a lovely place to live. All three offer an ideal place for young families, singletons, and retirees alike to settle.', NULL, 1, NULL, NULL),
(76, '3500', 'A country town with a lot to offer, Mildura in 3500 is tucked in on the banks of the River Murray, Australia’s longest river. For a fun day out with the family, why not try taking a relaxing boat trip across the water, or enjoy a spot of fishing or water skiing? Whatever you decide to do, there’s no shortage of restaurants and cafes in 3500 for you to head to at the end of a busy day. And, just a short bus or train ride away from nearby Irymple, Nichols Point, and Merbein, 3500 also very well-connected.', NULL, 1, NULL, NULL),
(77, '2200', '2200 is a well-connected suburb with excellent public transport links. So, if you want to head to Sydney for the day, it’s really easy to do so. However, there’s a lot you can do in 2200’s own suburbs, particularly for food lovers. With an astonishing array of Vietnamese and Lebanese restaurants, and fantastic fresh meat and vegetables on offer in Saigon Place shopping centre, Bankstown is foodie heaven. And, while Condell Park might not have quite so many amenities, its quieter, community vibe has become more of a draw for people in recent years.', NULL, 1, NULL, NULL),
(78, '2155', 'Whether you want to eat and drink, explore, or relax, you can find what you’re looking for in 2155. In Kellyville, you could spend your afternoon looking around the Museums Discovery Centre and finish the day off with a delicious meal at one of the many multicultural restaurants in the area. Or, head on over to Rouse Hill for a spot of shopping in the bustling town square, or to Beaumont Hills to visit one of 2155’s delightful nature reserves and parks.', NULL, 1, NULL, NULL),
(79, '4211', '4211’s central suburb of Nerang is the perfect place for people who want peace and quiet without feeling cut off. It’s just a short drive to some of the Gold Coast’s beautiful beaches and is within just a stone’s throw of some of 4211’s fabulous shopping and recreational facilities. Highland Park Shopping Plaza is a case in point, housing a wide range of shops including a bakery and a butcher. Quiet, green, and close to everything you need, the attractive, leafy suburbs of 4211 are an idyllic place to settle.', NULL, 1, NULL, NULL),
(80, '6056', 'Perhaps most famous for the Jane Brook Estate and Garbin Estate wineries in the suburb of Middle Swan, 6056 is home to small communities in the foothills of the Darling Scarp. There are plenty of restaurant options over in Midland, and good gym and fitness facilities in nearby Swan View. However, 6056 is a little lacking in bars and clubs. But, while not the best place for nightlife, it is close to the city and has great public transport facilities, so you won’t be left wanting.', NULL, 1, NULL, NULL),
(81, '4122', 'Not far from Brisbane’s Central Business District lies 4122, a postcode of relatively small suburbs that are nonetheless loved by the locals. There is a great balance between country and city life in 4122. In Mount Gravatt, you can go hiking up the nearby mountain of the same name by day and enjoy one of the area’s many eateries by night. It’s a great area for families, too, with Wishart and Upper Mount Gravatt housing some of the finest schools in Queensland.', NULL, 1, NULL, NULL),
(82, '3690', 'Outdoorsy types will love 3690. There are plenty of spots in the suburb of Wodonga to take the family camping, as well as areas for walking and biking. And, since Wodonga is nestled beside the Murray River, it’s a great place to go swimming in the summer months, too. But there’s more to 3690 than nature. Food fans will simply adore the local produce showcased in the restaurants, while those who want to grab a drink at the end of the day can do so in one of Wodonga’s bars and pubs.', NULL, 1, NULL, NULL),
(83, '3046', 'Quiet and unassuming, 3046 is something of a hidden gem to the north of Melbourne’s Central Business District. Located just 10km away from the CBD, 3046’s suburbs are free of the hustle and bustle of the city, while still retaining character. They’re particularly perfect for people who love to stay active, with tennis courts in Hadfield, cricket parks in Oak Park, and the Northern Golf Club in Glenroy. Green space and parks abound in these small suburbs, but residents are by no means deprived of restaurants, cafes, and shopping options in 3046.', NULL, 1, NULL, NULL),
(84, '4152', 'Carindale in 4152 is a bustling hub to the east of Brisbane’s Central Business District. It has been described by locals and visitors alike as a mini-CBD due to its wide range of shopping, recreational, and health facilities, as well as its excellent public transport links. But, for all the excitement at the heart of 4152, there is plenty of green space to take in, too. Camp Hill encompasses the Whites Hill Reserve, and Carina and Carina Heights are both home to lots of really beautiful parks.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(85, '4503', '4503 is a neighbourhood favoured by families; it has an excellent balance of coastal areas and green spaces for residents of all ages to enjoy. Dakabin offers plenty of recreational areas a short journey from the train station; spectate and participate in games at Bob-Brock Park, where you\'ll find soccer, tennis, and cricket facilities. A little further afield, Kallangur is located near Lake Kurwongbah, where you can sit back and relax while adventure seekers can get involved in exhilarating water sports. 4503 does not fall short of retail; numerous shopping centres are located across the neighbourhood!', NULL, 1, NULL, NULL),
(86, '3754', 'Doreen is a serene neighbourhood with pleasant views infused with nature at every corner, perfect for daily strolls around 3754. Modern residential areas are excellent for retirees and families; children can be occupied at greens such as Hill Top Park, equipped with climbing frames and basketball hoops. Enjoy an endless choice of friendly restaurants, cafes, and pubs for the adults! 3754 invites further tranquillity with highly recommended well-being centres, kick back and relax at the spa or invest yourself in a game of golf at a spectacular course. Take a straight route from Doreen, and reach Melbourne in less than an hour, ideal for those looking at Universities or career opportunities sightly further afield.', NULL, 1, NULL, NULL),
(87, '2287', '2287 is a prosperous neighbourhood with seamless, natural beauty. There are plenty of educational opportunities for local youth, with one of Newcastle’s leading private schools situated in Elermore Vale. Hikers will be greeted with the picturesque routes at Mount Sugarloaf, located in Wallsend, home to many wildlife species. Outdoor extraordinary may be interested in The Shaft Tavern fishing event, which takes place annually. Areas such as Fletcher are filled with popular shops and entertainment venues such as cinemas. 2287 does not fail to deliver fresh produce with many bakeries and butchers, and cafes situated across the suburb.', NULL, 1, NULL, NULL),
(88, '2257', 'Surrounded by a vibrant blue ocean, you will find everything you need in the coastal suburb, 2257. Killcare offers a broad selection of amenities such as seaside boutiques, yacht charters, and many restaurants. 2257 is never short of social opportunities; Hardy’s Club consistently hosts Live Music and special events for all the family. If you enjoy spending time outside, Umina, commonly known as ‘The Peninsula’, can offer views similar to that on a postcard. The coast location does not fall short on travel links; a ferry service to neighbouring suburbs operates at Ettalong.', NULL, 1, NULL, NULL),
(89, '2099', 'With some beautiful areas situated by the sea, 2099 can offer its residents serene coastal living. Especially popular with beach-lovers are the suburbs of Dee Why and North Curl Curl, both located on the coast. Their beaches are super safe and family-friendly, too, so why not go surfing with the kids or take a walk around the rock pools? For those in 2099 that don’t live on the coast, the beaches are still easily accessible. And, in nearby Narraweena and Cromer Heights, as are all of the shops and dining options you could possibly want.', NULL, 1, NULL, NULL),
(90, '3280', 'Situated by the beach in beautiful 3280 are the quaint and lovely seaside towns of Warrnambool and Dennington. Spend a gorgeous summer’s day at McGennans Beach, or go whale watching at Logans Beach in the spring. There’s a good range of restaurants in 3280, too, situated along the attractive streets where you can also take in the historical architecture. And, known for its delicious dairy products, a day in 3280 just wouldn’t be complete without a factory tour and tasting at Cheese World.', NULL, 1, NULL, NULL),
(91, '6027', 'The community spirit of 6027 is what makes it really stand out. Made up of some relatively small suburbs, there is a distinctive neighbourly feel about the streets of 6027. Small, though, does not necessarily mean boring. There are golf courses and tennis courts over in Connolly and easy access to the beach in Edgewater, while Joondalup is home to the second-largest shopping mall in Western Australia. It may not have everything you’d expect to find in a big city, but for residents of 6027, everything they need is right on their doorstep.', NULL, 1, NULL, NULL),
(92, '2031', 'Not far from Sydney’s Central Business District is the small seaside suburb of Clovelly in 2031. Home to one of the world’s first Surf Life Saving Clubs, Clovelly Beach is a safe place for all the family to relax, swim, and surf. A little to the west is Randwick, which boasts excellent cafes and restaurants, beautiful parks, and great public transport links. So, for anyone hoping to hop on over to Sydney from 2031, all it takes is 15-minute ride on one of Randwick’s frequent buses.', NULL, 1, NULL, NULL),
(93, '2147', 'The quiet streets of 2147 are much loved by their residents. Lined with trees and dotted with plenty of parks such as Endeavour Park in Kings Langley, there is a certain sense of calm about this area. You’re well-catered for on the food and shopping front in 2147, too, with lovely cafes and restaurants in Lalor Park and the shopping plaza in Seven Hills. And, it’s a convenient place for professionals, with top-notch public transport to the city and surrounding suburbs keeping it well-connected.', NULL, 1, NULL, NULL),
(94, '2541', '2541 is a picturesque location if a little removed from the city of Sydney. However, there is plenty to keep you occupied in 2541, especially if you love the outdoors. Nowra in particular is a beautiful area, home to several beautiful beaches, mountains, and parks. It also has all the amenities a regional town could want. Worrigee is, admittedly, a little more secluded. But, up-and-coming as it is, Worrigee can offer residents and visitors plenty of shopping options as well as golf courses and cricket pitches.', NULL, 1, NULL, NULL),
(95, '6069', 'If you’re looking for the perfect balance between country and suburban life, then 6069 is the place for you. At the moment, the suburb of Ellenbrook is on the rise, with more restaurants and recreational centres cropping up all the time. 6069 has relatively few shops and cafes, though, particularly in The Vines, although the ones that are there are of great quality and friendly, too. However, the biggest pull of the place is undoubtedly the beautiful scenery. Take a trip to Annie’s Landing Park or go for a walk around the lakes in Ellenbrook to take in the sights.', NULL, 1, NULL, NULL),
(96, '4215', 'Situated by the sea in Gold Coast is 4215, which can boast of great facilities, excellent public transport, and beautiful views of both the sea and skyline. Given that the suburb of Southport in 4215 is home to the area’s Central Business District, it probably won’t come as a surprise to learn that shops, restaurants, and pubs abound. And, over in nearby Labrador, there is a buzzing community of people who love to get outdoors and keep fit. Head towards the beach and you’ll see plenty of people swimming in the sea or going for a run along the pathways.', NULL, 1, NULL, NULL),
(97, '5162', '5162 is home to Morphett Vale, the largest suburb in the state of South Australia. So, even though it’s fairly far out from the Central Business District, there is plenty going on to keep visitors and residents alike occupied. With beautiful houses, plenty of parks, and lots of shops in the local Woodcroft Mall, 5162 offers the best of city living in a far more relaxed package. The area has great schools, too, making it an ideal option for young families looking to settle down.', NULL, 1, NULL, NULL),
(98, '4017', 'Incorporating a number of seafront suburbs such as Seagate, Shorncliffe, and Brighton, 4017 is a lively area on the outer edge of Brisbane. It boasts a number of green spaces and nature reserves such as the Deagon Wetlands (ideal for biking, birdwatching, and bushwalking!) as well as fantastic beaches, making it ideal for lovers of the outdoors. Its largest suburb, Bracken Ridge, also offers a variety of shopping options including the Bracken Ridge Plaza. There are also plenty of schools in 4017, which along with the beaches and outdoor activities makes it a perfect area for families.', NULL, 1, NULL, NULL),
(99, '2480', 'As the regional centre of the North Rivers, Lismore is ideal as a gateway for exploration, surrounded by picturesque rural areas that nature lovers will adore. To the north is the Nightcap National Park, an expansive nature reserve perfect for hiking and nature walks, and for those who love the beach, the iconic Byron Bay is under an hour away by car. The city itself is young and vibrant, with the university drawing in a number of students which has fuelled a growing arts scene and a notably LGBT-friendly atmosphere.', NULL, 1, NULL, NULL),
(100, '6530', 'The 6530 area mostly consists of Geraldton, a city hugging Australia’s west coast with long, hot summers and mild winters – perfect for sun-seekers! Known for its sports, residents can be found surfboarding and windsurfing along the shores of Sunset Beach or enjoying a leisurely 18 holes at the expansive Spalding Park Golf Club. New builds and redevelopments in the West End have also helped to revitalise the city, making it ideal for those seeking an active, modern lifestyle.', NULL, 1, NULL, NULL),
(101, '3429', 'Just north of central Melbourne in 3429 sits Sunbury, a small but growing satellite city with a vibrant heart. The city’s growth has been fuelled by workers from Melbourne drawn by the cheaper cost of living and the ability to enjoy the best of both worlds: the convenience of the city’s proximity alongside the peace and quiet of the more rural setting. As well as stating their love for the beautiful countryside on the city’s doorstep, residents also praise the safe and friendly atmosphere to be found in Sunbury, making it a lovely place to settle down.', NULL, 1, NULL, NULL),
(102, '3195', 'Home to Mordialloc, Parkdale, Waterways, and other much-loved suburbs of Greater Melbourne, 3195 is a relaxed postcode that has plenty going on. In fact, besides being a fair distance out from the Central Business District, neither residents nor visitors often have much bad to say about 3195. With trendy cafes and boutique stores, fitness amenities, and access to beautiful beaches, 3195 is considered to be an ideal place for families, retirees, and students alike. No matter who you are, the friendly beachside communities are sure to make you feel at home.', NULL, 1, NULL, NULL),
(103, '2290', 'The small suburbs of 2290 have benefited in recent years from an uptick in investment. Mount Hutton in particular has been on the up, with a boom in new home construction that started in the mid-2010s. The latest residents of the area can enjoy easy access to 2290’s largest shopping centre, Lake Macquarie Square, as well as the area’s newly upgraded parks. Over in Redhead, there is a beautiful beach, beloved by both locals and tourists. Easily travel from Redhead to Kahibah via train, to make the most of the best walking trails and natural bushlands 2290 has to offer.', NULL, 1, NULL, NULL),
(104, '6167', 'The historical Kwinana suburbs of 6167, including Calista and Medina, are named after settler ships that arrived at the port of Fremantle in the 1800s. Much of the older architecture remains intact in these areas, although it coexists with new housing developments. It is this balance between old and new that gives 6167 its charm. Of the postcode’s several suburbs, Orelia is home to the most amenities, including sports facilities, cafes and restaurants, and the nearby Kwinana Marketplace. Public transport is also excellent in Orelia and the surrounding suburbs, making the city centre easily accessible to residents.', NULL, 1, NULL, NULL),
(105, '6062', 'Less than five miles out from the Perth Central Business District is the suburb of Embleton in 6062. Loved for its convenience, style, and affordability, this soon-to-be-discovered suburb is home to close-knit, neighbourly communities. However, for those who want a change from the peace and quiet that Embleton offers, public transport can easily take them to one of the more bustling areas that surround 6062. Or, they can head over to nearby Noranda, which has a commendable range of shopping options, medical facilities, and attractive parks.', NULL, 1, NULL, NULL),
(106, '3058', 'Coburg is the multicultural heart and soul of 3058 and has come to be known for its wonderful restaurants that showcase cuisines from all over the world. There are plenty of amenities, too, both in Coburg and in nearby Coburg North, including shopping options and new cafes. If that wasn’t enough, the beautiful Merri Creek Pathway runs through both of these areas, and its miles-long trail is perfect for nature lovers. With so much to offer, it’s little wonder that Coburg in 3058 has been designated one of the Major Metropolitan Activity Centres in the Melbourne 2030 Metropolitan Strategy.', NULL, 1, NULL, NULL),
(107, '3149', 'Made up entirely of the suburb of Mount Waverley, 3149 is a beautifully kept and well-serviced area of Greater Melbourne. For those looking for a fun day out, there’s an aquatic centre for the kids, a great selection of restaurants, and good shopping facilities, to name just a few things. And, residents of Mount Waverley are likely to live in the catchment area of several great schools, which makes the area ideal for young families. There are plenty of opportunities to take in nature in 3149, too, with the Valley Reserve and Waverley Road Basin situated slap bang in the middle.', NULL, 1, NULL, NULL),
(108, '6169', 'Nestled away in the city of Rockingham is Warnbro, a hub of activity in 6169. It has everything its residents could need, like specialty retailers in Warnbro Fair Shopping Centre, excellent sporting facilities, and beautiful, scenic spots like the Warnbro Foreshore Reserve and Warnbro Beach. Every suburb in 6169, including Shoalwater, Safety Bay, and Waikiki, is loved for its peace, quiet, and community feel. And, for those who like a bit of adventure, it’s easy to get away for a day. Just take a canoe or kayak out onto the water and go explore nearby Penguin Island or Seal Island.', NULL, 1, NULL, NULL),
(109, '2160', 'The relatively new suburbs of Merrylands and Merrylands West in 2160 are both up-and-coming areas, with more and more investment being channeled into both housing and retail. There’s plenty to do, too, particularly on Merrylands’ main high street. Go shopping for an afternoon in the Stockland Merrylands Shopping Centre, and then choose from one of many different multicultural restaurants for a delicious evening meal. In this diverse and welcoming location, you’re likely to meet lots of personable people, whether they work in the local library or chemist, or they pass you in the bustling streets.', NULL, 1, NULL, NULL),
(110, '2567', 'Old meets new in the suburb of Narellan in 2567, with a modern shopping centre sitting alongside the old St Thomas Chapel and Victorian-era Studley Park House. The community itself is also home to people of all different ages, as more and more young families gravitate to this peaceful country suburb with plenty to do. For those in 2567 who love the outdoors, Harrington Park is an excellent location, home to the Harrington Park Lake Loop. In fact, beautiful parks and other scenic outdoor spots abound in 2567, including William Howe Regional Park in Narellan Vale and Currans Hill Park.', NULL, 1, NULL, NULL),
(111, '3156', 'Ferntree Gully, situated on the edge of the beautiful Dandenong Ranges, is great for those who love to hike and take in extraordinary views. In fact, the whole of 3156 is a dream for nature lovers. The smaller, neighbouring suburb of Upper Ferntree Gully is green and well-kept, while the hilly suburb of Lysterfield is home to Lysterfield Lake and Lysterfield Park. And, they are all within range of shopping centres and essential amenities. There is also a library and community centre in Ferntree Gully, as well as pubs, bakeries, and family restaurants.', NULL, 1, NULL, NULL),
(112, '2500', 'Wollongong, a Coastal suburb, part of the 2250 postcode of New South Wales, is situated just an hour’s drive from the centre of Sydney! With attractions such as the Science Space, a wonderful all-ages science museum full of activities, and Wollongong Botanic Garden, there’s always something for everyone in the family to enjoy! Raising a family is made easier in this area, with schools such as Peats Ridge Public School, Kariong Public School, and Chertsey Primary School, just to name a small few.', NULL, 1, NULL, NULL),
(113, '2285', 'The 2285 suburb of Australia is situated just West of the town of Newcastle. Surrounded by Coastal views and encapsulating areas such as Cameron Park, Cardiff, and Edgeworth, 2285 is a perfect area to live! With attractions such as the Glenrock Lookout, a beautiful view over the coast, and the Fairy Garden, 2285 is full of nature! The area is perfect for raising a family, with local schools including Glendale Technology High School, Cardiff Community Preschool, and St. Kevin’s Primary School to name just a few.', NULL, 1, NULL, NULL),
(114, '3163', 'Encapsulating the areas of Carnegie, Glen Huntly, and Murrumbeena, 3163 is located just South-East of the greater Melbourne area. Surrounded by towns such as Chadstone, Bentleigh, and Camberwell, 3163 is a perfect place to raise a family! Local attractions include the Model Tudor Village and the LEGOLAND Discovery Centre! Raising a family in this area is made far easier with local schools such as McKinnon Primary School, Murrumbeena Primary School, and Hughesdale Primary School, to name just a few.', NULL, 1, NULL, NULL),
(115, '4500', 'Encapsulating the areas of Bray Park, Brendale, Cashmere, and Strathpine, 4500 is a postcode situated in the North of Brisbane. Surrounded by lakes, rivers, and coasts, there is no lack of nature for anyone who chooses to live here! Attractions local to the area include Community Peace Park and Boggo Road Gaol! Raising a family in this area is made easier with local schools such as Pine Rivers State High School, Bray Park State School, and South Pine Community Kindergarten, to name a few.', NULL, 1, NULL, NULL),
(116, '2530', 'The 2530 postcode of New South Wales encapsulates the areas of Avondale, Brownsville, Horsley, Kanahooka, and many more! Situated just West of Lake Illawarra, 2530 has great access to the nearby Sydney, and a number of local attractions including Fitzroy fall Lookout, Providential Point Lookout, and Twin Falls Lookout to give a sense of the Australian landscape! Raising a family in the area is made easier with local schools such as St. John’s Catholic Parish Primary School, and Koonawarra Public School to name just a few.', NULL, 1, NULL, NULL),
(117, '4165', 'Encapsulating areas such as Mount Cotton, Point Halloran, Point Talburpin, and Victoria Point, 4165 is home to a large number of families, both new and old! Just East of Brisbane, and West of North Stradbroke Island, 4165 is home to attractions such as Warner Bros. Movie World, and Ripley’s Believe It Or Not! Raising a family here is made easier, with local schools such as Victoria Point State School, BayView State School, and St. Rita’s Catholic Primary School, to name just a few!', NULL, 1, NULL, NULL),
(118, '3072', 'Covering the Area of Preston, the postcode of 3072 is located towards the North of Melbourne. Between the suburbs of Thornbury, Coburg, Reservoir, and Heidelberg West, 3072 is not far from numerous Melbourne based attractions such as Melbourne Zoo, SEA LIFE Melbourne, and the Melbourne Museum! Local schools in this area abound, including Preston High School, Preston South Primary School, and St. Raphael’s Primary School, just to name even a small few.', NULL, 1, NULL, NULL),
(119, '2077', 'You’ll never tire of the vibrant naturistic views 2077 has to offer, perfect for any keen walker. Head over to Hornsby Heights, situated on the eastern side of Galston Gorge and the Berowra Valley National Park, to take in an outstretched view of forestation. Or relish the deep blue to emerald-coloured waters inside Ku-Ring-Gai Chase National park within Asquith. In 2077 you’re never far from something new with direct links to the coast and just a 40-minute drive to Sydney’s bustling city centre.', NULL, 1, NULL, NULL),
(120, '2617', '2617 is an innovative suburb that strives to celebrate Australia’s cultural and historical significance. Look out for the many roads named after parliament officials and law professionals, plus the distinctive Blue Mountains Hotel. If you’re seeking retail therapy, Belconnen’s Westfield has various shops selling clothes, gadgets, refreshments, or health and beauty products. Don’t forget to take advantage of 2617’s nature trails, particularly at Lake Ginninderra positioned within Emu Ridge, where you’ll experience the finest sunset views. Large residential areas of Lawson are well connected to Australia’s capital city Canberra located just a 12-minute drive away.', NULL, 1, NULL, NULL),
(121, '6018', '6018 is a bustling entertainment hub containing something for all the family. Innaloo is home to Perth’s largest cinema complex called Event Cinema, including 18 screens that facilitate the ultimate 4DX experience with a recliner chair view. Or perhaps spend the day shopping at Innaloo’s Westfield Mega-Centre, where you can stop off for a bite to eat or purchase steaming goods from the bakery. If you’d rather have an outdoor adventure, Karrinyup is just a short trip to a white sanded beach with deep blue waters. Alternatively, take a leisurely stroll around 6018’s Lake Gwelup Reserve, where you\'ll find all kinds of creatures.', NULL, 1, NULL, NULL),
(122, '4556', 'If you appreciate the great outdoors, you\'ll value the unique green expanses 4556 has to offer. Situated on a 180m mountain, you\'ll be fortunate enough to absorb broad views over the Sunshine Coast of Queensland. 4556 is filled with unexpected hidden gems; follow tropical walkways to discover the beautiful Buderim Falls. Or try out the deliciousness of nearby outdoor bars and restaurants established over 4556\'s captivating views. If you\'re looking for innovative prospects, Sippy Downs has you covered. Home to Australia\'s newest University of the Sunshine Coast, the area is thriving with opportunities.', NULL, 1, NULL, NULL),
(123, '5114', 'There is something for everyone in the large suburb of 5114 situated north of Adeline. Discover handy park areas such as Blakeview Town Park, the perfect space to play sports or exercise using the outdoor gym facilities. Get to know fellow dog walkers of 5114 at Stebonheath Dog Park within Andrews Farm. Or take the kids to the nearby playing areas where you’ll find BBQ facilities. Looking for a way to spend your evening? Travel a short distance outside Craigmore to Shedley Theatre or take a trip to Smithfield Plains where you’ll find a delightful winery called Viagra Wines.', NULL, 1, NULL, NULL),
(124, '6430', 'Discover the unique charm behind 6430, Australia\'s largest Outback city. Don\'t be deceived by its vast location; there is plenty to do here. Play golf over serine green courses positioned east of Lamington, attend horse racing events, or attend Goldfield\'s Art Centre near Piccadilly. You won\'t need to look far from a scrumptious hot meal, with access to a wide variety of cuisines, including Chinese, Vietnamese, Thai, and Italian! Rich in history, explore Kalgoorlie-Boulder’s historic town hall or Sugar Pit with a guided tour or helicopter ride. Also, in 6430, there are plenty of places to grab a fuelling coffee.', NULL, 1, NULL, NULL),
(125, '3028', 'Explore endless possibilities within the innovative suburb of 3028, home to a diverse range of wonderful cultures. Young people are becoming increasingly attracted to contemporary designed properties and generous land sizes within 3028. City-goers can conveniently access Princes Freeway to reach Sydney City Centre in under an hour. Laverton is home to Melbourne Ballpark State baseball stadium, which hosts yearly national events for sports fans to enjoy. Additionally, expect to see large groups of migratory birds during outdoor hikes around Cheetham Wetlands in Altona Meadows.', NULL, 1, NULL, NULL),
(126, '2171', 'Residents of 2127 have an abundance of opportunities to appreciate outdoor spaces, especially if you\'re a dog owner. At In Cecil Hills, embrace vibrant family-friendly green spaces, play areas, and seated shelters within Gough Park or Dunmbral Park. Or perhaps take a trip to Hoxton Park\'s Trash and Treasure Grand Bazaar, where you\'ll find all kinds of hidden gems. In 2127, you\'ll never be far from a delicious meal; choose from various cuisines originating from Italy, Vietnam, the Middle East, and Thailand. Also, 2127 has excellent city transportation. A car ride to Sydney\'s City Centre will take under 45 minutes.', NULL, 1, NULL, NULL),
(127, '810', 'A short distance from Darwin lies 810 hugging the shorelines along Coconut Grove, Rapid Creek, and Nightcliff. Spend a great day out at the locally famous Rapid Creek Markets, where you’ll find a celebration of cultures and wares, including vibrant arts, crafts, homemade foods, exotic plants, and fresh seafood. \nDiscover bright picnic spots across 810, where plenty of food vans are available. Head inland to Casuarina Square, where you’ll find shopping centres suitable for the whole family. Local youth can enrol at the Charles Darwin University situated in Brinkin for a mix of city-based and coastal student life.', NULL, 1, NULL, NULL),
(128, '2280', 'Located just 23km from Newcastle\'s Central Business District is 2280, a bright postcode surrounded by Lake Macquarie\'s eastern side. If you love seafood, head over to the lake view restaurants of Marks Point, where you\'re guaranteed to find a romantic spot. Water sports lovers can dive into windsurfing and kitesurfing off the shores of Valentine, nearby Croudace Bay. Further inland, you\'ll find everything you need from convenience shops to butchers, local GP practice, to Bowling Club, perfect for everyday family life!', NULL, 1, NULL, NULL),
(129, '830', 'Discover bright picnic spots across Nightcliff, where plenty of food vans are available. Head inland to Casuarina Square, where you’ll find shopping centres suitable for the whole family. Local youth can enrol at the Charles Darwin University situated in Brinkin for a mix of city-based and coastal student life.', NULL, 1, NULL, NULL),
(130, '2913', 'Encapsulating areas such as Franklin, Ginninderra Village, and Ngunnawal, 2913 is a perfect area to raise a family in Australia! Located in the Northern section of Canberra, and surrounded by Areas such as Gungahlin and Mitchell, attractions for 2913 residents and tourists include: Canberaa Walk-in Aviary, The Big Bunyip, and Cockington Green Gardens! Local schools to the area abound, such as: Franklin School, Margaret Hendry School, and Palmerston District Primary School just to name a few.', NULL, 1, NULL, NULL),
(131, '5290', 'Encapsulating the areas of Mount Gambier and Mount Gambier DC, 5290 is home to a large number of families, and elderly couples, making it a wonderful place to live. Located between Melbourne and Adelaide, 5290 is home to a number of attractions, including: Umpherston Sinkhole, The Blue Lake, and Centenary Tower. 5290 is a great place to raise children, with local schools such as Gladigau Park Kindergarten, Melaleuca Park Primary School, and Grant High school, just to name a few!', NULL, 1, NULL, NULL),
(132, '4109', 'Encapsulating areas such as Altandi, Banoon, Macgregor, Sunnybank Hills and Sunnybank South, 4109 is a postcode that covers a large number of families and elderly people. Located in the Southern section of Brisbane, 4109 has great connections to metropolitan life, with nearby attractions including Warner Bros. Movie World and more! Local schools abound in this area, with schools such as Robertson State School, and Sunnybank Hills State School to name just a small few.', NULL, 1, NULL, NULL),
(133, '4114', 'Covering areas such as Kingston, Logan Central, Trinder Park, and Woodridge, 4114 is a postcode that is located within the Southern section of Brisbane. 4114 has great connections to metropolitan life and serves a large population of families and elderly people. Local attractions include Warner Bros. Movie World and Logan Gardens. The area is perfect for raising a family, with local schools such as Woodridge North State School, and Harris Fields State School, just to name even a small few!', NULL, 1, NULL, NULL),
(134, '6064', 'Encapsulating the areas of Alexander Heights, Girrawheen, Koondoola, and Marangaroo, 6064 is a postcode set towards the Northern section of the city of Perth, towards the West of the continent. Surrounded by areas such as Hillarys, Wanneroo, and Osborne Park, and attractions such as Caversham Wildlife Park, and Paloma Park. Local schools in the area are easily accessible, with such schools as Carnaby Rise Primary School, Illawarra Primary School, and Waddington Primary School, just to name a few!', NULL, 1, NULL, NULL),
(135, '3082', 'Located in the Northern section of Melbourne, Mill Park, under the postcode of 3082, is home to a large variety of families and couples. Mill Park is close to the towns of Craigieburn, and Whittlesea, and has local attractions such as Buttercross Park, Model Tudor Village, and Plenty Gorge Park, among many more attractions that offer outdoor fun for all. 3082 is also home to numerous schools, such as Mill Park Heights Primary School, Plenty Parklands Primary School, and Findon Primary School, just to name a few!', NULL, 1, NULL, NULL),
(136, '4817', 'Encapsulating the areas of Alice River, Bohle Plaines, Hervey Range, Kirwan, and Stableford among more, 4817 is located just towards the South of Townsville in Queensland. With a sizeable family population, in a suburban environment, it is a great place to live! Local attractions include Piper’s Lookout and Castle Hill Lookout! Local schools in this postcode abound, with options such as Kirwan State Primary School, Thuringowa State High School, and Weir State School, just to name a small few.', NULL, 1, NULL, NULL),
(137, '3844', 'Encapsulating the areas of Blackwarry, Callignee, Carrajung, Flynn, and Traralgon, amongst many others, 3844 lies between towns such as Callignee, Balook, and Gormandale, and is over two hours by car to the nearest city of Melbourne. With great connections to Metropolitan areas, alongside nearby nature grounds and other tourist destinations, this is a great place to live! If you’re looking for local schools, there are options such as Park Lane Preschool, St. Gabriel’s Primary School, and Tyers Primary School.', NULL, 1, NULL, NULL),
(138, '2320', 'Encapsulating a vast array of areas from Aberglasslyn, Bolwarra, and Farley, to Maitland, Oakhampton, and Rosebrook, 2320 is located just North West of Newcastle and has great connections to the city, as well as a number of tourist destinations, including Maitland Gaol, Hunter Valley Gardens, and Hunter Valley Zoo among many others. If you’re keen to find some shopping fun, then look no further than local amenities such as WOW Aberglasslyn, and Rutherford Marketplace!', NULL, 1, NULL, NULL),
(139, '3152', 'Located within the bustling hub that is Melbourne, on the Southern Coast of Australia, 3152 encapsulates the areas of Wantirna, Wantirna South, and Knox City Centre. Connections to Central Melbourne are easily accessible, and the short distance from Yarra Ranges National Park makes this a very attractive area for families and even couples to live in! The local school in the 3152 area is Wantirna Primary School, a quaint, but fully qualified school perfect for any child!', NULL, 1, NULL, NULL),
(140, '3214', 'Located near the urban centre of Geelong, Victoria, and a small journey away from the Metropolitan hub of Melbourne 3214, covers areas such as Corio, Norlane, and North Shore. This area is perfect for families, and even young couples, due to its city connections, and local areas of nature, such as Geelong Waterfront! A number of education options are available to residents of 3214, including, Geelong Grammar School, and North Shore Primary School!', NULL, 1, NULL, NULL),
(141, '2795', 'Made up of a large number of areas, such as Bathurst, Copperhannia, Gemalla, and Isabella, to name just a small few, 2795, lies just West of Sydney, about a three-hour journey by car. This postcode has great urban connections but still offers a suburban lifestyle, with local attractions such as Abercrombie House, Machattie Park, and Bathurst Regional Art Gallery. Local schools in the 2795 area include the Macquarie Grammar School and the Sydney Boys High School.', NULL, 1, NULL, NULL),
(142, '2112', 'Located within the greater Sydney area, and encapsulating smaller areas such as Putney, Denistone east, and Ryde, 2112 is a beautiful area with wonderful urban connections, while still offering a suburban lifestyle. Local attractions in the area include Sydney Harbour Bridge, Kissing Point Park, and Lane Cove National Park, just to name a few! 2112 is also an attractive area for students, with main campuses for the University of Sydney, and the University of New South Wales, and quick access to the cultural hub of Bondi beach!', NULL, 1, NULL, NULL),
(143, '2763', 'Encapsulating the areas of Acacia Gardens, and Quaker’s Hill, 2763, located in the greater Sydney area is a wonderful place to raise a family. With strong connections to the urban hub of Melbourne, and local nature reserves, this blend of urban and suburban life is highly attractive for anyone looking to live in Australia! Local schools abound, such as the Willunga Child Care & Preschool, and the Barnier Public School! As well as this, a local Catholic University also has its campus close by.', NULL, 1, NULL, NULL),
(144, '2195', 'Family-friendly residential areas of 2195 possess excellent city links, located just 14km from Sydney; commuters can even jump on the Sydney Metro for a speedy journey. Discover intricately designed places of worship throughout 2195, such as Lakemba Mosque alongside various educational institutions. Let the kids burn off steam at Wiley Park recreational grounds, perfect for sports, picnics, and dog walks. 2195 has a strong sense of community; you’ll never live too far from friends or family in the region. Meet up at an abundance of local restaurants offering Thai, Chinese, Lebanese, and Italian cuisines (and more!).', NULL, 1, NULL, NULL),
(145, '3204', 'The affluent suburb of 3204 is excellent for families of all ages! Get the kids together at one of the many recreational grounds located throughout Bentleigh and Ormond, where they can safely play sports or have a picnic. Grab your bicycle helmets or hiking boots; 3204 is just a short ride away from the coastal region of Brighton. Spend free time enjoying the local artisan butchers, restaurants, and chic cafes. Or jump on a 25-minute train ride to Melbourne City.', NULL, 1, NULL, NULL),
(146, '3044', 'Situated just 10km north of Melbourne’s Central Business District lies Pascoe Vale and Pascoe Vale South regions of 3044. There are plenty of amenities convenient for everyday tasks, such as supermarkets, pharmacies, delicious deli counters, and trendy cafes. Local youth will not be short of educational opportunities with a wide variety of schools and colleges. 3044 thrives in the summer with the opening of Pascoe Vale and Oak Park outdoor swimming pools. 3044 residents live relatively close to Essendon Fields should their fancy a quick getaway.', NULL, 1, NULL, NULL),
(147, '2161', '2161 is a suburb of Sydney located within New South Wales, filled with prosperous opportunities throughout Yennora’s industrial areas. The residential area of Woodpark is situated on the border of the Prospect Canal Cycleway, perfect for a family day out! You’ll also find various shops, takeaway choices, cake makers, and convenience stores; however, if you’re looking for more options, Greystanes shopping centre is just a short drive further. As younger families relocate into affordable properties, the future of 2161 is looking bright!', NULL, 1, NULL, NULL),
(148, '4214', 'The suburbs of 4241 are in a prime location, adjacent to Australia’s Gold Coast, a world-famous holiday destination. The pleasant area of Ashmore is filled with vibrant plants, dog walking routes, parks with play areas, and BBQ facilities. Public transport links in 4241 are excellent; take a short ride to the Gold Coast seafront or up to Coombabah Lake Conservation Park. Home to kangaroos, visitors can relish the treelined pathways and serene waters on a sunny day. Local youths have access to well-regarded schools, while Moledinar is close to the Gold Coast University Hospital, offering plenty of medical opportunities.', NULL, 1, NULL, NULL),
(149, '2122', 'Embrace the thriving atmosphere of 2122’s central plaza guaranteed to brighten your day out. Famous for ‘accidentally’ growing the Granny Smith apple, Eastwood closes off the oval and streets to host the Granny Smith festival to celebrate the iconic fruit. Every October in 2122, the grounds are filled with fairground rides, markets, street theatres, parades, apple baking competitions, and fireworks; it’s safe to say you’ll have plenty of entertainment. Marsfield is known for its links to leading scientific institutions such as CSIRO, Macquarie University, and University Hospital.', NULL, 1, NULL, NULL),
(150, '3178', 'Geographically one of the largest suburbs located south-east of Melbourne within the City Knox lies 3178, just 27km from Melbourne’s Business Central District. Innovative developments have introduced numerous shopping centres meaning you’ll be spoilt for choice; discover a wide variety of shops, cafes, supermarkets, and takeaways at Rowville Lakes and Wellington Village Shopping Centres. Neighbourhoods in 3178 look out for each other generating a real sense of community and an excellent way for the kids to make friends. Also, join one of the many local sports teams within Rowville.', NULL, 1, NULL, NULL),
(151, '3196', 'Located within 3196 lies a steady balance of the residential area and tranquil greenery with direct routes to the coast. Chelsea is a perfect location for early retirees looking to pursue new hobbies with community or sporting organisations and the church. Undertake a tranquil round of golf at the Australasian Golf Club’s Chelsea Public Golf Course, or head over to Edithvale’s Dolphin Baseball Club. In between activities, enjoy the peaceful scenes 3196 offers, and stroll along the Patterson River within Bonbeach.', NULL, 1, NULL, NULL),
(152, '6168', 'The coastal region of 6168 is located in Western Australia, southwest of Perth city centre, home to a bustling, united community ideal for growing families. Parents will find an array of welcoming schools and colleges to support their children. On a sunny weekend, head over to Cooloongup’s lakeside bike and trekking trails, and keep an eye out for Australian wildlife and migratory birds. Whether you’re a local resident or visitor, you must take a ferry from Shoalwater to Penguin Island for one of Australia’s most fantastic days out! Be sure to keep an eye out for ocean dolphins, or even better yet – swim with them!', NULL, 1, NULL, NULL),
(153, '2046', 'Surrounded by bright blue waters lies 2046, where there are plenty of places to sit and enjoy the sun. Admire the large waterfront homes over at Russel Lea, on one side you’ll see vibrant Iron Cove and on the other Five Docks Bay; take a leisurely stroll or cycle around the curve of the bay. Abbotsford is picturesque and known for its charm, 2046 is filled with trendy cafes, chic restaurants, and great parks. If you’re keen to see more, head over to Chiswick harbour where you’ll find an abundance of boutique coffee shops to appreciate!', NULL, 1, NULL, NULL),
(154, '2756', 'An idyllic suburban neighborhood in New South Wales, northwest of Sydney, 2756 nestles in between three stunning national parks; the Blue Mountains, Wollemi, and Yengo. 2756 boasts walking and bike trails with breath-taking views, perfect for nature lovers. The Parr State Conservation Area is also an ideal camping spot home to plenty of wildlife.\nWindsor is the largest town with many historic buildings for visitors to discover. Windsor benefits from excellent transport links with a reliable train service running from Windsor into Sydney Central station throughout the day. For shopping, Windsor Riverside Shopping Centre has plenty to offer customers.', NULL, 1, NULL, NULL),
(155, '6171', 'Balvidis is a friendly suburban community near the town of Rockingham, just south of Perth. The Transperth bus route means 6171 benefits from having strong reliable transport links to the city of Perth. The Walyungup salt lake is a sight to behold, the dry sand area surrounding the lake is a popular spot with land sailors. The splendid coastal beach area and the Indian ocean are found very close to 6171 at a 20-minute walk, beach and watersports lovers will feel comfortable and at home living in 6171. Balvidis is a family community with plenty of schools to choose from.', NULL, 1, NULL, NULL),
(156, '2620', '2620 is home to the suburbs of Beard, Hume, Oaks Estate, and Tharwa, and is a prime location for commuters being located so close to Australia\'s vibrant capital city Canberra. There are plenty of things to see in Canberra, such as the Australian National Gallery, and the National Museum of Australia (documenting the country’s social history). Living in 2620 is a wonderful opportunity to escape city life, and explore the Googong Foreshores where you can go canoeing, fishing, and take in the creeks. Queanbeyan is the main city in 2620, an ideal place to get groceries, try one of the many local restaurants, or visit the Queanbeyan museum.', NULL, 1, NULL, NULL),
(157, '2640', 'A welcoming community that lies on the Victoria-New South Wales regional border, 2640 is home to the thriving city of Albury, with its twin city of Wodonga located nearby in 3690. 2640 is an area surrounded by lots of eye-catching greenery with multiple National Parks situated nearby. For fans of golf, there are many great golf courses in 2640, including the prestigious Thurgoona Country Club Resort. Here there is something for people of all ages, from neighbourhoods lined with bars and restaurants with an active nightlife scene, to traditional idyllic rural country communities.', NULL, 1, NULL, NULL),
(158, '2283', 'Located 35km from the city of Newcastle, 2283 is a community in New South Wales where residents are blessed with splendid views of the glistening Lake Macquarie. 2283 is an ideal location for those wishing to escape city life. Two of the main suburbs in 2283 are Rathmines and Wangi Wangi. Rathmines is a picturesque suburb originally inhabited by aboriginal people. Rathmines Park is a must-visit and there are numerous top fishing spots in Rathmines. Wangi Wangi is a quaint suburb known for the Lake Macquarie State Conservation Area, being a great place to fish, a top family holiday destination, and being a friendly location to live.', NULL, 1, NULL, NULL),
(159, '4216', '4216 is conveniently situated in a prime location and lies only 10km north of the centre of the city of Gold Coast, Queensland. The neighbourhood is a dream for beach lovers with the stunning sprawling Moondarewa Bay and its golden sands. 4216 offers residents close proximity to key local amenities, such as the Gold Coast University Hospital. Coombabah is a peaceful suburb home to many stunning waterfront apartments and houses, a great option for retirees. Biggera Waters is a beautiful coastal suburb in 4216, home to several luxurious holiday resorts. 4216 is a wonderful area to move to, a stone\'s throw from the centre of the city of Gold Coast.', NULL, 1, NULL, NULL),
(160, '3130', 'Situated only 16km east of Melbourne’s central business district, 3130 is home to the pleasant leafy suburbs of Blackburn, North Blackburn, and South Blackburn. Kalang Park (part of the Blackburn creek lands) boasts majestic biking trails and serene nature areas for people to explore and indulge in peaceful suburban living. Blackburn also benefits from handy brilliant transport links into and out of Melbourne’s city centre, thanks to the regular train service which runs from Blackburn Station-Flinders Street, which is direct with no changes.', NULL, 1, NULL, NULL),
(161, '2323', 'A peaceful rural community, 2023 is home to a collection of suburbs of the city of Maitland. The largest suburb in 2323 is East Maitland, which has the infamous attraction Maitland Gaol, a former penitentiary that has been transformed into a tourist attraction hosting guided tours and festivals. For those interested in shopping, Stockland Green Hills Shopping Centre in East Maitland has an impressive range of stores, from children’s toys to beauty salons, to cafés, to banks, to clothes shops.', NULL, 1, NULL, NULL),
(162, '6060', '6060 is located just north of Perth, close to Perth’s central business district. The suburb of Joondanna in 6060 is an ideal neighbourhood for families, with numerous primary and secondary schools in the local area. Another key local educational facility in 6060 is the prestigious vibrant Edith Cowan University (ECU). Living in 6060, you will have lots of options at your disposal locally in terms of grocery shopping with the Dog Swamp Shopping Centre in the suburb of Yokine home to multiple different supermarkets. Perth International Airport is handily only 12km away from 6060.', NULL, 1, NULL, NULL),
(163, '2154', '2154 is a friendly suburban area, made up of Castle Hill, a suburb northwest of the city of Sydney. 2154 has fantastic shopping options thanks to the gigantic Castle Towers Shopping Centre in the heart of Castle Hill, one of Australia’s largest shopping centres. There are many large-size stunning traditional family houses on offer for sale and for rent in Castle Hill, ideal for families to settle in. 2154 is a quiet leafy suburban area, with lots of homes and large well maintained idyllic gardens.', NULL, 1, NULL, NULL),
(164, '3134', '3134 is a much sought-after green suburban area that lies 24km east of Melbourne’s central business district, home to the idyllic suburbs of Ringwood, Ringwood North, Warranwood, and Warrandyte South. Ringwood boasts a wealth of outdoor spaces for local residents to enjoy, including Ringwood Lake Park, Ringwood Public Golf Course, Jubilee Park, and Mullum Mullum reserve with its fascinating creek trail. Ringwood is also a top place to raise children, there are many local activities for kids such as visiting the playground in Ringwood Lake Park or going swimming and enjoying the slides at Aquanation Leisure Centre. 3134 is home to some of Melbourne’s best suburbs and offers an escape from city living.', NULL, 1, NULL, NULL),
(165, '6025', 'Located a mere 20-minute drive north of the centre of the city of Perth, 6025 is home to four idyllic coastal suburbs; Craigie, Hillarys, Kallaroo, and Padbury. Living in a home in any one of these 6025 communities at a stone’s throw from the Indian Ocean is an unmissable opportunity for any beach lovers, sun-seekers, and water sports junkies. Another key amenity that aptly lies just a 10-minute walk from 6025 in the adjacent 6027 is Edith Cowan University’s Joondalup Campus. Don’t miss out on investing in a home in this prime commuter location.', NULL, 1, NULL, NULL),
(166, '3165', '3165 is home to Bentleigh East, a small cosy suburb found approximately 17km and a 45–50-minute train journey from Melbourne’s central business district. Do you want to escape the city of Melbourne and follow a more relaxed slower lifestyle in the suburbs? If so, moving to 3165 will be a great choice. In terms of sports activities on offer in Bentleigh East, there are cricket pitches at Centenary Park, and Yarra Yarra Golf Club is known locally as a prestigious golf club. For gym enthusiasts, Bentleigh Fitness Centre has a gym with a range of weights, cardio machines, and a sauna.', NULL, 1, NULL, NULL),
(167, '6280', '6280 is found in the state of Western Australia and is home to numerous friendly rural locality communities, such as Busselton, West Busselton, and Wilyabrup. 6280 is predominantly a coastal area, located right next to the Blackwood, Jarrahwood, and Millbrook State Forests. 6280 is also down the road from the picturesque Whicher National Park. Therefore, nature enthusiasts will feel very much at home here when taking in the fresh local air and be able to take full advantage of the splendid local beaches and forests, with their breath-taking scenery.', NULL, 1, NULL, NULL),
(168, '5600', '5600 in the Eyre Peninsula, South Australia, has proud deep roots going back to its traditions of steelmaking and mining iron ore. Whyalla is a small city and the most populated settlement in 5600 and was formerly known as the ship-building capital of Australia. Whyalla is currently home to Whyalla Steelworks, the only manufacturer of rail in Australia, providing a key service to Australia’s rail industry. Living in Whyalla you will be able to enjoy its beautiful coastline. There’s no shortage of places locally to walk your dog, explore scenic coastal walks, or do a spot of fishing. 5600 is an affordable place to live, and the median house price in Whyalla is far lower than the national average.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(169, '5159', 'A leafy suburban area just south of the city of Adelaide, 5159 offers residents a great quality of life where they can enjoy a variety of handy local amenities. Aberfoyle Hub Shopping Centre in Aberfoyle Park is a place where you can find many things, from fashion to mouth-watering food in the restaurants and cafés, to fresh food in supermarkets, to pharmacy stores. Aberfoyle Park is also a top place to raise children, and is home to one of Australia’s largest public high schools (Aberfoyle Park High School). Flagship Hill is another pleasant 5159 suburb, and it has the picturesque Flagship Hill Golf Club. Commuting from Flagship Hill-Adelaide’s CBD is simple through the G20 direct bus route.', NULL, 1, NULL, NULL),
(170, '2204', '2204 is home to the vibrant suburb of Marrickville in the west of the city of Sydney, conveniently only 7km from Sydney’s booming city centre. Cooks River in the summer months with its sun-tinged water and views of Sydney’s skyscrapers in the distance is a sight to behold. The Cooks River trail is a top route for keen runners. 2204 offers its residents a high quality of life, it is a green suburb with four public parks that is ideal for outdoorsy types. There are large shops, such as in Marrickville Metro Shopping Centre and Woolworths 463 Illawarra Road, which can often come in very handy.', NULL, 1, NULL, NULL),
(171, '2234', '2234 is found in the idyllic leafy southern suburbs of Sydney. 2234 boasts stunning local beauty spots such as George River National Park. The George River is a prime spot for fishing, boating, and even enjoying picnics and barbeques in warmer months! There are plenty of places to go shopping in Menai, at Menai Marketplace you can come across fabulous delis and fresh food outlets, as well as an array of all other store types. Sydney is very accessible from 2234, and only a 30-minute drive by road or a 30-minute train from nearby Sutherland Station. 2234 is one of Sydney’s top suburbs!', NULL, 1, NULL, NULL),
(172, '3040', 'The suburbs of 3040 are located a mere 8km northwest of Melbourne’s central business district. The suburbs of 3040 are home to plenty of outdoor green spaces for residents to enjoy, with there being three public parks, the 5-mile creek reserve, and Essendon’s Cricket ground all found within the 3040 postcode. Essendon and West Essendon are popular residential suburbs, with reliable regular trains running into Flanders Street Railway Station in the heart of Melbourne’s central business district. Whether you are a young professional or a growing family, 3040 is a great location to live!', NULL, 1, NULL, NULL),
(173, '2428', '2428 is found on the mid-north coast of New South Wales. The most populated settlements are the coastal towns of Forster and Tuncurry. The gorgeous local beaches mean it is a popular summer holiday destination. By taking out a boat into the ocean in Forster you can even enjoy a spot of dolphin and whale watching! If you are not a beach person, there is the Wallingat National Park and Wallis Lake which has many brilliant fishing spots. 2428 is a great place to live and the local community has benefitted majorly from tourism over the years.', NULL, 1, NULL, NULL),
(174, '3038', 'Home to the welcoming leafy suburban communities of Keilor Downs, Keilor Lodge, and Taylors Lakes, 3038 is found 22km from Melbourne’s bustling central business district. Keilor Lodge and Keilor Downs are both wonderful tight-knit suburban communities, and top places to raise children with there being a variety of local primary and secondary schools to choose from. Green Gully Reserve in Keilor Downs is a splendid local outdoor space, perfect for runners and dog walkers. Green Gully Reserve is also home to a cricket pitch, the Green Gully Soccer Club, and a kids’ playground. 3038 offers wonderful suburban living!', NULL, 1, NULL, NULL),
(175, '2036', 'Home to coastal suburbs just 13km south of Sydney’s central business district, 2036 boasts some breath-taking beaches, such as Yarra Bay, Frenchmans Bay, and Little Bay. It is a 40-minute bus ride from Chifley into Sydney’s city centre, therefore 2036 is a prime location for commuters to live. Do you want to be able to take in the gorgeous South Pacific Ocean whilst being close by to the international business city of Sydney? If so, we recommend looking a 2036 and its stunning suburbs.', NULL, 1, NULL, NULL),
(176, '2566', '2046 is a collection of suburbs part of the Macarthur 40 km southwest of Sydney. The suburb of Minto historically was originally home to indigenous Australians (Tharawals). Minto benefits from a good transport link to Sydney, as Minto Railway Station is serviced by the Sydney Trains network. Bow Bowing and St Andrew are two friendly suburban communities with plenty of green space for residents to make the most of. There are many good quality schools in the 2046 area, and numerous schools in the suburbs of 2046 have reputation for being very good for sports in particular.', NULL, 1, NULL, NULL),
(177, '3024', '3024 is a rather rural zone situated approximately 35km southwest of Melbourne’s central business district. The largest and most popular settlement in 3024 is the suburb of Wyndham Vale. Wyndham Vale is a thriving suburban community, home to many local businesses. Wyndham Vale Central College is a highly reputable secondary that has benefitted from a lot of state funding in recent years, so families can rest assured that the educational opportunities on offer in 3024 are of a good standard. Wyndham Vale Station to Melbourne’s central business district is an easy 35-minute direct train journey.', NULL, 1, NULL, NULL),
(178, '2217', '2217 is home to splendid suburbs and is located 16km south of Sydney. 2217 is also just a stone’s throw away from Sydney Airport, perfect for any visitors you may have staying from overseas! Living in 2217 truly offers local residents the quintessential ideal Australian suburban experience. Are you a beach lover? The stunning Ramsgate beach in the suburb of Ramsgate has glistening golden sands to die for, especially in the summer months. The suburban communities in 2217 are friendly, and neighbours look out for one another here.', NULL, 1, NULL, NULL),
(179, '6059', '6059 is home to the prime commuter suburb of Dianella, situated only 8km north of the central business district of the city of Perth. Dianella is a green suburb with attractive open spaces. The Dianella Regional Open space is a great place to go running, and Dianella Dog Park is an ideal place to walk your dog. Perth’s city centre is easily accessible from 6059, Dianella-Perth city centre is just a 17-minute direct bus journey. So take a break from city life in Perth, a look into moving to the dreamy suburbs in 6059.', NULL, 1, NULL, NULL),
(180, '2035', 'Home to the ideal suburban communities Pagewood and Maroubra just 8km south of Sydney’s central business district, 2035 is a much sought-after location to live in. Maroubra is home to the breathtaking Maroubra Beach, a beautiful sandy beach and a prime spot for surfing. There are many wonderful restaurants to enjoy and dine-in in 2035 for the food lovers out there. 2035 offers you the optimum suburban living experience, with Sydney’s city centre also being just a few kilometres away.', NULL, 1, NULL, NULL),
(181, '2760', 'Escape the busy crowded urban life in Sydney and move to 2760, home to friendly neighbourly green suburban communities. The suburbs of 2760 are found 50km west of Sydney. There are many beautiful open spaces locally for residents to enjoy, such as the walking trails at the Wianamatta Regional Park. Colyton is a wonderful community to raise kids in, with there being a range of schools (primary and high schools) available to send your children to in the local area.', NULL, 1, NULL, NULL),
(182, '2196', '2196 is home to the residential suburban communities of Punchbowl and Roselands, just 18km southwest of Sydney’s central business district. In terms of local shopping options, Roselands Shopping Centre is home to many clothes shops, a supermarket with fresh food, and various fantastic restaurants. The Punchbowl Park is an important place for recreational community sports activities, it has tennis courts and a cricket pitch. Punchbowl Park\'s cricket pitch hosts cricket matches for the local cricket club. Punchbowl is an ideal spot in Sydney’s suburbs, and accessing Sydney’s central business district is very easy through a direct train journey from Punchbowl Station.', NULL, 1, NULL, NULL),
(183, '2121', 'Just 18km away from the central business district in Sydney lie the scenic, calm yet industrial suburbs of Epping and North Epping. Classic restaurants, reserves, bays, and tranquil Islands line the perimeters of 2121, making it easy to work, play, and generally have a good time with family and friends in and out of Epping. Epping also serves as a major connecting suburb to other major cities. Yet, within its lush, green borders, there’s a lot to enjoy from the Forest Parks to the local clubs in the area. This decently multicultural suburb in New South Wales is a great place for professionals looking for a less bustling city and families that love the calm and stability Epping guarantees.', NULL, 1, NULL, NULL),
(184, '6330', '6330 boasts major towns, cities, and suburbs from Albany, to Walmsley and Bornholm. It covers up to 50 explorable areas as well as cities and towns in Western Australia with a wide range of beaches, museums, national parks, and picturesque hills. Albany is one of the most popular cities in the area with its city centre sitting between Mount Clarence and Mount Melville. It has fast become the home to many tourists, professionals, families, and ex-pats thanks to its rich history and plethora of preserved National attractions. 6330 would be the perfect place to resettle, or a destination site for a little perusing of beaches and parks like Centennial Park, Middleton Beach, Frenchman Bay, and EMU Point.', NULL, 1, NULL, NULL),
(185, '2580', '2580 may not have bustling suburban areas or the busy night-life other postcodes guarantee. However, this quiet and homey area is probably the best place to settle if you love little traffic, fresh air, beautiful hills and mountains, and the promise of peace. One of the towns in the region, Bungonia is also home to the oldest Roman Catholic church in Australia. In the same region, there’s a Pristine Shoalhaven river that almost looks artificially carved out by the river\'s shorelines. Other scenic and recreational attractions include the Bungonia National Park, and a Lookdown at the Valley creek just 1.5KM away. Activities like caving, canyoning, and kayaking are popular in the region as most landscapes remain untouched. 2580 also boasts of small villages and towns like Parkesbourne, plus areas like Greenwich Park, Wombeyan Caves, Brisbane caves, and Spring Valley.', NULL, 1, NULL, NULL),
(186, '2229', 'Just 24 Km away from the busy central district of Sydney lies the Caringbah suburb. It’s surrounded by Lilli Pilli, Port Hacking, and Dolans Bay; residential areas filled with fresh farm markets, grocery stores, organic food markets, and the infamous Saltwater Market. Additionally, Dolans Bay is one of the go-to regions to settle when looking for the perfect getaway from basic suburban homes. The streets extend all the way to the docks at bay, while some homes sit on the borders of the water. 2229 also has a good number of both public and private schools for residents resettling with their families. These suburbs have ranked highly as safe, friendly, and culturally-diverse regions with breathtaking views, minimal traffic, and generously sized lands.', NULL, 1, NULL, NULL),
(187, '2641', 'With locations such as Hamilton Valley, situated along the Bungambrawatha Creek, and with other areas such as Lavington, and Springdale Heights, 2641 is a postcode that covers a wide array of landscapes, from urban to rural. With only a four-hour drive separating 2641 from Central Melbourne, Hamilton Valley is perfectly situated for urban connections. With an established population of families and couples, 2641 is perfect for raising children, with a variety of schools available, for multiple ages.', NULL, 1, NULL, NULL),
(188, '3182', 'Encapsulating the metropolitan hubs of St Kilda and St Kilda West, and mere minutes from Central Melbourne, 3182 accommodates a more urban population and lifestyle. Populated by families and couples, largely occupying apartments, 3182 offers both a wonderful place to raise a family and simple urban connections. A wide array of schools, for multiple ages, can be found in the area, and local attractions such as the famous St Kilda Beach allow for perfect weekend retreats for the whole family!', NULL, 1, NULL, NULL),
(189, '2529', 'Located towards the South of Wollongong, 2529 is an area with wonderful urban connections and a diverse population of families, couples, and single young people. Covering areas such as Shellharbour, Blackbutt, Dunmore, and Oak Flats, and only 20 kilometres from the nearest city of Wollongong, 2529 is a perfect area to raise a family in Australia. Various schools are located around the area, for parents and children to choose from. Local attractions to the 2529 area include Jamberoo Action Park and even Kayak tours!', NULL, 1, NULL, NULL),
(190, '2263', 'Separated by the two lakes of Budgewoi Lake, and Tuggerah Lake the areas of 2263; Toukley, Gorokan, Lake Haven, and Charmhaven, are located just south of the city of Newcastle. With a healthy population of families and couples, 2263 is a perfect place to begin a family! With local schools such as Gorokan High School and Toukley Public School, just to name a few, and local beaches and cities within easy reach, 2263 has something for everyone in the family!', NULL, 1, NULL, NULL),
(191, '2478', 'West of the city of Brisbane, and containing areas such as Ballina, Pimlico, Cumbalum, Patchs Beach, and Skennars Head, 2478 is wonderfully located to offer urban living, alongside natural and rural landscapes! 2478 is made up of a population of families and couples, making the area perfect for raising a family of your own. There are multiple schools close by to choose from, and the nearest city of Brisbane and a variety of Southern-facing beaches are easily accessible for wonderful downtime!', NULL, 1, NULL, NULL),
(192, '2880', 'Surrounded by rich vistas of Australia’s deserts, and containing such areas as Broken Hill, Burns, and Cameron Corner, 2880 boasts a small but welcoming population of families, couples, and younger people. A number of schools can be found in Broken Hill, and local residents of the area have become well-known for their friendliness and culture. The closest urban hubs are the cities of Melbourne, and Adelaide, meaning living in 2880 doesn’t mean being detached entirely from the outside world!', NULL, 1, NULL, NULL),
(193, '3121', 'Located close to the central hub of Melbourne, 3121 offers a vibrant and cultural lifestyle, close to many urban attractions, and facilities. Covering the areas of Burnley, Cremorne, and Richmond, 3121 offers a wonderful living space, amongst a welcoming population, made up of families, couples, and young people. A variety of schools are available, to accommodate a number of age groups, as well as campuses for some of Australia’s top universities! Local attractions include the Royal Botanic Gardens and Queen Victoria Market!', NULL, 1, NULL, NULL),
(194, '2207', 'Not far from the bustling heart of Sydney, and close to the wonderful Botany Bay, lies 2207. Home to such areas as Bardwell Park, and Bexley North and South, 2207 is an area made up of a population of families, couples, and young people. Local schools and universities abound, with plenty of generous choices depending on the catchment area. And when the weekend arrives, you won’t be far from the World famous Bondi Beach and the urban sprawl of Sydney.', NULL, 1, NULL, NULL),
(195, '3032', 'Close to the vibrant city of Melbourne Victoria lies the area of 3032, home to such areas as Ascot Vale, Highpoint City, Maribyrnong, and Travancore. Ascot Vale, named after the world-famous racetrack, has become a wonderful and trendy neighbourhood of young people and families. Maribyrnong is home to a vast urban population and plenty of natural and recreational attractions for the whole family. 3032 is perfect for raising a family, with multiple schools nearby offering a vast and strong curriculum.', NULL, 1, NULL, NULL),
(196, '4509', 'Towards the North of the city of Brisbane lies the small area of Mango Hill, under the postcode 4509. With a small, but welcoming population of over 8,000, comprised of families and couples, 4509 offers a wonderful suburban lifestyle, with very strong connections to the city of Brisbane. Raising a family is perfect in this area, with most every need catered to, by the various shopping destinations, and numerous schools to give your child the best education.', NULL, 1, NULL, NULL),
(197, '4220', 'Fun and breathtaking places like Nobby Beach, GoldCoast Highway, and Burleigh golf clubs characterize 4220. It’s rich with suburbs from Miami to Burleigh Waters. Enjoy live bands and delicious street food or take the family out to the scenic Nobby Beach and or lodge at their water-side apartments. There are sea-view rooms with beach access, indoor/outdoor pools, and barbeque spots. The regions in 4220 are also very property hot because of the rising settlements, Burleigh Waters alone has a population of about 14,310. Plus, the region equally has a variety of high-standard primary and High schools. It’s a family-friendly region with lots of side attractions to help blow off some steam when needed.', NULL, 1, NULL, NULL),
(198, '2761', 'Located at about 40+ KM from the Sydney Business District, suburbs like Glendenning, Colebee, and Oakhurst sit pretty on the greenery of New South Wales. These towns have certainly grown rapidly over the years alongside the real estate market. Besides, the suburbs in 2761 are not without pure gem vacation spots, picture-perfect attractions, and recreational centres. Places like Glendenning, Joe McAleer Park, and the calm and comfy rest stops are just some of the most suitable places to relax, rejuvenate and get ready for a new week. The markets in these suburbs are equally quite safe and easy to access. Feel free to visit the night markets or get some fresh produce from the nearest farmers\' market. At the end of the day, 2761 may be home to many entrepreneurs, professionals, and students alike, but it’s also an excellent place to raise a family, thanks to the standard education system.', NULL, 1, NULL, NULL),
(199, '4650', 'There are extra tranquil and fine lodges available in the 4650 zones. Even though this postcode is mostly characterized by rural areas, it still makes it a homely and peaceful place for families to settle. Rural settlements like Bauple, Antigua, and Aldershot still boast of bubbling markets with fresh produce and traditional materials. The 4650 zone also promises easy access to wildlife, hiking trails, camping sites, and blue clear waters surrounded by white sands. Thanks to the Poona National Park, most of the endangered species in the area are well protected and preserved to avoid extinction. The residents also enjoy views from the cluster of small islands in Boonooroo, a golf course, and a tennis court.', NULL, 1, NULL, NULL),
(200, '4573', 'There are about seven popular areas within Postcode 4573 some of which include Point Arkwright, Peregian Springs, Peregian Beach, and Mount Coolum. The region is known for its scenic views, paradise beaches, and even the volcanic dome that watches over the shrubs and greenery within the postcode 4573. Coolum Beach and Peregian Beach are the two major suburban areas, and as the names imply, they both have houses, resorts, and restaurants by the beachside. It’s common to find couples and families living in these regions because of the peace and tranquil beauty the areas with 4573 exude.', NULL, 1, NULL, NULL),
(201, '4301', 'The homey region that covers the 4301 postcodes has pristine suburbs like Redbank, Collingwood Park, and Redbank Plains. The area has seen progressive growth over the years with new homes and vast development projects to show for it. It has surely become a top suburb for entrepreneurs, professionals and large families to settle in. Movement is equally fairly easy thanks to the easy Translink bus services and the Redbank Railway station which connects 4301 to the Brisbane central business district.', NULL, 1, NULL, NULL),
(202, '7310', '7310 is well-populated with cafes, fine-dining restaurants, casual contemporary and fast-food joints. It certainly has that city look, yet still encapsulates the tranquil and green scenery some people crave in less urban settlements. Devonport, being the main city in the area, is an excellent example. It’s somewhat overlooked by tourists which makes it a top choice for those that love peace, quiet and some more acres on their land. 7310 also connects to surrounding cities like Melbourne thanks to its proximity to Tasmania and the major seaport that links the two cities.', NULL, 1, NULL, NULL),
(203, '4221', '4221 is blessed with friendly communities, upcoming suburbs, and pet-loving beaches. Palm Beach alone is home to cosy cafes, a vast number of restaurants and the cleanest beach in Queensland. Elanora is another wonderful suburb in the area that perfectly combines traditional country living with the business of beach life. It’s still a quiet place to work, resettle or purchase a home. Yet, the tourist attraction and nightlife equally make it a fun place to live in. Plus, with Burleigh and Coolangatta just 10 minutes away, it’s easy to switch between cities thanks to their reliable rail and ferry systems.', NULL, 1, NULL, NULL),
(204, '4118', 'Towards the Southern section of the world-famous city of Brisbane, 4118 covers areas such as Browns Plains, Brownsleigh, Forestdale, Hillcrest, and Regents Park. With simple access to Central Brisbane, and the Gold Coast, and situated amongst more suburban surroundings, 4118 is proving a wonderful place to live in Modern Australia! Local schools range from St. Bernadine’s Catholic Primary School to Brown Plains State High School, among others, and local attractions include the Karawatha Forest Discovery Centre and Rainforest Tours, which offer fun for the whole family!', NULL, 1, NULL, NULL),
(205, '3088', 'Offering suburban environments with quick access to Central Melbourne, 3088, and its areas: Briar Hill, Greensborough, and Saint Helena, is a great place to live in Australia! With a large and welcoming population of families and young couples, alongside connections to metropolitan areas in Melbourne, 3088 is a welcoming area that can accommodate almost every need! With local schools in abundance, such as Greensborough Primary School and Greensborough College just to name a few. And when the weekend rolls along, the city of Melbourne is never far!', NULL, 1, NULL, NULL),
(206, '3109', 'Doncaster East, represented by the postcode 3109, lies towards the North East of Melbourne, only a 25-minute drive from the city centre. Offering suburban neighbourhoods and lifestyles, with quick access to urban connections, makes it no surprise that 3109 is proving a popular spot to raise a family in Australia! Local schools like Serpell Primary School, and East Doncaster Secondary College seek to bring the top-quality curriculum to local children, and local attractions in Melbourne make entertaining the whole family simple!', NULL, 1, NULL, NULL),
(207, '6152', 'On The Northern Side of the Swan River, which runs through the heart of Perth, is the area of 6152, made up of areas such as Como, Karawara, Manning, Salter Point, and Waterford. With a population of over 26,000 and composed of families and younger couples, 6152 is a friendly, and well-connected area of Australia to live. With schools such as Como Primary School, and Como Secondary College, ready to teach local children, and attractions such as the Kings Park and Botanic Garden to entertain the whole family.', NULL, 1, NULL, NULL),
(208, '2528', 'Joined by the Windang Road, which crosses the river between the South Pacific and Lake Illawarra, 2528 covers the areas of Barrack Heights, Mount Warrigal, Warilla, and Windang. Located towards the South of Wollongong, and just above Shellharbour, 2528 is made up of a population of families, and more elderly couples, ready to welcome new neighbours! Local schools are plentiful, from Warilla High School to Windang Public School. Local attractions are also not far off, such as Shellharbour beach, and Murad’s Island!', NULL, 1, NULL, NULL),
(209, '2150', 'Attractions abound in 2150, covering the areas of Harris Park and Parramatta, and Parramatta Westfield. Located in the Westerly part of Sydney, 2150 is already well connected to the cultural hub of the city but also has a sizeable stable of attractions and schools to cater to the families that populate the area. Attractions such as Code Red Laser Tag, and Newington Armory keep the whole family occupied, while events such as Rooftop Hangouts can keep the older kids entertained. 2150 is perfect for raising a family!', NULL, 1, NULL, NULL),
(210, '2611', 'Located amongst vast and awe-inspiring mountain ranges, 2611 offers a suburban lifestyle that allows its residents to be close to nature! 2611 is not completely cut off from urban life, however! The nearest town of Canberra offers metropolitan life close to a rural lifestyle! 2611 covers areas such as Brindabella, Chapman, Rivett, Uriarra, and Weston, amongst others, which boast a friendly population of families, with access to high-quality schools, and attractions such as the National Arboretum Canberra.', NULL, 1, NULL, NULL),
(211, '2570', 'Offering an incredibly rural and natural lifestyle, while also offering incredibly close proximity to the city of Sydney, 2570 is a remarkable place to live in Modern Australia. Encompassing areas such as Belimbla Park, Camden, Elderslie, and KIrham, just to name a few, 2570 offers bountiful neighbourhoods made up of friendly and welcoming populations of families and elderly couples. Local schools make it easy to raise children in the area, with such schools as Camden Public School. Connections to Central Sydney also make entertainment a cinch!', NULL, 1, NULL, NULL),
(212, '6019', 'Scarborough, and Wembley Downs, two suburbs of the Greater Perth area, lie just North of central Perth, along the coast, and within easy access of Scarborough Beach. Covered under the 6019 postcode, this area offers suburban lifestyles, perfect for the large population of families in the area. Local schools are plentiful, with such institutions as Scarborough Primary School, International School of Western Australia, and more. Connections to the greater Perth area make entertaining the whole family easy and make work commutes much shorter.', NULL, 1, NULL, NULL),
(213, '2144', 'With close connections to the greater Sydney area, and covering the suburb of Auburn, 2144 is proving to be a very wonderful place to live in Australia. Local attractions abound in all directions, thanks to 2144’s connections to Central Sydney, but the area also has a number of its own attractions, such as Auburn Botanic Gardens and the Peacock Gallery, which offer unparalleled connections to nature. Local schools also focus on delivering high-quality education to all children in the area.', NULL, 1, NULL, NULL),
(214, '4121', 'Holland Park and Holland Park West have proven themselves as highly popular place for families, couples, and younger people to live. Covered under the postcode of 4121, alongside areas such as Ekibin, Mount Thompson, Tarragindi, and Wellers Hill, Holland Park offers a suburban lifestyle while also being remarkably close to central Brisbane. With a population of over 26,000, of which many is families, Holland Park is filled with people ready to welcome new neighbours to warm communities.', NULL, 1, NULL, NULL),
(215, '2905', 'Located South of the Metropolitan area of Canberra, and part of the Namadgi National Park area, 2905 covers areas such as Bonython, Calwell, Chisholm, and Gilmore, among others. The local population of around 32,000 is composed largely of families and young couples, due to the suburban lifestyles the location offers, with simple links to metropolitan life in Canberra. Local schools such as Telopea Park School, Calwell High School, and Calwell Primary School make education simple for local families.', NULL, 1, NULL, NULL),
(216, '2486', 'With multiple bodies of water, such as the Terranora Creek, and Charles Bay, 2486 offers a lifestyle of suburban neighbourhoods nestled amongst rural areas of land, and wonderful bodies of water to relax beside. Connections to urban areas are strong, with a short journey to the Gold Coast, and its many beaches, which makes planning weekend retreats simple. Local schools for families include Pacific Coast Christian School, Terranora Public School, and Carool Public School to name a few.', NULL, 1, NULL, NULL),
(217, '2065', 'Towards the upper Northern shore of Sydney lies 2065, which covers the areas of Crows Nest, Gore Hill, Greenwich, and St Leonards to name just a few! Offering a suburban lifestyle with easy access to Central Sydney, 2065 is perfect for those looking to live a modern life in Australia. Commuting to city work is simple and easy, and weekends are sorted, with easy access to beaches and Sydney’s many attractions! Schools are also plenty, such as Greenwich Public School, and North Sydney Girls High School.', NULL, 1, NULL, NULL),
(218, '4218', 'With a population of over 33,000, in a suburban setting, surrounded by heritage sights, and with connections to the greater Gold Coast area, 4218 is a highly popular place to live in Modern Australia! With immense views over the Coral Sea, and access to plentiful beaches to soak in the sun, 4218 offers the best of city life, while also offering a suburban setting for your family! Local schools and attractions abound, so raising a family in the area is easy.', NULL, 1, NULL, NULL),
(219, '4051', 'Circling the Enoggera hills, and occupying such areas as Alderley, Gaythorne, Grange, and Newmarket, 4051 is a taste of suburban life close to the heart of Brisbane. Parks and tree-covered walks abound in Gaythorne, alongside independent cafes, bars and restaurants such as Hansell & Gretel café, and Des Alpes. Keeping the whole family entertained is easy too, with attractions such as Walkabout Creek Discovery Centre, which offers the opportunity to encounter native wildlife and walk through well-tended lands!', NULL, 1, NULL, NULL),
(220, '2210', 'Circled by Georges River and situated on the South East section of the wider Sydney area, 2210, encompasses the areas of Lugarno, Peakhurst, and Riverwood. 2210 encapsulates a number of suburban neighbourhoods, parks and reserves, such as the Salt Pan Creek Reserve, and Gannons Park. With a welcoming and vibrant population of families, young people and couples, 2210 is a wonderful place to live, or even to raise a family in modern Australia!', NULL, 1, NULL, NULL),
(221, '2220', 'Hurtsville, just 15 kilometres away from Sydney’s Central Business District, covered by the 2220 postcode has a population of over 30,000, with much of that comprising of families and young couples. 2220 offers suburban lifestyles for those in the Hurstville neighbourhood, with easy and convenient connections to the greater Sydney area. Local attractions such as Carss Bush Park take advantage of 2220’s location, offering wonderful views across Georges River, in a fresh and natural setting.', NULL, 1, NULL, NULL),
(222, '2430', 'Located close to the coast of Australia, overlooking the Tasman Sea, 2430 covers a large variety of areas from Black Head, Hillsville, to Kolodong and Taree, just to name even a very small few. Its closest municipal area, Newcastle is just 169 km away, a mere 2-hour drive! 2430 covers neighbourhoods and suburbs that are surrounded by vast swathes of nature, and convenient urban connections. Local beaches, such as the Diamond Beach make soaking in the sun all the easier!', NULL, 1, NULL, NULL),
(223, '3219', 'On the Westerly end of the Port Phillip Bay, South-West of Central Melbourne lies 3219, home to Breakwater, East Geelong, Newcomb, and Whittington. Multiple nature reserves and parks dot the postcode, such as Eastern Park, which offers unrivaled views over Port Phillip Bay, and Stingaree Bay. Local neighbourhoods are home to families of welcoming and warm locals, waiting to welcome new neghbours! Local schools include Geelong East Primary School, St Albans Park Kindergarten, and Whittington Primary School.', NULL, 1, NULL, NULL),
(224, '4077', 'Part of the wider Brisbane area, 4077 lies just southwest of the heart of one of Australia’s most famous cities. With a population of 27,000, largely made up of families, in neighbourhoods such as Doolandella, Durack, Inala, Richlands, and Serviceton, 4077 is a warm and welcoming place to raise a family. Local schools such as Glenala State High School, Inala State School, and Richlands East State School help to provide a top-quality curriculum to local kids.', NULL, 1, NULL, NULL),
(225, '2251', 'Encapsulating suburbs such as Avoca Beach, Bensville, and Bouddi, 2251 is a wonderfully situated area of Australia, with close links to the city of Sydney. Many of 2251’s suburbs, including Bouddi, surround Bouddi National Park, which is home to camping opportunities, swimming spots, and ample opportunity to engage in fishing. Other suburbs like Bensville are situated near large bodies of water, such as a popular fishing spots. 2251 is also close to multiple coastal beaches that offer a relaxing retreat for all!', NULL, 1, NULL, NULL),
(226, '6036', 'Looking over the vast expanses of the Indian Ocean lies 6036, a postcode home to the suburbs of Butler and Jindalee. If you are looking for a small town with wonderful cafes, a welcoming population and plentiful facilities, then Jindalee has everything you could need. Butler also offers suburban lifestyles with plenty of amenities, parks and attractions to appeal to anyone in the family. Even living in the area is appealing, with a number of schools including Butler Primary School.', NULL, 1, NULL, NULL),
(227, '3166', 'Part of the Eastern wing of the greater Melbourne area, 3166, boasts a population of over 25,000, with much of that comprising of families with children, as well as elderly and young couples. 3166 includes the suburbs of Hughesdale, Huntingdale, and Oakleigh. Oakleigh offers an urban lifestyle within a suburban setting. Oakleigh once operated as a separate city, before being absorbed by Melbourne. 3166 offers up-to-date amenities, education and entertainment to make raising a family easier.', NULL, 1, NULL, NULL),
(228, '2230', 'Towards the Southernmost part of the greater Sydney area lies the postcode of 2230, consisting of a number of areas separated by the Simpsons Bay, which leads out to the Tasman Sea. Areas include Bundeena, Burraneer, Cronulla, Maianbar, and Wooloware. 2230 offers a metropolitan community surrounded by water and nature, with nature walks, and relaxation spots, and cafes available. Local populations, numbering up to 28,000 are friendly and welcoming, making it also a perfect place to live, made better by its proximity to greater Sydney.', NULL, 1, NULL, NULL),
(229, '4178', '4178, a postcode close to the heart of Brisbane, covers a wide variety of areas and suburbs, such as Lindum, Lytton, Wynnum, and Port of Brisbane. Port of Brisbane is perhaps the central point of 4178, nearby to fisherman’s island, an area which keeps the wider city of Brisbane connected to the wider world! Areas such as Lytton offer natural landscapes and historic grounds, while Wynnum and Wynnum West offer suburban lifestyles.', NULL, 1, NULL, NULL),
(230, '3146', 'Glen Iris, a large suburb of the Metropolitan City of Melbourne, lies close to the heart of the city, on the Western side. Glen Iris is a heavily populated area of Melbourne, being one of the central areas for the Melbourne population to occupy, with a current population of over 25,000 in the suburb alone. Under the postcode of 3146, Glen Iris is proving to be one of the best areas in Melbourne to live, due to its proximity to the greater city, and its suburban population.', NULL, 1, NULL, NULL),
(231, '2759', 'Covering the areas of Erskine Park, and St Clair, 2759, situated towards the West of Sydney, is a popular place within Australia. Erskine Park is a popular suburb with families, both established and new, due to the number of schools, and amenities such as groceries and local shops and cafes. St Clair, likewise, also offers a suburban lifestyle, with a friendly population of 19,897 people. Local sights, such as the Sydney Opera House, and Scenic World offer world-famous landmarks and natural landscapes.', NULL, 1, NULL, NULL),
(232, '4226', 'Clear Island Waters, an upper-class suburb of Australia’s Gold Coast, is just one of many features of the 4226 postcode. 4226 covers Kerrydale, Merrimac, and Robina and the aforementioned Clear Island Waters. Clear Island Waters offers top-of-the-range waterfront housing that looks over the Clear Island Lake. Robina, Kerrydale and Merrimac, are more heavily populated areas, home to a sizeable population of middle-class families who benefit from local amenities, schools, and proximity to urban hubs.', NULL, 1, NULL, NULL),
(233, '3084', 'Surrounded by the natural landscapes of the Banyule Flats reserve and the Warringal Parklands, 3084 is home to suburbs that offer comfortable living within close proximity to the heart of Sydney. Eaglemont is a picturesque and rural suburb home to a number of private schools and walking ranges. Rosanna boasts a number of public schools, amongst other high-class amenities for its population of families. 3084, and its suburbs are a wonderfully high-class part of the greater Melbourne area, somewhere you’d be proud to call home!', NULL, 1, NULL, NULL),
