(235, '5109', 'Part of the city of Salisbury, on the northern outskirts of Adelaide, is 5109, home to Brahma Lodge, Salisbury East, Salisbury Heights, Salisbury Park, and Salisbury Plain. 5109 is a popular suburban location, judging by its local population of over 22,000, of which, many are families. 5109 is in close proximity to the centre of Salisbury, and Adelaide, meaning that almost every need for its population is catered to, by its many amenities.', NULL, 1, NULL, NULL),
