(237, '3155', 'Boronia, under the postcode of 3155 is home to a number of public parks, including the Liverpool Road Retarding Basin. Boronia has a healthy population of around 23,500 people, with much of this population being made up of families, and young couples. Boronia is within easy access to the greater Melbourne area, which makes it an appealing area to live. Boronia has a number of local schools including Boronia Heights Primary School, Knox Central Primary School, and more, which offer top-of-the-range curriculums for local children.', NULL, 1, NULL, NULL),
(238, '3012', 'With excellent proximity to the Heart of Melbourne, 3012 is a wonderfully modern part of Australia. 3012 is a popular area to live in, with a population of over 26,000 reflecting this. Brooklyn, one of its suburbs, maintains a quiet suburban atmosphere, despite its proximity to metropolitan life. Kingsville, another suburb, is known for having a vibrant array of eateries, such as Nirankar Restaurant, Mesa Verde, and Goon Korean BBQ. There are even more suburbs within 3012, all of which have appropriate amenities for daily life.', NULL, 1, NULL, NULL),
(239, '2260', 'Set along the East coast of Australia, not far from the greater metropolitan areas of Gosford and Sydney, and looking out over the Tasman sea, 2260 encapsulates the suburbs of Erina Heights, Forresters Beach, and North Avoca, Terrigal, and Wamberal. With easy access to wonderful beaches and the Wamberal Lagoon Nature Reserve, 2260 is a perfect area in Modern Australia to call home, or even to visit as a tourist! Well known for its beaches, this is a spot that can’t be missed!', NULL, 1, NULL, NULL),
