(241, '2262', 'Largely circling Lake Munmorah, and looking over the South Pacific Ocean from Cabbage Tree Harbour, 2262 sits between the Metropolitan hubs of Newcastle and Sydney. Multiple Suburban hubs are dotted throughout 2262, surrounded by large lakes and other bodies of water. Blue Haven, one of 2262’s suburbs is home to over 6,000 people alone, with other suburbs adding up to a total population of 22,500. Local schools and amenities, and the proximity to metropolitan areas, make it clear why 2262 is so popular.', NULL, 1, NULL, NULL),
(242, '2232', 'If you’re looking for suburbs with great links to nature, beaches, and greater metropolitan areas, look no further than 2232, home to the suburbs of Audley, Garie, Gray’s Point, Kareela, Kirrawee, and more. To the South of 2232 lies Royal National Park, home to excellent fishing and swimming spots, forest walks and trails, and plenty of camping opportunities. To the North of 2232 is the World famous city of Sydney, meaning that connections to urban life and the excitement of the city are also not far off!', NULL, 1, NULL, NULL),
(243, '7018', 'Looking over the immense breadth of the River Derwent in the Eastern section of the greater Hobart area, 7018 is home to the suburbs of Bellerive, Montagu Bay, Rosny Park, Tranmere, and Warrane. 7018 boasts wonderfully situated homes, in the Tranmere area, which look over the River Derwent and boast their own sizable gardens. Bellerive is home to the world-famous Bellerive Oval Cricket Grounds, and Warrane boasts a more suburban population. 7018 is a wonderfully vibrant area both to live and to visit!', NULL, 1, NULL, NULL),
(244, '2914', '2914 is a thriving postcode to the North of the ACT with main communities in Throsby, Amaroo, Forde, and Bonner. Encompassing the protected nature reserve of Mulligans Flat Nature Reserve for several walks, runs or cycle paths, this is an area for the nature lover. With thriving shopping centres such as the Major Shopping Centre, and educational institutions aplenty (with schools, colleges and the University of Canberra, Bruce Campus), 2914 offers an abundance for all demographic groups. This private postcode has a peaceful suburban vibe where the community can thrive in everything there is to offer, and only 15 minutes from Canberra airport, there is the possibility to travel further afield.', NULL, 1, NULL, NULL),
(245, '6054', '6054 is a postcode situated in North-East Perth and only minutes from the transport hub at Perth airport. Home to suburbs such as Bassendean, Ashfield, and Lockridge, the area has an abundance of parks with over 14 in Bassendean alone. Being located only 9km from Perth CBD, this postcode encapsulates modern-suburban living with the Casa Mia Montessori school among other educational institutions. With everything on the doorstep, 6054 is a thriving community and with transport links so close, the world is their oyster.', NULL, 1, NULL, NULL),
(246, '2213', 'The main suburb of Panania is located in the postcode of 2213 alongside other smaller suburbs such as Picnic Point and East Hills. Panania is an aboriginal word for the sun rising in the East and shining on the hills, which is a testament to the modern-day living in the 2213 postcode. Bounded by the busy M5 South Western Motorway to the North, this postcode has excellent shopping opportunities around the main station. With only 23 minutes from Sydney CBD, this is great suburban living with multiple parklands along the Georges River and everything you need.', NULL, 1, NULL, NULL),
(247, '2126', '2126 is home to both Dural and Cherrybrook suburbs, a mix of Aboriginal heritage and European. This postcode is not only less than 20 miles from Sydney and Bondi Beach, it also has the Dural Nature Reserve and animal centres in the vicinity for fun family days out. With transport links to Sydney from Cherrybrook and the surrounding area, you\'ll not have to worry about parking spaces on your travels, and 2126 even houses its own Cherrybrook Village Shopping centre for nearby commerce in the neighbourhood.', NULL, 1, NULL, NULL),
(248, '5158', 'Just south of Adelaide is 5158, where suburbs Hallett Cove, Trott Park, Sheidow Park, and O\'Halloran Hill call home. Offering great views of the sea, fantastic shopping opportunities, attractions for all the family and excellent transport links, there\'s so much choice that you\'re bound to have a great time. Even if you prefer a calm day as opposed to a busy and fruitful one, there\'s always the option of enjoying the sea air and taking a brisk walk across Hallet Cove Beach to one of the many cafes alongside it. The possibilities are endless in 5158!', NULL, 1, NULL, NULL),
(249, '3145', 'Just 8 miles from Melbourne lies the suburb of 3145, featuring Malvern East and Caulfield East. Caulfield contains popular landmarks such as the Caulfield Racecourse and the Caulfield campus of Monash University and Glen Eira College. 3145 also houses the oldest Buddhist Institution in Victoria (Buddhist Society of Victoria) which was founded in 1953, has a great number of public open spaces in Malvern East, such as Hedgeley Dene Gardens and Central Park so there\'s no shortage of great places to be.', NULL, 1, NULL, NULL),
(250, '2745', 'In the state of New South Wales, the suburb of 2745 lies around the edge of Sydney, containing Regentville, Glenmore Park, and Wallacia. Glenmore Park is one of Penrith City\'s most rapidly developing housing estates, catering to the economic, recreational, and social needs of its residents, while Wallacia provides a calmer ambiance with the more recent development of hobby farms, etc. This suburb is great for those who are looking for a more rural lifestyle with all the perks of city life.', NULL, 1, NULL, NULL),
(251, '4078', 'The outer suburb of 4078 contains Ellen Grove, Richlands, and the beautiful Forest Lake - the first Master Planned Community within the City of Brisbane, and was considered to be instrumental in the creation of affordable Australian housing. The community is linked by a large network of both cycling and pedestrian pathways, integrated into a large open-spaced network. Meanwhile, Richlands houses the Queensland Lions Football Club and has great sporting facilities, and Ellen Grove has great links to Brisbane and the nearby industrial estate of Carole Park.', NULL, 1, NULL, NULL),
(252, '3075', 'The suburb of 3075 is home to Lalor in Melbourne, Victoria, and lies just north of Melbourne\'s central business district. Many of the streets are named after prominent civilian and military figures, and the suburb itself was named in honour of Peter Lalor, member of parliament and leader of the Eureka Stockade rebellion of 1854. 3075 offers much in the way of recreation and leisure, is home to three football teams and two tennis teams, and also has great shopping opportunities with small specialty shops alongside popular brands. Lalor is rich in history and culture - there\'s plenty to explore!', NULL, 1, NULL, NULL),
(253, '5113', '5113, a northern suburb of Adelaide is home to Davoren Park, Elizabeth North, Elizabeth Downs, and Elizabeth Park. This beautiful area houses a number of sports clubs and leagues, as well as a local shopping centre and gorgeous housing. The suburb is great for both young and old, with plenty of open space for sport/leisure and great schooling opportunities to support families. Elizabeth Downs even has its own tavern with bars, bistro, and bottle shop for when parents need time to themselves.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(254, '3976', 'Hampton Park makes its home in 3976, bounded by the South Gippsland Freeway in the west, Langbourne Drive in the east, Glasscocks Road to the south and Centre Road to the north. The suburb lies just south-east of Melbourne and offers great historical culture, as it was first developed during the World War 1 era, and now has a significantly increasing population due to its transport links, excellent shopping centre, and fantastic selection of schools. With its gorgeous housing, 3976 is a great place to live and thrive.', NULL, 1, NULL, NULL),
(255, '4507', 'In 4507 lies the smallest of three major sand islands - Bribie Island. This isle hugs the coastline and while the ocean side of the island is somewhat sheltered from the prevailing winds, the lee side is much calmer, and white sandy beaches decorate the south of the island where the suburbs of Bongaree, Woorim, Bellara and Banksia Beach lie. Many types of flora and fauna populate this island alongside the human suburbs, and it also houses a number of heritage-listed sites and historical landmarks to explore. You\'ll not be short of things to discover in 4507!', NULL, 1, NULL, NULL),
(256, '6108', 'The suburb of Thornlie is situated in 6108, southeast of Perth\'s central business district. This large suburb houses strong transport links, a terrific shopping centre, fantastic playgrounds and sports facilities - perfect to go alongside the high-quality housing in the Crestwood Estate if you\'re looking to raise a family. This area is a model housing development, still noted for its Radburn architecture and successful implementation of such housing, designed so that homes faced each other and shared common yards. While this design hasn\'t worked elsewhere, here in 6108 it has thrived and created a positive community!', NULL, 1, NULL, NULL),
(257, '3153', 'In the suburb of 3153 lies Bayswater, northeast of the central business district of Perth and just north of Swan River. 3153 features a low-density residential suburb that consists of single-family detached houses and several clusters of commercial buildings around the intersection of Whatley Crescent. Bayswater hosts a number of delightful parks and reserves which include playgrounds, grassed areas, cafes, and a boat ramp - there\'s even the local event, the Autumn River Festival, which brings the community together and is fun for all ages!', NULL, 1, NULL, NULL),
(258, '2141', 'Lidcombe and Berala are a part of the 2141 suburb, west of Sydney with close links to the city and surrounding area. Berala was once a swampy area and attracted wild birds, which is where its name derives from - the Aboriginal word for musk dusk, \'Barella\'. Lidcombe remains the cultural centre of Sydney\'s Ukrainian community, originating from a large number of post-WWII European migrants. The 2141 suburb hosts heritage-listed sites and many interesting landmarks to explore alongside its commercial and industrial areas!', NULL, 1, NULL, NULL),
(259, '4812', '4812 is situated in the traditional Wulgurukaba Aboriginal country and contains multiple suburbs; Currajong, Pimlico, Gulliver, Mundingburra, Rosslea, Hermit Park, Mysterston, and Hyde Park, all with links to the City of Townsville. The Queensland suburbs offer a lovely community feel, with fantastic shopping opportunities, great schools, and excellent transportation to and from the city. Explore Gill Park with your family, travel to the botanical gardens, or even explore the surrounding area to learn more about the suburb of 4812.', NULL, 1, NULL, NULL),
(260, '3802', 'The suburb of 3802, featuring Endeavor Hills and Lysterfield south, borders the Monash Freeway and Dandenong Creek to the west, lying southeast of Melbourne\'s central business district. Endeavour hills host many recreational facilities, including a skate park just outside of the leisure centre, and a number of tennis courts. There are over 80 retail stores in the nearby shopping centre, and nearby is the Library complex and Neighbourhood centre, providing help and learning to all ages, including adult learning. 3802 also contains Lysterfield South\'s Churchill National Park, a great day out for picnics, exercise, or even bird watching.', NULL, 1, NULL, NULL),
(261, '2602', 'In the North Canberra district is the suburb of 2602; Ainslie, O\'Connor, Hackett, Watson, Downer, Lyneham, and Dickson. This suburb hosts the nature trails of Mount Ainslie, the Australian War Memorial, and many more well-known landmarks and heritage sites for you to discover. Bus routes between the suburbs in 2602 are regular and efficient, but you can always choose to walk to your destination amongst the leafy streets and single dwelling houses. 2602 also hosts a number of parks such as Lyneham\'s Exhibition Park (EPIC) where the annual car festival, The Royal Canberra Show, is held, as well as the National Folk Festival.', NULL, 1, NULL, NULL),
(262, '4170', '4170 houses the suburbs of Morningside, Cannon Hill, Norman Park, and Seven Hills, located less than 7 miles away from the City of Brisbane. This metropolitan area hosts a number of shopping centres and heritage sites, as well as excellent transport links and cycling paths. Seven Hills itself is named after the Seven Hills of Rome, which are within the boundary of the suburb, barring Esquiline Hill which is in a neighbouring suburb. 4170 is varied between flat and hilly landscapes, but the quiet roads make for excellent recreational cycling.', NULL, 1, NULL, NULL),
(263, '2325', 'In the suburb of 2325, just 15 minutes from idyllic wine country lies Bellbird, Aberdare, and the City of Cessnock, once known as The Coalfields. This suburb is known as the gateway city to the vineyards of neighbouring suburbs, a large transformation from its mining history. The City has a humid subtropical climate, with hot summers and cool winters, so the weather is sure to have your back as you explore the heritage sites in 2325 and learn more about Cessnock\'s history, all while enjoying the rich culture of the suburb.', NULL, 1, NULL, NULL),
(264, '870', '870 has a number of suburbs, including Mount Johns, Desert Springs, and Alice Springs City; the third-largest town in the Northern Territory. The original inhabitants of the area, the Arrernte, know this area as \'Mparntwe\', and have lived in the Central Australian Desert (in and around Alice Springs) for thousands of years. 870 hosts a hot desert climate, as it is just south of the Tropic of Capricorn, but that shouldn\'t stop you from discovering the rich history and culture of the Aboriginal people in the area.', NULL, 1, NULL, NULL),
(265, '2527', 'Situated in the Macquarie Valley near the City of Shellharbour is 2527, where Albion Park and Albion Park Rail reside. Nearby is the suburb of Haywards Bay, blowing wonderful salty air from the ocean into the suburb. This area also houses heritage and museums detailing railway history, but if that\'s not to your tastes then how about the great number of recreation in the area? There are many popular pubs in Albion Park and many various sporting teams to cheer on!', NULL, 1, NULL, NULL),
(266, '4132', 'In 4132 is the suburbs of Marden and Crestmead, located inside the boundaries of Logan City. Around 20 miles from Brisbane, this suburb has excellent housing estates for families and new homeowners. the Karawatha Forest Discovery Centre lies only 9KM away from the suburb, but if you want something closer to home, there\'s always Crestmead Park and Judith Park for a gentle walk enjoying the scenery, or even JJ Smith Park to the north alongside Scrubby Creek Corridor Park. 4132 certainly has more than enough places to explore and enjoy!', NULL, 1, NULL, NULL),
(267, '4020', '4020 hosts the suburbs of Scarborough, Newport, and Redcliffe; a thriving seafood industry just north/northeast of the Brisbane metropolitan area in Queensland. Nearby is Queens Beach, where parts of the movie Scooby-Doo were filmed, and the main street of Scarborough (Landsborough Avenue) is popular amongst residents and day visitors from Brisbane. The overlooking views of Moreton Island and quiet ambiance attract many to the cafes there, and with a themed playground nearby, there are even places for kids to play. 4020 hosts a number of heritage sights across its suburbs as well, so there are plenty of attractions to explore!', NULL, 1, NULL, NULL),
(268, '3074', 'Thomastown, Victoria lies in the suburb of 3074, approximately 30 minutes north of Melbourne\'s central business district. Visit the strip shopping centre in the High Street, just parallel to Thomastown Railway Station, or one of the many shopping centres/areas along Settlement Road and Dalton Road to get your purchases or if that\'s not to your taste there\'s always the 5 sporting ovals around the town, as well as a Recreational and Aquatic Centre to get some good exercise in. Finally, the community regularly gathers in March to unite for the Whittlesea Community festival, showcasing local culture through live entertainment, food stalls, hand-made crafts, and a delightful firework finale!', NULL, 1, NULL, NULL),
(269, '2117', 'Dundas, Dundas Valley and Telopea all make their home in 2117, New South Wales. Telopea is named for the plant which became the floral emblem of New South Wales, and the original name for the Dundas area was The Ponds, which is still reflected in The Ponds Creek. There are a number of heritage sites in 2117, including Dundas Railway Station and Redstone, and the popular Phillip Ruddock water park in Dundas Valley, which opens during the summer months. If you want to travel outside of summer, there are still plenty of parks and recreational facilities available in the suburb suitable for all ages.', NULL, 1, NULL, NULL),
(270, '2205', '2205 is home to Turrella and Arncliffe in New South Wales, a suburb around 10 km south of Sydney. A mostly residential area, this suburb has a variety of cultures and is diverse in its population, boasting a number of heritage sites and buildings in recognition of its multicultural space. The 2205 area also hosts an excellent shopping area, with excellent transport links to cities and towns in the area if you ever decide to have an outing without a car.', NULL, 1, NULL, NULL),
(271, '2190', 'Greenacre lies in the suburb of 2190, with Mount Lewis at its edge. The suburb is only less than 20 km southwest away from Sydney\'s Central Business District, with excellent transport links and a fantastic commercial area. Their area also boasts a number of parks available to explore and enjoy, as well as sports and recreational facilities including but not limited to; rugby, soccer and bowling. Finally, there are a great number of schools in the area, so the residential area is perfect for raising a family.', NULL, 1, NULL, NULL),
(272, '3011', 'Footscray and Seddon are suburbs located in 3011, lying in the inner-western suburb of Melbourne, approximately 5km from Melbourne\'s central business district. Footscray hosts a diverse central shopping area, created from many successful waves of immigration experienced in the Melbourne area. The multicultural area reflects the cultures of Greek, Italian, and Vietnamese people and many more. Timeout Magazine recently placed Footscray at 13th in its \'50 Coolest Neighbourhoods in the World\' from 2019, which reflects the 3011 suburb\'s distinct and diverse array of cuisine, bars, nightlife and arts scene.', NULL, 1, NULL, NULL),
(273, '4019', '4019 lies in the Moreton Bay region, and hosts the suburbs of Margate, Clontarf, and Woody Point; southwest of the Redcliffe Peninsula and around 20 miles north-north-east of Brisbane. This coastal suburb is a popular recreational destination for Brisbane locals and visitors, with beautiful beaches and heritage sites to explore for great days out. The 4019 suburb also offers the Woody Point Jetty, with seating and facilities available for fishing activities so there\'s more to offer than a day at the beach if that\'s not to your taste.', NULL, 1, NULL, NULL),
(274, '2350', 'Armidale is a city located in the suburb of 2350, approximately halfway between Brisbane and Sydney. The city has a subtropical highland climate due to its elevation, but the summers can still get very warm. St Peter\'s Anglican Cathedral is a delightful display of great architecture even if you aren\'t Christian or religious, and other attractions of 2350 include the University of New England, the Armidale, and Region Aboriginal Cultural Centre, Wollomombi Falls, and Cunnawarra National Park. There\'s no shortage of places to explore!', NULL, 1, NULL, NULL),
(275, '3752', 'The suburb of 3752 is home to Mernda and South Morang, less than 30 km northeast of Melbourne\'s central business district. The suburb has multiple shopping facilities and areas for sport; the Mernda Cricket Club has regularly won Championships in both the Diamond Valley Cricket Association and the JIKA Association, and the area also hosts a football club and local rugby league. South Morang in 3752 also has a number of historical sites and areas of cultural significance; Farm Vigano and Le Page Homestead to mention a few, and transport links are excellent should you want to explore outside the area.', NULL, 1, NULL, NULL),
(276, '2066', 'In the Lower North Shore of Sydney lies 2066, hosting a number of suburbs including Lane Cove West, Riverview, Lane Cove, Northwood, and more. This area is just over 10km away from Sydney and has a number of recreational facilities including Lane Cove Golf Course, and borders Lane Cove River. The residential area has a great selection of schools in the area, as well as Lane Cove Library and multiple playgrounds and parks to explore and delight in. 2066 also has a number of heritage sites and commercial areas.', NULL, 1, NULL, NULL),
(277, '2216', 'The suburbs in southern Sydney, 2216, are home to Rockdale, Banksia, and Brighton Le Sands; less than 15 km away from Sydney\'s central business district. Popular attractions include the gorgeous Lady Robinsons Beach, the Banksia Hotel, Cook Park, and the popular multicultural cuisine of Brighton Le Sands. Areas such as \'Little Greece by the Bay are quite well known in the area, and there are plenty of commercial sites in the area for retail therapy!', NULL, 1, NULL, NULL),
(278, '3215', '3215 hosts the suburbs of Bell Post Hill, Hamlyn Heights, Drumcondra, Rippleside, and Geelong north; residential suburbs within Geelong, Victoria. A popular and wealthy area, this gorgeous suburb has beautiful sea views, excellent transport links, and wonderful recreational areas. Attractions include St Helens Beach (which also has an expansive fishing pier), Rippleside Beach, Rippleside Park, and Hamlyn Park, but there are many more to explore. In addition, the actor Guy Pierce once lived in Hamlyn Heights in 3215 during the 1990s.', NULL, 1, NULL, NULL),
(279, '2289', 'In the suburbs of Newcastle lies 2289, featuring Adamstown, Kotara, Charlestown, and Garden suburb; approximately 4-5 miles from Newcastle\'s central business district. Kotara is known as one of the largest retail destinations in Newcastle, whereas Charlestown is known for its large business centre - both proving themselves to be popular locations! The residential areas of 2289 are also popular, with multiple schools and parks in the area for families and people of all ages to enjoy.', NULL, 1, NULL, NULL),
(280, '2315', 'The suburb of 2315 includes Corlette, Fingal Bay, Nelson Bay, and Shoal Bay, located in the Hunter Region of New South Wales. This suburb has a humid subtropical climate, influenced by its maritime setting, and is quite popular with tourists for dolphin and whale watching in Nelson Bay. Other recreational aquatic activities are available at the many beaches along the coast of 2315, along with the more inland Tomaree National Park should you need a break from the fresh sea air.', NULL, 1, NULL, NULL),
(281, '6020', 'The suburbs of Perth located in 6020 feature Carine, Marmion, North Beach, and Watermans Bay; they feature a mix of residential areas and local attractions, including the Star Swamp Bushland Reserve and a number of beaches. There are terrific transport links around the area and leading to centre of Perth, and excellent commercial opportunities within 6020 as well. The area also hosts the Mount Flora Regional Museum, the Marmion Angling and Aquatic Club, and Carine Regional Open Space which is home to many rare waterbirds, frogs and turtles.', NULL, 1, NULL, NULL),
(282, '2067', '2067 is home to Chatswood and Chatswood West, a major business residential district located on the lower north shore of Sydney, approximately 10km from Sydney\'s central business district. This area is one of the north shore\'s major commercial and retail districts, also known as the Sydney Global Economic Corridor. 2067 hosts the corporate headquarters of big-name brands such as PepsiCo and Abigroup, but also has a number of local outdoor markets and a delicious range of restaurants and cafes. The Willoughby Spring festival is held annually in September, as a testimony to a modern and multicultural Chatswood.', NULL, 1, NULL, NULL),
(283, '3183', 'East St. Kilda is located in 3183, a suburb of Melbourne and approximately 6km south-east of Melbourne\'s central business district. This area features a lovely residential district with excellent transport links and wonderful public spaces to explore. Alma Park in 3183 has multiple recreational facilities, including a lovely playground for the kids to enjoy. There are also a number of prominent heritage sites to explore and landmarks of residential and non-residential architecture to appreciate.', NULL, 1, NULL, NULL),
(284, '3825', 'The suburb of 3825 contains Moe, Walhalla, Yallourn, and Newborough, located in the Latrobe Valley in the Gippsland region of Victoria. It lies approximately 80 miles from the central district of Melbourne and has fantastic countryside views to go with its celebration of cultural heritage, as the city of Moe locally produces Aboriginal and Koori art. The township of Walhalla (named for Valhalla of Norse legend) is a popular tourist spot as it contains many historical buildings from the days of gold mining, and the area around the town adjoins the Baw Baw National Park.', NULL, 1, NULL, NULL),
(285, '4074', '4074 has a number of south-western suburbs of Brisbane, including Jindalee, Mount Ommaney, Westlake, Jamboree Heights, and Sumner. The suburb is approximately 10 miles southwest of Brisbane\'s central business district and has excellent residential areas, terrific transport links across 4074 (and further), and great retail opportunities across the suburb. This suburb borders the Brisbane river and also has multiple recreational areas such as the Mount Ommaney Bushland Reserve, but if you prefer more urban areas, Sumner\'s large industrial park contains a wide variety of services and interesting items!', NULL, 1, NULL, NULL),
(286, '3201', 'Carrum Downs is in the 3201 suburbs, less than 40km southeast of Melbourne\'s central business district. This residential area has a great selection of schools for primary, secondary, and tertiary level education, along with fantastic community services, a wide range of sports facilities, and a number of parks and reserves within the suburb. 3201 is also home to the largest Hindu temple in Victoria, the Shri Shiva Vishnu Temple, and is popularly known for holding annual Hindu festivals, such as Holi and Diwali.', NULL, 1, NULL, NULL),
(287, '4868', 'Located in Cairns, 4868 encompasses Bayview Heights, Worree, White Rock and Mount Sheridan. Located approximately 7 kilometres south of the main city of Cairns, it offers a getaway into nature through numerous parks and reserves such as Ellen Close Reserve, Pezzutti Park, but also has a thriving suburban area with local amenities like the Cairns Golf Course, and the Cairns Amateurs Carnival racetrack for a more traditional day out. 4868 also offers the hotspot of the White Rock Lookout less than 4 kilometres away, offering magnificent views and trails!', NULL, 1, NULL, NULL),
(288, '3173', 'One of the largest suburbs South-East of Melbourne, 3178 encompasses Rowville, an amazing up-and-coming district ideal for families. It is close to the East Link and Monash, making it easy to go anywhere, and is just a thirty-minute drive into the city. 3178 is also 27km south of Melbourne’s central business district, making it appealing to business professionals also. It offers the much-improved Stud Park shopping centre, and numerous nature reserves such as Parkridge Reserve and Murrindal Drive Reserve. It also boasts the Tirhatuan Wetlands and the Conservation Reserve, abundant with beautiful, natural flora and fauna.', NULL, 1, NULL, NULL),
(289, '2137', '2137 is a quality suburb in the inner West of Sydney with an abundance of green space, sports fields, and three golf courses within easy driving distance, making it ideal for kids, dog walkers, and growing families. It is 10km west of the Sydney central business district and offers many local amenities like Majors Bay Shopping Village and Queen Elizabeth Park. 2137 also offers the City of Canada Bay Museum and overlooks the Parramatta River. There are also 6 routes via concord for Transit Systems making it easy to get around this bustling location.', NULL, 1, NULL, NULL),
(290, '3169', '3169 is a suburb in Melbourne 20km South-East of the Central Business District with substantial industrial facilities including Clayton Business Park, McCormick Foods Australia, Goodman Fielder and Viridian Glass. Yet, Clayton South is not all work and no play as it has much to offer in terms of sports and recreation, including the largest pistol shooting club in Victoria, and several parks including Namatjira Park, and The Grange Reserve, Heatherton Park, and Keely Park. Also, the Djerring Trail runs adjacent to the railway line for popular walking and bike trails. 3169 also offers Rosebank Avenue for amenities, including a post office, news agency, and various fast food outlets including 24-hour Mcdonald\'s. Transport is so good within 3169 it is occasionally called Westall due to the name of the main road and railway station, allowing easy commuting between the diverse range of activities offered here.', NULL, 1, NULL, NULL),
(291, '4575', 'A coastal suburb of Kawana Waters in the Sunshine Coast region, 4575 is a peaceful area surrounded by lush, untouched beaches due to a coastal reserve established to prevent beachfront development. Yet, it offers residential living through the area immediately to the West of the coastal reserve. 4575 is an excellent community that retains the spirit of the Sunshine Coast of the early days through its reputation as a small beach town close to everything. Its serenity derives from having no busy roads to cross to reach stretches of pristine beach, while still being in reach of larger areas like Caloundra (just 12 kilometres North).', NULL, 1, NULL, NULL),
(292, '2536', 'Known for its scenic seascapes complete with beautiful beaches and sheltered coves, 2536 is a bustling coastal suburb of the Eurobodalla shire. It is two hours drive from Canberra and a four-hour drive from Sydney, and the Moruya airport is just 30km south of the town, making it an ideal holiday destination. Natural features are at the forefront of this coastal suburb, with 2536 being the centre for sustainable agriculture and providing arguably the best Oysters in Australia, sourced from the Clyde River and readily available from many local restaurants!', NULL, 1, NULL, NULL),
(293, '4069', 'Known for its idyllic rolling hills and greenery, 4069 is located on the river, just 10 kilometres South-West of the Central Business District. A leafy suburb, it is ideal for professionals and families, proving a number of local amenities like schools and restaurants, and two large retail centers: Kenmore Village and Kenmore Plaza. It is a well-established suburb that is sufficiently connected to the central city and the University of Queensland by the main road Moggil road and bus routes. This serene space also has a reputation as one of Brisbane’s safest suburbs!', NULL, 1, NULL, NULL),
(294, '6021', '6021 is a middle-class suburb occupied by a majority of families and retired homeowners, with a strong neighbourhood watch. It is highly populated by Greek, Italian and Macedonian families, the architecture benefitting from these cultural influences. It is one of the largest suburbs in the Northern part of Perth and is close to amenities and recreation. It is known for its beautiful beaches, such as Scarborough beach with pedestrian promenades, shops, cafes and playgrounds, popular for riding the waves while surfing. There are other beaches such as Cottesloe and City Beach, perfect for relaxing on the sand and going for an idyllic swim. It also boasts botanic gardens and a miniature railway museum!', NULL, 1, NULL, NULL),
(295, '3677', 'Encompassing Appin Park, Yarrunga, and Wangaratta, 3677 is a rural city with an administrative center, 236km from Melbourne. It boasts a high population, low employment, and exceptional house growth, and is in an optimum location for Victoria’s considerable wine and gourmet food industry. 3677 also has an excellent assortment of shopping streets, including Murphy, Reid, Ovens, and Ford Streets with a mix of specialty shops and essentials. Local attractions such as Merriwa Park and the King George V Gardens allow a relaxing element, and the yearly Jazz and Blues festival attracts talent from all around the globe!', NULL, 1, NULL, NULL),
(296, '3101', '3101 is an inner suburb of Melbourne, 5km East of Melbourne’s Central Business District, bordering the Yarra River to the West and North. A historically affluent suburb, it attracts families and elderly people due to its reputation as a safe and friendly environment. Sackville Ward streets such as Alfred, Rowland, Wellington, and Grange offer exceptional examples of Edwardian, Victorian, and contemporary architecture. 3101 also offers convenient access to public facilities through tram routes and train lines, excellent education centres, and a wide choice of restaurants. Recreational sites include notable golfing clubs and lush green parklands!', NULL, 1, NULL, NULL),
(297, '6055', '6055 covers the historic suburb of Hazelmere in Western Australia, a hidden gem many do not know about. It is located 14 kilometres East of Perth’s Central Business District, bordered by the Great Eastern Highway to the South, the Roe Highway to the East, and on the Northern Edge of Perth Airport. Safe and convenient, it has one of the lowest crime rates in Perth. 6055 has many historical attractions to visit, including Coal Dam Park and Woodbridge Historical Site, as well as natural feature locations such as Carnegie Park and Juniper Gardens, perfect for a stroll outside!', NULL, 1, NULL, NULL),
(298, '3131', 'Located in Melbourne, 3131 is a quiet suburb 18 kilometres East of Melbourne’s Central Business District. It has also greatly benefitted from a new railway station, uniting North and South areas and better access to the Eastern Freeway. It offers a good mix of families and singles due to its location and bustling city centre offerings. 3131 features ‘the mega mile’ shopping district, boasting the largest retail strip for bulk goods along this row, as well as other retail businesses and Whitehorse’s main offices. It also features Network Ten studio, where popular soap Neighbours is filmed!', NULL, 1, NULL, NULL),
(299, '4012', '4012 is an inner suburb of Brisbane, now called Nundah after previously being called German Station. It is primarily a residential suburb that was initially working class, yet has become more gentrified in modern years, featuring an assortment of traditional workers\' cottages and high-density apartment blocks. It straddles Sandgate Road, which features a traditional shopping strip nearby to the Nundah Bypass. Transportation is excellent in 4012, with both the Nundah City Railway Station and Toombul City Railway Station in the suburb, as well as many bus services. It also features notable heritage sites to visit, including Corpus Christi Church, Toombul Shire Hall, and the First Free Settlers Monument.', NULL, 1, NULL, NULL),
(300, '3047', '3047 has plenty of exciting activities to offer! From its lush green parks to its fun playgrounds and even a global learning centre, there is something entertaining for everyone here. Experience excellent events and amusements at The Meadows, home to greyhound races, and innumerable fun activities and dining opportunities. Being located just 16km outside of Melbourne, the most vibrant, bustling city of the state of Victoria, as well as the Dallas area, from 3047 you can easily access the nearby neighbourhoods without traveling too far outside the area.', NULL, 1, NULL, NULL),
(301, '3340', 'Being a large urban area means that 3340 has many perks. Featuring outdoor activities in abundance, such as the Long Forest Flora and Fauna Reserve and a gorgeous bushland walk alongside the river in Lerderderg Gorge, 3340 is the perfect place to lose yourself in nature, relax and unwind. Situated only 14km away from Melbourne city, Ballarat and Geelong, 3340 is close to its surrounding neighbourhoods too. It’s a natural paradise providing so many things to do.', NULL, 1, NULL, NULL),
(302, '3555', '3555 is a suburb perfectly suited to children, with its many kids\' activities including outdoor sports like running, cycling and hiking in Rosalind Park. Featuring a subterranean tour of an ancient, historical mine, in which you can take part in a gold panning experience, there truly is something for everyone in 3555. If you venture outside of the area to Kangaroo Flat, you can savour the flavours of international food in some great eateries. 3555 is also home to star Australian Football League players.', NULL, 1, NULL, NULL),
(303, '4113', 'A suburb located in the outer south area of the City of Brisbane, 4113 is just 18.6km away from the central business district. The area offers several things to do, including various shopping centres, leisure activities offered by the Runcorn Horse and Pony Club, and 33 green parks that provide spaces for picnics and barbecues. The industrial suburb of Eight Mile Plains is also nearby in which local shopping opportunities are available on the Padstow/Warrigal roads. The area even features a technology park that offers commercial co-working spaces.', NULL, 1, NULL, NULL),
(304, '4570', 'You will be transported back in time when you experience the heritage of 4570. At locations such as Memorial Park and Miners Hill, Mary Street and the gold mining museum you can truly experience olden times in this town. In the nearby neighbourhood, Monkland, you can immerse yourself in cultural events and activities such as the Regional Gallery and the Woodworks Museum, while Southside is a semi-rural location that features the Gympie Racecourse and Adrian McClintock Park show grounds. There is a direct bus from Brisbane to Gympie, providing a transport link between these two neighbourhoods.', NULL, 1, NULL, NULL),
(305, '4127', 'Featuring the Daisy Hill State Forest, which was formerly used for gold mining and making honey and gathering timber, among other things, a large segment of the area is protected by the Daisy Hill Conservation Park. Having been given $3.3 million in 2017, the Koala Centre of the park was then upgraded. Now featuring some of the top trails for mountain biking, 4127 is a beautiful area so named after the daisies that were spotted growing on the land by the first European settlers.', NULL, 1, NULL, NULL),
(306, '4560', 'A rural location that can be found near the Sunshine Coast Region of Queensland, 4560 was so named after the creek that runs through the area – the Maroochy River’s tributary. With a few enjoyable local events, 4560 is a slice of tranquility. 4560 is located near the Bli Bli area and within the Greater Nambour area, a locality that features an entertainment and arts venue. There are many other popular things to do, including the Nambour Festival, the three-day Sunshine Coast Agricultural Show, and the Queensland Home Garden Exposition.', NULL, 1, NULL, NULL),
(307, '4700', 'With a population of just over 4,000, 4700 is a small suburb in the Rockhampton region area of Australia. A mere 4km away from the central business district, the location is within close proximity to its surrounding neighbourhoods, including The Range and Depot Hill. It features the upgraded Rockhampton Showgrounds that belong to the Rockhampton Agricultural Society, in which leisure and recreational activities take place. In the nearby suburb of Allenstown the local shopping centre, which had undergone a refurbishment in 2012, provides the perfect place to purchase your heart’s desire or sip on a cup of coffee.', NULL, 1, NULL, NULL),
(308, '3910', 'Natural scenes and adventures await you in 3910, Melbourne. In addition to the McClelland Gallery, Sculpture Park, and Cruden Farm, you can visit the Mulberry Hill National Trust and take a peek into the history of some of the skilled writers and artists of Australia. Enjoy the many parks and attractions of 3910, including Langwarrin Beach, Lloyd Park, and Langwarrin Skatepark. The area is easily accessible via the Western Port Highway, the South Gippsland Highway, and the Monash Freeway.', NULL, 1, NULL, NULL),
(309, '5112', 'An area that was mostly farmland before the 1950s, 5112 has since industrialised. It is now home to the Elizabeth Shopping Centre, as well as the Central District Bulldogs, a team that plays in the South Australian National Football League. The residential suburb, Hillbank, features spectacular views of 5112, via a lookout located in Jo Gapper Park, while the nearby neighbourhood of Elizabeth Grove features a local shopping centre and churches of various denominations. As you explore, don’t forget to dive into some delicious dishes in the local eateries or bakeries. Nearby areas include Elizabeth South, which provided a community for Elizabeth North and its neighbours.', NULL, 1, NULL, NULL),
(310, '2223', 'Located just 20km away from the Sydney central business district, 2223 is an easily accessible suburb with a shopping centre and many transport links. The area has plenty of parks, such as Jubilee Park, Hurstville Golf Course, and many others and provides sporting opportunities as well as the chance to immerse yourself in nature. Its neighbour, Oatley, can be found just 18km away from the Sydney central business district and is known for its main attraction, Oatley Park, a green gem full of beautiful natural scenes.', NULL, 1, NULL, NULL),
(311, '3186', 'A coastal residential district that boasts affluence and beauty, 3186 is home to some of the most wealthy inhabitants of Melbourne. Renowned for its Dendy Street Beach, the area is frequented by cyclists due to its popular cycling paths. The Middle Brighton Municipal Baths are also a favourite with locals and tourists, while cafés, cinemas, and spectacular skyline views from the beachfront are also open to you. The suburb is well connected and accessible via many transport links.', NULL, 1, NULL, NULL),
(312, '5095', 'A suburb situated near the City of Salisbury that has lovely parks and trails, 5095 offers the beauty of nature, with lots of local wildlife. It is located just 12km from Adelaide and its neighbour, Mawson Lakes, can be found close by. The Mawson Lakes area, named after Australian geologist, explorer and academic Sir Douglas Mawson, has many amenities including a central commercial area in addition to many smaller restaurants and shops. Over the recent years, the area has seen several offices transformed into apartments due to the requirement of the near university.', NULL, 1, NULL, NULL),
(313, '2088', '2088 is a suburb on the lower North shore of Sydney, located just 9 kilometres south of Sydney’s Central Business District. It forms a peninsula between Sydney Harbour and Middle Harbour, featuring a number of beaches including Balmoral, Chinamans, Obelisk, and Cobblers Beaches. 2088 is primarily a residential suburb with a majority population of families and older people. Architecturally it has predominantly federation-era houses but features other styles like California bungalow, modern townhouse, and apartment buildings. The commercial shopping area ‘the Strand’ is located along Military Road, featuring a variety of boutiques, cafes and restaurants!', NULL, 1, NULL, NULL),
(314, '5085', 'A south-Australian suburb just 8km from the Adelaide city centre, 5085 is in close proximity to the picturesque coastal capital while also providing a getaway from the city. Somerset Reserve, Folland Park and St Albans Reserve are all examples of the green gems that 5085 has to offer. Neighbouring Northfield provides parklands for strolls or walks, while the many local transport connections in the nearby suburb of Enfield provide access to many shopping centres, libraries and restaurants.', NULL, 1, NULL, NULL),
(315, '3172', '3172, once remote farmland, began to be urbanised in 1960 and is now a quaint little village that features a bustling Sunday market, a small shopping centre and several community facilities. A farmers market and an adventure mini-golf venue are available to you, making 3172 a great location for the whole family. Visiting the nearby suburb of Springvale South is a breeze; it’s located just 24km away from Melbourne.', NULL, 1, NULL, NULL),
(316, '3070', 'Populated by Greek and Italian residents, in addition to musicians, young families and artists, 3070 provides numerous things to do and events for the whole family. From a free library to multiple green open spaces and parks, to shopping centres, 3070 has something for everyone. Lying just 6km away from Melbourne’s central business district, you have easy access to the vibrant metropolis – it’s on your doorstep!', NULL, 1, NULL, NULL),
(317, '7320', 'With a population of 18,336, 7320 is located on the beautiful and remote island state of Tasmania, the smallest state in Australia. Admired for its wild scenery, wonderful wildlife and quiet beaches, there is no shortage of natural beauty to enjoy. Situated by the coast, there are many attractive suburbs in 7320, including the port city of Burnie, and the small towns or Cooee and Shorewell Park. You’ll also find great artisanal food and drink scene.', NULL, 1, NULL, NULL),
(318, '3338', 'Urban and rural, with plenty of activities to indulge in, 3338 offers you the best of both worlds. With its many parks, including Melton South Oval, Mount Carberry, and Blackwood Drive Reserve, you can experience the relaxing, peaceful vibes of nature. At the same time, you have transport links such as rail and buses to other areas so that, on your doorstep, you also have access to the Eynesbury locality. Take the chance to see some of the native species of the area, including the barking owl and the buloke.', NULL, 1, NULL, NULL),
(319, '2518', '2518 is a safe and convenient suburb located within Wollongong. Corrimal’s Central Business District is located on the Prince’s Highway and expands to several adjacent streets. It fractures shopping centres such as Lederer Corrimal and Corrimal Park Mall, located next to the park. Outside the centre is ‘The Green Frog’, an old locomotive that has become a staple of the town, featured on the welcome sign. The Corrimal railway station provides transportation in 2518. It is also the birthplace of ice cream manufacturer Streets. Every second Sunday in September is also the annual ‘Spring into Corrimal’ family festival, fun for everyone!', NULL, 1, NULL, NULL),
(320, '2040', 'An inner-west suburb of Sydney, situated just 6km away from the Sydney central business district, 2040 is a culturally diverse neighbourhood with multiple things to offer. Bicycle routes and paths interconnect with various areas within the suburb. The neighbouring Leichhardt area features an Aquatic Centre, in addition to the Leichhardt Oval, both of which are well worth a visit – the Oval is actually home to the Wests Tigers! With links to and from Sydney, you can visit the city that is most populous in Australia with ease.', NULL, 1, NULL, NULL),
(321, '7248', 'A residential locality of Launceston, 7248 is located around 7 kilometres North. It is located on the Eastern side of the Tamar River. The University of Tasmania, Australian Maritime College and TasTAFE have a campus in 7248. Transport is provided through route A8 of the East Tamar Highway, running North to South. For recreational events, visit the Tasmanian Turf Club Sports Complex, or take a trip to the serene Lilydale Falls waterfalls. It is populated by families and singles, with exceptional parks and recreation, a mix of new and character homes, and is conveniently located only 5-10 minutes drive from Launceston.', NULL, 1, NULL, NULL),
(322, '5023', 'Once an incredibly rural suburb, 7248 has rapidly evolved into a residential area that features the Royal Adelaide Golf Club, and the Seaton Ramblers – a football team that plays in the third division of the South Australian Amateur Football league. Venturing slightly outside of Seaton will take you to one of Adelaide’s western suburbs, Findon, known for Adelaide Arena. A venue that seats 8,000, the arena is the home of the Adelaide 36ers, the team that has won the National Basketball League four times.', NULL, 1, NULL, NULL),
(323, '6111', '6111 is a fantastic place for families. Providing shows such as the Annual Kelmscott Show, which is frequented by children and adults alike, this location has something for everyone. The Westfield and Champion Lakes areas are located just to the west of 6111, so you should seize the chance to visit the Champion Lakes Regatta Centre – the place in which water, and recreational activities are held. Roleystone is also a short venture to the east, providing a shopping centre, a botanic garden oasis and a golf resort.', NULL, 1, NULL, NULL),
(324, '4818', 'With a population just shy of 6000, 4818 is a suburb of Townsville bordered to the East and North-East by the Bohle River, and to the North and North-East by Stony Creek. Transportation through the suburb is provided by the Bruce Highway and Nightjar Railway Station. In the West of 4818, there is grazing on native vegetation. In the South of the leafy suburb, there is housing, mainly for families with children as there are great play options. Amenities include Beau Park Drive Park and Pine Meadows Park, great days out for the family!', NULL, 1, NULL, NULL),
(325, '2131', '2131 is situated just to the west of the Sydney central business district. Being highly urban, multicultural and culturally diverse makes it a vibrant, lively place to be. Its cultural heritage is rich, while there are also plenty of enjoyable things to experience such as the neighbourhood’s many parks and swimming pools. Alongside the Hammond, Pratten and Ashfield parks, the swimming pools in the Ashfield Aquatic Center will be renovated to include a children’s leisure pool, an outdoor pool and open, green community spaces.', NULL, 1, NULL, NULL),
(326, '6026', 'Initially, a rural location, 6026 has greatly evolved in the years after the 1970s. Residentially it has developed a lot, and the growth of the Woodvale neighbourhood, for instance, was completed in 1995. It is home to many immigrants, including approximately 21% British-born and 3% South African-born inhabitants. Exploring just outside of Woodvale will take you to Kingsley, in which there are major shopping centres, an art gallery, and plenty of bus links. The Kingsley Football Club can also be found in the suburb so you can show your support and cheer on the home team!', NULL, 1, NULL, NULL),
(327, '2324', 'A suburb in which you can find the junction of the Williams and Hunter rivers in the New South Wales area of Australia, 2324 is a region with lots to offer. If you’re in Raymond Terrace you should take the opportunity to visit Boomerang Park, a large open parkland with multiple facilities including a skate park as well as picnic spaces. If you are in the Tea Gardens area, go for a stroll or cycle around the Marine Drive near the Myall River. If you travel slightly further out, you could even experience the picturesque, tranquil seaside town of Hawks Nest as you take in the beautiful Bennetts Beach.', NULL, 1, NULL, NULL),
(328, '5043', 'Covering 115 hectares, 5043 is a quiet and appealing South-Western suburb of Adelaide. It has a variety of transport links including two bus routes directly servicing the area, Ascot Park Train Station and Marion Train Station. 5043 is an excellent location for families with children due to the convenience of the amenities, as there are lots of playgrounds. These include several large reserves which contain facilities such as playgrounds, basketball rings, and BBQ facilities. It is also home to the outdoor Marion Swimming Centre open from mid-spring to mid-autumn, with the Westfield Marion shopping centre a short drive away.', NULL, 1, NULL, NULL),
(329, '4075', 'With recreational sports clubs, cafés and fitness centres, 4075 is a suburb with tons to offer. In Graceville, there are many parks including Faulkner, Graceville Memorial, and Simpson’s playground. There are also many sports clubs here such as the Graceville Amateur Swimming Club and the South West United Hockey Club. If you are in the neighbouring Sherwood area, don’t forget to check out the botanical garden, which is a heritage site in the area and you should also seek out the many green open spaces in Corinda if you are a nature lover.', NULL, 1, NULL, NULL),
(330, '4217', 'In 4217, located in the City of Gold Coast, there are numerous things to do and see. The Home of the Arts Centre in Bundall provides a venue for dance, theatre, music comedy and artistic events. It even provides a cinema that shows foreign films. Go a little outside of Bundall to find Surfers Paradise, a neighbourhood with high-rise buildings and the Cavill Mall, as well as an immaculate beach perfect for surfing. In Surfers Paradise, there are many attractions such as a museum and an amusement park. Being so close to Surfers Paradise, other neighbourhoods such as Benowa and Main Beach are well worth a visit too.', NULL, 1, NULL, NULL),
(331, '3138', 'With its many local events and activities, 3138 has a community atmosphere. Its local fun festival “Celebrate Mooroolbark” has been celebrated since 2002, and there are also many points of interest such as the community centre and Blue Light Disco, which are popular with young people. With its libraries, children’s parks, and football clubs 3138 is such a great location for families. There are many transport options, such as the local buses and the trains, which will be rebuilt by 2022.', NULL, 1, NULL, NULL),
(332, '3171', 'A suburb that has grown significantly over the 1990s, 3171 is an area that offers you parks, the Sandown Greyhound Racing Club, temples and nature reserves. In this location, you should definitely take the chance to dine on some of the delectable dishes that are available in exotic eateries. With Vietnamese, Cambodian and fusion-style food, your tastebuds will definitely be woken up. Served by two railway stations and several buses, this neighbourhood is well connected to the other surrounding areas, so you can easily explore the nearby locations.', NULL, 1, NULL, NULL),
(333, '3043', 'Being just 15km away from Melbourne’s central business district means that in 3043 you can access both worlds – the local community facilities of a smaller district and the larger, busier Melbourne city centre. Nearby, Gladstone Park is where the Jacana Valley can be found, in addition to many green open parks and spaces, and Tullamarine is incredibly close to you, providing multiple different sporting activities. You can also access Gowanbrae, which is also close by and provides a commuting path for cyclists, perfect for getting around or exercising in the outdoors.', NULL, 1, NULL, NULL),
(334, '6014', '6014 is just 8km away from the Perth central business district. In 6014, the affluent suburb of Churchlands can be found, which is home to many local wildlife species including amphibians and freshwater fish. With its close proximity, you can also explore the area of Floreat, in which there are a variety of shops, supermarkets, and sports facilities. And journeying outside of Churchlands will take you to Wembley and Jolimont, which also have parks and open spaces – natural treasure troves in which you can take in the pretty scenery.', NULL, 1, NULL, NULL),
(335, '2767', 'Doonside, Woodcroft, and Bungarribee are three small suburbs in the area of 2767. Located in Doonside, tourists and locals visit the popular Featherdale Wildlife Park as well as the Nurragingy Nature Reserve, locations in which you can familiarise yourself with the local wildlife and species. Slightly further out, the Panalatinga Creek can be found flowing through the suburb of Woodcroft, an area with a few local buses to take you to nearby destinations, and you can even become one with nature if you decide to visit the Bungaribee Nature Reserve that is in close proximity.', NULL, 1, NULL, NULL),
(336, '4703', '4703 encompasses several settlements in the Rockhampton and Yeppoon Keppel areas, as well as other areas such as Greenlake and Shoalwater Bay. The industry within the shire is diverse, with timber harvested from a nearby pine plantation and significant pineapple production occurring. Other agricultural crops are grown here. 4703 has grown as a tourist attraction with Keppel Bay and the nearby islands a major drawcard.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(337, '2076', '2076 encompasses the three suburbs in the upper North shore of Sydney: Wahroonga, North Wahroonga, and Normanhurst. Wahroonga is located 18 kilometres northwest of Sydney’s Central Business District and has several listed heritage sites, including Wahroonga Reservoir and Evatt House. Both Wahroonga and Normanhurst have their own train stations and have bus services provided by Transdev NSW’s Upper North Shore. 2076 has many recreations and amenities, such as Wahroonga Park with established trees. The second oldest national park in Australia, Ku-ring-gai Chase National Park, is located north, offering walking tracks, picnic sports and Aboriginal sites with rock carvings.', NULL, 1, NULL, NULL),
(338, '3122', 'In the City of Boroondara, the suburb of 3122 can be found just 6km away from Melbourne’s central business district. A little further out, and offering technical and further education, the Swinburne University of Technology is located in Hawthorn. The neighbourhood is highly multicultural and is known for its diverse range of restaurants which exceed expectations in terms of quality and quantity. With its many hotels and nightclubs, 3122 is a popular area that has many facilities such as youth clubs, sporting facilities and places of worship.', NULL, 1, NULL, NULL),
(339, '3356', 'Not only will you be able to experience a fauna and flora area in 3356, you can also reap the advantage of being in a suburb that has the Delacombe Town Centre shopping centre, commercial areas and green spaces on your doorstep. The population of this area is expected to nearly double by 2030 due to the plans for new housing estates, so this neighbourhood is constantly developing and expanding. The town is served by local taxis and bus service, catering to your needs to travel around and explore nearby neighbourhoods.', NULL, 1, NULL, NULL),
(340, '3095', 'With a stunning grassy reserve that offers a children’s playground, as well as wide paths that are perfect for strolling or cycling, 3095 provides nature in abundance, particularly in the area of Research. 3095 is located 21km away from Melbourne’s central business district, and it is Eltham North suburb is where you can find the North Eltham Jets Basketball Club and the Eltham Redbacks Football Club. Libraries and bushland reserves are great places to experience tranquility and peace in 3095, and in the suburb of Eltham, you can dive into an artistic world – a community of the Montsalvat artists.', NULL, 1, NULL, NULL),
(341, '2114', 'From the Darvall Park forest reserve in Denistone to stunning views of the Parramatta River in West Ryde and the commercial areas of Meadowbank, there are heaps of things to do in 2114. At Darvall Park, the range of flora and fauna is incredible, and you could be lucky enough to spot a satin bowerbird or Australian king parrot in this beautiful reserve. In Meadowbank, there are waterfront dwellings and shopping centres, so there are a huge variety of activities, sights and events for you to experience in 2114.', NULL, 1, NULL, NULL),
(342, '3132', 'In 3132, cafes, supermarkets and shops are available to you in the commercial precinct. With bushland parks and a public garden, the suburban area of Mitcham provides the perfect location for outdoor activities and absorbing open green spaces. This suburb is also the place that the Mitcham Tigers football team calls home, and features many local sports clubs. Mitcham is also the place that artistic performers called the Mitcham Collection call home, a group that has performed in Melbourne International Comedy Festival.', NULL, 1, NULL, NULL),
(343, '5253', 'Fresh vegetables, chickens and nutritious dairy are some of the produce that the farming area of 5253 provides. Murray Bridge takes its name from the road and crossing that passes over the Murray River, which is the longest river in Australia. Shopping complexes, marketplaces and supermarkets provide goods and products for locals, and there are many amenities and activities that the whole family can enjoy, such as the wetlands, the regional art gallery, and Lavender Federation Walking Trail.', NULL, 1, NULL, NULL),
(344, '3939', 'A suburb on the seaside that features the Boneo plains and the Port Phillip shores, the neighbouring areas Rosebud and Mccrae are frequented by tourists and beachgoers who just love the sandy shores, markets, camping areas and parks. For people who enjoy outdoor activities, and for families, 3939 provides many things to do, and you can even experience an element of culture in the McCrae Homestead National Trust property – which can be found at the foot of St Arthur’s Seat.', NULL, 1, NULL, NULL),
(345, '2452', 'A quaint, but popular village located in the coastal area, Sawtell has a sandy beach, and multiple sporting clubs and is highly popular with tourists. The local restaurants and cafés are thriving, providing the optimal place to grab a bite or sip on some refreshments. Swimming is available at the Boambee creek, and you can have the experience of a lifetime at Sawtell Headland where you can go whale watching! In 2452, there are many amenities including a cinema, bakeries, and pubs too.', NULL, 1, NULL, NULL),
(346, '4116', 'Calamvale, Stretton and Drewvale are all located in the 4116 suburb, and each provides access to some spectacular natural scenes. The wide range of local Calamvale wildlife makes their home in the Golden Pond Wetlands, while the Westfield Garden City shopping centre is available in Stretton, offering you a rural and commercial blend. Stretton also joins the Karawatha Forest, an area in which a variety of vegetation flourishes. If you are raising a family, locals describe Drewvale as the perfect location', NULL, 1, NULL, NULL),
(347, '4810', 'The largest urban center north of the Sunshine Coast, 4810 is a city on the North-Easter coast of Queensland. Considered by locals the unofficial capital of North Queensland, it hosts a significant number of governmental, community and major business administrative offices. Inner-city development has led to population growth and gentrification of the central business district, providing a younger population than Australian and Queensland averages. The Ross River flows through 4810. It has some great attractions such as ‘the Strand’, along tropical beach and garden strip, and Riverway, a riverfront parkland attraction!', NULL, 1, NULL, NULL),
(348, '4035', 'Albany Creek, which belongs to the suburb of 4810, is home to Olympic gold medallist Bronte Barrett and Leith Broadie and is just 18km away from the City of Brisbane. In addition to its many leisure centres, this location has three major shopping centres. It is just 30 minutes away from the Brisbane central business district, located on a hill close to the South Pine River. Bridgeman Downs is also very close, providing extra shopping villages and centres, and it can be easily visited by bus.', NULL, 1, NULL, NULL),
(349, '3400', 'A small city that is situated in Wimmera, Horsham has the eponymously named river bending around it named. The Horsham Botanic Gardens are also a must-see if you are in the area, as they were designed by landscaper William Guilfoyle. But the city also provides sporting activities, performances in the Wesley Performing Arts Centre and community bands that play live music. Also available to you are two lively, annual festivals – the Kanamroo festival and the Horsham County Music Festival.', NULL, 1, NULL, NULL),
(350, '3108', 'With its panoramic scenes and views, from Doncaster in 3108, you might even be lucky enough to spot the Bacchus Marsh when the weather is clear. But within the suburb, you can go shopping in the recently renovated Westfield Doncaster shopping centre. The sports team Doncaster Sharks call Doncaster their home, and they take part in the Eastern Football League. In 3108, there are some transport links are available to you, including the Route 48 Tram, local buses, and a railway station located 3km away in the Box Hill area.', NULL, 1, NULL, NULL),
(351, '2164', 'Multiple streets in 2164 are named after incredibly renowned people, including Shakespeare, John Locke, Geoffrey Chaucer, and Robert Frost. Featuring a nature reserve with local flora and fauna, Wetherill Park is a beautiful place to visit or live. Knowing this, Italian footballer Christian Vieri even made this suburb his home! Its Shakespeare park was recently renovated, and the Wetherill Park contains a place of worship – a Buddhist temple, while sports grounds and a skate park are also available in the surrounding Smithfield area.', NULL, 1, NULL, NULL),
(352, '2074', 'North and South Turramurra are two suburbs located within the 2074 area. North Turramurra contains the sphinx war memorial, a sandstone replica carved by William Shirley in the 1920s as a commemoration of the soldier’s colleagues. But there are also amenities in abundance such as restaurants, a shopping village, and cafés available in the area. South Turramurra is a very green suburb in which you can find many trails and walking paths to the neighbouring areas – Marsfield and North Epping, for instance, are just on your doorstep.', NULL, 1, NULL, NULL),
(353, '3015', 'An interesting fact about Spotswood, located in 3015, is that it was where the movie of the same name ‘Spotswood’ was created, a film starring Russell Crowe. The area features a cricket club that takes part in the Victorian Turf Cricket Association, but it is also home to many golfers who compete in the Westgate Golf Club. Meanwhile, South Kingsville is a mere 10-minute drive away from Melbourne central business centre and provides a range of restaurants, a children’s playground and other amenities.', NULL, 1, NULL, NULL),
(354, '2281', '2281 is the largest town in the city of Lake Macquarie, at the entrance to the popular attraction to Lake Macquarie. It has an industry of coal mining, fishing, boating, and tourism. It is 25.2km from Newcastle, where many of the professionals and singles who live in the area commute to. 2281 is very popular for water sports, beaches, and fishing. Notable beaches are Caves Beach and Murrays Beach, and the chance to scuba dive is available at Snorkel and Dive Safari! It is the perfect location for lakeside living.', NULL, 1, NULL, NULL),
(355, '3056', 'Noted for its cultural diversity and lively music and arts scenes, Brunswick, in 2281, is a very vibrant and multicultural suburb. The population is made up of many students due to the nearby University of Melbourne. Enjoy the nightlife and let loose in Brunswick – there are many nightclubs and venues to choose from! Moreland is in close proximity and also hosts street parties such as the most popular Sydney Road Street Party, which is sponsored and supported by the local council.', NULL, 1, NULL, NULL),
(356, '3941', 'Coming a long way in its development over the past ten years, 3941 is an idyllic seaside town in Greater Melbourne on the Morning Peninsula. It is 95kms South of Melbourne’s Central Business District. 3941 has an abundance of ocean life, such as stingrays, spider crabs, squid and octopus, occasionally attracting seals. Rye’s Beach on Port Phillip Bay is popular with swimmers, yachtsmen, fishermen, and suffers, as well as having marked snorkelling areas and trails to follow. It has affordable housing and excellent amenities and facilities, ideal for ocean living.', NULL, 1, NULL, NULL),
(357, '2146', 'Exploring around 2146 will take you to Toongabbie and Old Toongabbie. Toongabbie has a busy shopping precinct featuring a supermarket and over 40 different shops, and to get around, there are also private buses that will take you to Blacktown, Westmead, and Seven Hills as well as many surrounding areas. You can find Old Toongabbie to the east, which lies approximately 29km away from the Sydney central business district. 2146 is also surrounded by Toongabbie Creek, which is the origin of the area’s name.', NULL, 1, NULL, NULL),
(358, '2118', 'Located 22km away from the Sydney central business district, 2118 contains Carlingford – an area that has quickly urbanised over the years, particularly after World War II. Now, when you visit Carlingford, you’ll find commercial and shopping areas, supermarkets and a variety of stores. Transport links include buses and rail options, taking you to nearby neighbourhoods. However, retaining its history, this location has many heritage sites such as war commemorations, churches and gardens.', NULL, 1, NULL, NULL),
(359, '3162', 'In Caulfield South, a suburb situated in 3162, natural local wildlife such as crested pigeons and wattlebirds, rainbow lorikeets and magpies can be spotted. The parts of 3162 that were once a council landfill until the mid-twentieth century site are now home to many beautiful gardens and parks that have recently been developed, and the area features playgrounds for children, playing fields and pavillons. Running through the neighbourhood are tram routes that can take you to Glenhuntly and Elsternwick stations.', NULL, 1, NULL, NULL),
(360, '3071', 'On the border of Thornbury, located within 3071, you’ll find the Merri and Darebin Creeks. In the centre, Thornbury Village is located. With plenty of things to do, you won’t get bored in 3071. Seize the chance to indulge in the nightlife scene and have a drink in the local bars and clubs. Also available to you are the many restaurants and cafés, parks, open spaces and sporting facilities – which include the Darebin International Sports Centre, the State Cycling Centre, and The Holy Trinity Cricket Club.', NULL, 1, NULL, NULL),
(361, '6101', 'The suburb of East Victoria Park in 6101 has more than 130 sites listed as historical heritage locations. It is located near the Swan River and became part of the City of Perth in 1917. Its neighbouring area, Carlisle, has a number of amenities and services available to you that include the Oats Street and the Carlisle train stations, four idyllic, immaculate parks – Parnham, Tom Wright, Fletcher and the Carlisle Reserve, as well as some churches and schools.', NULL, 1, NULL, NULL),
(362, '2539', '2539 is a coastal town in the city of Shoalhaven, located on Princes Highway about 230 kilometres South of Sydney. The commercial area is also along the highway, with a range of shops, arcades and a cinema. There is also a close link with the historic settlement of Milton, with several services shared between the two. 2539 is a 7km stretch of urban residential areas stretching from Mollymook to Narrawallee, with landmarks including the Pigeon House Mountain and the Castle. It is served by premier motor service between Sydney and Eden, Bomaderry railway station, and Ulladulla Buslines. Ulladulla Harbour is also a minor port and historical attraction!', NULL, 1, NULL, NULL),
(363, '3141', 'Having been ranked the best suburb in which to live out of the Melbourne suburbs in 2005, South Yarra in 2539 has an abundance of things to offer. Trendy, modern shops, restaurants and vibrant nightclubs await you, and the location also boasts spacious green areas for those who enjoy outdoorsy activities, including parts of the Royal Botanic Gardens of Melbourne. With primary schools and sporting opportunities, South Yarra has something to offer to everyone.', NULL, 1, NULL, NULL),
(364, '2282', 'The second largest population centre in Lake Macquarie, 2282 is a suburb in the city of Lake Macquarie. Located 15 kilometres from Newcastle’s Central Business District, it has over 615 businesses operating in the area. It has a couple of recreational hubs, including near the Lake Foreshore with outdoor dining and indoor shopping centre Warner’s Bay Village. 2282 also has a large industrial estate, including features such as an ice rink, bowling alley and laser tag. It is also home to several prestigious sports teams including Warner’s Bay Bulldogs!', NULL, 1, NULL, NULL),
(365, '3181', 'Prahran is located within 2282 and is a beautiful place to live with many amenities. From music shops to book stores, clothing shops and restaurants, there are many things to do in 2282. Skate parks, playgrounds and parks are available for walking or jogging, and public gardens such as Victoria Gardens provide the perfect places to unwind and take in the pretty scenery. Local tram routes can take you to various nearby areas, and you can also take the Sandringham line from Prahran Station to venture outside of the neighbourhood.', NULL, 1, NULL, NULL),
(366, '4068', 'A riverside suburb designed as a regional activity centre, 4068 is in the city of Brisbane. It is connected to Chelmer on the southern bank of the river by four bridges, two rail bridges, and one road bridge. Home to Indooroopilly Shopping Centre, the largest shopping centre in Brisbane’s western suburb. 4068 is popular with professionals and university students from the nearby University of Queensland campus. The architecture us varied with detached houses, medium density houses, and recently a trend towards small lot and townhouse developments.', NULL, 1, NULL, NULL),
(367, '2120', 'Having a prominent central commercial area, one of the largest in Hornby Shire, means that the area provides many services, shops and restaurants, and all are available to you in 4068! Also in the neighbourhood are many churches of different denominations, schools, leisure and sports activities such as the Pennant Hills Football Club, in addition to many gardens, parks and reserves. The Lane Cove River’s source is situated in Thornleigh and the neighbouring area of Westleigh was once home to the renowned actor Mel Gibson. Both of these locations have many bus and train transport links, taking you to Waitara, Normanhurst and beyond.', NULL, 1, NULL, NULL),
(368, '3840', 'Being home to a two-hectare rose garden parkland that was a former railway is just the surface of 3840’s beauty. The Morwell Centenary Rose Garden features thousands of roses and was even granted an award in 2009 by the World Federation of Rose Societies. From preschool to higher-level education, 3840 is also a great location for students. The area even features the Central Gippsland Institute of Technical and Further Education, as well as an art gallery in which both a variety of roses and an outstanding local collection can be found.', NULL, 1, NULL, NULL),
(369, '3042', 'If you’re stuck for things to do in 3042, you should check out the restaurants and cafés located in the main shopping centre of Niddrie for a bite to eat or a refreshing drink. Venturing a little further out will take you to Keilor Park, which is bordered by the Maribyrnong River. The nearby location of Airport West features a shopping centre and a cinema, and it is also known for its circus which tours Victoria. The circus is incredibly popular in Australia and has been performing in 3042 for more than 40 years! Trams, rail and bus routes are your available options to travel around 3840.', NULL, 1, NULL, NULL),
(370, '6028', 'Located in the northern suburb of Perth, 6028 is 29 kilometres north of Perth’s Central Business District. The Currambine shopping centre is located here and contains a cinema complex. The suburb is divided into quarters by the dual carriageways Connolly Drive and Moore Drive. Primarily a residential suburb, 6028 contains 5 holes of the Joondalup Golf Course. Transport is excellent through buses operated by Swan Transit and the Currambine railway station.', NULL, 1, NULL, NULL),
(371, '3170', 'In 3170 you’ll find Mulgrave, which is a suburb that is 21km away from Melbourne’s central business district. Over the years Mulgrave has gradually reduced in size, yet it still provides plenty of amenities and things to do. The Waverley Gardens Shopping centre, for instance, offers a huge variety of about 110 shops, while from the Sunday Mulgrave Farmer’s Market you can purchase plenty of fresh fruit and vegetables. For entertainment, you can even watch The Mulgrave Lions compete in the Eastern Football League and support the home team!', NULL, 1, NULL, NULL),
(372, '7010', 'Meaning ‘Glen of Tumbling Waters’, 7010 is a pleasant, family-orientated, working-class suburb fantastic for amenities near Hobart. It has the River Derwent to the East and Mount Wellington to the North. It is 8 kilometres away from Glenorchy’s Central Business District, the second largest shopping district in Tasmania. 7010 has three major shopping centres: Northgate Shopping Centre, Glenorchy Central and Glenorchy plaza. It also features the entertainment facilities of Glenorchy pool, Village Cinemas Complex, and the Tasmanian Transport Museum, providing great recreation for families!', NULL, 1, NULL, NULL),
(373, '2322', 'Bisected by the New England Highway, 2322 is a suburb in the city of Maitland with a population of just over 8000. It includes the areas Thorton, Beresfiled, Tarro and Hexham, taking its name from the railway station. The area has transport through the railway station, including the Bloomfield Coal Loop. 2322 has an industrial estate with many residential subdivisions. Prices of houses in this area are reasonable and of a decent size, giving Thorton a reputation as an excellent place to live.', NULL, 1, NULL, NULL),
(374, '2093', '2093 is located 12 kilometres north of the Sydney central beaches district and encompasses the suburbs of Balgowlah, Manly Vale, Balgowlah Heights and North Balgowlah. Each suburb has a number of heritage-listed sites popular to visit. Balgowlah in particular is one of the destinations for the Hop-Skip-Jump free bus services operated by Northern Beaches Council. There are several commercial areas within 2093, focusing on smaller, corner shop-style attractions.', NULL, 1, NULL, NULL),
(375, '3226', 'A small town on the shores of Victoria, 3226 is popular with both its locals and the tourists that visit from areas such as Melbourne and overseas. Close to the beach, the shopping centre in Ocean Grove is an amenity to which many visitors flock. But there is also an abundance of activities and events available to you in 3226. Whether that’s kayaking, surfing or canoeing, or hiking on footpaths or trails in the area, the outdoor activities of 3226 are invigorating and exciting. Local woodland can be found in the Ocean Grove Nature Reserve, and skate parks, swimming pools and football are also very popular.', NULL, 1, NULL, NULL),
(376, '4508', '4508 is situated along the shoreline of the Moreton Bay Region. Though once an area that was used for farming and agricultural cultivation, the Deception Bay beachfront has recently undergone a significant renovation. It has also been divided in two, and the area to the north has become division two. The suburb was so named to reflect the small bay close to the Pumicestone Passage. A public library and some schools are located in the area and, with many taverns and eateries, it is a top spot to savour some delectable dishes.', NULL, 1, NULL, NULL),
(377, '6031', 'A suburb of Perth, 6031 is located within the city of Wanneroo, located 30 kilometres from Perth’s central business district. Meaning ‘shade of trees’, it has a population of just over 7000. There are two retail facilities within 6031, the Carramar Village Shopping Centre, and the second site a zoned regional shopping centre. The area is serviced by bus links which provide connections back to the Joondalup line. It is a good mix of privacy and proximity to amenities, with friendly people always keen to help!', NULL, 1, NULL, NULL),
(378, '3934', 'A seaside location that is known for its bathing beach and the Balcombe Creek, 3934 is a picturesque coastal town. The suburb takes its name from the eponymous Mount Martha, the peak of which rises 160m into the air. The area’s population has increased significantly in recent years, and Martha Cove is particularly popular. An area that is flourishing and attracting many, people flock to the large harbour and play golf here in the Mount Martha Valley Golf Club. Among many exciting leisure activities, equestrian, and cross country activities are offered at the Mornington Peninsula Pony Club.', NULL, 1, NULL, NULL),
(379, '3124', 'Being one of the most luxurious and prestigious suburbs in Melbourne, and offering an array of activities and things to do makes 3124 a beautiful place to live or visit. The area is well connected to surrounding neighbourhoods, with transport links such as the tram, railway and bus. With multiple idyllic parks, fun playgrounds and natural reserves, this area provides a blend of tranquility, natural beauty and the benefit of having local, cultural activities such as the Camberwell Sunday Market, as well as a cricket club and many churches.', NULL, 1, NULL, NULL),
(380, '4304', 'Located in Queensland in the City of Ipswich, 4304 encompasses several areas including Blackstone, Booval, Bundamba, Ebbw Vale and Silkstone. It is located around 40 kilometres southwest of Brisbane’s central business district, with agricultural and rural areas to the west. 4304 contains both residential and commercial areas and has a number of heritage-listed sites including the Booval War Memorial. It is described as a lovely suburb with affordable houses, and Brisbane is just a short trip away!', NULL, 1, NULL, NULL),
(381, '3104', '3104 is a suburb of Melbourne located 10 kilometres east of Melbourne’s central business district with a population of around 20,000. One of the first suburbs to be developed following the rise of post-war suburbia, with areas designed as family homes in quiet, expansive areas. 3104 is a notably affluent suburb in Melbourne’s top 20 exclusive postcodes, having larger block sizes and with an average 3 bedroom house costing AUS$1.46 million. The main shopping area is known as The Village, with a number of transport links connecting it.', NULL, 1, NULL, NULL),
(382, '3228', 'Being a resort along the seaside, 3228 is renowned worldwide for its surf beaches. The internationally-recognised Bells Beach, alongside Point Impossible, Jan Juc and Southside are all incredibly popular with tourists and surfers. The area is a hotspot of global surf companies that have made Torquay their home. In this location, you can access the Surf World Museum while along the Surf Coast Plaza you should take the chance to indulge in the delicious food. The area has recently undergone development, with homes being built in Jan Jun.', NULL, 1, NULL, NULL),
(383, '2519', '2519 encompasses several suburbs of Balgownie, Fairy Meadow, Fernhill, Mount Ousley, and Mount Pleasant located in Wollongong. It is connected to the Princes Highway. 2519 has a history of coal mining and farming industries, that in recent years were overtaken by urban expansion. It is inhabited by a range of citizens across the socioeconomic spectrum. In recent years, the property market has exploded and many suburbs have been turned into townhouses or villa developments.', NULL, 1, NULL, NULL),
(384, '4815', 'A suburb that contains the areas of Condon and Rasmussen, 4815 is home to the Thirtymile Creek. Rasmussen, which is sandwiched between the Kelso and Condon suburbs, has many residential areas and estates being constructed. It was named after a family which settled in the 4015 area – a family that once had a dairy farm that was located close to the Ross River. With a school and plans to construct major shopping centres, the area of 4815 is slowly developing into a quaint suburb.', NULL, 1, NULL, NULL),
(385, '3127', 'Containing the Mont Albert and Surrey Hills area, the suburb of 3127 has plenty of gardens and parks, including the South Surrey Park and the Surrey Gardens. In addition to being home to the Canterbury Cobras, the area also contains the Canterbury Cricket Club and a local tennis club. So there are outdoor activities to do and clubs to join in abundance in this leafy green suburb which has beautiful, tree-lined streets.', NULL, 1, NULL, NULL),
(386, '2142', 'With a blend of industrial, residential and commercial constructions, 2142 is developing quickly. In Granville, you can sip on a drink of your choice at one of the four pubs located in the area. You can even sing your heart out, as some of the attractions include live music and karaoke events! The neighbouring area of Rosehill is home to the Rosehill Gardens Racecourse, and the area currently has a blend of recreational, industrial and commercial land that is soon going to be redeveloped.', NULL, 1, NULL, NULL),
(387, '820', 'Surrounded by crystal blue waters of Fannie Bay, the rising region of 820 is home to scenic marinas with plenty of places to taste fresh seafood. There’s a real sense of community in 820 where you can enjoy quality local produce from weekly markets in Parap. Cullen Bay invites residents to enjoy its top bars, restaurants, and cafes while taking in the beautiful scenes. Outdoor lovers will be spoilt for choice when it comes to choosing one of the many cycle routes throughout The Gardens.', NULL, 1, NULL, NULL),
(388, '2291', 'Encompassing Merewether, Merewether Heights and the Junction, 2291 is part of Newcastle in New South Wales and is located 3 kilometres from Newcastle’s central business district. The suburb stretches 3 kilometres from Merewether Beach in the East to Adamstown in the West. 2291 includes some of Newcastle’s most famous beaches, including Dixon Park Beach and Glenrock Lagoon. The dominant industry was previously coal mining, creating working-class mining villages, which have developed into the region’s most sought-after residential suburb, regarded for schools, The Junction Shopping Village, and amenities like restaurants and bars.', NULL, 1, NULL, NULL),
(389, '5540', 'A seaport and city that is constantly developing, the 5540 neighbourhood has received a new cultural precinct valued at $3.3 million and offers many things to experience. The area is also the major retail centre of the Australian mid-north region. There are plenty of cultural things to experience in 5540, including the Port Pirie RSL Museum, the Regional Tourism & Arts Centre, the National Trust Museum and more, while local eateries dish up some delectable plates of food for you to dine on.', NULL, 1, NULL, NULL),
(390, '812', '812 is located in the Northern Territory of Australia, 3.9km away from Darwin International Airport. This area of Australia is well-known for its colourful desert landscapes in the Outback. Many of the suburbs in 812 are small and can be explored within a day, so stop off for a snack in Anula and visit the marketplaces in Malak. For a more energetic day, visit the water playground at Leanyer Recreation Park. The capital city of Darwin is approximately 10km away, close to the Charles Darwin National Park.', NULL, 1, NULL, NULL),
(391, '4558', 'In the Sunshine Coast Region of Queensland, you can find the quaint seaside town of Maroochydore in addition to the suburb of Kuluin. Being a major commercial location in 4558, the central business district of Maroochydore is known for its Sunshine Plaza shopping centre. But it is also a great area in which you can take part in surf sports carnivals and enjoy the summer sun. Don’t forget to check out the Rotary Park in Maroochydore and the popular Maroochydore Beach, locations which locals and tourists frequently visit.', NULL, 1, NULL, NULL),
(392, '5118', 'Located 39 kilometres northeast of Adelaide city centre, 5118 has a population of over 3000. It is a well-serviced transport area, having the Horrocks Highway and Gawler train station. It has several amenities including the Gawler Par 3 Golf Course and is home to the Willaston Football Club. 5118 also offers the Elliot Goodger Memorial Park and the Clonlea Park for residents to enjoy. It has easy access to the city and generous land sizes, making it a settled community with a high potential for growth.', NULL, 1, NULL, NULL),
(393, '5038', '5038 includes the areas of Camden Park, Plympton, Plympton Park, and South Plympton, described as situated in a perfect position. It is located near the Anzac Highway, lined with palm trees and very green for most of the year. Houses\' prices are affordable depending on the size desired, with a number of parks and schools within this leafy suburb. 5038 offers the historic Parkin House which houses an important piano collection.', NULL, 1, NULL, NULL),
(394, '5125', 'Including Golden Grove, Golden Grove Village, and Greenwith, 5125 is a suburb of Adelaide with a population of over 10,000. It has been described as a comfortable suburb good for family living, offering neat and tidy subdivisions with large houses, neat gardens, and double garages. Adelaide Metro bus routes cover this area and provide transportation. 5125 is an excellent green suburb for serene and natural views, with many creeks, dams and rivers for residents to enjoy!', NULL, 1, NULL, NULL),
(395, '6105', 'With many local schools community activities and facilities, in addition to parks and open spaces, 6105 is a neighbourhood for families. In Cloverdale there is something for everyone – the City of Belmont Youth and Family Centre, Foster Hall, and Miles Park Community Centre are all available to you with plenty of events and things to do. Meanwhile, Kewdale offers its locals several reserves and parks such as Wicca Reserve, Willow Lake Park and more, which are all perfect locations for fun, outdoor activities, getting fresh air and exercise and taking in the local scenery.', NULL, 1, NULL, NULL),
(396, '3198', 'Located just 36km away from Melbourne’s central business district, Seaford offers the best of the rural, open green parks and is still close enough to the urban offerings of Melbourne. With plenty of public facilities, such as Keast Park, the Kananook walking trails and the Seaford Foreshore Reserve, you can immerse yourself in the best of both worlds – the green paradises and the blue sea. Frequented by bird watchers, you should visit the Seaford Wetlands, which are home to local wildlife, including some endangered birds.', NULL, 1, NULL, NULL),
(397, '3133', 'Home to the Vermont Eagles, who play in the Eastern Football League, 3133 hosts many sports teams including the Whitehorse United Soccer Club and the Vermont Cricket Club. With its churches and schools, the neighbourhood of 3133 has a real community feel. And located just 20km away from the Melbourne Central Business District, Vermont South is within commuting distance to Melbourne while offering a shopping centre, local parks and reserves, so you can benefit from the best of both worlds.', NULL, 1, NULL, NULL),
(398, '3220', 'Containing the Barwon River and being a starting point of the Bellarine Rail Trail, 3220 gives you a scenic world in which you can also enjoy the outdoors, go cycling or walking and experience nature. The area features the Kardinia Park in addition to restaurants and pubs, in which you can unwind, and relax. Boasting two rowing clubs, Barwon and Corio Bay, there are activities in abundance in 3220. Geelong itself is the second-fastest-growing city in Australia, with a population of nearly 270,000. With its many tourist attractions, such as Buckley Falls and the Geelong Botanical Gardens, 3220 provides both tranquility and vibrant atmospheres to enjoy.', NULL, 1, NULL, NULL),
(399, '4115', 'With its churches, mosques and schools the 4115 area provides a real community vibe. Algester is only 18km away from the central business district and its nearby neighbour, Parkinson is a residential location that is slowly developing. Both areas are extremely close to the City of Brisbane and Logan City, but for a tranquil, local lunch you should visit some of the restaurants or cafés in the area.', NULL, 1, NULL, NULL),
(400, '2680', 'A major regional city known as the ‘food bowl’ of Australia, 2680 has a population of around 27,000. It is the regional service centre for the vast Murrumbidgee Irrigation Area, one of the most productive agricultural regions in Australia. There have also been several developments for shopping centres recently, including Griffith City Plaza, Griffith Central, and Driver Shopping Complex. 2680 offers a warm and friendly place for families to reside, with affordable houses to buy and rent. The average house for rent is $115 lower than the New South Wales average!', NULL, 1, NULL, NULL),
(401, '3129', 'Home to Box Hill North, the 3129 area is only 14km away from the Melbourne Central Business District. But you should explore the area thoroughly because it has many gems to offer – shopping centres in abundance, several schools and colleges, parklands and sports clubs – Box Hill North has it all! Discover the Bushy Creek Trail, the Koonung Creek, and the children’s playgrounds which can be found in Springfield Park and Elgar Park. Featuring cycle paths and reserves, you can get back to nature and make yourself at home in this peaceful suburb.', NULL, 1, NULL, NULL),
(402, '4557', 'Mountain Creek takes its name from the eponymous creek that flows down the slopes of Buderim and joins the Mooloolah River. The area has a high school – the Mountain Creek State High School, and has a shopping centre as well as a library on wheels – a mobile library service. Mooloolaba is also found in 4557 and it is known for its Mooloolaba Triathlon as well as the Mooloolaba Yacht Race. But you can also experience many events that take place on the beach in which you can find the UnderWater World marine park, galleries, restaurants and bookshops.', NULL, 1, NULL, NULL),
(403, '2304', '2304 is a suburb of Newcastle located 8 miles away from Newcastle’s central business district with a population of just under 2000. Named for the daughter of a landowner, it has the Hunter River to the north, the Main Northern railway line to the south, Newcastle Harbour to the east and open ground to the west. There is a shopping district along Maitland Road, with several historic sights of interest including the History of Mayfield Mosaic. 2304 is in the process of being slowly reinvented, but has good housing stock, excellent proximity to beaches and city, and is affordable!', NULL, 1, NULL, NULL),
(404, '2100', '2100 includes Allambie, Allambie Heights, Beacon Hill, Brookvale, North Manly, Oxford Falls, and Warringah Mall. It is around 16 kilometres north-east of the Sydney central business district. It has areas of fast-growing business communities and major industrial areas. Primary transport is provided by buses, but there are also ferry services due to the area being part of the Northern Beaches region. 2100 is safe and friendly, with many local amenities like Oxford Falls Peace Park and Allenby Park for residents to enjoy!', NULL, 1, NULL, NULL),
(405, '3135', 'Delicious baked goods, tasty takeaway food, local pharmacies and supermarkets – are just some of the services available to you in the 3135 area. Melbourne’s central business district is located just 25km away from Ringwood East, but with these amenities, you might want to stay within the Ringwood East area. The suburb Heathmont is also on your doorstep, a place in which you can find butcher shops, several schools, an array of recreational clubs and many churches of varying denominations.', NULL, 1, NULL, NULL),
(406, '3128', 'Featuring a shopping area as well as recreational community services such as the Box Hill Community Centre, there is a clear family vibe in 3128. It is also highly multicultural, with Chinese, Malaysian, and Indian people populating the area. You can therefore dig into some exotic cuisines in local cafés and restaurants. There are multiple schools in 3128, and the location is well connected to surrounding areas via rail, tram and coach. Box Hill South is not far away, offering a golf course and school, and through the Gardiners Creek Valley a bicycle and pedestrian path winds.', NULL, 1, NULL, NULL),
(407, '2206', 'A suburb in South Western Sydney, 2206 is located 10 kilometres southwest of the Sydney Central business district. IT is located near the Cooks River and Wolli Creek. It is a primarily residential area with some commercial developments around the main road of Homer Street. It has a number of heritage-listed sites including Wolli Creek Aqueduct and Earlwood Aboriginal Art Site. 2206 is serviced by a number of bus routes and has many beautiful parks and gardens such as Gough Whitlam Park. It is a multicultural area known for being a quiet, safe and clean suburb.', NULL, 1, NULL, NULL),
(408, '6066', '6066 is a suburb of Perth located 14 kilometres north of the Perth central business district with a population of around 18,000. While there is no railway line servicing the area, there are several bus routes straight into the city. 6066 is described as having a safe family feel and being an affordable suburb with excellent facilities. It has excellent facilities. Amenities and attracts include the Emu Swamp Reserve, Alta Laguna Park, and Uluru Park.', NULL, 1, NULL, NULL),
(409, '3079', 'A suburb of Melbourne, 3079 is 9 kilometres northeast of Melbourne’s central district with a population of over 12,000. The southern border is formed by the Yarra River, with the Darebin Creek creating the West boundary. The suburb has two railway stations, Ivanhoe and Darebin. It also features the art deco town hall of The Centre Ivanhoe. It has several amenities including the Hatch Contemporary Arts Space and Melbourne’s longest-running book club, the ‘Ivanhoe Reading Circle’. Many street names in 3079 derive their name from characters in the novel ‘Ivanhoe’ by Sir Walter Scott!', NULL, 1, NULL, NULL),
(410, '5606', 'Located on a Boston Bay shoreline, the area of Port Lincoln has been known as a seafood hotspot and is called Australia’s seafood capital. 5606 features unique wildlife experiences, delectable seafood dishes and ocean activities for outdoor lovers, such as scuba diving and kayaking, windsurfing and shark cage diving. And with its National Parks and coves, including Lincoln National Park and Lincoln Cove, you can spend your days hiking, horse racing, or bird watching in a location that provides breathtaking coastal views.', NULL, 1, NULL, NULL),
(411, '4179', '4179 covers the suburbs of Lota, Manly, and Manly West, all located in Queensland. It is situated around 16 kilometres east of the central business district, and is dominated by mudflats and Mangrove wetlands to the south and east. 4179 has a number of heritage-listed buildings in each of its suburbs including Lota House, Manly War Memorial and the Michael Gannon residence. The Manly Boat Harbour is also the largest boat harbour facility in Queensland. Many houses in this area are standalone, with a mix of families and couples inhabiting 4179.', NULL, 1, NULL, NULL),
(412, '6148', 'Located within the City of Canning in Perth, 6148 is a suburb deriving its name from the shells found on the shores of the Canning River. Residents have access to many major bus routes and a stretch of Leach Highway is nearby on the southwestern border of the suburb, creating excellent transport. 6148 further contains a neighbourhood shopping centre, Shelley Hub, which provides a post office, restaurants, beauty salon and hairdressers among other amenities. It is a lovely suburb and cited as a great family area.', NULL, 1, NULL, NULL),
(413, '4123', 'With a green corridor that preserves the local wildlife, fauna and flora, whilst being located just 17km away from the Brisbane central business district, 4123 provides a place in which you can relax and appreciate both worlds. You can find, in Rochedale, the tranquil Bulimba Creek, while the Surfers Paradise is 35 minutes away from Rochedale South by car. The area of Rochedale is developing, with plans to transform farmlands and bushland into housing. The aim of the Rochedale Urban Community Development will see the neighbourhood increase its population.', NULL, 1, NULL, NULL),
(414, '2034', 'Being located in the beachside area of the City of Randwick and known for its secure swimming conditions, the area of Coogee in 2034 is incredibly popular with locals and tourists – particularly with families. With a rock pool area on the beach, and many festivals such as The Annual Coogee Family Fun Day, The Coogee Arts Festival, and the Island Challenge, you will not get bored in this seaside haven. The neighbourhood of South Coogee is nearby, offering the recreational area that is Latham Park, in which you can find football fields, tennis courts and cricket pitches.', NULL, 1, NULL, NULL),
(415, '2565', '2565 is an area in which you’ll find Ingleburn and Bardia. Known for its heritage sites such as the Ingleburn Military Heritage Precinct, its local library and its two shopping centres, in Ingleburn, you can experience a variety of activities and fun things to do. Recreational parks such as the Macquarie fields and Milton Park are green open spaces in which you can play a variety of sports. Meanwhile, Bardia is a little suburb with a small population of just over 1,600 people. It has a public school and is just 44km away from the Sydney central business district.', NULL, 1, NULL, NULL),
(416, '2037', 'In the 2037 area, you can explore the Glebe and Forest Lodge neighbourhoods. In Glebe, which is located a mere 3km away from the Sydney central business district, you can immerse yourself in the natural scenery of Blackwattle, and Rozelle Bay. With a shopping centre that has a food court and a cinema, as well as a Saturday market offering clothing, crafts and arts, Glebe has a real community feel. Neighbouring Forest Lodge is more of a peaceful, tranquil area which, in spite of its popularity with students, is a great place to unwind in its many cafes and local pubs.', NULL, 1, NULL, NULL),
(417, '3048', 'A suburb of Melbourne, 3048 is 19 kilometres north of Melbourne’s central business district with a population just shy of 15,000. Recent years have led to a focus on suburbs to the north, following the property boom that began in the 1980s. The area has excellent transport links, situated near the Pascoe Vale Road to the east, Barry Road to the south and Somerton road to the north and is frequented extensively by local taxi companies. It also provides several bus routes and has two train stations, Coolaroo Station and Roxburgh Park Station. 3048 has several places of interest with a cinema complex, four milk bars, a skate bowl and the central shopping centre is Centro Meadow Heights.', NULL, 1, NULL, NULL),
(418, '5008', 'Located in the City of Charles Sturt, 5008 is an inner west suburb of Adelaide. The area is well serviced by public transport, such as the Adelaide Metro and train stations. Elizabeth Street has a number of cafes and clothing boutiques to entice residents, and there are two parks located on Day Terrace beside the Croydon railway reserve known as Croydon Train park and Croydon playground reserve. There is a free street music festival held annually.', NULL, 1, NULL, NULL),
(419, '2614', '2614 is a suburb of the Belconnen district of Canberra, with the streets in the suburb named according to the theme of Northern Territory pastoral stations. The area is a popular location for sport, featuring the Hawker Playing Fields, Hawker Enclosed Oval, a small football stadium, centre for tennis and lawn bowls, and the Hawker International Softball Centre. The centre of the suburb is the group centre with many small businesses and shops. The area is underlined by Silurian age rhyodacite as part of the Walker Volcanics.', NULL, 1, NULL, NULL),
(420, '6058', 'A suburb of the City of Kalamunda, 6058 is 15 kilometres to the southeast of Perth and is split by the Roe Highway into a southern residential area and a northern industrial area. The area also contains a major rail hub. There are several shops in the Forrestfield Forum & Marketplace comprising 52 shops including Coles and Woolworths. It is well serviced by Transperth bus routes, allowing easy access to the local amenities including the Hatfield Park Recreation Centre which features sporting complexes, a nature conservation park, and a lake.', NULL, 1, NULL, NULL),
(421, '4212', 'In the City of the Gold Coast, in 4212, you will find both Hope Island and Helensvale. If you explore Hope Island you’ll notice its many amenities – theme parks and golf courses, restaurants and shops, and a marina are all available to you in this scenic neighbourhood, and its Marina Shopping Village is well worth checking out. In Helensvale, discover the local public library, the Coombabah Creek, and the Saltwater Creek Conservation Park. The area is also home to some local sporting teams such as the Helensvale Hornets, and there are also some swimming pools in this neighbourhood.', NULL, 1, NULL, NULL),
(422, '5107', 'Parafield Gardens and Greenfields are both located in 5107. In Parafield Gardens you can splurge and shop for your favourite things in each of the shopping centres. There is also a total of five schools in the neighbourhood and four of them are public schools. Greenfields is 13km away from the city centre and to get around, you can use the Greenfields railway station, which is on the Gawler railway line.', NULL, 1, NULL, NULL),
(423, '2211', 'Only 22km away from the Sydney central business district, Padstow and Padstow Heights are situated in the area of 2211. With churches of many different denominations, public and private schools and various junior football clubs, Padstow is a residential suburb with plenty of things to do. Venturing out to Padstow Heights via the local bus will take you to Padstow Heights, a location which is very close to Salt Pan Creek as well as the Georges River.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(424, '2111', '2111 is an area that covers Boronia Park, Gladesville, Henley, Huntleys Cove, Huntleys Point, Monash Park, and Tennyson Point in the locality of Chatswood. It is located roughly 10 kilometres north of the Sydney central business district and features a number of heritage-listed sites. 2111 features a number of commercial district centres and is cited as a great location with open areas and bordering the water. A leafy area with amenities all around, it is cited as an excellent location for families with children!', NULL, 1, NULL, NULL),
(425, '3184', 'With a beautiful beach on the bayside, in which you can go windsurfing and enjoy a variety of different sports, Elwood can be found in the area of 3184. The beach is very popular, but Elwood is also known for its shopping strip – the Elwood Village, as well as the Elwood Canal and Point Ormond Reserve. The neighbourhood also has a few churches, football and sailing clubs, and there are multiple schools, both public, private and secondary. Many transport links are available, including trams and buses, taking you to locations slightly further out.', NULL, 1, NULL, NULL),
(426, '6153', 'A suburb of Perth located within the City of Melville, 6153 named for the Scottish heritage of the discovery, Sir Alexander Percival Matheson. The area is bordered by Canning Highway to the north, Wireless Hill Park to the west, and Garden City shopping centre to the south. A notable feature is the Wireless Hill Museum, a landmark site of the first communication in radio and is now featured for wildflowers and rabbits. It is described as a great suburb with excellent amenities and schools, with great views of the river and city, famed for its flora and fauna.', NULL, 1, NULL, NULL),
(427, '5086', '5086 is a suburb in the inner north-eastern suburbs of Adelaide, around 5 kilometres from the city centre and around 10 kilometres from Adelaide’s central business district. It is bordered on the west by Hampstead Road and on the south by North East Road, with the northern boundary of Muller Road and the eastern boundary is Ways Road. 5086 is described as a wonderful, safe suburb to raise a family with a variety of amenities including shops, parks and reserves, as well as excellent public transport and schools.', NULL, 1, NULL, NULL),
(428, '4869', '4869 is a suburb of Cairns, approximately 9 kilometres south of Cairns City with a population of around 8000. It is described as a family-friendly suburb with an easy drive to work with walking tracks everywhere. Houses are described as excellent value for money, located on nice blocks with wide streets in a leafy suburb. There are several parks including B R Riley Park and Edmonds Close Park, as well as Sugarworld Adventure Park which is fun for all the family!', NULL, 1, NULL, NULL),
(429, '5169', 'Over the years, the area of Seaford Rise, located in 5169 has undergone multiple land developments. Tourism has greatly increased in the beachy areas as a result. The neighbouring Moana has a caravan park, the perfect getaway location in which to relax and unwind and it also has a sandy, white beach in addition to a surf life sailing club. Meanwhile, Seaford Meadows, which can also be found in 5169, has some shopping amenities and the Onkaparinga River Recreation Park is also located in this area.', NULL, 1, NULL, NULL),
(430, '2113', 'Both East Ryde and Macquarie Park are found in the 2113 zone. Being a small, tranquil suburb that lies on the Lane Cove River, there are some beautiful walks and paths or trails including the Great North Walk. With parks and waterways in abundance, this neighbourhood is home to some natural gems. Higher education is available in the nearby area of Macquarie Park, in its university and this area has many retail facilities. In fact, it is known as an economic pillar for the international businesses that have made this area their home.', NULL, 1, NULL, NULL),
(431, '4879', '4879 covers coastal suburbs of Buchan Point, Clifton Beach, Ellis Beach, Kewarra Beach, Palm Cove, Trinity Beach, and Trinity Park. It is considered a tropical, relaxed hub with stunning amenities and is an excellent attraction to tourists. IT features many local beaches and parks, including Cook Bay and Palm Beach. 4879 is cited as an excellent area for families due to the friendly nature of neighbours and the array of local amenities. There are stunning nature areas such as the Barron Gorge National Park, where the waterfalls are not to be missed!', NULL, 1, NULL, NULL),
(432, '6151', 'Being an affluent area means that 6151 is a place where you’ll find mansions and high-rise apartments. This is because of 6151’s proximity to the central business district and the Swan River. There are so many attractions and points of interest here, including the Perth Zoo, which is home to exotic Australian wildlife, the Sir James Mitchell Park which has picnic and barbecue spaces as well as the Old Mill and the Old Mill Theatre. There is also a ferry that links South Perth to the central business district.', NULL, 1, NULL, NULL),
(433, '4506', 'Located in the Moreton Bay Region, 4506 is a suburb located 44 kilometres north of Brisbane’s central business district with a population of around 21,000 people. It is a mostly residential area comprising low-set brick homes and semi-rural acreage. The main highway is the Bruce highway which passes from south to north through the suburb. 4506 has a main commercial area along Morayfield Road, including the Morayfield Shopping Centre. It also has a number of heritage-listed sites including Oaklands Sugar Mill and Morayfield Plantation which make for excellent historical visits!', NULL, 1, NULL, NULL),
(434, '2790', '2790 is located in New Country West and includes areas such as Ben Bullen, Lowther, Hartley and South Bowenfels. It has several local features including Blue Mountains and the Blue Mountains National Park, Tower Mountain, The Bull Ridge and Mount Clear. It is described as having a great neighbourhood feel with a safe atmosphere, making it great for families with kids. The area is known for its temperate climate with something to appeal to everyone!', NULL, 1, NULL, NULL),
(435, '2075', 'Located on the Upper North Shore of Sydney, 2075 is 18 kilometres north of the Sydney central business district. Since the expansion to the suburb after World War Two, it has seen a steady growth of families moving to the area due to its reputation as a safe and wealthy suburb. 2075 features the St Ives Shopping Village with over 110 stores and the Village Green Park directly opposite, with sporting fields, baseball fields, tennis courts and a skate park. The Village Green also hosts the annual Festival on the Green!', NULL, 1, NULL, NULL),
(436, '6714', 'Recent years have seen the Karratha area in 6714 open new facilities. These amenities include a public library, a hospital and a state-of-the-art theatre with indoor and outdoor cinemas, spaces for rehearsing, and art rooms. You should check out the events and festivals that occur throughout the year, such as the Cossack Art Awards and the Red EarthArts Festival. You can also find the Karratha Airport in the 6714 neighbourhood and there are a number of sports teams and clubs in this area.', NULL, 1, NULL, NULL),
(437, '7011', '7011 is a suburb of the City of Glenorchy, named after Claremont House built by local settler Henry Bilton. It has a shopping centre named Claremont Plaza and several churches. This suburb offers an enviable lifestyle, with a quiet atmosphere, friendly neighbourhood atmosphere. 7011 is also perfect for those with an active lifestyle due to the sports teams and facilities in the area. The architecture is described as having a wonderful synergy between new and old through a mix of old character homes and new modern builds, ideal for everyone!', NULL, 1, NULL, NULL),
(438, '3025', 'Located 10 kilometres southwest of Melbourne’s central business district, 3025 is a suburb of Melbourne with a population of over 12,000. The area contains one of two oil refineries in Victoria, and a number of sports clubs including the Altona Lakes Golf Club and the Paisley Park sporting facility. Furthermore, they offer the Altona Gate Shopping Centre and Kororoit Creek Trail for the perfect blend of nature and commerce within the area. 3025 has been described as an easy place to live due to the peaceful nature and excellent parks and sporting facilities.', NULL, 1, NULL, NULL),
(439, '4055', '4055 is an outer north-western suburb in the City of Brisbane with just shy of 6000 people. It is located 15 kilometres northwest of Brisbane’s central business district. There are 8 parks which comprise almost 13% of the total area and are known as a leafy and natural area. For transport, it is serviced by many bus routes and the Ferny Grove railway station. 4055 is described as one of the best family-friendly suburbs in Brisbane, with a safe and peaceful atmosphere, clean living and leafy, natural features.', NULL, 1, NULL, NULL),
(440, '3168', 'Home to perhaps one of the biggest technology, science and research centres in Australia, Clayton provides locals with plenty of education facilities and schools. With churches of varying denominations and a mosque, the area also provides many places of worship. It also contains other points of interest including a football club and a cricket club. The neighbouring area of Notting Hill is home to the Natural Confectionary Company among other notable businesses, and it’s just 19km away from the Melbourne Central Business District.', NULL, 1, NULL, NULL),
(441, '2780', 'Katoomba, the chief town of the City of Blue Mountains, resides in the suburb of 2780 alongside North Katoomba, Leura, and Medlow Bath. 2780 is less than 65 miles west of Sydney and approximately 24 mils south-east of Lithgow, with Katoomba situated on the Great Western Highway. Many buildings in this suburb attract an alternative subculture with their art-deco style shops and housing. The town hosts a Winter Solstice festival known as \"Winter Magic\", featuring local talent and handicraft.', NULL, 1, NULL, NULL),
(442, '2906', 'In the Lanyon Valley area of Canberra, and the 2906 location, you can find the neighbourhood of Conder, an area that contains the Lanyon Market Place and a few schools. In addition to these amenities, this location is also where you will find the Vikings clubs – a rugby union team – and there is also a youth centre. In the neighbouring area of Banks, you can relax and unwind in the Canberra Nature Park, a region known for its hills and high peaks, from which you can take part in the exhilarating activity of hang-gliding.', NULL, 1, NULL, NULL),
(443, '3564', 'The town of Echuca, located in the 3564 suburbs is found near the meeting points of three rivers – the Murray, the Campaspe and the Goulburn. Taking part in the yearly festivals is really exciting, and they include events such as waterskiing, the Riverboats Music Festival, and the WinterBlues festival. In addition to the top-quality restaurants, that have been mentioned in the Age Good Food Guide, there are many schools and shops in this area. And with golf and horse riding clubs, you can exercise and enjoy a variety of outdoor activities and sports.', NULL, 1, NULL, NULL),
(444, '2140', 'The suburb of 2140 Inner West of Sydney is home to Homebush, Homebush West, and Strathfield West. This suburb is just 12 km west of Sydney\'s central business district and has a number of heritage-listed houses in the Village of Homebush estate. The Homebush railway station in 2140 serves all stations on the Inner West and Leppington line of the Sydney train network, but if you\'d prefer to travel by car then there\'s easy access to the M4 Western motorway.', NULL, 1, NULL, NULL),
(445, '2192', 'The westernmost suburb in the inner-west of Sydney is 2192, containing Belmore, South Belmore, and Campsie. 2192 is just over 10 km away from Sydney\'s central business district, and hosts a number of period family homes with large back-yards, multiple heritage sites, and excellent commercial opportunities. Belmore also has excellent schooling for both primary and secondary education, and has excellent transport links to the rest of the suburb and into Sydney itself. Campsie also contains a number of parks, such as Anzac Park and Loch Street Reserve, so there\'s no shortage of places to explore.', NULL, 1, NULL, NULL),
(446, '3218', '3218 is a commercial and residential suburb within Geelong Victoria, and contains the suburbs of Geelong West, Herne Hill and Manifold Heights. 3218 has a wide range of residential homes and schooling, as well as a number of heritage-listed sites. The main street of Geelong West, Pakington Street, hosts a number of these sites and is also where the annual festival known as Pako Festa is held around late February. This festival is held to promote the cultural diversity of the area, as well as show an appreciation for artworks and fashions created by the citizens of the area.', NULL, 1, NULL, NULL),
(447, '3936', 'Safety Beach resides in Metropolitan Melbourne in 3936, alongside Dromana and Mount Martha. This suburb is under 50 miles away from Melboune\'s central business district and is primarily made up of seaside towns with popular beach activities such as boating, swimming, and sailing. The area of Safety Beach has a calm sandy bay, and the foreshore reserve hosts a children\'s playground and BBQ area with shading. Dromana features a number of vineyards in 3936, and the Dromana Drive-In cinema is popular with both tourists and locals.', NULL, 1, NULL, NULL),
(448, '3188', 'A busy shopping centre awaits you in the Hampton location, catering to your every need with its 50 retailers, but there is also a huge range of restaurants and cafes. For outdoor activities, you can check out the cricket and football clubs, while the Hampton Angling Club serves as one of the best of its kind in Australia owing to its close proximity to the snapper waters. Meanwhile, the residential Hampton East is also in the area of 3188 and is just 13km away from the Central Business District of Melbourne.', NULL, 1, NULL, NULL),
(449, '4370', 'In southeast Queensland is 4370, containing the town of Warwick and the suburb of Rosenthal Heights. 4370 is approximately 130 km southwest of Brisbane and has a number of excellent schools, heritage sites, and attractions, including The Pringle Cottage Museum. The area has a humid subtropical climate, with slightly cooler and less humid weather than the southeast Queensland coast due to it being more elevated and inland. Events that take place here throughout the year include; Warwick Agricultural Show in March, the Jumpers and Jazz in July festival, and The Rose Bowl Polocrosse Carnival in August.', NULL, 1, NULL, NULL),
(450, '2101', 'The 2101 suburb of northern Sydney, approximately 25-30 km north of Sydney\'s central business district, is home to Warriewood, Elanora Heights, Narrabeen, and North Narrabeen. Part of the Northern Beaches region, this suburb also has a number of excellent residential areas and schooling, as well as a lovely medium-sized shopping centre in the southern part of Warriewood. There are a number of terrific transport links throughout 2101 that also connect to Sydney, but with four beaches to choose from in the Narrabeen suburb, as well as the Narrabeen Lagoon to explore, there\'s plenty to see already in 2101.', NULL, 1, NULL, NULL),
(451, '5045', 'Known as the oldest European settlement on mainland South Australia, 5045 is home to Glenelg, Glenelg North, Glenelg East, and Glenelg South. This beachside suburb is popular with tourists and hosts many attractions, including several hotels and restaurants. Features in 5045 include its wide beach which is popular with both locals and tourists, and Jetty Road which contains a number of shops and entertainment facilities. Annual celebrations in the area include the Greek festival of Theophany and the celebration of Epiphany.', NULL, 1, NULL, NULL),
(452, '3081', 'The Heidelberg Heights location in Melbourne is served by the Yarra Plenty Regional Library. You’ll also find the North Heidelberg Football Club here, a team that plays in the Northern Football League. The neighbour of Heidelberg Heights, Heidelberg West, is home to a shopping centre with an open style, open green parkland spaces, and the areas around Darebin Creek. 3081 is a great neighbourhood for recreational and leisure activities in the outdoors, as it contains plenty of sports teams and clubs.', NULL, 1, NULL, NULL),
(453, '4030', 'The 4030 suburb north of Brisbane\'s central business district includes Luwyche, Wooloowin, Clayfield, and Windsor, and is approximately 2-4 miles north of Brisbane. This suburb is a mix of residential areas with a number of heritage-listed sites, excellent schooling for both primary and secondary ages, fantastic parks to explore, and transport links across the suburb and throughout. 4030 is also home to Downey Park, which has become strongly associated with the development of women\'s sport in Brisbane and plays host to many events.', NULL, 1, NULL, NULL),
(454, '5092', 'The suburb of Modbury in Adelaide is located in 5092 and also hosts Modbury Heights and Modbury North. This suburb is approximately 10 miles northeast of Adelaide and has beautiful residential areas to choose from, great transport links around 5092, excellent schools, and is home to the Tea Tree Plaza shopping complex. This shopping mall contains around 245 stores, including big name brands such as Woolworths and Myer, and is the second-largest shopping centre in Adelaide. Modbury also has a lovely large park known as Civic Park, across from Tea Tree Plaza, which is popular for BBQs and picnics.', NULL, 1, NULL, NULL),
(455, '2219', 'Located in southern Sydney, 2219 is a suburb 18 kilometres south of the Sydney central business district with a population of just under 1500. Noted as a quiet residential suburb, it is on the western shore of Botany Bay. The area has a number of historical sites of interest, including Sandringham Bay, Cook Park, and Georges River Reserve. 2219 has a small number of shops and amenities located at the intersection of Clareville Avenue and Russell Avenue. It also boasts the George River Sailing Club on the foreshore, a perfect leisurely activity!', NULL, 1, NULL, NULL),
(456, '2199', 'Named for the Aboriginal word meaning ‘now’ or ‘today’, 2199 is a suburb located 20 kilometres west of the Sydney central business district. The central commercial area is located on the Hume Highway near the Yagoona railway station. The station is on the Bankstown Line of the Sydney trains network, and further transport is provided through bus services and the main transport line of the Hume Highway. There are several parks in the suburb of 2199 such as Gazzard Park, George Green Oval, and the O’Neill Park, featuring various sports facilities and play equipment.', NULL, 1, NULL, NULL),
(457, '2526', 'A suburb of Wollongong, 2526 is located approximately 10km southwest of the Wollongong central business district. It is a residential suburb to the west and an industrial suburb to the east. There is a stirp of commercial venues along the Princes Highway in the area. Notable and distinctive buildings are the Catholic Church and the Syriac Orthodox Church. Other places of interest are the old school building, several historic buildings, and a community centre. 2526 offers a unique view of Mount Kembla, showing a distinctly different shape than other views of it.', NULL, 1, NULL, NULL),
(458, '3551', 'A town in northern Bendigo, 3551 is 169 kilometres north of the state capital Melbourne with a population of just over 2000. A primarily rural township, it was initially the site of some of Victoria’s largest gold rushes in 1851. A notable site of interest is the war memorial honouring soldiers who fought for Australia. 3551 has been described as one of the best inland regional cities, with lots of parks and easy access to the city and amenities.', NULL, 1, NULL, NULL),
(459, '6156', '6156 covers the areas of Attadale, Melville, and Willagee around 15 kilometres south of the Perth central business district. It has several attractions of interest including Alfred Cove, Lucky Bay, and Pelican Point. The area has been described as a very safe area close to parks, schools and shops. A highlight of 6156 is the Garden City shopping centre. It is ideal for families, with activities and facilities for everyone to enjoy!', NULL, 1, NULL, NULL),
(460, '4227', 'With a market square that has facilities in abundance, including restaurants, gyms and pharmacies, in Varsity lakes, 4227, you have a range of amenities and services available to you. From parks such as the Varsity Lakes Skate Park and Central Park, you can visit green open spaces at any time. Table tennis and fitness are also options in the community centre of Varsity Lakes. Another suburb close to Varsity lakes is Reedy Creek in which you’ll discover the eponymous creek flowing, and you’ll also notice that it\'s a residential area that is developing, featuring various schools and churches.', NULL, 1, NULL, NULL),
(461, '3850', 'In Sale, located in the 3850 area, you’ll be able to enjoy numerous attractions and events that attract tourists and locals. The Marley Point Overnight Yacht Race, the Gippsland Art Gallery, the Arms Forces Museum, and the Port of Sale are all events that provide entertainment and cultural fun for the whole family. But there are also many sporting events and teams that you can enjoy, including cricket, basketball and football in the Gippsland Regional Sports Complex. A shopping precinct is also available to you, which includes a variety of shops including food, clothes and music.', NULL, 1, NULL, NULL),
(462, '4161', 'Awaiting you in the Alexandra Hills area of 4161 are high schools, shops and sports clubs – offering something for everyone. The sporting clubs include the Alexandra Hills Cricket Club and the Bombers Australian Rules Football Club. But if you’re not into watching sports you can connect with nature in the bushland and many parks and recreational areas – Windemere Road Park and George Street Park are just a few of the open spaces available to you. Neighbouring Wellington Point provides a mobile library as well as the picturesque King Island and the Wellington Point Clock Tower, which can be found in the restaurant and shopping area.', NULL, 1, NULL, NULL),
(463, '3013', 'When you get to Yarraville in 3013, you will notice the many features available which include the Yarraville Gardens, the Beaton Reserve, Stony Creek, and the Yarraville Village Shopping Strip. With a character that is one of a kind, this area has six cinemas, restaurants and cafés, many of which are critically acclaimed and award winning. An array of cuisines are therefore available in 3013, such as Thai, Indian, Chinese and Greek food. Offering plenty of cultural and artistic events, such as a film society in Yarraville village, the annually celebrated Yarraville Festival and the Yarraville Market, this neighbourhood is full of diversity and multicultural attractions.', NULL, 1, NULL, NULL),
(464, '2009', 'St Bartholomew’s Park, Pyrmont Park, and Pirrama Park are among the top recreational and green spaces in the area of Pyrmont in the 2009 location. From the peninsula of Pyrmont Park you have views of Balmain East, while in Pirrama Park, leisure spaces are available to you such as barbeque equipment, cafés and facilities for children. In the Darling Harbour you will find a casino called The Star, but there are also other commercial features such as the Sydney Fish Market and the headquarters of Vodafone.', NULL, 1, NULL, NULL),
(465, '2228', 'A shopping strip and a shopping centre are key places in Miranda, 2228, places which many visitors from the surrounding Sutherland Shire frequent. Miranda is only 24km away from the Sydney central business district and with its many transport links, you can easily access Cronulla Beach and Cronulla Rock Pools. Meanwhile, the residential area of Yowie Bay is also not too far away and it features a marina, The Port Hacking Open Sailing Club as well as a small public school', NULL, 1, NULL, NULL),
(466, '4032', 'Being home to a Westfield shopping centre that is the largest in Australia means that in Chermside, in 4032, all of the amenities are open to you! From a cinema complex that has 16 screens to department shops of top, well-known brands, Chermside is often identified as a small central business district in Brisbane and it is quickly developing. It is close to Chermside West, which is just 10km away from the Brisbane central business district and contains an array of shops, churches and residential areas.', NULL, 1, NULL, NULL),
(467, '6149', 'Not only does the area of Bull Creek offer parklands such as John Creaney Park and a reserve, it also provides locals with a great range of supermarkets and the Stockland Bull Creek Shopping Centre, in addition to restaurants offering fast food and newsagents. But it is also a place in which you can find the Aviation Heritage Museum, where you can dive into history. If you journey outside of Bull Creek, in 4011 you can also find the affluent neighbourhood of Leeming, home to the Leeman Spartan Cricket Club, the bowling club and a golf club.', NULL, 1, NULL, NULL),
(468, '4011', 'The churches of different denominations are not the only community amenities available to you in 4011, Clayfield – there are also several schools in the neighbourhood. But in the nearby area of Hendra you will find an array of cafés and pubs, restaurants and takeaways, so don’t forget to indulge in the local eateries. With Beirne Park and The Doomben Racecourse, outdoor lovers can take part in exercises on the paths and trails. Take the chance to immerse yourself in nature, see the Kendron Brook and experience the best natural scenes.', NULL, 1, NULL, NULL),
(469, '7249', '7249 covers the areas of Glen Dhu, Kings Meadows, Punchbowl, Sandhill, South Launceston and Youngtown. The area is described as a beautiful character city, attractive to mainland buyers as a good-sized regional town with low unemployment levels. 7249 boasts many wineries, with excellent proximity to the coastline and almost no traffic congestion. The iconic Cataract Gorge is a sight not to be missed in the area, with facilities like swimming pools, a railway and a landscaped Victorian garden that features peacocks!', NULL, 1, NULL, NULL),
(470, '2032', 'With a population of about 4,920 people, Bellevue somehow stands as one of the richest settlement areas in Sydney. It’s just 5 KM east of Sydney\'s busy central district and is home to some of the biggest names in Australia. It’s lined with a good array of both private and public schools and residents equally enjoy easy access to supermarkets, farmers\' markets and community markets. Plus, their cuisine is continental and versatile, with both local, continental and fast foods available on diverse menus. The 2023 Postcode areas are also exciting and productive places for business hopefuls, successful entrepreneurs, professionals and families hoping to give their children the best education can offer.', NULL, 1, NULL, NULL),
(471, '4151', 'The area of Coorparoo in 4151 has undergone quite a few reformations. Residential towers have been constructed, but they also contain commercial areas. It’s called Coorparoo Square, and for the shopping enthusiasts among you, there are plenty of coffee shops, retail shops, supermarkets and a cinema complex with 10 screens! With a children’s play area in the Majestic Park as well as the open spaces in Coorparoo Creek Park, you have the best of nature and retail all in one community.', NULL, 1, NULL, NULL),
(472, '4208', '4208 is spread out across a number of suburbs in the City of Gold Coast area in Queensland, including Ormeau and Ormeau hills in the extended metropolitan area, and the seaside suburb of Jacob\'s Well. While there are no schools in Ormeau Hills, Ormeau itself in 4208 has up to seven schools available, ranging from Primary to College. Jacob\'s Well offers multiple boating and fishing amenities, and also operates a volunteer marine rescue service that serves multiple bays and rivers including Moreton Bay.', NULL, 1, NULL, NULL),
(473, '3193', 'A suburb located on the bayside of Melbourne boasting immaculate surroundings, shoreline reserves a shopping centre, and beautiful beaches, the area of Black Rock in 3193 is ideal for nature lovers. There are even children’s playgrounds and recreational spaces, parks and gardens in which you can absorb the natural oasis that is Black Rock. The nearby, neighbouring location of Beaumaris is known for its fossil site and features a cliffside and many organisations such as the Beaumaris Conservation Society and the Marine Care Ricketts Point.', NULL, 1, NULL, NULL),
(474, '2330', 'On the banks of the Hunter River, 2330 is located 144km north-north-west of Sydney and 70km north-west of Newcastle, a fantastic location between two large metropolitan areas. The main urban area features areas such as Wattle Ponds and Singleton Heights, and rural areas include villages like Camberwell and Belford. There are around 16,000 living in 2330. Transport is serviced by local and long-distance rail services, and a series of bus services, with 26,000 buses traveling through Singleton daily! It is also home to the world’s largest sundial.', NULL, 1, NULL, NULL),
(475, '3875', 'With its name reportedly meaning ‘valley of the children, 3875 is a shire traditionally owned by the Tatungalung clan. It is located on the bend of the River Mitchell. There are several iconic landmarks in the area, such as the memorial to William J. Yates, the Roman Catholic Church, and several beautiful gardens, such as the Central Gardens which run for over 500 metres. The reputation of 3875 as a marketing and trading centre has been aided by the construction of railway services, bus services, and the Bairnsdale Airport. It is notable for sports, featuring three Australian football clubs, cricket teams for men and women, and soccer clubs, among others.', NULL, 1, NULL, NULL),
(476, '2607', '2607 is located in the state of the Australian Capital Territory, covering the areas of Farrer, Isaacs, Mawson, Pearce and Torrens. The closest urban centre is Canberra, which also features the nearest airport and train station. There is interesting fauna located in the area, such as kangaroos and the blue tongue lizard. Notable amenities within 2607 are Mount Taylor, which has a prominent hill elevation of 856 metres and Red Hill, which is famed for its vineyards and beautiful beaches!', NULL, 1, NULL, NULL),
(477, '3161', 'Featuring the Caufield Park, an ample spacious, green oasis that is suitable for sports or going for a walk, the Caufield North location of 3161 has a real community feel and friendly atmosphere. With local shops and eateries serving up good grub, an array of local schools, and great transport links, this location has something to offer everyone – including families and the retired. The Monash University is accessible by tram if higher education appeals to you, and without venturing too far out, you can access St Kilda beach.', NULL, 1, NULL, NULL),
(478, '3068', 'Containing five schools and a commercial area with continental dishes and supermarkets, the Fitzroy North area of 3068 is a tranquil, green location with a community atmosphere. It features Rushall garden which is located on what used to be a railway and is now a communal area. But the location is known for its Edinburgh Gardens, wide-open spaces which used to be the playing grounds of Fitzroy Football Club. The area’s gardens and parks extend into the neighbouring area of Clifton Hill, where you’ll find Mayor’s Park, Quarries Park and Darling Gardens, in addition to a popular shopping strip.', NULL, 1, NULL, NULL),
(479, '5074', 'Supermarkets, modest-sized shops and primary and secondary schools are what Newton in 5074 has to offer. Green, safe and clean, whilst being in close proximity to its surrounding suburbs and the city, you can indulge in the benefits of the urban and the rural. With the Newton shopping centre, and beautiful green hills contained in one small suburb, you can really enjoy the best of both worlds.', NULL, 1, NULL, NULL),
(480, '5073', 'Named for the village of Rostrevor in Northern Ireland, 5073 is a suburb of Adelaide, situated around 10 kilometres east-north-east of the Adelaide city centre. There are several schools in the area, as well as a nature playground in Morialta Conservation Park, featuring three waterfalls and activities including bushwalking, bird watching and rock climbing. 5073 also features other beautiful nature reserves such as Launers Reserve, Pacific Avenue Reserve and Anderson Corner.', NULL, 1, NULL, NULL),
(481, '2264', 'Covering several areas including Balcolyn, Morisset and Sunshine, 2264 is located in the state of South Wales in the locality of Pymble. It has a number of interesting attractions and tourist spots, including Goat Island, a heritage-listed site known as Me-mel by the local Cadigal people. Furthermore, in 2264 there are lovely coastal locations to enjoy, such as Scarborough point and Sugar Bay. Pymble has been described as a quiet, safe and conservative area to live in, just 15 kilometres from Sydney’s central business district.', NULL, 1, NULL, NULL),
(482, '6100', 'With a population of around 2500 people, 6100 is an inner south-eastern suburb of Perth. Across the Swan River from 6100 is the Perth Central Business District. Interesting attractions of the area include the Belmont Park Racecourse, the winter thoroughbred racing track of Perth, a 60,0000 seat multi-purpose venue called Perth Stadium, and Crown Perth, with three hotels and casino. Burswood was also formerly the site of Western Australia’s first and oldest golf course, which opened in 1895 and was operational until 2013.', NULL, 1, NULL, NULL),
(483, '2533', 'An attractive coastal town destination, 2533 features the Kiama Blowhole, as well as several surfing beaches. The proximity to Sydney, just 120 kilometres south, makes it an appealing tourist destination for those wanting a day trip to the beach. There are a number of attractions, such as the Minnamurra River and Saddleback Mountain. 2533 also has a number of heritage-listed sites, such as Kiama Railway Station and CBC Bank Building, offering something for everyone to see!', NULL, 1, NULL, NULL),
(484, '3059', 'A hospital service known as the Greenvale Sanitorium closed its doors in 1998 and has been replaced by new housing constructions, making the area of Greenvale in 3059, a welcoming and pleasant location. Private schools are available in addition to one public, and you have the Melbourne Airport directly on your doorstep. With sporting clubs such as the Greenvale Tennis Club and a soccer club, this once rural, quietly developing suburb has plenty to offer and is just 21km away from the Melbourne Central Business District.', NULL, 1, NULL, NULL),
(485, '5014', 'A suburb of Adelaide, 5014 is situated 9 kilometres of the north-west of the city centre with a. population of just over 2000 people. There are several transportation options, including public transport run by the Adelaide metro, and the Port Road. 5014 has been described as having a family-friendly feel, benefited by the excellent schools and amenities in the area. It is an excellent value suburb with fantastic infrastructure, where occupants feel safe and right at home!', NULL, 1, NULL, NULL),
(486, '6147', 'There is a range of green open parks in the area of Lynwood, 6147, but it is also a residential location that caters to the needs of its local shoppers with its shopping centre. This location is a real community and includes restaurants, a primary school, a post office as well as a community hall. The location itself is vibrant and is close to the neighbouring area of Langford where you’ll find multiple primary schools, various churches, a pub and a shopping centre.', NULL, 1, NULL, NULL),
(487, '7009', '7009 in the state of Tasmania encompasses the areas of Derwent Park, Lutana, Moonah, and West Moonah, around 5 kilometres away from the urban centre of Hobart. Named Tasmania’s most life-style friendly suburb, the area has a convenient location to the Hobart central business district and several notable heritage buildings to catch the eye. Locals describe 7009 as having a relaxed vibe, helped by the quick transport, with barely any traffic hams or city pollution. There is also a notable restaurant strip sure to entice many!', NULL, 1, NULL, NULL),
(488, '2017', 'A skate park and a youth centre are just a couple of things that appeal to the families in the area of Waterloo, in 2017, and with the government’s aims to construct nearly 7,000 homes and buildings in the next 20 years, this area is developing fast. Places of worship include many churches, and the area is only 3km away from the Sydney central business district. Close by, the neighbourhood of Zetland features irrigation set up, which is linked to forward-thinking water management. You can also access the Airport & South Line of the Sydney Trains network in the area of Zetland, taking you to destinations further outside.', NULL, 1, NULL, NULL),
(489, '2042', 'The well-known Elmore Theatre provides live comedy and music in the 2042 area, and there are a number of gay pubs in which you can sip on a refreshing drink of your choice. Catering to the goth presence in the location, the yearly celebrated Under The Blue Moon festival attracts locals and visitors alike. With a Sydney Institute Design Campus and a shopping strip, this neighbourhood is vibrant and culturally diverse. With a number of galleries, cafés, and restaurants in the area, Newton provides plenty of things to do – including festivals such as The Feastability and the Sydney Fringe.', NULL, 1, NULL, NULL),
(490, '5096', 'The areas of Gulfview Heights, Para Hills, and Parahills West form 5096 in the state of South Australia. Located on a hill, this suburb offers sweeping views and serene streets. There are large blocks, and much flora and fauna to be enjoyed through the reserves and lakes in the area, such as the Hope Valley Reserve and the South Para Reservoir. Noted as a safe area, 5096 is popular with families of all ages, aided by the excellent amenities in the area.', NULL, 1, NULL, NULL),
(491, '3018', 'Feasting on delectable dishes, visiting some of the beautiful nature reserves in the area, and going for walks in the Altona Coastal Park are just a few ideas for fun things to do in the Seaholme area of the 3018 location. Surround yourself with nature and enjoy the beautiful scenic views! Meanwhile, at Port Phillip’s Altona Beach, you can go swimming or explore the outdoors. The area provides major gardens and parks that include conservation spots such as the Truganina Coastal Parklands.', NULL, 1, NULL, NULL),
(492, '2333', 'Known for its wine production and a gourmet selection of food, Muswellbrook in 2333 is the perfect place to devour some delicious dishes. It is also a great place to absorb some cultural events, such as the Blue Heeler Film Festival, The Muswellbrook Creative Arts Fair, and the Muswellbrook Carnivale. There are various schools located in the Muswellbrook area, and it was once home to some acclaimed people including golfer Kurt Barnes, rugby league footballer Jamie Feeney and Olympic hockey medallist Simon Orchard.', NULL, 1, NULL, NULL),
(493, '3033', 'Keilor East has many schools, sports teams, and facilities, and a shopping centre – the Milleara Mall to offer. Brimbank Park and Rosehill Park are the best locations to go for walks while you take in the beauty of nature or have a picnic. You might even choose to go bird-watching in this stunning location. The 3033 area is just 13km away from the Central Business District of Melbourne and nearby, the Maribyrnong River surrounds one side of the suburb.', NULL, 1, NULL, NULL),
(494, '4160', 'A primarily residential locality, 4160 is immensely popular due to the coastal attractions it boasts, including the popular walk along a sandbar to King Island, only emerging during times of low tide. With a population of over 12,000 people, it is named Wellington Point and is highly popular for aquatic sports. Despite its urban and residential nature, 4160 retains its seaside atmosphere excellently, making for a lovely day-trip destination. There is also a shopping and restaurant area that contains the Wellington Point Clock Tour, an attraction not to be missed!', NULL, 1, NULL, NULL),
(495, '5022', 'Suburbs on the coast of the 5022 area, Henley Beach and Henley Beach South have an abundance of things to do. Whether you want to go to Henley Beach, have a picnic in Henley Square, or go slightly further out and visit Linear Park in Henley South, there are plenty of activities here for you. Go cycling in Linear Park on the cycle path, or go for a stroll alongside the River Torrens – the natural landscape and scenes are perfect for picture taking, relaxing, or exercising.', NULL, 1, NULL, NULL),
(496, '2227', '2227 encompasses the areas of Gymea and Gymea Bay (adjacent suburbs) in the locality of Illawarra. Located around 26 kilometres away from the Sydney Central business district, it has a low-density residential suburb with several commercial areas located along Gymea Bay Road. 2227 has adopted the Doryanthes excelsa, also known as the Gymea Lily, as a symbol of the area, as they can be found growing in areas such as the Royal National Park. Overall it is described as a safe, family friendly suburb with attractive amenities such as good schools and convenient transport.', NULL, 1, NULL, NULL),
(497, '2749', 'Cranebrook features a shopping centre, primary schools and several churches. It is also a place where you’ll find the Sydney International Regatta Centre – the former home of the rowing events during the Sydney Olympics in the year 2000. By car, you are only ten minutes away from Penrith, and Cranebrook has a few local buses which can help you to get around and access these areas. Scenic views are available from the hillsides of Cranebrook, from which you can see the Blue Mountains and the Nepean River.', NULL, 1, NULL, NULL),
(498, '2440', 'Just 16.5 kilometres from the coast of the Pacific, 2440 is a town in New South Wales. With a rough population of over 15,000 people, the area has aboriginal roots dating back over 4000 years. Now, the area is noted as great for people who adore the outdoors, with beautiful rivers and beaches. 2440 has a number of interesting attractions and amenities, including the heritage-listed sites of the Kempsey Post Office and the Macleay River Railway Bridge, and the Kempsey Central Shopping Centre.', NULL, 1, NULL, NULL),
(499, '5070', 'With a small population of under 2000 people, 5070 is a suburb of Adelaide constructed in 1856 by Edward Castres Gwynne. The area features the notable heritage-listed site of Glynde House, as well as having easy access to amenities to keep residents entertained. 5070 is mostly occupied by residents over 60, with 67% of residents owning their own property. The area is located close to the capital of Adelaide (around 7 kilometres away) and has fabulous amenities for residents and visitors to enjoy, including notable eateries.', NULL, 1, NULL, NULL),
(500, '5163', '5163 is a metropolitan suburb of Adelaide, bordering several roads including Honeypot road to the North and the Southern Expressway to the south. Described as a good, honest suburb, it boasts some excellent ocean views that are perfect for relaxing. Ideal for families, the area is quiet and peaceful and located close to the shopping centre. Previously, 5163 was known as Hackham but was renamed after the former Nourlunga mayor Walter Morris Hunt to Huntfield Heights in the late 1990s.', NULL, 1, NULL, NULL),
(501, '3142', 'An affluent and wealthy suburb – nearly the most expensive postcode of Australia, Toorak in 3142 on average has the highest value properties in Melbourne. It is home to Toorak Village, a small strip of cafés and shops in the centre of Toorak Road. There are various churches in the neighbourhood, which include the extremely popular St. John’s Anglican Church, in addition to primary and secondary schools. On the border you’ll find the neighbourhood of South Yarra in addition to the Yarra River.', NULL, 1, NULL, NULL),
(502, '3187', 'With its lush open green parklands such as Landcox Park and Dendy Park, the Brighton East location in 3187 is the perfect place to enjoy some outdoor activities. The area has many primary and secondary schools, sports clubs, and sporting events such as bowls, cricket and football. It is just 12km away from the Melbourne Central Business District, so you can reap the benefits of being in a gem-filled oasis and having an urban area full of enterprise on your doorstep.', NULL, 1, NULL, NULL),
(503, '4157', 'Containing a shopping centre and large commercial areas, you simply won’t get bored in Capalaba! From markets and libraries to schools and cinemas, Capalaba in 4157 offers an array of things to get stuck into. This area also features many sports clubs such as the Capalaba Warriors and the Capalaba Bulldogs. You can find the Tingalpa Creek in this neighbourhood, which is the border between the Capalaba suburb and City of Brisbane. And there are also several beautiful natural spaces and parks in the area.', NULL, 1, NULL, NULL),
(504, '3016', 'Festivals, history tours and museums such as the Williamstown Festival and the maritime museum are just a few of the cultural events going on in Williamstown in 3016. The popular Literary Festival, for example, an event that promotes writing and literature, encourages local residents to contribute and participate in their own works. There is an abundance of recreational sports, clubs and events in this location. But should you need to venture further out, you have an array of transport links to take you where you want to go, including three train stations, buses and a ferry service.', NULL, 1, NULL, NULL),
(505, '4101', '4101 covers numerous suburbs in Brisbane, incorporating locations such as Highgate Hill, Mater Hill, and South Brisbane. The area is approximately 2 kilometres away from the central business district located on the Brisbane River, making commuting easy through a number of transport services. Many of the residents in this area are professionals due to the ideal location in 4104, there are a number of attractive places for residents and guests to visit, including Gardens Point, Victoria Park and Kinellan Point. The area has been described as peaceful, but with a thriving nightlife with many amenities within walking distance.', NULL, 1, NULL, NULL),
(506, '3194', 'Just 21km away from Melbourne’s central business district, Mentone is a suburb that has plenty of amenities and things to enjoy. Stretching along the beautiful Beaumaris Bay, you’ll find the Mentone Beach, and here you can walk along the shoreline and relax. But also in the area, you can explore the vibrant shopping strip offering bookstores, clothing shops, restaurants and bakeries among other things. The Mentone bowling club also offers fun and entertainment for the whole family and also located in the area are many primary and secondary schools.', NULL, 1, NULL, NULL),
(507, '3031', 'With a commercial area and being home to the Melbourne Cup horse race, Flemington has something to offer everyone. Whether you’re looking to get back to nature in one of the open parks, see the native flora and fauna in one of the reserves or wake up your tastebuds with a refreshing drink in the local cafés, in the area of 3013 you have all of these options available to you. You also have plenty of transport links in the area to travel further out and there are also a few schools here too.', NULL, 1, NULL, NULL),
(508, '2564', 'Macquarie Fields is a suburb of Sydney with the postcode 2564. Located around 38 kilometres southwest of the central business district, it features a high-security housing estate and international standard golf, aiding its reputation as an excellent suburb with an exceptional variety of facilities, including its own beach! 2564 also features skate parks, shopping and leisure centres, and well as a number of schools. The Macquarie Fields Leisure Centre is renowned for offering residents a variety of activities, including an Olympic-sized swimming pool, a gymnasium and an indoor aquatic centre.', NULL, 1, NULL, NULL),
(509, '2221', 'A suburb in southern Sydney, 2221 is located just 18 kilometres south awa7 from the Sydney central business district. The area was named for William Blake, a postmaster in 1863, and features a bridge believe to be named after another local man: ‘Tom Uglys Bridge\'. Tom Uglys Point, the most southern part of the suburb that shares this name, features fishing spots and a marina, with delicious seafood restaurants, In addition to the heritage-listed site of Thurlow House, 2221 also has a shopping strip located on the Princes Highway, serviced by regular buses.', NULL, 1, NULL, NULL),
(510, '4103', 'Annerley is a suburb that is only 4km away from the Brisbane central business district, so you’ll have no trouble accessing the heart of the city. With a public library in addition to several schools and churches of a range of denominations, the Annerley area in 4103 has a community atmosphere. The area contains many quaint cafés, and with annual events such as the Junction Fair, now known as the Annerley Junction Christmas Fair, the communal spirit runs through the whole suburb.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(511, '2575', 'A northern village in New South Wales, 2575 has a small population of under 3000 people. It is located 115 kilometres away from the Sydney central business district, and around 17-kilometre drive to Mittagong. The area boasts eateries such as a pizzeria and bakery, and amenities such as stores, real estate agents and a GP’s surgery. There are also activity centres like tennis courts and sporting fields. 2575 is the home of the soccer team known as the Hill Top Kookaburras, founded in 1981, which compete in the Highlands Soccer Association.', NULL, 1, NULL, NULL),
(512, '6050', '6050 is an inner suburb of Perth, with the Swan River to its east and a population of just over 11,000 people. Notable places include the Astor Cinema, now on the State Register of Heritage Places, originally constructed in 1914/1915. The Western Australian Academy of Performing Arts located in 6050 also boasts famous alumni like Heath Ledger and Hugh Jackman. Mount Lawley is described as offering the best of both to its residents, having an array of exceptional schools and cafes, but also offering bars and nightlife. The community spirit is strong, but Mount Lawley is considered to be one of Perth’s most expensive suburbs.', NULL, 1, NULL, NULL),
(513, '3820', 'Choose to watch or participate in sporting events hosted by the many clubs in the area of Warragul, including the United Soccer Club, the Greyhound Racing Club, or the Warragul Country Club (for golf). You can even experience the cycling events at the velodromes of the Warragul Cycling Club! And as it offers educational institutions for all ages – primary and secondary schools, as well as a campus of the Central Gippsland Institute of Further Education, there is really is something for everyone here.', NULL, 1, NULL, NULL),
(514, '6122', '6122 includes the central suburb of Byford, as well as areas such as Cardup, Darling Downs, and Karrakup in the locality of Tangney. The suburb has been described as popular with families due to its welcoming atmosphere and plenty of excellent schools. While it is located a fair distance (around 30 kilometres) from Perth City, the excellent transport links it closely with the inner metro area. Attractions in 6122 include Whitby Falls (with an elevation of 134 metres) and Serpentine Falls, which features waterfalls and varied flora and fauna including spider orchids and trigger plants.', NULL, 1, NULL, NULL),
(515, '3222', '3222 covers the area of Curlewis, a rural suburb with a small population of just over 1550 residents. It is surrounded by suburbs including Drysdale and Wallington and offers access to Port Phillip Bay via the north of the suburb. Since 2010, the area has undergone significant growth, including the Baywater Estate and Curlewis Parks; a total of 650 lots have been developed in the area. 3222 also features the Curlewis shopping centre which features a Woolworths, a pharmacy and other shops, ideal amenities for residents!', NULL, 1, NULL, NULL),
(516, '3140', 'Renowned for its Lilydale lake, a children’s play area and recreational zone, there are multiple things to do in 3140. This area contains Olinda Creek, which stretches from the Dandenong Ranges to the Yarra River. Home to the Lilydale Falcons, and a cricket team, these two main sports teams in the area compete in the Eastern Football League and the Ringwood District Cricket Association. You’ll also find the Lilydale Library situated on the campus of the Box Hill Institute, providing costless events and activities for everyone.', NULL, 1, NULL, NULL),
(517, '5024', 'The areas of 5024 are Fulham, Fulham Gardens and West Beach, situated in the state of South Australia. Notable attractions in the area are Point Malcolm and Sleeps Hill. There is a large greenspace of Fulham in Linear Park, featuring the Torrens Linear Park Trail, which is 30km long and has a bicycle path! Fulham, Fulham Gardens and West Beach have excellent transport links, including several roads connecting to the Adelaide city center, and the Adelaide metro provides bus services. 5024 is described as a clean and quiet suburb, great for both professionals and families with children.', NULL, 1, NULL, NULL),
(518, '2018', 'Lush green open spaces, parks and golf courses, including the Eastlake Golf Course and the Lakes Golf course, provide perfect locations to indulge in recreational activity. But in the area of 2018 much more is available, including a school, a few churches and a shopping centre. Rosebery is also extremely close to the Eastlake neighbourhood, providing the Turruwul park, with ample green open space, several schools including the Sydney International Film School, and a shopping centre.', NULL, 1, NULL, NULL),
(519, '2470', 'The postcode of 2470 encompasses a large area of New South Wales, including suburbs such as Alice, Coombell, Fairy Hill, and Shannon Brook. The nearest urban centre is Lismore, located around 40 kilometres away. A significant attraction in the area is Richmond Range national park, co-managed by the Githabul People and home to Australia’s World Heritage Area of Cambridge Plateau and Bungdoozle area rainforests. There are various endangered species here, such as the golden-tipped bat and Parma wallabies, making 2470 a definite hit with tourists and residents!', NULL, 1, NULL, NULL),
(520, '3060', 'Located 12 kilometres north of Melbourne’s central business district, 3060 is a suburb with a population of around 14,000 people. Originally part of Box Forest, the area has since expanded to feature commercial areas such as the one bordering Sydney Road and Bonwick Street, which has a wide range of shops, Italian cuisine, and cafes. 3060 has public transport links to the Melbourne central business district through railway stations and bus routes. There are also bike paths such as the Upfield Bike Path, Merri Creek Trail, and Western Ring Road Trail, and further sports amenities like the Fawkner Leisure Centre.', NULL, 1, NULL, NULL),
(521, '2041', 'Covering the areas of Balmain, Balmain East, and Birchgrove, 2041 is located in the locality of Leichardt, in New South Wales. The has undergone a transformation from a working-class industrial suburb into an easy-going place with a great community feel. The area has become desirable for upper-middle-class families due to the good schools and amenities like pubs and cafes. Points of interest within the 2041 area include Mort Bay and Snails Bay, giving the suburb a reputation as an excellent place for day trips.', NULL, 1, NULL, NULL),
(522, '6157', '6157 is a suburb of Perth, known as Palmyra, located 12 kilometres from the capital city. Described as a leafy suburb, it is ideal for families with children due to the abundance of parks and play areas. Two of the central parks in 6157 are Emily Main Park, south of Palin Street, and George Thompson Park on McKimmie Road, opposite the State Primary School. The average age of residents is around 39, with around 62% in full-time employment. The median rent in Palmyra is around $305 and the median mortgage repayment is $2000, making 6157 a desirable area to live!', NULL, 1, NULL, NULL),
(523, '3930', 'On the shores of Melbourne, the seaside area of Mount Eliza in 3930 not only provides schools for preschoolers as well as primary, secondary, and university level education, it gives you shopping areas, bays, and beautiful beaches. The Moorooduc Quarry Flora and Fauna Reserve are located in the area of 3930, a reserve with land that stretches off into the distance. With sports clubs and activities such as skating in the Mount Eliza skate park, you’ll have plenty to do in this seaside suburb.', NULL, 1, NULL, NULL),
(524, '4504', 'Grabbing a bite to eat after shopping is a great way to enjoy the many amenities in 4504, which is located on the fringes of Brisbane and is being residentially renovated. In the shopping village in Narangba, there is a 24-hour gym, a bakery, and many retail shops. Various parks and playgrounds are available to you and your children, in addition to the sports amenities that include soccer and rugby fields as well as a couple of baseball pitches.', NULL, 1, NULL, NULL),
(525, '2209', 'The postcode of 2209 links the suburbs of Narwee and Beverley Hills (nicknamed Bevo by locals), situated in Sydney, in New South Wales. The area is between 15-18 kilometres from the Sydney central business district. The main shopping area in Narwee is located on Broad Arrow Road, close to the railway station. Similarly, Beverly Hills, has a shopping strip on King Georges Road. 2209 is labelled as a quiet and safe area, which although rather average, has affordable housing for residents!', NULL, 1, NULL, NULL),
(526, '5251', 'Covering the areas of Mount Barker, Mount Barker Junction, and Wistow, 5251 is in the state of South Australia. Mount Barker is known as a great and affordable place to live, with excellent shopping facilities with fantastic parking. Due to the exceptional schools in the area, 5251 is an ideal location for families. Wistow is home to the Wistow Cricket Club, with the team known as the Echidnas, who have won five A Grade premierships since their formation in 1982!', NULL, 1, NULL, NULL),
(527, '3355', '3355 is a suburb in Bendigo, just 5 kilometres from the Bendigo central business district. The area derived its name from the Eastern Grey Kangaroos that would frequent the area inhabited by miners during the gold rush and lived in the landscapes of the local area. With the growth of the population from 3355 to 12,000 in 2016, the area has been updated to suit the community, including the addition of a sporting complex, a new ambulance station, and a new fire department. Kangaroo Flats has one primary shopping centre, which opened in 1979, with a K-Mart, Coles, and Safeway, as well as 55 other stores to keep shoppers entertained!', NULL, 1, NULL, NULL),
(528, '4306', 'With a population of approximately 400 people, 4306 is a rural locality in Brisbane known as Kholo. Located around 22 kilometres west of the Brisbane central district, the average age of a resident is 42, and the area is majority English-speaking. Described as peaceful and idyllic for those who love wildlife, Kholo has horse trails, Brisbane Forest Park and Lake Manchester Dam to boast to residents and visitors. 4306 is also known for offering bushwalking in the crisp Australian air, undisturbed by a notable lack of traffic.', NULL, 1, NULL, NULL),
(529, '2777', 'A town in the blue mountains, 2777 is located 72 kilometres west of the Sydney central business district. The area is served by ideal transport such as the railway station and bus services provided by the Blue Mountains Transport, allowing for easy access to the commercial area located around Macquarie Road. There are several festivals in the area, such as Foundation Day and Anzac Day Parade. Also, 2777 is ideally situated for visiting the Blue Mountains National Park and the Greater Blue Mountains Area World Heritage Site, both not to be missed!', NULL, 1, NULL, NULL),
(530, '6063', 'Around 9000 people live in 6063, a suburb in Perth in the City of Swan located around 12 kilometres from the city centre. The name Beechboro is from the first European landowner who inhabited the area. The suburb developed in stages through different areas, benefiting from significant capital growth, first being East Beechboro and West Beechboro, and later extended to the Timberlane Estate, Bennett Springs, and Orchid Park. 6063 is described as a multicultural suburb with fantastic, caring neighbours and attractive, affordable prices for housing!', NULL, 1, NULL, NULL),
(531, '5098', '5098 covers the suburbs of Ingle Farm and Walkley Heights, both located in the state of South Australia and around 11 kilometres away from Adelaide. Described as great starter suburbs, they are close to amenities such as the retail zone at the junction of Montague Road and Walkleys Road. 5098 is well serviced by Adelaide Metro, having undergone transportation upgrades in the past few years. Notable attractions in the area include Hope Valley Reservoir and Thordon Park Reservoir, perfect for a relaxing visit!', NULL, 1, NULL, NULL),
(532, '3147', 'A suburb with a recreation centre and a village shopping precinct, the neighbourhood of Ashburton in 3147 offer many things to do. With churches and sports facilities at your disposal, including indoor and outdoor pools, and the Malvern Valley Golf course, you can fill your days with exercise, fun and interesting activities. There are also primary schools in the area as well as a few campuses of the Monash and Swinburne Universities. And with plenty of local sports teams, you can even back your favourite and support them!', NULL, 1, NULL, NULL),
(533, '2068', '2068 covers the areas of Castlecrag, Willoughby, Middle Cove, and Willoughby North in the locality of Chatswood. Castlecrag is a suburb of historical interest as it was designed by Walter Burley Griffin and Marion Mahony Griffin, designing homes using natural stone to blend into the environment. 2068 has been described as a great suburb with a true village atmosphere, with fantastic parks and nature reserves. Areas appealing to visitors include Mowbray Point (1.2 kilometres away) and Sailors Bay (1.6 kilometres away), giving both residents and visitors something fun to do!', NULL, 1, NULL, NULL),
(534, '5032', 'Near the River Torrens, 5032 covers the area of Underdale and has just over 2000 people residing there. Depicted as offering an exceptional lifestyle package, the suburb is perfectly situated for the linear park, amenities and public transport. The homes in the area are diverse, and halfway between the city and the sea, allowing residents enough time for work and play. 5032 also boasts the Sugar Club and the Smiling Samoyed Brewery to give residents and tourists a unique experience while visiting this small part of South Australia!', NULL, 1, NULL, NULL),
(535, '2162', 'Sefton in New South Wales is located in the suburb of 2162, approximately 23 km west of central Sydney and sharing its postcode with the neighbouring suburb of Chester Hill. Both suburbs in 2162 have primary and secondary schooling in their residential areas, along with excellent transport via the Sydney trains service. Sefton has a number of sporting facilities available, including Jenson Oval and Sefton Golf Course. Chester Hill hosts a lovely shopping centre, as well as a number of parks suitable for all ages to enjoy.', NULL, 1, NULL, NULL),
(536, '2115', 'The suburb of Ermington in 2115 offers parks in abundance, such as the George Kendall Riverside Park and the Cowells Lane Reserve, in addition to churches and many schools. It is 19km away from the Sydney Central Business district, so you have access to the city centre as it’s extremely nearby. Local tennis courts and a reserve await you for those competitive, sports-filled, outdoor days. With a vibrant, busy shopping strip located on the Betty Cuthbert Avenue, you can go shopping to your heart’s content.', NULL, 1, NULL, NULL),
(537, '3103', 'Approximately 10km east of Melbourne\'s central business district lies the suburb of 3103, containing Balwyn, Deepdene, and Mont Albert North. Balwyn has been consistently ranked as one of Melbourne\'s 5 most exclusive suburbs and hosts great places of interest, such as the heritage-protected Reid Estate, and the Maranoa Gardens, one of the first botanical gardens in Australia dedicated to indigenous flora. 3103 also has a number of great transport links across the suburb and beyond, as well as great commercial opportunities and wonderful housing.', NULL, 1, NULL, NULL),
(538, '2193', 'Available to you in the Canterbury area are several shops and supermarkets, in addition to a hotel and many restaurants. There is a centre for fitness, and with such parks as Tasker Park and Canterbury, you have the freedom and fresh air to do outdoor exercise and enjoy the beautiful scenery. There are also many schools, and churches of different denominations, and the area is just 10km away from the Sydney Central Business District. The suburb Hurlstone Park is very close to Canterbury in 2193. It is surrounded by the Cooks River and provides plenty of pubs and recreational centres.', NULL, 1, NULL, NULL),
(539, '2090', 'A beautiful suburb located on the Sydney harbour, and sandwiched between Mosman Bay and Shell Cove, the Cremorne Point is home to the Cremorne Reserve – a place where you can experience spectacular views and scenery overlooking the Mosman Bay and the city. The Foreshore Walk of the 2090 area is a gem – it’s an oasis of nature in which you can have a picnic or take in the landscape and with options to take a ferry to the city and experience the best of both worlds.', NULL, 1, NULL, NULL),
(540, '4163', 'Along the coastline of the Redland City area in Queensland, the Cleveland suburb is a treasure trove of fun, exciting outdoor activities and things to do. At the Toondah Harbour, you’ll discover some of the local wildlife such as the migratory birds and turtles that live in the area – it’s a great place to birdwatch or see the best of nature. With its cultural locations and amenities that include the Redland Museum, the Redland Performing Arts Centre, and Redland Art Gallery, experience history and artistic events on your doorstep.', NULL, 1, NULL, NULL),
(541, '2218', 'Top-quality public and private schools with treelined streets and a peaceful, community atmosphere, Carlton is a neighbourhood full of tranquility. In addition to the Melbourne Business School and Melbourne Law School, you’ll find plenty of colleges and schools. There are multiple churches in the area in addition to sports clubs and facilities. But you can also grab a bite to eat in one of the many restaurants or cafés in the area, which include delicious ice creams and cakes, or relax in a bookstore. In neighbouring Allawah, you have grocery stores, takeaway shops and newsagents – all of the essential amenities in one.', NULL, 1, NULL, NULL),
(542, '3085', 'A primary school as well the Yarra Plenty Regional Library service are a couple of fundamental amenities that are offered to you in the Yallambie area. And with the Yallambie Park and being home to the Banyule City SC team you can feel part of a real community here in Yallambie. This small suburb is only 16km away from the Melbourne Central Business District and features the Plenty River, which can be found on the eastern side of the neighbourhood.', NULL, 1, NULL, NULL),
(543, '4031', 'The suburb of 4031 contains Gordon Park and Kedron, both northern suburbs of Brisbane and around 5 miles from Brisbane\'s central business district. Its schools lie primarily in Kedron and neighbouring suburbs, and both suburbs have excellent residential areas with great local restaurants providing unique service to the people of 4031. There are also a few heritage-listed sites in the area to explore, as well as transport links to and from the central business district.', NULL, 1, NULL, NULL),
(544, '5211', 'The suburb of 5211 lies 40-60 miles south of Adelaide and contains a variety of named suburbs and seaside towns; Hayborough, Victor Harbor, Encounter Bay, and McCracken. Victor Harbor is known as a popular tourist destination, and also popular with kids celebrating their final year at school. 5211 is host to Australia\'s most visited park, Granite Island Recreational Park. This park is a protected area, connected by a horse-drawn tram, and is often visited for its wildlife.', NULL, 1, NULL, NULL),
(545, '2024', 'Situated near the beach, 2024 is a suburb of Sydney located in New South Wales. The suburb is around 7 kilometres east of the Sydney central business district. There are many beautiful, natural points of interest to visit, including Bronte Beach, Nelson Bay, and Bronte Park. Here in 2024, you can participate in cliff-top walking paths and enjoy the beautiful scenery. There are a number of heritage-listed sites including Bronte House and Waverly Cemetery.', NULL, 1, NULL, NULL),
(546, '6232', 'A north-eastern suburb, 6232 is located 7 kilometres from the centre of Bunbury, close to the Collie River. It features several recreational activities including the Eaton Fair shopping centre, and a sports complex, the Eaton Recreation Centre. Primarily a residential centre, 6232 has been described as an affordable housing area for both buyers and renters. There are many lawns and playgrounds to enjoy, as well as a path along the river for a relaxing stroll.', NULL, 1, NULL, NULL),
(547, '2537', 'With a population of close to 4000 people, 2537 is on the coast of New South Wales, with heavy industries in agriculture, aquaculture and tourism. The area is known for Moruya granite, which aided the construction of significant Australian landmarks such as the Sydney Harbour Bridge. 2537 is great for residents and tourists as it offers a multitude of shops and services along the high street to entice visitors. On Tuesday afternoons and Saturdays, there are markets in the area selling fruit and vegetables which prove highly popular!', NULL, 1, NULL, NULL),
(548, '2151', '2151 covers the area of North Parramatta and North Rocks in the state of New South Wales. It is located approximately 20 kilometres north of Sydney’s central business district. There are a number of heritage-listed sites in the area, which are receiving assistance from UrbanGrowth NSW Development Corporation to help preserve the areas, such as Lake Parramatta and St Patricks Cemetery. The suburb of 2151 is described as a lovely area to live with plenty of history, and easy access to the lakes, church and restaurants, with transport available to ease your access.', NULL, 1, NULL, NULL),
(549, '2073', '2073 covers the areas of Pymble and West Pymble, both located in Sydney. The area is located approximately 15 kilometres of the Sydney Central Business District, with Pymble and West Pymble having a combined population of just under 20,000. There are several commercial areas including Phillip Mall, which was renovated in the 1990s to brighten the gardens and add additional amenities such as a children’s playground. 2073 features the significant building of Ku-ring-gai Town Hall, a stunning example of the Inter-War Spanish Mission architectural style, which is a listed building along with the Pymble chapel beside it.', NULL, 1, NULL, NULL),
(550, '3212', 'Being a quaint little town with a lot to offer makes the area of Lara in 3212 a great place to live. Boasting the essential amenities, including a butcher and travel agents, a supermarket, and many hairdressers, the community vibe of Lara is present in this neighbourhood. From coffee and cake shops to bakeries, international restaurants and well-known takeaway shops, there is something about the area of Lara that lures in many commuters, locals and visitors.', NULL, 1, NULL, NULL),
(551, '2502', 'The areas of Cringila, Lake Heights, Primbee, and Warrawong all share the postcode of 2502 in New South Wales. Areas such as Cringila are reportedly densely populated, whereas areas such as Primbee have smaller suburbs. An effort to rejuvenate the wildlife in the area has been made in Cringila Community Park, as the area is superfluous with wildlife due to the protected rainforest in the area. 2502 is located around 70 kilometres from the Sydney central business districts, and offers many amenities including hospitals, cinemas, shopping centres and malls, the perfect mix of natural and residential.', NULL, 1, NULL, NULL),
(552, '5700', 'The area of 5700 covers the areas of Miranda, Port Augusta, Port Augusta North, Port Augusta West, and Willsden, in the state of South Australia. The suburb of Miranda is a well-known commercial centre for other suburbs, located around 24 kilometres south of the Sydney central business district. 5700 offers the features of North Hummock (with an elevation of 195 metres) and South Hummock, hills in the area that are situated close by to attractions such as Moseley Park.', NULL, 1, NULL, NULL),
(553, '3137', 'The club areas and facilities of the community and sports amenities are open to you in the area of Kilsyth in the 3137 neighbourhood. Whether you’re looking for a community centre, a lake, or a children’s playground to entertain the kids, you can find them all here in Kilsyth. From a swimming club to a badminton association and a cricket club, sports and exercise are available in abundance here. There are also shopping facilities and many schools in the Kilsyth area, in addition to reserves and parks of a huge variety.', NULL, 1, NULL, NULL),
(554, '6008', 'Referred to by locals as Subi, 5700 is an inner west suburb of Perth. While it used to be predominantly occupied by working-class families, since the 1990s it has been part of an urban development product to revitalise it. Significant landmarks of interest include features such as the Subiaco Oval and the Subiaco Arts Centre. 5700 also features homes built with elaborate leadlight window architecture. Every year there is a boutique street festival, proving popular with locals and tourists alike!', NULL, 1, NULL, NULL),
(555, '2766', 'A beautiful nature reserve, park and gardens all in one – the Nurragingy Reserve awaits you in the area of Rooty Hill 2766, but you’ll also discover that there are many other parks such as Angus Park and May Cowpe Reserve. In this location, there are also churches of various denominations and a shopping area. The area of Eastern Creek, on the doorstep of Rooty Hill, offers you the Sydney Motor Sports Park, and the urban Western Sydney Parklands.', NULL, 1, NULL, NULL),
(556, '2299', 'Located 8 kilometres away from Newcastle’s central business district, 2299 is a suburb in the state of New South Wales. Originally the area was a coal mining town, with features such as churches, a music hall, and a post office. Famously, 2299 is the location of the first organised soccer match played in Australia, between the miners of Lambton and Weston. The colliery was closed in the late 1950s and now the area is covered with housing for the 5000 people residing in the area.', NULL, 1, NULL, NULL),
(557, '3556', 'Once a gold mining town, the Eaglehawk neighbourhood has transformed and now provides sporting facilities and schools to locals and settlers. Canterbury Park offers croquet and bowling spaces and contains the Bendigo Leisure centre in which you can go swimming, play squash and try to make a birdie on the golf course! The Star cinema is available too, and the town even has a yearly held arts festival in addition to the Annual Canterbury Carols.', NULL, 1, NULL, NULL),
(558, '7315', '7315 is situated on the northern coast of Tasmania, with a population of almost 15,000 people. The area has undergone substantial improvement by the Central Coast Council to improve the area to tourists, such as adding a new basketball stadium, the Schweppes arena, and the Leven bridge. A notable sight of interest is the war memorial clock tower in the area. 7315 also added a walking track open to the public between Turners Beach and Ulverstone to encourage residents to get out and about in nature!', NULL, 1, NULL, NULL),
(559, '2177', 'The plans to renovate Bonnyrigg through housing developments mean that the population of this area is likely to increase by 2022. In the location of 2177, you’ll find a shopping area, a few Asian businesses and public and private schools. Bonnyrigg is just 36km away from the Sydney central business district, but closer to home, you’ll find Bonnyrigg Heights, in which there are also a few schools and a local garden centre.', NULL, 1, NULL, NULL),
(560, '2902', 'Not only are there a range of public and private schools in the area of Kambah, but you will also find a real community with tonnes of things to do. In 2902 location there are various churches, a tennis club, and playing fields in addition to a pony club and a BMX park which provide activities and events for the entire family. With landscape features such as the Village Creek Valley, the closeness of the Murrumbidgee River as well as the many hillsides, you’ll feel tranquility and peace in this nature-filled neighbourhood.', NULL, 1, NULL, NULL),
(561, '2135', 'Shops and restaurants, churches and schools – are just a few of the amenities available to you in the Strathfield location. The educational institutions of the 2135 area range from public to private and even university-level facilities, with the area boasting a campus of the Australian Catholic University. The neighbouring suburb of South Strathfield offers plenty of cycle paths, reserves and parks such as Dean Reserve and the St Anne’s Reserve, the latter is bordered by the Cooks River which is home to an abundance of wildlife.', NULL, 1, NULL, NULL),
(562, '4878', 'Barron, Holloways Beach, and Smithfield are just some of the areas covered by 4878, in the locality of North Queensland. The area boasts some beautiful coastal regions including Holloways Beach and Machans Beach, both popular spots for locals and tourists. 4878 has been described by residents as a fantastic area with a great location to the city of Cairns (around twenty minutes away). The area has a reputation as being a safe neighbourhood, letting many residents explore with ease and peace of mind.', NULL, 1, NULL, NULL),
(563, '3207', 'A diverse suburb with coves and fishing points, sports teams and excellent transport links, the area of Port Melbourne is a great place to live or visit. Having increasingly developed into a more residential and commercial neighbourhood, the area has seen Bay Street become a main shopping area. But there are also other commercial locations in Beacon Cove, which include cafes, restaurants, and a fitness centre with tennis courts and swimming pools. The fishing points can be found at Fishermans Bend, which contains the Westgate Park Reserve.', NULL, 1, NULL, NULL),
(564, '5097', '5097 covers the areas of Redwood Park, Ridgehaven, and St Agnes, located in Adelaide. The area has a number of interesting reservoirs to visit including Hope Valley Reservoir, Thordon Park Reservoir, and Kangaroo Creek Reservoir, all located within 10 kilometres of the area. Described as ideal for all ages, the area has reasonably priced houses with plenty of amenities such as playgrounds. 5097 has also been described as an easy commute to work, meaning it is a desirable location for all ages.', NULL, 1, NULL, NULL),
(565, '4105', 'In the locality of Underwood Central, 4105 is home to Clifton Hill, Moorooka, Moorvale, Tennyson, Yeerongphilly. Located around 5 kilometres from the Melbourne central business district, the area of Clifton Hill is gradually becoming more expensive to reside in and is now considered one of Melbourne’s most liveable suburbs. Notable attractions within 4105 include Mount Gravatt, Mount Thompson, and Pine Mountain, which offer nature experiences for residents and tourists alike.', NULL, 1, NULL, NULL),
(566, '4128', 'A residential location that boasts beautiful bushland and forest, plenty is on offer at Shailer Park. Check out the Logan Hyperdome shopping centre which is what caused the Government of Queensland to name the 4128 suburbs as a major centre of activity. In this area, you’ll also find the Tanah Merah neighbourhood, which is close to Shailer Park. Tanah Merah offers a children’s playground and a small caravan park, locations that are perfect for outdoorsy activities. You might even spot a wallaby or koala in this area!', NULL, 1, NULL, NULL),
(567, '6057', 'A suburb of Perth, 6057 is situated at the base of Darling Scarp, east of the Perth central business district. The suburb is large with a population of over 12,000 people and is experiencing continued population growth. There are several amenities in the area including parks and reserves such as the Scott Reserve and the Flemming Reserve. Transport is excellent in 6057, serviced by Transperth bus services, and a new railway station High Wycombe station which will provide access to the airport.', NULL, 1, NULL, NULL),
(568, '3185', 'The Elsternwick Park, the Elsternwick Hopetoun Gardens, and the popular shopping strip located on the Glen Huntly road are all amenities that you should visit if you’re n the 3185 location. But there are also private schools and a state school, in addition to many recreational sports and clubs including the Elsternwick Cricket Club and the Croquet Club which appeal to those who enjoy sporting activities. Gardenvale occupies the same postcode as Elsternwick Park and is a mere 10km away from the Melbourne central business district.', NULL, 1, NULL, NULL),
(569, '3197', 'Situated 17 kilometres southeast of Melbourne’s central business district, 3197 is a suburb in Melbourne with around 10,000 residents. The area expanded following the Second World War, with many residents choosing to build their own houses in larger house blocks like Oakleigh South. Amenities include the Mavis Hutter Reserve, which features outdoor gym equipment and a playground. The area hosts Melbourne’s famous Sandbelt, which has three private golf clubs. The oldest ice rink is also located in 3197, the Olympic Ice-Skating Rink!', NULL, 1, NULL, NULL),
(570, '6233', 'With a residential population of just shy of 15,000 people, 6233 is located in Western Australia. The town is 12 kilometres from Bunbury’s central business district and is bordered to the south and east by rivers. Transport in the area is provided by Transbury, with the 841-bus route in the area. The central amenities of 6233 are the Australind Village Shopping Centre, containing specialty stores, and the Treedale shopping centre. There is also an 18-hole Bunbury Golf Club, which hosts the South West Open tournament every year in June!', NULL, 1, NULL, NULL),
(571, '2212', 'Surrounded by the areas of Revesby Heights, Padstow, and Condell Park, the Revesby suburb can be found 22km away from the Sydney central business district. It is a residential suburb that contains an expanding shopping area, cafes, restaurants and supermarkets. A prominent feature of Revesby is the Revesby Workers’ Club, a spot that you can use as a venue for entertainment, leisure and dining. You can also enjoy the monthly-held local arts and crafts fair at Abel Reserve. And in the Revesby Heights location, you will find a boy’s secondary school as well as the Revesby Heights Junior Rugby League Football Club.', NULL, 1, NULL, NULL),
(572, '6052', 'There are plenty of restaurants, cafes and eateries in the area of Bedford serving up delectable food. And if you’re looking to unwind, rest and relax, you could book a session in the Natures Hideaway Day Spa, which has received many positive reviews. The Morley area is known as being home to the second largest shopping area in the Perth location – the Centro Galleria. You can also make use of the many recreation centre facilities and take part in a range of sports including basketball, soccer, badminton or rollerskating.', NULL, 1, NULL, NULL),
(573, '6023', 'With an array of areas that feature bushland and parks, Duncraig is a location for those who love the outdoors. But it also provides numerous shopping centres, including Carine Glades and Glengarry if you are more of a retail fan. These shopping centres even contain taverns that serve up pub grub, the perfect food to enjoy after spending the day shopping. The affluent neighbourhood of Bellevue Hill is located close to Duncraig, providing tree-lined streets and expensive dwellings. You can also find private schools, a small shopping centre and various sports clubs and parks.', NULL, 1, NULL, NULL),
(574, '2023', 'Located beside the harbour, 2023 is a suburb of Sydney in the Municipality of Woollahra. It is located in an incredibly affluent area, being named the most expensive suburb in Australia in 2018. A median house price for the area is reported at $5.4 million, with the highest taxable income averages in Australia. The real estate of 2023 is incredibly exclusive, with houses in the area selling for sums as much as $60 million in the case of the Rona estate. Other notable houses include the historic Queen Anne home Caerleon (sold last for $22 million) and Ginahgulla, also known as Fairfax House.', NULL, 1, NULL, NULL),
(575, '4124', 'Covering the areas of Boronia Heights, Greenbank, Lyons and New Beith, 4124 is in the locality of Underwood Central, located around 30 kilometres away from Brisbane. The area features many natural reserves such as Spring Mountain and Bundamba Lagoon. A notable sight of flora and fauna in the area is a location of parkland and water originally named The Platypus Pools and Bracken Way. This section of 4124 features a variety of wildlife including the platypus, the rare black cockatoo, and kookaburras. This strip also provides great recreational activity, casual strolls, and horse and bike riding!', NULL, 1, NULL, NULL),
(576, '2030', 'Situated on the coastline of the Tasman Sea, 2030 is an eastern suburb of Sydney, located around 9 kilometres east of the Sydney Central Business District. Primarily a residential suburb, many properties boast views of iconic landmarks such as the Sydney Harbour and the Sydney Harbour Bridge. The Dudley Page Reserve in 2030 is a popular location for weekend visitors, who like to enjoy the sunset and partake in picnics. Dover Heights is believed to have its name derived from the cliffs in Dover, Kent, due to a resemblance.', NULL, 1, NULL, NULL),
(577, '5011', 'Covering all areas of Woodville including Woodville Park, Woodville South, and Woodville West in South Australia. Located around 8 kilometres northwest of the Adelaide central business district, Woodville is home to a population of just over 2000 people. Local residents have described the area as a nice area, with considerate neighbours. 5011 is described as safe and pleasant, located close to amenities such as the Queen Elizabeth Hospital. Attractions include Point Malcolm and Garden Island, all less than 10 kilometres away.', NULL, 1, NULL, NULL),
(578, '4066', 'A private hospital and reliable, local transport are two essential amenities that you’ll find in the suburb of Auchenflower. You can also grab a bite to eat in the restaurants and cafes in the 4066 area. Here you are just 2.5km away from Brisbane\'s central business district, and the area of Toowong is also very close. Toowong has a huge array of things to enjoy, including several parks, a swimming pool and a library. The area is also home to football and rugby clubs, in addition to a vibrant shopping centre.', NULL, 1, NULL, NULL),
(579, '6024', 'Delicious Thai and Malaysian food, newsagents, and businesses – these are the many offerings of Greenwood in 6024. Not only can you feast on delectable dishes, but you can also access a supermarket, a 24 hour leisure centre and gym and a greengrocer. And you can even visit the local reserves and parks in the area, which include a golf course, a children’s playground, and an outdoor basketball facility. There are several churches in the area and the neighbourhood is served by local buses and rail.', NULL, 1, NULL, NULL),
(580, '3123', 'Being home and headquarters to some of the largest, Australian companies such as Bunnings and Coles, Hawthorn East is a hive of activities. Open green spaces include the Fritsch Holzer Park which is a great spot to do recreational and sporting activities, but the Cato Park and Victoria Road Reserve also attract locals, while from Anderson Park you can experience views of the busy Melbourne Central Business District. There are tram and train transportation links available to you in the 3123 area in addition to multiple primary and secondary schools.', NULL, 1, NULL, NULL),
(581, '2256', 'On the shoreline of the Central Coast area of New South Wales, you’ll find the area of Woy Woy in 2256. Primarily a residential area, the Woy Woy location has many cultural events and festivals that include The Brisbane Water Oyster Festival, the plays and performances of the Woy Woy Little Theatre Company among others. There are a few restaurants and cafes that can be found on the Woy Woy waterfront, and if you want to venture a little further out, you can use the ferry link that will take you to Davistown.', NULL, 1, NULL, NULL),
(582, '4171', 'The area of Hawthorne contains several amenities to enjoy – you can watch a great movie in Hawthorne Cinema Complex, get some fresh air in the multiple parks of the area and rely on the good public transport services that Hawthorne offers. It is well connected to surrounding areas and only 6.5km away from the Brisbane central business district. The suburb of Bulimba is extremely close and features various sports and clubs, a public library and some good cups of coffee in its local cafes.', NULL, 1, NULL, NULL),
(583, '6009', 'A notably affluent suburb of Peth, 6009 is located around 7 kilometres from the Perth central business district in Western Australia. The area offers a variety of housing for residents including wealthy homes, student accommodation, a golf club, a commercial area, and The Lions Eye Institute. A notable feature of the area is The Peace Memorial Rose Garden on the Stirling Highway, which is a touching tribute to the lives lost in war, first developed in the 1940s. 6009 has excellent service links, such as the CircleRoute bus service.', NULL, 1, NULL, NULL),
(584, '4505', '4005 covers the areas of Burpengary and Burpengary DC in the locality of Northgate North. The suburb is one of the fastest-growing in the area, with a population of just under 15,000 people. There are several major retailers in the area including Kmart, Coles, and ALDI, and the area is 35 kilometres from the Brisbane central business district. The name of 4505 derives from the aboriginal word meaning the ‘place of the green wattle’. Previously a blue-collar suburb, the area is now home to more families due to the economic growth of the area.', NULL, 1, NULL, NULL),
(585, '2097', 'Covering the areas of Collaroy, Collaroy Beach, Collaroy Plateau West, Long Reef and Wheeler Heights, 2097 is in the locality of Warringah. Collaroy is commonly referred to as ‘the Roy’ by resident and is located within close distance of the beach. There are several commercial areas in 2097, including shopping precincts like that along Pittwater Road. Wheeler Heights features some notable places of interest including Jamison Park, and the Narrabeen Lagoon Trail, the latter allowing paths for bushwalkers, cyclists and joggers.', NULL, 1, NULL, NULL),
(586, '2203', 'A mere 7.5km away from the Sydney Central Business District, the area of Dulwich Hill is a suburb in the 2203 area. Providing retail areas in abundance, restaurants, cafes and businesses too, the area has plenty to offer. Schools and churches of an array of denominations are available to you, in addition to a public library. For transport, the Dulwich Hill Railway Station provides links to Lidcombe, Liverpool, and Bankstown, but you can also use the local buses to access the nearby neighbouring suburbs.', NULL, 1, NULL, NULL),
(587, '3224', 'An Australian rules football club – the Lions, the many luxury facilities of the Leopold Sportsman Club and the beautiful Lake Connewarre are all available to you in the area of Leopold. Here, you can also find three educational institutions for children as well as tasty food in local restaurants and cafes. The location is growing residentially, with housing developments and constructions having nearly been completed. The Bellarine Rail is also available, which is a path or track on which you can cycle or go for a stroll.', NULL, 1, NULL, NULL),
(588, '4054', '4054 has a population of just under 7000 and has a rich history, with the name deriving from a Yuggera word meaning ‘young man’. By road, it is 12.4 kilometres west of Brisbane, and it is also serviced by a newly built railway line. The median age of 4054 is 37, the same as the national Australian average. There are several amenities in the area, such as a 27-hole championship golf course, Great Western shopping centre, and a vegetative area known as the Keperra Bushland, perfect for picnics!', NULL, 1, NULL, NULL),
(589, '2047', 'The Drummoyne location is home to many amenities, features and plenty of things to do. In addition to a vibrant shopping mall (the Birkenhead Point Outlet Centre), various churches of different denominations, and an Olympic-sized swimming pool you’ll find a pedestrian and cycling route that extends for 7km around the nearby suburbs. There are schools in this area and various clubs and sporting events, including the Drummoyne Rowing Club and the Drummoyne Rugby Club. The 2047 location is also bordered by the Parramatta River on three sides.', NULL, 1, NULL, NULL),
(590, '6450', 'A town on the Southern Ocean coastline with major industries of tourism, agriculture and finishing, 6450 has a population of around 12,000 people. The area features the only port available in the southeast of Western Australia, known as the Esperance Port, which underwent renovations costing $54 million in the early 2000s. 6450 boasts numerous gorgeous sandy beaches for tourists and residents, offering swimming, scuba diving and surfing. A notable attraction of 6450 is the Pink Lake, named for the pink tint in the water due to the red algae residing there!', NULL, 1, NULL, NULL),
(591, '3039', 'In Moonee Ponds, you’ll find the scenic Queens Park, a picturesque area with artistic public pieces, majestic trees and a tranquil lake that local wildlife and birds have made their home. The park also contains the Moonee Ponds Bowling Club and the Queens Park pool. Also located in the 3039 area is the Moonee Valley Racecourse – home to horse racing in the area. The Puckle Street shopping area features plenty of cafes, shops and restaurants, and it is easy to get around with transport links such as rail, local bus routes and cycling paths.', NULL, 1, NULL, NULL),
(592, '2029', 'Just 7km away from the Sydney central business district, the area of Rose Bay is located in the New South Wales area. This location boasts views of the Sydney Harbour Bridge in addition to the famous and world-renowned Sydney Opera house. With an array of sporting events such as the National Rugby League and Woollahra Golf club, you’ll feel right at home here in 2029 if you are a sports lover. And for those who own a dog, you can go for walks and take in some sea air at Rose Bay beach, which is a also popular place to go swimming.', NULL, 1, NULL, NULL),
(593, '3975', 'You have the Melbourne central business district in close proximity to the 3975 area – it’s located just 36km away from Lynbrook. The Lynbrook area is serviced by the Lynbrook railway station and also has a real community feel as it boasts the Lynbrook Community Centre. The Lyndhurst Football and Netball Club is another recreational feature located in the area, and you can also find a local shopping centre in Lynbrook. With primary schools and the Banjo Paterson recreation reserve, the area provides something for everyone.', NULL, 1, NULL, NULL),
(594, '2222', 'The main shopping mall can be found near the Penshurst railway station in the 2222 location, but the area also offers the Penshurst RSL social activity club, and a museum that features video games. For this reason, as well as the fact that there are many schools in the area, the Penshurst area is great for children. Also in the 2222 location, you’ll find plenty of places of worship, in addition to recreational and sporting areas such as the Aquatic Centre, local tennis courts, a cricket club in addition to the many leafy green parks.', NULL, 1, NULL, NULL),
(595, '6076', 'Some of the areas covered by 6076 include Bickley, Kalamunda, and Walliston in the locality of Curtin. As a whole, the area is growing in popularity, described as a great suburb for families with children. A notable attraction of the area is the Perth Observatory, which was previously located in West Perth, and is now located in Bickley. Many of the areas are located close to the Darling Scarp, along cliff that has been used for many years for stone quarries, forestry and bauxite mining.', NULL, 1, NULL, NULL),
(596, '2134', 'Being just 10km away from the Sydney central business district means that in 2134 you can access the many offerings of Burwood while having the city on your doorstep. And there are many things to do in the Burwood location including going shopping in the main shopping strip, taking in the fresh air and idyllic scenes in Burwood Park, having access to a playground and listening to the Christmas carols during that special time of year. You can easily travel around to neighbouring areas by railway and local bus services.', NULL, 1, NULL, NULL),
(597, '2284', 'In New South Wales, 2284 covers several areas including Argenton, Boolaroo, and Teralba in the locality of Hunter. The area has many beautiful natural features including the Myall Lakes National Park, which has one of the largest coastal regions (Myall Lakes) and offers over 40 kilometres of beaches, which is one of the most popular visiting spots around! Other interesting attractions include Boughton Point and Dewey Point, both around 6 kilometres away!', NULL, 1, NULL, NULL),
(598, '2022', 'An area that has gone through many developments in the recent past, Bondi Junction now features many residential changes, an increase in transport networks, and various other amenities and services. You\'ll notice the commercial area that provides plenty of retail shops. It is known as one of the biggest shopping areas in the metropolitan area of Sydney. The 2022 area is also renowned for its rugby league club – the Sydney Roosters, or the Eastern Suburbs District Rugby League Football Club. If you need to get around, there are plenty of transport links in the area too.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(599, '2127', 'A suburb on the western shore of Homebush Bay, 2127 is located just 15 kilometres west of the Sydney Central business district with a population of around 7000 people. Much of the suburb is reclaimed land, now featuring notable amenities such as Marina Square shopping centre with over 40 shops, and cycle paths extending through the Sydney Olympic Parklands. Much of 2127 is serviced by bus to transport residents around, which a proposed light rail to be built in the area.', NULL, 1, NULL, NULL),
(600, '3041', 'Adjacent to Essendon Airport, 3041 has a population of around 3000 people. It is situated just 10 kilometres north of Melbourne’s central business district, with the local government residing in the city of Moonee Valley. 3041 has been described as one of the fastest-growing areas around, offering a balanced lifestyle to inhabitants. Residences vary from houses to apartments, to multi-storey buildings to ensure something for everyone! It has a notable family friendly vibe with numerous parks and family activities to enjoy.', NULL, 1, NULL, NULL),
(601, '2107', 'A stunningly serene beachside suburb, 2107 is part of the Northern Beaches region in Sydney. Located 37 kilometres north of the Sydney central business district and with a population of around 10,000 people, it offers something for everyone. Named for the final resting place of King Arthur, 2107 now boasts numerous commercial areas such as clubs, supermarkets, cafes and cinemas, as well as heritage-listed sites for visitors with a historical interest. Avalon Beach is famous for surfing, also featuring famous orange-coloured sand!', NULL, 1, NULL, NULL),
(602, '4133', 'A suburb in Logan City, 4133 has a number of heritage listed sites including the Waterford State School and includes the woodlands Estate. It is popular with singles and professionals, with a median age of 33, and noted for its aesthetically pleasing residential atmosphere. There are many parks and walkways for residents to enjoy in 4133, and house prices are affordable. Amenities in the area are excellent, with considerate neighbours and great views as an added bonus!', NULL, 1, NULL, NULL),
(603, '6010', '6010 is a western suburb of Perth situated on the north bank of the Swan River. Areas of interest include the Claremont Oval, the Claremont Showground, and also the heritage-listed site the Claremont Post Office. A strip of bars and pubs great for nightlife activities can be found between Bayview Terrance and Gugeri Street, offering excitement to residents and tourists alike. 6010 is also reported to be in the heart of the suburbs, with the perfect location for those with an active lifestyle!', NULL, 1, NULL, NULL),
(604, '3107', 'With a shopping centre and two beautiful leafy parks that track for strolling, you can access the best of both worlds here in Lower Templestowe. You can even go swimming in the Yarra River or choose to take part in the exhilarating sport of rafting! There is a hotel as well as a primary and a secondary school, and the area is well serviced by local buses. The 3107 area also contains the Ruffey Creek and the Ruffey Lake Park, a lush green gem of a place in which you can connect with nature.', NULL, 1, NULL, NULL),
(605, '2525', 'An indoor shopping centre with two storeys, a park that features sporting facilities, a mini sculpture garden and a health centre for babies are available in Figtree. You’ll also find an additional few food stores and a commercial area with an array of services and goods in the area. 2525 also provides a hotel and a private hospital, in addition to various schools and a dog park, making it a great area for families. It is also home to the Figtree Junior Soccer Club – a successful, large club with a stadium that is used by Collegians Rugby League.', NULL, 1, NULL, NULL),
(606, '6102', 'Home to the central campus of the Curtin University of Technology, 6102 is also located 8 kilometres away from Perth’s central business district. The area has a number of education centre including colleges, a senior high school and a university, which has attracted many international students to the area, 25% from East or South-East Asia. There are also many other amenities in 6102 such as restaurants, The Bentley Centre shopping mall, and a range of bus services to help residents get around.', NULL, 1, NULL, NULL),
(607, '6172', '6172 is home to Port Kennedy, located in the city of Rockingham. The area is situated on a unique wetland formation referred to as the Becher Wetland Suite, which forms linear patterns rather than circular. It offers bot affordable housing and rental options, and is attractive compared to house prices in Perth. A mixed suburb, 6172 caters to all ages, and is part of the Rockingham Lakes Regional Park, giving residents and tourists plenty to do!', NULL, 1, NULL, NULL),
(608, '5087', 'A suburb in Adelaide first settled by German immigrants and named after a Prussian village, 5087 is now home to a population of around 6000 people. There are several bus routes in the area that provide easy access to the central business district and neighbouring suburbs. 5087 also boasts the Torrens Linear Park, a stunning area that follows the hills to the coast, the first of its kind to be developed. Residents have described 5087 as a lush, green area with many trees perfect for daily walks.', NULL, 1, NULL, NULL),
(609, '2173', 'A residential suburb with plenty of amenities such as shopping centres and nature hotspots, 2173 is home to around 9000 people. Located just 30 kilometres southwest of the Sydney central business district, the area is known for its strong community feel, offering events such as an annual Easter Egg Hunt and Christmas carolling. Points of natural interest in 2173 include Wattle Grove Park and Australis Park, where many residents are seen strolling with their families!', NULL, 1, NULL, NULL),
(610, '5013', 'With the exception of light industry to the south, the area of 5013 is a primarily residential suburb in Adelaide. Located about 10 kilometres away from the Adelaide central business district, the suburb is inhabited by under 4000 people, with the majority of the population over the age of 25. The largest park in the Pennington area is situated in 5013, as well as the Pennington Oval. Transport links are provided by the Adelaide Metro, as well as a series of convenient roads to keep the area connected.', NULL, 1, NULL, NULL),
(611, '4210', 'The city of Gold Coast, 4210 is inhabited by almost 12,000 people. Bordered to the west and north by the Coomera River, it can only be crossed by using the causeway. Interesting attractions in the area are the Warner Bros. Movie World theme park and Wet’n’Wild Water World, both within the boundaries of Oxenford. 4210 is rated as one of the best suburbs in the area due to the greenery and community feel, including a neighbourhood watch group to keep the suburb safe!', NULL, 1, NULL, NULL),
(612, '3055', 'Home to Brunswick Cricket Club, Brunswick West provides many interesting and fun things to do for its locals and visitors. Open green spaces such as the reservations near the Moonee Ponds Creek provide lush and leafy areas in which you can take part in sporting activities. Also, you’ll find the Dunstan Reserve with its two ovals, in addition to various other smaller reserves scattered throughout this location. There are a few primary schools in the area of Brunswick West, and you can also find commercial areas and shopping strips here too.', NULL, 1, NULL, NULL),
(613, '4159', 'Cricket and rugby clubs, a scout group, and reliable access to surrounding nearby areas via good transport links are available to you in the location of Birkdale. Birkdale is a suburb on the coast and its neighbouring locations include Thorneside and Alexandra Hills. In addition to the primary schools in the area, you will also discover housing in a canal-style development called Aquatic Paradise, and there is also a shopping area located in close proximity.', NULL, 1, NULL, NULL),
(614, '3125', 'Located just 14km away from the Melbourne central business district, Ashwood is a suburb in Victoria offering an array of essential amenities and outdoor activities. From the Ashwood shopping centre strip, to the various schools and preschools located in the area, Ashwood provides something fun for everyone. There are also many parks, reserves and trails, including Salisbury Reserve, the Ashwood Reserve on Gardiners Creek and a cycle path that runs through this location.', NULL, 1, NULL, NULL),
(615, '3106', 'Being just 16km outside of Melbourne’s central business district in Templestowe is a real benefit – you have the city in close proximity, and you can enjoy the many attractions that this suburb offers. From big shopping malls to parklands you’ll have a blend of the rural and urban features available to you here. With an array of state schools in this location, as well as sports clubs such as the Australian Rules Templestowe Dockers, the Bulleen Templestowe Amateur Football Club and the Manningham United FC team, this is an area for families and sports enthusiasts alike.', NULL, 1, NULL, NULL),
(616, '5062', 'A notably green suburb with several hills, 5062 is a suburb in Adelaide, located 8 kilometres southeast of the city centre. The suburb is notably affluent, containing several of South Australia’s most expensive houses, several designed in the beautiful Georgian Revival architecture style that appeals to residents. 5062 has been described as a suburb ripe with opportunity, located close to all hubs of life and activity. Attractions include Torrens Park and Leawood Gardens, great for visiting!', NULL, 1, NULL, NULL),
(617, '5082', 'Located just 5 kilometres away from Adelaide city centre, 5082 Is home to around 13,000 people. Notable attractions in the area include the sports centre the Prospect Oval, and a number of serene parks including Soldier’s Memorial Garden, which is the largest park in the area. Here, there are open field spaces, playgrounds and a community garden for residents and visitors alike to enjoy. 5082 is a safe area with plenty of shopping options to enjoy!', NULL, 1, NULL, NULL),
(618, '3034', 'Avondale Heights, located just 11km away from the Melbourne central business district, is surrounded by the Maribyrnong River – a spot with a cycle trail along which is perfect for exercising and outdoor activities. If you’re more of a shopper, there are more than 60 shops here, offering goods and merchandise. For transport links, you have many local buses that run in this suburb. There are various sports teams in the area including the Avondale Heights Soccer Club. The Avondale Heights Basketball Team and the Avondale Heights Cricket Team. Take your pick!', NULL, 1, NULL, NULL),
(619, '2305', 'Being just 9km away from the central business district of Newcastle in New South Wales means that in New Lambton Heights you can reap the rewards of the city as well as everything that this leafy green gem of a suburb. Featuring indispensable amenities such as a hospital complex that includes services for children and a primary school the small 2305 area is good for families. This location also contains native, majestic trees as well as the Blackbutt Nature Reserve. In fact, you’ll discover lots of picnic locations and trails for hiking in this area, as well as native wildlife.', NULL, 1, NULL, NULL),
(620, '2224', 'Well known for its stunning waterfront features, 2224 is a suburb in Southern Sydney that covers the areas of Kangaroo Point, Sylvania, Sylvania Southgate, and Sylvania Waters. While the area is primarily residential, it has some delightful areas of native bushland, as well as commercial developments to provide essential amenities to residents. Some of the shopping areas of 2224 include Sylvania Shopping Village, Sylvania Shopping Centre, and the Richmond Centre, and there is a multi-purpose function centre named Doltone House.', NULL, 1, NULL, NULL),
(621, '2300', 'Covering the areas of Bar Beach, Cooks Hill, Newcastle, Newcastle East, and The Hill, 2300 is located incredibly close to Newcastle’s central business centre, around a kilometre away. In Bar Beach in particular, there are several local heritage-listed landmarks including the Cooks Hill Surf Life Saving Club and Memorial and the Empire Park Bowling Club Fence. Many of the properties in 2300 are designed in an art deco architectural style that is incredibly appealing to residents!', NULL, 1, NULL, NULL),
(622, '2298', 'Situated 6 kilometres from Newcastle’s central business district, the Georgetown in 2298 derives its name from the previous landowner of the area, George Moate, as Moate Street is located centrally in the suburb. A primarily residential area with affordable housing, it provides its population of around 2000 residents with easy access to amenities such as schools and shops. 2298 also covers the nearby suburbs of Waratah and Waratah West, all in the locality of Hunter.', NULL, 1, NULL, NULL),
(623, '5048', 'Located by the beautiful Australian coast, 5048 is home to just over 3000 residents. The area offers many essential properties with a view of the Gulf of St Vincent. It is serviced by the Seaford railway lines well as several routes connecting to the Adelaide central business district. Notable landmarks of 5048 include the Brighton Road Oval and Townsend House. 5048 is regarded as a safe neighbourhood ideal for beach lovers, with the main city just 20 minutes away by train!', NULL, 1, NULL, NULL),
(624, '2138', 'Covering the suburbs of Concord West, Liberty Grove and Rhodes, 2138 is in the locality of Parramatta in New South Wales. It is located around 16 kilometres away from the Sydney central business district and has a combined population of around 20,000 people. Liberty Grove in particular has a number of attractive amenities such as swimming pools, gymnasiums, village green and parks and shops. There is also the Rhodes Waterside shopping centre that is serviced by the Northern line train station and several bus routes. 2138 also has a number of heritage-listed sites including Thomas Walker Convalescent Hospital Buildings and the Yaralla Estate.', NULL, 1, NULL, NULL),
(625, '2774', 'Situated in the Blue Mountains, 2774 is a suburb in New South Wales. It has an altitude of 234 metres and is home to around 7500 people as of the 2016 census. The area offers Blue Mountain Walking Tracks within the heritage-listed site of Blue Mountains National Park, which allows residents and visitors alike to explore nature. 2774 features a railway station called the Blaxland Railway Station as part of the Blue Mountain Line. The commercial area received significant work meaning there are a number of shops in the area to visit.', NULL, 1, NULL, NULL),
(626, '5041', 'Colonel Light Gardens, Cumberland Park, Daw Park, Panorama and Westbourne Park are all situated in 5041. It is situated around 7 kilometres from the Adelaide city centre. Colonel Light Gardens is known as a garden suburb, with tree-lined wide streets and bungalows styled in the post-war architecture. Westbourne Park has a number of transport links including the Adelaide Metro’s railway line and a number of bus routes. Residents describe 5041 as a beautiful area with a family-friendly feel, with Colonel Light Gardens in particular named the state’s most in demand postcode by The Advertiser!', NULL, 1, NULL, NULL),
(627, '6208', '6208 encompasses several areas including Fairbridge, Meelon and Oakley. Located on the north bank of the Murray River, North Yunderup is home to a small population of under 1000 in 6208. The area is situated in the locality of Brand, and has many tourist attractions including the Nine Mile Lake, which has an elevation of 6 metres, and Lake Mealup, both of which are under 13 kilometres away. Fairbridge in 6208 is a site of historical interest due to it hosting a Former Farm School for migrant children, which has since been transformed into a site for education, school camps and tourism purposes.', NULL, 1, NULL, NULL),
(628, '7008', 'Considered to be Hobart’s oldest suburb, 7008 was historically inhabited by some of the wealthiest citizens. Now, the area is an inner-city residential suburb with a population of around 6000 people, located 4 kilometres from Hobart’s central business district. The area has interesting architecture, with many homes constructed with Federation-style homes, as well as Colonial, Art Deco and Italianate builds. 7008 is also well connected to other areas through a cycleway and several roads including the Brooker Highway.', NULL, 1, NULL, NULL),
(629, '2027', 'Situated beside the beautiful Sydney harbour, 2027 is an eastern suburb, located around 4 kilometres east of the central business district. The suburb is considered highly desirable to reside in due to the expensive and exclusive real estate, making it one of the most prominent Australian suburbs. There are numerous landmark buildings in 2027, including Craigend, a large stately home built in the Moorish and Art Deco architectural style, and Carthona, one of the most valuable properties in Sydney. During the Sydney 2000 Olympics, many of the sailing events were hosted at Darling Point!', NULL, 1, NULL, NULL),
(630, '4213', 'The 4123 area covers several suburbs such as Austinville, Bonogin and Tallai in the Gold coast Locality. Austinville in particular has a small population of under 400 people and is home to a large conservation area that regrew after the end of banana farming. Attractions in the area include Bally Mountain, offering a beautiful nature trail with a length of 5.8 kilometres. 4213 is also situated near Mount Wunburra, which has a beautiful and scenic view once you reach the top!', NULL, 1, NULL, NULL),
(631, '4005', 'If you are in the New Farm location, not only do you have the Brisbane central business district practically on the doorstep, you have an array of essential services and enjoyable things to do in this suburb. From local primary schools, a main commercial area in addition to a large range of businesses, the 4005 location is packed with amenities and is a hive of activity. Once a power station for tramways, the Powerhouse has become a popular performance and arts location, and there is also a public library in the area. Getting around is a breeze, you can take the bus to nearby locations, and there are also ferry services.', NULL, 1, NULL, NULL),
(632, '3250', 'A city on the small side that lies on the Lake Colac shoreline, Colac is a location with lots to offer despite its petite size. If you’re in the area, visit Lake Colac and take the chance to go water skiing or fishing. In addition to the outdoor activities, there are multiple primary and secondary schools in the area, and you’ll find the beautiful Colac Botanic Gardens here too. Featuring natural volcanic plains means that the 3250 area is home to the biggest perpetual salt lake – Lake Corangamite, and the Red Rock Reserve, a volcano, is also in the area.', NULL, 1, NULL, NULL),
(633, '7050', 'On the outskirts of Hobart, 7050 is home to just over 10,000 people and is considered one of the fastest growing regions within the state of Tasmania. There are several commercial areas within the suburb, such as the Kingston Town Shopping Centre and Channel Court Shopping Centre. The area is desirable to residents due to its proximity to the Hobart central business district. There is also the Kingston Plaza to visit. 7050 is home to the national headquarters of the Australian Antarctic Division!', NULL, 1, NULL, NULL),
(634, '2487', 'Home to suburbs such as Casuarina, Cudgen and Kings Forest, 2487 is in the locality of Toowoomba. The area is renowned by residents due to its natural beauty, as well as several fantastic amenities such as coffee shops and restaurants. Culture is also thriving in the area due to the art scene, with several large street artworks available to view. In September, 2487 has a festival called the Carnival of Flowers, earning the area its name as The Garden City of Australia!', NULL, 1, NULL, NULL),
(635, '2456', 'There are several suburbs in 2456, including Arrawarra, Mullaway and Safety Beach, in the site of New South Wales. The area has several beaches in the area, including Ocean View Beach and Pipeclay Beach, both of which are located under 6 kilometres away. Mullaway Beach in 2456 is notable for its recreational activities such as fishing and swimming, as well as offering picnic areas and barbecues. Furthermore, it is renowned for its sensational views!', NULL, 1, NULL, NULL),
(636, '2485', 'A town in New South Wales, 2485 is located close to the Tweed River. It is situated beside the border of Coolangatta, a suburb of the Gold Coast, which many consider being its ‘twin town’. Here, residents can change time zones by crossing the nearby Queensland border, due to the area not observing daylight saving. 2485 has an economy heavily based on tourism, with popular destinations including Mount Warning, and Lamington National Parks, which are famed for their beautiful flora and fauna!', NULL, 1, NULL, NULL),
(637, '2132', 'If you love the outdoors and nature, the Croydon Train park and Croydon playground reserve in the 2132 area are the perfect spots for you. But there are also other amenities for eating out and shopping among other things, including the cafes of Elizabeth Street, a pilates studio, a bakery, and a gym, in addition to many other stores and services. There is a really exciting festival named the Queen Street Music Festival. Being free means that anyone can attend and it often features local bands that play great music!', NULL, 1, NULL, NULL),
(638, '4169', 'East Brisbane, Kangaroo Point, and Stanley Bridge all share the postcode of 4169 in the locality of Underwood Central. The area is located around 5 kilometres southeast of the Brisbane central business district, with the area being primarily residential. The architecture of the area features many Queenslander residential buildings. There are a number of heritage-listed sites in the area including Kitawah, Eskgrove and Hanworth. Kangaroo Point in 4169 features attractions such as the Story Bridge and Kangaroo Point Cliffs, popular with both residents and tourists.', NULL, 1, NULL, NULL),
(639, '6035', 'A beautiful coastal suburb located on the outskirts of Perth, 6035 is located just 35 kilometres north of Perth’s central business district. The area features an urban centre with residential housing as well as the Yanchep National Park, which has the beautiful Loch McNess water feature. Yanchep National Park also has tours of Crystal Cave, and koala displays! The area has a population of under 3000 people with an average age of 38, in line with the Australian average. 6035 has many amenities for residents including shopping centres, garden centres, and other businesses.', NULL, 1, NULL, NULL),
(640, '2850', '2850 is home to over 60 suburbs in the locality of New Country West, including Yarrawonga and Ullamarra. The closest airport is the Bathurst Airport, and Wappinguy is the nearest train station, keeping the area well connected. Interesting features of the area include The Gulph (around 7 kilometres away) which is a mountain with elevation 700 metres above sea level and Dairy Mountain. Yarrawonga in 2850 also features Lake Mulwala, which is a popular location for boating, fishing and kayaking for residents and tourists alike!', NULL, 1, NULL, NULL),
(641, '2208', 'Kingsgrove is just 13km away from the Sydney central business district. It offers an array of public and private schools as well as a range of churches with different denominations. In addition to these indispensable amenities, there are also plenty of recreational parks and nature reserves including the Dowsett Park, the Beverly Grove Reserve, the Kingsgrove Avenue Reserve and more. There is even a shopping area on Kingsgrove road, boasting restaurants, hair salons, cafes and food stores. You are also well connected to the surrounding locations via bus and rail.', NULL, 1, NULL, NULL),
(642, '3305', 'Featuring the Great South West Walk, a track that extends 250km from Portland, the 3305 area is ideal for strolling and absorbing the beauty of nature. This walk will take you along river gorges and forests, to the tops of cliffs and spectacular bays. The walk is not the only feature that attracts tourism; if you check out the Portland Maritime Museum you’ll be transported back in time. Portland also features a vibrant culture and arts scene and here you will find a number of painters sculptors and musicians among others. They are part of the Council for Encouragement of Music and Arts’ incentive.', NULL, 1, NULL, NULL),
(643, '3912', 'Located 55 kilometres away from the Melbourne central business district, 3912 has a population of just over 11,000 people. The area was originally constructed as an orchard town but has grown substantially over time. 3912 is well connected to surrounding areas by the Somerville railway station, and several bus services. There is also boat access to the Western Port through the Yaringa Marina. There are fantastic amenities within the area, such as a retail district and landmarks including the Somerville Hotel!', NULL, 1, NULL, NULL),
(644, '6000', 'In addition to being the central business district of Perth, the 6000 location is also a suburb that extends to the Hyde Park area. Featuring the Forrest Chase shopping precinct that is over 120 years old, shopping is just one of the options available to you in the 6000 area. You can absorb and take in cultural aspects of the city in the Perth Cultural Centre, discover new things in the State Library of Western Australia or listen to spectacular concerts in the Perth Concert Hall. If sports are your thing, you can be a spectator in the Perth Arena and view some of the indoor sports that are hosted here.', NULL, 1, NULL, NULL),
(645, '6109', 'A good aspect of Maddington is its closeness to the Perth central business district; it’s only 20km away, which means you can access the city centre easily. Maddington has kept its orchards and vineyards but has since developed to contain the Maddington shopping centre. Offering activities for the kids is also another perk of Maddington – it features a scout group, a karate club and many other fun things to do, so you can constantly keep the children entertained.', NULL, 1, NULL, NULL),
(646, '4014', '4014 includes the suburbs of Banyo, Nudgee and Virginia within the locality of Northgate North. The area of Banyo is considered a combination of residential and industrial areas, including transport links such as the Gateway Motorway. Due to its closeness to the Brisbane Airport and the Port of Brisbane, the area. has experienced much business growth in the past few years. Attractions of 4014 include Nudgee Beach and Cowards. Island, both located just under 5 kilometres away!', NULL, 1, NULL, NULL),
(647, '4405', 'With a public library in addition to two creative studios and a few parks, the area of Dalby has slowly become a more active area. Upon the opening of Dalby Shoppingworld, the Dalby central business district began to attract more and more people, making the area more vibrant. The location features a rugby union team that takes part in the Darling Downs Rugby competition. The area has a community feel and contains churches and schools.', NULL, 1, NULL, NULL),
(648, '4567', 'The 4567 area is a beautiful location that is known for its Sunshine beach. The small village and restaurants that are found in this area make 4567 the perfect zone to explore. You might also choose to grab a refreshing drink and enjoy the scenery. Take your pick. It\'s the ideal place for those who love to be near the sea. You\'ll find local buses in this area and various schools, and you can get to Brisbane in 1 hour, 45 minutes by car, should you need to go into the centre. It is a truly stunning location that offers plenty to do.', NULL, 1, NULL, NULL),
(649, '2870', 'Featuring parks such as Commonwealth Park and Kings Park, the Parkes location is a beautiful place to live or visit. A significant site and point of interest include the National Rose Garden, part of the Australian Commonwealth Heritage List. But this location is also home to notable buildings and amenities, including the National Library of Australia, the National Gallery of Australia, which displays portraits of significant Australians, and the National Science and Technology Centre, which offers exhibits related to technology and science. It’s simply a melting pot of different activities and things to do', NULL, 1, NULL, NULL),
(650, '4164', 'The Thornlands location features major amenities such as the Redlands District Rugby League Football club, as well as the Pinklands Netball and Pony Club. If you are a sports fan, these are the perfect places for you. There are also many schools and churches in the area. Though the location also contains lands used for farming, it is a residential area that is just 28km away from Brisbane, the capital of Queensland.', NULL, 1, NULL, NULL),
(651, '6173', 'Secret Harbour, a suburb that is found in Perth, offers many amenities, services and things to do. With a shopping centre and supermarkets in addition to restaurants, a pharmacy and a gym, you will discover that the Secret Harbour area provides all the necessary features of a real community. There is a golf course, as well as primary and secondary schools here. The 6173 location also has the Secret Harbour Surf Beach, which is a great place to go surfing and is protected by lifeguards and lifesavers throughout the year.', NULL, 1, NULL, NULL),
(652, '2380', 'Boasting an abundance of local wildlife species such as kangaroos, koalas and echidnas, the Gunnedah location is a truly beautiful place. In fact, the koalas are frequently found in the majestic trees of the 2380 area, and their population is probably the biggest in this state. With plenty of educational institutions and reliable transport links to other nearby neighbourhoods, the Gunnedah area contains all of the essential services you need. The location is also a major producer of goods such as beef, pork, lamb and cotton, a feat that is reflected in its yearly held agricultural field day.', NULL, 1, NULL, NULL),
(653, '2904', 'Green open spaces, a large shopping center in close proximity, and a range of walking trails. 2904 is an area that offers its residents a little bit of everything. It is a family-friendly location that is ideal for raising young children. You\'ll find various schools, a weather station and a shopping center in the Monash suburb, and should you need more variety you can explore the Erindale Shopping Centre which is also nearby. The area is partially surrounded by Tuggeranong Creek, and there is a recreation zone in this location as well.', NULL, 1, NULL, NULL),
(654, '5115', 'The borders of the 5115 location have been expanded due to the Northern Expressway construction. If you are in Munno Para Downs, you\'re minutes away from Andrews Farm and not too far away from the Angle Vale shopping areas. You will also find the South Australian Country Fire Service in Munno Para Downs.', NULL, 1, NULL, NULL),
(655, '2019', 'Despite being close to the airport, 2019 is a green, leafy area. It is family-friendly and in close proximity to plenty of lush green parks and beautiful beaches. It boasts a blend of urban and rural elements, with a few coffee shops and pubs. It also has a couple of pharmacies and the 309 bus route runs through the area, which will take you to Redfern and Green Square station. You\'ll have no problem accessing the central business district should you need to explore further out. It\'s a homely country town with an urban twist.', NULL, 1, NULL, NULL),
(656, '6162', 'Being close to Fremantle is one of the perks of being in the 6162 location. Public transport will take you there quickly, but there are many things to enjoy in the 6162 area itself. If you are raising a family, there is a local community school. The community feel of White Gum Valley is reflected in its many amenities too, including cafes and delis. You\'ve got Booyembarra Park within walking distance and if you\'re into golf, there is also a golf course in this location.', NULL, 1, NULL, NULL),
(657, '5072', 'What is fantastic about the 5072 location is its picturesque geographical features. You\'ll find Thorndon Park Reservoir just 4km away, Mount Osmond 5.5km away and Mount Lofty slightly further out. If you wanted to explore more of these geographical features, you\'ve got Brown Hill and Hope Valley Reservoir in close proximity. The public transport makes getting around effortless, and if you\'re a beach lover, it\'s well worth checking out West Beach - which is approximately 1 hour, and 30 minutes away from Auldana.', NULL, 1, NULL, NULL),
(658, '5012', 'You don\'t have to travel too far if you want to visit Tennyson beach from Athol Park - that\'s the beauty of 5012. This area also has a few shops, and you\'ll get a great sense of adventure when you discover Fawks Reserve in this location. Bus routes and transport serviced by Adelaide Metro are available in this area too, meaning that there are no problems if you need to travel to nearby locations.', NULL, 1, NULL, NULL),
(659, '3190', 'In the Highett area of Melbourne you’ll find that there are a number of facilities and amenities. From the Olympic-sized Waves Leisure Centre swimming pool that was recently renovated to the Highett Football Club that plays in the Southern Football Netball League, there are many opportunities to back your favourite team! There are also two cricket clubs in the area, in addition to numerous schools and a shopping centre that can be found on Highett Road. The 3190 location is merely 16km away from the Melbourne central business district, so you can easily access the city.', NULL, 1, NULL, NULL),
(660, '7030', 'The 7030 suburb is home to a wide range of areas. As well as Arthurs Lake and Bothwell, you will also find locations such as Millers Bluff and Pelham. In this area, huge lakes such as Woods Lake are simply stunning. Fishing is one of the best pastimes if you are living in the 7030 suburb - there\'s nothing better than enjoying the natural scenes. Choose one of the lakes in the area, such as Great Lake. Stay at the nearby Great Lake hotel and grab your fishing rod. Mount Penny and Mount Patrick can also be found in the 7030 location. Exploring these areas truly is the best way to rediscover nature.', NULL, 1, NULL, NULL),
(661, '3818', 'With notable residential growth due to the new home developments, the 3818 location has a real community vibe. Hosting the yearly Ficofolia gum tree festival year seen the whole neighbourhood gets together on Drouin streets while schools in the area decorate their costumes or floats. This town is home to the Drouin Dragons Soccer Club team that plays in the Gippsland Football League, and it also has a golf and country club. The town’s many essential amenities such as the many supermarkets, fast food takeaways and restaurants are all available to you too.', NULL, 1, NULL, NULL),
(662, '5068', '5068 is an impressive suburb. It is a charming location where you\'ll find many different zones, including Kensington Park, Kensington and Trinity Gardens. The area has a vast selection of schools. There are state primary schools, high schools and one private, Catholic girls\' secondary school in the area. For this reason, it\'s a great place to raise a family. Some notable facts about Kensington, in the 5068 suburbs, is that it got its name from the Kensington Gardens located in London, England. In the 5068 suburb, the Second Creek winds its way through the area. It is a beautiful area where you will also find Kensington Gardens Reserve and Burnside Adventure Park.', NULL, 1, NULL, NULL),
(663, '3585', 'The Swan Hill Jockey horse racing club, the Murray Downs Golf Club and the Swan Hill football club all call the Swan Hill location their home. These are just a few of the sports teams that you can get behind in this area. In the 3585 location, there is a huge array of primary schools and colleges, so it’s a good area for families with children. With green open spaces and parks, as well as the Murray River flowing through it, Swan Hill is a tranquil location. It also has rail and bus networks, which means that you can get around the local area with ease.', NULL, 1, NULL, NULL),
(664, '2360', 'Being located on the Macintyre River means that the Inverell location is picturesque. The area also has plenty of enjoyable and things to do and see such as the yearly Inverell Cycle classic bike race, which starts in the Grafton area and finishes in Inverell. You could visit the National Transport Museum, which is home to in excess of 120 exhibits of vehicles such as motorcycles and classics. With two primary and two secondary schools, and a range of reliable transport links, there are essential services for the locals and tourists that frequent the 2360 location.', NULL, 1, NULL, NULL),
(665, '2049', '2049 covers the areas of Lewisham, Petersham and Petersham North in the locality of Leichhardt. The area is around 7 kilometres south-west of the Sydney central business district and has a number of heritage-listed properties including the Long Cove Creek Railway Viaducts and Petersham Reservoir. 2049 is serviced by a number of transport links, including the Lewisham railways station and bus links. There is a commercial area nearby with a range of shops. Petersham is considered the heart of Sydney’s Portuguese community!', NULL, 1, NULL, NULL),
(666, '4811', '4811 covers several areas in the locality of North Queensland, including Cluden, Oak Valley, Oonoonba and Wulguru. There are several notable features in the area like Mount Stuart, Mount Jack and the Muntalunga Range, all of which are under 10 kilometres away from the area. There are two central shopping centres in the area, including Fairfield Waters and Annandale Central. Interestingly, Oak Valley is the only community in Maralinga Tjarutja Aboriginal Council Local Government Area.', NULL, 1, NULL, NULL),
(667, '5075', 'Just 10 minutes away from the central business district of Adelaide you will find Dernancourt in the 5075 suburbs. Two main schools serve this location - the Dernancourt Primary School and the Dernancourt Junior Primary School. This postcode is also where you will find Paradise, a place that is bordered by the Torrens river and contains the Thorndon Park Reserve and Reservoir. Being supplied water from the Torrens river, this reservoir was the very first that served the metropolitan area of Adelaide. Paradise also features the Adelaide Metro bus service and a childcare centre for early learning.', NULL, 1, NULL, NULL),
(668, '2133', 'Getting to the Sydney central business district from the 2133 area is effortless, so if you are located in Croydon Park or Enfield South you have easy access to various amenities. But within these two areas, you’ll discover plenty to do. In Croydon Park, there is a shopping area that features various eateries and cafes. You will also notice that the area is well connected, with several bus routes taking you to Drummoyne and Ashfield. But what is also great about Croydon Park are its many parks, including Rosedale reserve and Flockhart Park. In Enfield South, you have access to a few essential amenities, which include cafes and chemists. Enfield South is also home to the Enfield Olympic Swimming Pool.', NULL, 1, NULL, NULL),
(669, '2069', 'The New South Wales area is where you will find Castle Cove and Roseville, as well as Roseville Chase. The 2069 location is full of fascinating things to do. Its parkland stretches for kilometres and kilometres and there is even a Castle in the area which was constructed in 1903. The residential zone features the crucial amenities that make life easy, including a café and a baker. Travelling further out is recommended should you require more variety. In Roseville, the selection of parks makes getting fresh air and exercise a breeze. Here you will also find the vital amenities needed to live comfortably, but if you want to get something that’s unavailable, hop on the train and go to the central business district for more of a selection.', NULL, 1, NULL, NULL),
(670, '2753', 'Richmond, Lononderry, Grose Vale, Yarramundi and four other areas are located in the 2753 postcode area of New South Wales. They each have their unique features. Londonderry, for instance, has various heritage sites and a selection of cafes. It has a post office and various shops, as well as a greyhound racing area. The Richmond area in 2573 also features heritage sites such as the Richmond railway station. Beyond this, you will notice the large range of educational institutes, including a campus of Western Sydney University. Grose Vale is a location full of natural beauty. In this location, you will discover the Blue Mountains national park and a primary school. And in Yarramundi is a smaller area that is home to the Western Sydney Mountain Bike Club and a few other notable recreation facilities.', NULL, 1, NULL, NULL),
(671, '2903', 'In the Wanniassa area of 2093, there is a vast array of facilities and amenities. For instance, for families with children, there is a primary and high school. There is also a Catholic and a Christian school, just to name a few. In terms of shops, you have the Erindale Centre for supermarkets and even a bakery. Sports centres are available in this location too. Outside of Wanniassa, but still within 2093, there is another area – the Oxley area. There are various parks in this zone, but traveling further out might be needed if you’re on the hunt for more amenities. One positive aspect about the area is that although it might be small, it has a lovely community vibe and is the ideal area to raise children.', NULL, 1, NULL, NULL),
(672, '4060', 'In 4060, in the Queensland area, there are three main zones. These areas include Ashgrove, St Johns Wood, and Ashgrove West. Ashgrove is a well-connected area in terms of its transportation. There are various bus routes if you want to discover more about the neighbouring areas. Also in the Ashgrove area is a large choice of restaurants from all over the globe. Getting around from St Johns Wood is also easy. This location has a wide range of buses, which is ideal for travelling. Within the St Johns Wood location, there is a pre-school and a scout group.', NULL, 1, NULL, NULL),
(673, '2071', 'In Killara, in the 2071 postcode, there are various amenities. As well as some top primary schools, you will also find good transport links such as the Killara railway station. This means that you have easy access to the central business district but will also enjoy the leafy green, beautiful open spaces in the Killara area. So, if you need to access shopping centres, just hop on the train and within 25 minutes you will be in the central business district. But if you want to enjoy the relaxing ambiance of the area, or perhaps go to a café or restaurant, the Killara area has a little bit of everything.', NULL, 1, NULL, NULL),
(674, '2576', 'A location that is the major entertainment and business area of Wingecarribee Shire means that there is an array of things to get stuck into in the 2576 area. From restaurants that serve up gourmet grub to cafés and bookshops, the Bowral area is packed with exciting and entertaining events and amenities. Featuring a botanic garden, a track for cycling and strolling beside the Mittagong Rivulet and some vineyards, there are some idyllic, natural scenes for you to enjoy here in 2576.', NULL, 1, NULL, NULL),
(675, '3177', 'If you can’t keep away from the beach, Doveton in the 3177 area is the spot for you. Getting to the beach from Doveton takes approximately 15 minutes so within an instant you’ll be getting your vitamin D. But you will also love the other amenities and attractions in the Doveton area, which include the Myuna Farm and the many open spaces. From Doveton Tennis Club to Eumemmerring Park and the vast range of cycle paths, fresh air is easy to come by. Eumemmerring is another area situated within the 3177 postcode that has plenty to offer. It is also close to the beach and is home to the Waratah Reserve. Accessing the main South Gippsland Freeway is easy from Eumemmerring if you need to get around by car.', NULL, 1, NULL, NULL),
(676, '4021', 'From the Kippa-Ring area, which is located in 4021 you will have no trouble accessing the Suttons beach on the peninsula of the Redcliffe area out towards the west. The other perks about the Kippa-Ring area include the fact that you have easy access to the railway station, which will take you to Mango Hill and further out. You have a shopping area in the 4021 location, in addition to a bus station and entertainment such as a cinema. With schools, a Catholic college, a private hospital and churches, the community feel of the Kippa-Ring area is clear to see.', NULL, 1, NULL, NULL),
(677, '2043', 'Being only 6km away from the Sydney central business district, the Erskineville suburb is located in the New South Wales state and has a diverse and cultured community. With several public and private schools, as well as buses and trains servicing the area, you have essential features available to you in the 2043 location. From modern apartments to the many hotels and takeaway food shops, you’ll feel right at home in this residential suburb.', NULL, 1, NULL, NULL),
(678, '5084', 'As you’re only a 15-minute’s drive away from the central business district of Adelaide, in Kilburn you can make use of the many amenities both here and in the city. You have good, reliable transport services in the area that can take you to local areas as well as locations a little further out. It is a multicultural location with many parks and open areas as well as affordable housing, all features that make Kilburn a good place to live or visit.', NULL, 1, NULL, NULL),
(679, '5019', 'With Semaphore Park right on the beachfront, the area is perfect if you want to listen to the waves and relax on the shoreline. But there are other advantages to the Semaphore Park location in 5019. The Point Malcolm Reserve is accessible from the beach, as is the smaller Frederick Miller Reserve. The Semaphore South location is slightly smaller, but here you will find open park spaces and a high school. Semaphore South is also right on the beachfront and is close to the neighbouring Exeter location, which features a railway line that will take you right into the centre of Adelaide.', NULL, 1, NULL, NULL),
(680, '5037', 'There are several reserves in the Netley location. In 5037 you will find the Elsie Street Reserve, the Baroda Avenue Reserve and the Florence Street Reserve, just to name a few. The North Plympton location nearby is bordered by the Weigall Oval and the Westside Bike Path, and you will also discover the Rex Jones Reserve within the area. In the Glandore location, you will have access to the tram, which will take you further out, as will the local buses. In Glandore, 5037, you will also find open spaces, which include the Jubilee Park. Kurralta Park, also in 5037, features the Grassmere reserve, and running through it is the Brown Hill Creek.', NULL, 1, NULL, NULL),
(681, '3672', 'With a real community feel, a crystal clear lake and beautiful walking paths and trails, you’ll love the outdoor sporting opportunities that the 3672 area has to offer. There are also gyms, a number of cafés and restaurants and you have an array of sports clubs in the area such as the Benalla Racing Club, the Golf Club, the Benalla & District Cricket Association and the Bandits Baseball Club. And with the Performing Arts and Convention Centre’s cinema, a significant art gallery and the modern murals known as the Benalla Street Art trail, there are numerous cultural features of the Benalla area on offer to you.', NULL, 1, NULL, NULL),
(682, '4702', 'One of the many perks of living in or visiting Gracemere is the fact that it is just 9km away from Rockhampton city, which is a commutable distance if you happen to work further out in the central business district. It has a good shopping centre, a friendly vibe and some leafy local parks. In addition to the schools, you’ll also notice that there are many new housing developments in this location and a public library is available to you too.', NULL, 1, NULL, NULL),
(683, '2096', '18 km northeast from the Sydney central business district is the North Beaches Region of 2096, containing Curl Curl, Freshwater, and Queenscliff. This area is known for its beaches and recreation, as Freshwater is known as the Australian home of surfing thanks to Duke Kahanamoku who first displayed surfboard riding in Australia in 1914. The nearby area of Curl Curl (the original Aboriginal name for the larger area of 2096) is home to make wild water and bush birds and has an excellent beach that is perfect for surfing.', NULL, 1, NULL, NULL),
(684, '5161', 'The area of 5161 lies 20 km south of Adelaide\'s central business district, north of the City of Onkaparinga. It contains the suburbs of Reynella, Reynella East, and Old Reynella, the historical center of the district. This area\'s transport links are serviced by buses on the Adelaide Metro network and the 5161 has a number of excellent residential areas, surrounded by great shopping experiences. There are also a number of parks and reserves such as a hiking area called Field River Public Land Trail if you\'re interested in doing more hiking in the great outdoors.', NULL, 1, NULL, NULL);
