(685, '2303', 'Situated close to Newcastle\'s central business district (4km) the suburb of 2303 is home to Hamilton, Hamilton South and Hamilton East. The residential areas of this district offer great homes for families and couples alike, and transport links to the city center are provided both by rail and bus. Hamilton is home to the State Transit Authority, Newcastle\'s major bus depot, but if you want things closer to home, you can always check out the local sports teams and parks, as well as the heritage listed buildings to help you learn more about Hamilton\'s history.', NULL, 1, NULL, NULL),
(686, '5042', 'In the inner south suburb of Adelaide known as 5042 lies Clovelly Park, St Marys, Bedford Park and Pasadena. This area is approximately 20 minutes from Adelaide city center. This suburb contains wonderful residential districts and parks, including Rosslyn Avenue Reserve and Clovelly Park Reserve, both featuring a playground area and sitting area. Over in Pasadena is the Pasadena shopping center and Foodland, with its recent redevelopment including a new church facility for Southland Vineyard Church. St Mary\'s Park is one of the largest reserves in 5042 and was once the training ground for South Adelaide Football Club.', NULL, 1, NULL, NULL),
(687, '5063', 'The inner southern suburb of Adelaide is 5063, approximately 3km southeast of Adelaide\'s central business district. 5063 is host to Parkside, Fullarton, Highgate and Frewville, with excellent transport links into the city, lovely residential areas and a multitude of parks and reserves to enjoy, most of which are fenced in with their own playgrounds. 5063 is also home to the Slingsby Theatre Company, located in Parkside though they are an internationally touring theatrical company, creating \'bold and beautiful theatre for adults and young people.', NULL, 1, NULL, NULL),
(688, '3922', 'The suburb of 3922 is on Phillip Island, approximately 2-hour drive from Melbourne though it can also be reached by coach or passenger ferry. Cowes, in 3922, is the main township of Phillip Island and is located on the northern side of the island. Tourists often stay in Cowes in preparation for races and events held at the Phillip Island Grand Prix Circuit nearby, but also to visit the bordering Phillip Island Nature Park, one of the largest conservation parks in Australia and totally owned by the Victoria State Government.', NULL, 1, NULL, NULL),
(689, '5173', 'Within the City of Onkaparinga is the outer southern suburb of Adelaide known as 5173, containing Port Willunga, Aldinga, and Aldinga Beach. This suburb is approximately 28 miles south of Adelaide\'s city center. Port Willunga is also known as Wirruwarrungga or Ruwarunga by the Kaurna people and is a popular tourist destination, especially for weddings. Port Willunga beach is one of the most photographed beaches in South Australia, as the remains of the Port Willunga Jetty make for wonderful shots of crystal clear waters and soft white sands.', NULL, 1, NULL, NULL),
(690, '6150', 'In the suburb of 6150 are Murdoch, Bateman, and Winthrop, located within the City of Melville with road access to Perth\'s central business district. Within Murdoch is Murdoch University and a campus of South Metropolitan TAFE, and across 6150 are multiple excellent schooling opportunities, ranging from primary to secondary, and of course, colleges. Transport links across these suburbs include rail and bus, and the suburb of Bateman has a small commercial center that offers some medical and chiropractic facilities.', NULL, 1, NULL, NULL),
(691, '3105', 'Tree-lined streets and affordable housing, easy access to the central business district and a school for the kids – are just a few of the amenities and available facilities open to you in the 3105 location. There are reserves and parks, the area is situated near the Yarra River and you have the Bulleen Plaza available to you if you’re an avid shopper. In addition to the schools, you’ll find that there are reliable bus services that take you into the Melbourne central business district should you need to travel into the city.', NULL, 1, NULL, NULL),
(692, '5051', 'Approximately 17 km south of Adelaide city center is the suburb of 5051, which includes Blackwood, Hawthorndene, Coromandel Valley and Craigburn Farm. The suburb of 5051 hosts a number of excellent schools for residential areas, as well as places of interest such as the Wittunga Botanic Garden, Blackwood Forest Recreational Park, and Sturt Gorge Recreation Park where diverse fauna often wander, including kangaroos, koalas, and echidnas. Transport in the area includes both rail and bus travel, with easy access to both in order to travel around the suburb.', NULL, 1, NULL, NULL),
(693, '4564', 'In the Sunshine Coast region of Queensland Australia is the suburb of 4564, which includes Twin Waters, Mugjimba, Marcoola, and Pacific Paradise. Tourists often visit the Twin Waters Resort and the beautiful beaches along with this suburb, including the Mudjimba Dog Beach which allows visitors to let their dogs enjoy the beach as much as they can! The suburb of 4564 also features Twin Waters Resort Golf Course as well as a skydiving centre by Sunshine Coast Airport if you\'re feeling a bit more daring.', NULL, 1, NULL, NULL),
(694, '2794', 'Located in the locality of New Country West, 2794 includes areas such as Bumbaldry, Hovells Creek and Noonbinna in the state of New South Wales. Local points of interest include Crowther Range, Conimbla Mountain and The Pine Mountain, all of which are located under 30 kilometres away. 2794 is a quiet area, with Cowra being the largest population centre in the area. Cowra has a number of heritage-listed sites including the Lachlan River railway bridge, and the Cowra railway station.', NULL, 1, NULL, NULL),
(695, '2594', '2594 is in the locality of Canberra and covers a number of areas, including Ashville, Bulla Creek, Memagong, Tubbul and Yannawah. Located around 120 kilometres away from the closest urban centre of Wagga Wagga, 2594 is in the state of New South Wales. There are several notable features in the area, including Walls Hill, Memagong Hill and Maori Spring, which are all under 20 kilometres away. Residents have described the area as being tight-knit, due to the small population inhabiting 2594.', NULL, 1, NULL, NULL),
(696, '2087', 'Located on Middle Harbour in the state of New South Wales, 2087 is located around 12 kilometres away from the Sydney central business district. Known by locals as ‘The Forest’, there is just. shy of 5000 people living in this suburb. Killarney Heights has a number of public transport options including bus routes and by road, taking around 20 minutes during quiet hours. There are a number of points of interest in 2087, including the heritage-listed site Bantry Bay Explosives Depot, and close to the Garigal National Park.', NULL, 1, NULL, NULL),
(697, '2517', 'In the northern suburb of Wollongong 2517 lies Woonona and Russel Vale, approximately 10 km from Wollongong and around 45 miles from central Sydney. The area features multiple beaches, including Bulli Beach and Woonona beach, as well as Woonona Rock Pool for those who are nervous about swimming in the ocean but still want to enjoy a little dip in the water. For other entertainment, there\'s the Russell Vale Golf Course and multiple lovely parks for walks from residential homeowners.', NULL, 1, NULL, NULL),
(698, '4007', 'Sipping on a cup of coffee in a local café, having access to a few schools and being a mere 7km away from the Brisbane central business district are all bonuses that you’ll notice in the 4007 location. You have the shopping area of Racecourse Road and access to the Ascot railway station should you need to venture to other locations.', NULL, 1, NULL, NULL),
(699, '2226', 'In southern Sydney is the suburb of 2226, where you can find Como, Jannali, and Bonnet Bay. They\'re approximately 17 miles south of the Sydney central business district and have lovely residential homes and a number of great schools such as Jannali High School or Como Public School. Como Hotel is a famous and historic Edwardian landmark in the suburb, where the balconies are reportedly fun to watch local rugby league football. The suburb of 2226 also has excellent transport links via bus and train so you don\'t have to spend money on fuel for trips.', NULL, 1, NULL, NULL),
(700, '4744', 'A community that offers a wide range of sporting facilities, including the chance to go swimming in the pool, play a game of soccer, practice your putting in a game of golf or even play tennis with your friends, the 4744 location is perfect for sports lovers. But these are just a few of the amenities available to you! If you’re in the area, you should take the opportunity to visit the public library, one of the many churches in the area, or the Peak Range National Park.', NULL, 1, NULL, NULL),
(701, '2548', 'On the south coast of New South Wales lies the suburb of 2548, which includes Tura Beach, Merimbula, Fishpen, and Berambool. The suburb hosts a number of resorts and beaches, including Merimbula Beach and Short Point Beach. As a popular holiday destination, you can also visit the amusement park Magic Mountain Merimbula for a fun day out for all the family. If beaches and parks aren\'t your styles, you can always visit Merimbula lake to enjoy the scenery and even hire a boat for a trip.', NULL, 1, NULL, NULL),
(702, '2448', 'The 2448 suburb lies on the mid-north coast of New South Wales, with the main suburbs being Nambucca Heads and Valla Beach. The area is surrounded by beautiful countryside to the west and stunning beaches to the east, offering multiple opportunities for exploration and holiday ideas. Nambucca Heads offers a number of places to stay, including a few caravan parks for a more interactive or local vacation. With so many different shopping places to explore as well, you\'ll be spoiled for choice.', NULL, 1, NULL, NULL),
(703, '5066', 'Lying approximately 7.5km from Adelaide City Centre is the suburb of 5066, containing Burnside, Beaumont, Hazelwood Park, Stonyfell, Wattle Park and Erindale. This area not only has excellent residential homes but also contains interesting places to explore such as the Ferguson Conservation Park and the Michael Perry Botanic Reserve in Stonyfell. 5066 also has great transport links for travel to the city center if you\'re looking to spend an urban day out, but staying local lets you enjoy plenty of shopping and food amenities so you may not want to leave.', NULL, 1, NULL, NULL),
(704, '5025', 'The western suburb of Adelaide is known as 5025 and includes Kidman Park, Flinders Park, and Allenby Gardens. The suburb of 5025 has plenty of schooling available from primary to secondary, as well as excellent residential areas for families. The area also hosts a number of reserves and parks to explore, such as Collins Reserve, Torrens Linear Park, or Allenby Gardens Reserve. Allenby Gardens is also home to some unique cafes and boutiques, and for a larger shopping experience, there\'s always the Allenby Gardens Shopping Complex.', NULL, 1, NULL, NULL),
(705, '2086', 'In the suburb of 2086 in northern Sydney lies Frenchs Forest, 13 km north of Sydney\'s central business district and colloquially known as The Forest by locals. This area contains plenty of schools and sporting opportunities for all ages, including the Warringah Aquatic centre with its Olympic indoor heated swimming pool. There are also excellent transport links available by bus and road connections for easy travel, and multiple chances for retail therapy with Frenchs Forest Town Centre, and Forestway Shopping Centre.', NULL, 1, NULL, NULL),
(706, '5031', 'In the state of South Australia, 5031 covers suburbs including Mile End, Thebarton, and Torrensville, situated around 3 kilometres away from the nearest centre of Adelaide. In Mile End, the majority of the suburb is residential and features a number of heritage-listed sites, as well as the Mile End Railway Museum. 5031 also covers Torrensville, which has a vibrant shopping area on Henley Beach Road which is great for residents and tourists alike. Thebarton features the Ice Arena, which is home to the Adelaide Adrenalines who play in the Australian Ice Hockey League!', NULL, 1, NULL, NULL),
(707, '5044', 'In the state of South Australia, Glengowrie and Somerton Park comprise 5044. Situated around 10 kilometres away from the nearest city centre of Adelaide, the areas have a combined population of around 10,000. Somerton Park is a beautiful coastal suburb described as super friendly and a beacon of suburban peace. Similarly, in 5044, Glengowrie is described as a convenient suburb with great access to schools, restaurants, and shopping, as well as the beach! Areas of interest include Marino Rocks and Shephards Hill, both under 10 kilometres away.', NULL, 1, NULL, NULL),
(708, '2125', 'Boasting attractions such as the Koala Park Sanctuary and the Cumberland State Forest, places which tourists and locals visit, the 2125 area offers plenty of things to enjoy. Take the chance to go shopping in one of the shopping complexes or have a meal in one of the local restaurants – the choice is yours. Another activity you should experience is the chance to go bird watching in the Cumberland State Forest or go for a walk in the green oasis getaway. It is the perfect location in which to escape city life!', NULL, 1, NULL, NULL),
(709, '4610', 'Points of interest in the 4610 area are the Bunya Mountains National Park as well as the local farms. In the National Park, you might be lucky enough to spot a parrot or Kookaburra! And there are numerous activities to indulge in in the Kingaroy location such as bird watching or wine tasting. This location has the Peanut Capital nickname owing to the fact that its plant that processes peanuts is the largest in Australia. A public library, a commercial centre with an array of amenities, and the Kingaroy Observatory that attracts tourists and locals are some of the star feature awaiting you in Kingaroy.', NULL, 1, NULL, NULL),
(710, '2020', 'From the shops along the Botany Road to the wide variety of takeaway food, there is something for everyone in the 2020 area. Mascot offers a real community vibe and its close proximity to a university, beaches, and schools make it a great location for families. It is only 7km away from the Sydney central business district if you need to access the city, but with nature and urban features on your doorstep, as well as the essential amenities, you might want to stay in Mascot.', NULL, 1, NULL, NULL),
(711, '2443', 'Areas in 2443 include Bobs Creek, Hannam Vale, and Moorland, among others. Located in the state of New South Wales, it is situated around 36 kilometres away from the city of Port Macquarie. Nearby attractions include Middle Brother, Wash Tub Bay, and South Brother, all located under 7 kilometres away. Within Hannam Vale, there are beautiful natural features including the Coorabakh National Park, and the Big Nellie, which are perfect for visiting. 2443 also has a number of hotels and cottages, perfect for tourists!', NULL, 1, NULL, NULL),
(712, '3151', 'With a huge number of beautiful leafy green parks with majestic trees, excellent public transport, and convenient shopping areas open to you, the 3151 location has a combination of essential amenities and outdoor spaces. It is suited to families due to its school and community feel. Sporting amenities are also available here, including the Nunawading Basketball Centre and the Nunawading Velodrome, and there are also cricket and football clubs in the area if sports are your thing.', NULL, 1, NULL, NULL),
(713, '4352', 'The postcode of 4352 in Queensland encompasses many suburbs. Some of these include Amiens, Coalbank, Derrymore, Gowrie Junction, and Palm Tree. It is in the locality of Toowoomba, in the state of Queensland, which has several local attractions. Great features include local natural hotspots, Mount Rolleston, Mount Mallard, and Mount Kent, all under 20 kilometres away. 4352 has been described as a great location for families, due to the mix of city and country living!', NULL, 1, NULL, NULL),
(714, '6103', 'Being just 5km away from the Perth central business district, the Rivervale suburb has the city in close proximity. Its location means that you can access the airport and the city centre with ease, and the beaches are just a short drive away. There are cafés and shops in the area, in addition to schools and parks – essential amenities that are easily available to you. Public transport will take you to major shopping centres and you can go for walks along the tranquil Swan riverside.', NULL, 1, NULL, NULL),
(715, '4565', 'Amenities such as a historic pub, in addition to several restaurants and a variety of shops, the Tewantin location is a friendly neighbourhood with many things to enjoy. Being in close proximity to Rainbow Beach and the Noosa Harbour Marina in Tewantin means you can access the seashore easily. The location provides the perfect blend of older buildings as well as some new developments, and there are a few trails and paths for walking in this peaceful suburb.', NULL, 1, NULL, NULL),
(716, '6006', 'The North Perth suburb is only 3km away from the Perth central business district. Many of the older homes are being renovated in the leafy, green area, and there are many facilities available to you. There are amenities such as cafés, shops, gyms, and a recreational area as well as a few schools to choose from. the Beatty Park Leisure Centre can be found in the 6006 location – a place in which you can go swimming – and there is also a shopping centre in the area.', NULL, 1, NULL, NULL),
(717, '2033', 'Kensington, in New South Wales, is just 6km away from the Sydney central business district. In close proximity to green outdoor spaces such as Moore Park, Fitzpatrick Park, Ingram Street Reserve and more, which are homes to an array of local wildlife, you can enjoy the outdoors on your doorstep. You’ll also find a campus of the University of New South Wales if higher education appeals to you, and there is also the Australian Golf club in this location, in addition to the Randwick Racecourse.', NULL, 1, NULL, NULL),
(718, '3144', 'Containing the Malvern Central shopping centre, in addition to a huge range of shops and restaurants, the 3144 location has many attractions and facilities available to you. As well as the many gardens and parks, you’ll discover the city centre that has the Malvern Library. There are also many schools and a few churches in the area, so there are indispensable facilities that you can make use of in the Malvern area. Should you need to go to the central business district of Melbourne, you’re only 8km away.', NULL, 1, NULL, NULL),
(719, '2484', '2484 encompasses several areas in the locality of the Gold Coast in New South Wales, including Back Creek, Condong, Doon Doon, Farrants Hill, Reserve Creek and Zara. The area is located around 36 kil0metres away from the urban centre of Lismore. There are numerous nearby features in 2484, including Lofts Pinnacle, Mebbin Rock and The Bar Mountain, all under 6 kilometres away. Residents have described the area as being excellent for the great weather and nature, as well as the multiculturalism and nightlife opportunities!', NULL, 1, NULL, NULL),
(720, '3750', 'A suburb that is just 26km away from the central business district of Melbourne, the Wollert location is close to the city. You can access the Melbourne centre easily, but the 3750 location also provides some essential amenities. With a school and a church, as well as some new children’s parks and reserves that are perfect for sporting activities, this location is good for families.', NULL, 1, NULL, NULL),
(721, '4805', 'In the Bowen location, which is a coastal area with beautiful scenes, you can easily access Mount Aberdeen National Park. There are also several schools, in addition to a higher educational facility. In addition to the many tourist hotspots such as the beaches, the Big Mango and the lookouts in this area, you will find many amenities – newsagents, cafes, sports clubs, and childcare centres are all open to you. Visit the Summergarden Theatre or the cinema for fun, entertaining things to do.', NULL, 1, NULL, NULL),
(722, '4059', 'The Kelvin Grove suburb is a mere 3km away from the central business district. Featuring the La Boite Theatre Company that performs plays in the Roundhouse Theatre, such cultural events are available to you in the 4059 location. Make use of the Victoria Park Golf course if you like sporty events and activities. This leafy green area also has many walking paths and shops, schools and markets. It is a diverse location with a large student population and it also features the Kelvin Grove park run each Saturday.', NULL, 1, NULL, NULL),
(723, '7015', 'Rose Bay, Lindisfarne, Geilston Bay and Flagstaff Gully are all in 7015 in the state of Tasmania, situated 12 kilometres away from the Hobart International Airport. Located just 2 kilometres away are the local points of interest of the Flagstaff Gully Reservoir, Lindisfarne Bay and Natone Hill, which are fantastic for residents and tourists alike! Rose Bay has interesting residential housing, with a mix of architectural styles including weatherboards and double brick houses. Lindisfarne in 7015 is known for hosting several rowing and sailing clubs along the Derwent River!', NULL, 1, NULL, NULL),
(724, '3465', 'In addition to the tasty takeaway food available in the Maryborough area, you can also make use of the many supermarkets and exercise outdoors on the cycle paths. There are various primary and secondary schools – both public and private, which is perfect for families that are raising children. You’ll also find a public library that is provided by the Fraser Coast Regional Council, in addition to the Maryborough Wallaroos Rugby League team. The main transport links available are the local buses that serve the 3465 area.', NULL, 1, NULL, NULL),
(725, '3049', 'Attwood and Westmeadows are situated in the locality of North West Melbourne in the state of Victoria with the postcode 3049. They are situated around 17 kilometres away from the capital city of Melbourne, and have several interesting features including Greenvale Reservoir, Coode Island, and Quarry Hill, all located within 20 kilometres. Attwood has a population of just under 3500 people and is home to Victoria Police’s Dog Squad and Mounted Branch. Additionally, in 3049 is Westmeadows, which is mainly a residential suburb but has a notable historic landmark the Old Coach House.', NULL, 1, NULL, NULL),
(726, '2163', 'Located in New South Wales, 2163 encompasses the areas of Carramar, Lansdowne and Villawood in the locality of Bankstown. Carramar has shy of 4000 residents and has been described as a forgotten suburb due to the dilapidated nature of its streets. Lansdowne has a notable set of traffic lights in the area, described as the Meccano Set. And the last area of 2163, Villawood, has thriving commercial areas including a bakery, chemists and grocers, as well as other stores.', NULL, 1, NULL, NULL),
(727, '3995', 'Being the biggest town in the area of South Gippsland, the Wonthaggi location has many tourist attractions – one of which is the State Coal Mine, which also has a café. There is the 18-hole Wonthaggi golf course, in addition to the community ad information centre art gallery called ArtSpace. Locals make use of the former Wonthaggi railway line by going cycling, walking, or even horseback riding. But for other things to do, you should check out the Williamsons Beach or the Bunurong Marine National Park, which each provides exciting and fun activities for the whole family.', NULL, 1, NULL, NULL),
(728, '2605', '2605 covers the suburb of Hughes, located in Canberra. The area is named for the Seventh Prime Minister of Australia, and the streets of the suburb are named for World War I Armed Service Personnel. There are several amenities in 2605, including a shipping centre, a tennis club and park, as well as schools. The area has been described by residents as ideal to live in as everything is in a good, close location, making it a great place to raise a family. Residents state that some areas of Hughes offer a beautiful view of the Brindabellas over the Woden Valley!', NULL, 1, NULL, NULL),
(729, '4120', 'With the Greenslopes Mall shopping precinct and various cafes and restaurants, there are a number of convenient amenities in the Greenslopes area. In close proximity, you have a good selection of public and private schools, in addition to various sports clubs and reliable public transport. There is also a private hospital that provides excellent patient care and is the largest private medical centre in Australia. You’ll find plenty of services and features suited to the whole family here in the Greenslopes suburb.', NULL, 1, NULL, NULL),
(730, '3148', 'In the Chadstone suburb, important features can be found. These include the Jordanville Community Centre, the Waverley Basketball Centre, and the Scotchmans Creek. The 3148 location is a small suburb offering the Chadstone Shopping Centre and two schools. There is also the Chadstone campus of the Holmesglen Institute offering university-level education. With plans for housing demolishment and renovation, the Chadstone location is slowly developing and also offers parks and childcare centres for the kids.', NULL, 1, NULL, NULL),
(731, '2060', 'In New South Wales, 2060 covers several areas, including Lavender Bay, North Sydney, and Waverton, in the locality of Chatswood. It is situated around 3 kilometres away from the nearest urban centre of Sydney. 2060 has several great features including Berry’s Bay, McMahons Point, and St Leonards Park, at a great distance of just over 1 kilometre away. Lavender Bay has been described as a beautiful harbourside suburb, with several landmarks including the Lavender Bay Baths of 1910.', NULL, 1, NULL, NULL),
(732, '3915', 'A seaside location that won the Tidy Town Award in 2004, Hastings is an immaculate location. It boasts a beach and many essential amenities, in addition to reserves on the coastline, a port and a pier that is a good spot for sightseers. Including several recreation centres for fishing or boating, water-based activities are available to you in this beautiful town. Visit the Tyabb antique centre or the Moonlit Sanctuary Wildlife Conservation Park to see some of the local fauna if you like nature and you won’t be disappointed by their display.', NULL, 1, NULL, NULL),
(733, '2106', '2106 covers the areas of Newport and Newport Beach in the locality of Warringah. Situated in the state of New South Wales, the nearest urban centre is Sydney, which his 25 kilometres away. Newport is located on Sydney’s Northern Beaches, making it a great spot for locals and tourists alike. The name is derived from historically being a new port for steamers carrying passengers and cargo. Newport Beach in 2106 has been described as one of Sydney’s best coastlines, and is 1.3 kilometres long!', NULL, 1, NULL, NULL),
(734, '2016', 'The 2016 suburb contains the Redfern location. In this area, you will find the Douglas St. People\'s Playground and the Redfern Park, which are open green spaces that are ideal for getting fresh air. The Edmund Resch Reserve can be found in this location as well, and Moore Park and Mount Steele Lookout are located to the east. The Surry Hills Shopping Village is the best place in 2016 to purchase products, so if you need any goods the shopping village is exactly what you will need. If you\'re looking to explore the surrounding areas of 2016, you will find the Redfern railway to the west of the area.', NULL, 1, NULL, NULL),
(735, '4018', 'Fitzgibbon and Taigum are two areas located in the 4018 suburbs. From Fernwood Place Park to Gumnut Street Park and Taigum Street Park, the open spaces you\'ll find in the 4018 area are the perfect places to explore the outdoors. To the east of the Taigum area, just outside of this zone, there is a cycle path. You will also find Boondall Park here, located on the border of the Taigum location. The Fitzgibbon area, in 4018, is home to the Cabbage Tree Creek, which runs along the eastern border of this zone. For cycling enthusiasts, there are two cycle paths in the centre and to the east of the location.', NULL, 1, NULL, NULL),
(736, '2327', 'There is a range of small central parks in the 2327 area. The Kurri Kurri location not only contains Molly Worthington Park, it also boasts the Kurri Kurri Central Park and plenty of other picturesque lush green spaces. For young children and older kids, there is a primary school and a secondary school in this area. The 2327 zone also features Pelaw Main, where you will also find a primary school and a vast stretch of green fields belonging to the Werakata State Conservation area. In fact, the Pelaw Main location is surrounded by picturesque open spaces. There is a train station in the Pelaw Main area should you wish to travel beyond this location.', NULL, 1, NULL, NULL),
(737, '3730', 'The main attraction of the Yarrawonga location is Lake Mulwala. It is a very popular spot with tourists and locals, and people flock here to take part in activities such as fishing and kayaking. You will also find the Yarrawonga Football Club in the area, a team that plays in the Ovens and Murray Football League of the Australian rules football league. Take the opportunity to explore the Murray River and enjoy the tranquility of this peaceful suburb.', NULL, 1, NULL, NULL),
(738, '2604', 'Kingston and Narrabundah belong to the 2604 suburbs. The Molonglo River is located towards the east of Kingston, and this location also contains a range of other amenities. As well as Norgrove Park, you will also find a shopping zone in Kingston. The boat harbour extends out onto the Molonglo River, and cycle paths surround the Kingston area. In Narrbundah, you will be able to take your pick of the many outdoor sports on the Boonmanulla Oval, the Canberra International Golf Centre Driving Range, and the Errol Kavanah Oval. There is an Early Childhood school located in Narrabundah and a college as well.', NULL, 1, NULL, NULL),
(739, '5039', 'In 5039, there are three main areas - Clarence Gardens, Edwardstown, and Melrose Park. Clarence Gardens features several locations that are ideal for sports, such as the Lawn Bowls Club. There is also a reserve located to the north of the area, called Nieass Reserve. In Edwardstown, you\'ll find a recreation ground and plenty of amenities and services - from takeaway food to local mechanics to plumbers, while Melrose Park contains several reserves, including Chellaston Reserve and Marion Reserve.', NULL, 1, NULL, NULL),
(740, '5033', 'The 5033 location is home to five areas, which are Cowandilla, Hilton, Marleston, Richmond, and West Richmond. Each area offers plenty of fun and amenities. Cowandilla has a reserve, and it also features the Cowandilla Primary School. This area is not far from the central business district if you need to take a trip to the centre. Cowandilla\'s neighbouring area, Hilton, Features electrical and repair services, cafes and restaurants - all the essential services needed if you are in this area. Marleston also has several services, a cycle path, and the Peake Gardens Reserve, while Richmond and West Richmond contain parks and reserves to explore and enjoy.', NULL, 1, NULL, NULL),
(741, '2558', 'Eagle Vale is bordered by the Hume Motorway and surrounded by Eschol Park and Kearns. All of these areas are part of the beautiful 2558 suburb. In Eagle Vale, there is a public school and a high school, making the area ideal for families and children. There is also the Odyssey House hospital located in Eagle Vale. Eschol Park also contains a public school and plenty of green, open spaces. The area also contains plenty of cycle paths, which is perfect for getting out into the fresh air. Kearns, in 2558, also has a public school. Here, you will also find Prentice Park and the larger Jemima Jenkins Park.', NULL, 1, NULL, NULL),
(742, '3223', 'Taking in the panoramic scenes of Port Phillip Bay from the hillsides is the perfect way to enjoy this coastal suburb in Victoria. But there are plenty of other activities to enjoy! It is a destination for families, with people coming to the area to enjoy fishing. Accessing the surf beaches in the Bellarine Peninsula location is a breeze – just take the ferry. There are fun festivals such as the Portarlington Mussel Festival and the Bellarine Agricultural Show. And with places such as the Portarlington Pier, in addition to the Portarlington Miniature Railway, you can take in the beautiful views of this picturesque town.', NULL, 1, NULL, NULL),
(743, '2321', 'The 2321 New South Wales suburb is home to various areas. You\'ll find Berry Park, bordered by the Hunter River, Butterwick, which features amenities such as plumbing services and estate agents, and Clarence Town, beside the Twelve Mile Creek. Other areas within 2321 include Cliftleigh, Duckenfield, Duns Creek, and Gillieston Heights, all of which are located near rivers and creeks. Glen Martin, Glen William, and Harpers Hill are also part of the 2321 location. These rural zones feature some amenities such as public schools and electrician services and are also situated near riversides. Heddon Greta, Hindon and Iona can also be found in 2321, as well as Lochinvar, Luskintyre and Morpeth. In Lochinvar, you\'ll find amenities in abundance, from bed and breakfasts to churches and schools. This suburb is packed with things to do.', NULL, 1, NULL, NULL),
(744, '2136', 'In the New South Wales location, you’ll find the suburb of Enfield. For something to do in the area, you should check out its commercial area located on Liverpool Road if you are an avid shopper. Besides that, there are an array of churches and schools in the 2136 location. Should you need to travel further out to access more amenities, you have reliable transport in this tranquil and quiet area, including various bus links.', NULL, 1, NULL, NULL),
(745, '3078', '3078 contains Alphington and Fairfield. Within Alphington, you\'ll find a train station and a grammar school. The Yarra river flows along the southern boundary of the Alphington zone, and there are parklands and parks to be enjoyed in this area. The Fairfield suburb is located close to the central business district and city centre - Melbourne. It has plenty of amenities such as the Thomas Embling Hospital and several ovals, which are ideal for sporting activities. The Yarra river also forms the southern boundary of Fairfield, and you\'ll find plenty of services in this location - including mechanics, plumbers, and takeaway food restaurants.', NULL, 1, NULL, NULL),
(746, '3111', 'Besides watching the Donvale Magpies play in the Eastern Football League or Mitcham Eagles in the Saturday Football League, there are sports facilities such as gyms and basketball courts that you can use in the Donvale location. Parks and bushland in abundance, this location is just perfect for outdoor sports too, as it features the Currawong Bush Park, the Yarran Dharan bushland and more open green spaces. There is an array of primary and secondary schools in the 3111 location, making this area a great place to raise a family.', NULL, 1, NULL, NULL),
(747, '4006', 'Bowen Bridge and Bowen Hills are two of the main suburbs in the 4006 area. Though Bowen Hills doesn\'t feature any educational facilities, you will find a theatre and a museum. There is also Bowen Park, which is a beautiful, green garden waiting to be explored - but there are also several other parks here as well, such as Cowlishaw Street Park. To the south of Bowen Hills, you will find Fortitude Valley. Here, there are several amenities - from restaurants to hairdressers - you\'ve got everything you need in the Fortitude Valley suburb. There are also other locations in 4006, such as Herston, Mayne and Newstead. In Herston, you\'ll find the University of Queensland Medical School, and beautiful Enoggera Creek is located on the northern border. Newstead is located to the east of Herston and is on the Brisbane River.', NULL, 1, NULL, NULL),
(748, '4223', 'In 4223 there are three main suburbs - Currumbin, Currumbin Valley, and Currumbin Waters. Jutting out into the South Pacific ocean, from Currumbin, is Elephant Rock. It is located on Currumbin Beach, which is where surfers go to catch the waves. Currumbin Valley is slightly more inland. Here, you\'ll find the Robert Neumann Park and the Currumbin Creek. In Currumbin Waters, you\'ve got a community special school, a rugby union club, and a cycle path. There is also a large number of amenities, including vehicle repair services and plumbing services.', NULL, 1, NULL, NULL),
(749, '2103', 'In addition to the various churches of different denominations, you’ll find primary schools and a secondary school in the Mona Vale location. Aside from the essential amenities, there is a shallow beach in this area that is next to a golf course as well as multiple reserves and parks. An additional beach which locals call The Basin can be found in the area, to which bodyboarders and surfers flock – it is a very popular spot for sea sports. You will also discover that there are several supermarkets in the 2103 location and many shops, so you have a wide array of amenities available to you here.', NULL, 1, NULL, NULL),
(750, '2119', 'Beecroft and Cheltenham are the two main suburbs located in 2119. Beecroft is a picturesque area that contains leafy parks, including Beecroft Park and the smaller Booth Park. In terms of schools, Beecroft has a public school and an Anglican school. In Beecroft, you will also find a vast selection of services, including dental care, hair and beauty services, cafes and carpentry services. Cheltenham is an affluent location offering a huge range of things to enjoy. It contains Cheltenham Oval and Cheltenham Park. If you are searching for educational institutions, the Cheltenham girls high school is one option for your children.', NULL, 1, NULL, NULL),
(751, '4860', '4860 is home to over 35 suburbs. Winding its way between each of the suburbs is the Johnstone River, to the east of which you\'ll find Flying Fish Point. This town is on the coast and has a local state school. Near the centre of the 4860 postcodes is Bamboo Creek, a small, rural location with farming activities and plenty of farmland. Goondi and Fitzgerald Creek are on the Johnstone River, and feature businesses such as estate agents, farmers and engineers, while Goondi Bend and Goondi Hill feature sports reserves and state schools. Venture further east and you\'ll find Innisfail - a suburb with schools, parks, lakes, and a botanical garden. The area also has a hospital and a memorial park. 4860 has a mixture of everything and suits families and the retired.', NULL, 1, NULL, NULL),
(752, '5016', 'Largs Bay can be found in 5016, as can Largs North and Peterhead. Largs Bay is just 16km away from Adelaide. It is also located on the coastline, where you will find Largs Bay Beach. Here, there are also cycle paths and piers to be enjoyed. Also within Largs Bay, you will find a school. Largs North is located to the north of Largs Bay. This slightly larger suburb contains the Largs North Reserve. It is also on the coast, where you will find cycle paths that have continued on from Largs Bay. In Peterhead, there are also a couple of reserves and various services. So, from bakeries to builders, you can make use of the many amenities that you\'ll find in 5016.', NULL, 1, NULL, NULL),
(753, '5076', 'The Athelstone suburb is only 10km away from the central business district of Adelaide, so it’s very easy to access. Surrounding this location is the tranquil River Torrens, and you will also find the Kangaroo Creek Dam as well as the Black Hill Conservation Park. There are several native wildlife species in the location and with multiple playgrounds and parks for children, this location is a great place to raise children. The spectacular views of the hillside are stunning.', NULL, 1, NULL, NULL),
(754, '7000', '7000 is a postcode that contains Glebe, Hobart, and Mount Stuart. It\'s also where you will find North Hobart, Queens Domain, and West Hobart. Though it is quite small, on its eastern border, Glebe features the Domain tennis centre and the Botanical Gardens. In North Hobart, there are many different international restaurants. You will also find a few secondary schools and other points of interest, such as the North Hobart Oval and the State Cinema. West Hobart, though once home to a farming area, now features a couple of schools and a college, while Queens Domain is a location in 7000 that has plenty of hills and inclines. It is mainly bushland, but barbecues are popular in this location.', NULL, 1, NULL, NULL),
(755, '3803', 'Points of interest in the Hallam location include the Hallam Community Centre and the schools in the area, but there is an array of other essential amenities in the area too. From the Fountain Gate Shopping Centre, to the cafes and bakeries, the services are numerous and the community vibe runs throughout the 3803 suburbs. A tennis club and a gym can be found here in addition to the indoor play centre – so you can access all the indispensable services needed to live a great life in the Hallam location.', NULL, 1, NULL, NULL),
(756, '4131', 'Located in 4131 are the suburbs of Loganlea and Meadowbrook. Along their eastern border is the Logan River. Both suburbs feature educational facilities, with Loganlea home to a state high school and Meadowbrook containing the Griffith University Logan. There is a hospital in Meadowbrook and you\'ll also find picnic grounds and beautiful open spaces along the river, such as Riverdale Park. Services in the Loganlea suburb include plumbers and air conditioning services, gas fitters, and TV antenna services. There are also lawn mowing services and swimming pool constructors in this location. You\'ll just love the greenery in 4131.', NULL, 1, NULL, NULL),
(757, '6225', 'Situated near the Collie and Harris Rivers junction, the 6225 location can be found in the Western Australia zone. The area has a coal-producing centre, but is also known for the Wellington Dam – a place where locals and tourists come to go swimming or fishing. Winner of the Australian Tidy Towns Competition, this location is committed to recycling. There is plenty of primary schools and one secondary school in the 6225 neighbourhood, and for tourists, there are attractions such as the Steam Locomotive Museum or the Collie Art Gallery.', NULL, 1, NULL, NULL),
(758, '3167', 'From the Dales and Talbot Parks, the many reserves and playgrounds to the sporting facilities, the Oakleigh South neighbourhood provides you with plenty of activities and amenities. The Mavis Hutter Reserve features gym equipment, which is a perfect way to get outdoor exercise. There are primary schools and secondary schools too. And there are also many places of worship in the area, including temples and churches, and for other sporting activities, you have the Olympic Ice Skating Centre right here in Oakleigh South.', NULL, 1, NULL, NULL),
(759, '4511', '4511 encompasses the areas of Godwin Beach, Ningi, and Sandstone Point in the locality of Northgate Central. The nearest urban centre to 4511 is the capital of Queensland, Brisbane, approximately 44km away. Notable attractions of the area include Godwin Beach, Shields Point and Parrot Island, which are all a short distance of under 5 kilometres away. Residents describe 4511 as a growing area with many new houses and apartments, located a short and convenient distance away from the central business district.', NULL, 1, NULL, NULL),
(760, '2546', 'With a population of just over 3000 people, 2546 cover the area of Narooma in New South Wales. Deriving from an aboriginal word meaning ‘clear blue waters’, 2546 has a range of beautiful natural features including Montague Island, which is a National Park and Wildlife Reserve. The mountain of Gulaga, located close to 2546, is a great natural feature that is said to resemble a dromedary camel. The oceanic climate makes 2546 ideal for both residents and tourists.', NULL, 1, NULL, NULL),
(761, '2143', '2143 contains three suburbs - Birrong, Potts Hill, and Regents Park. Reserves, parks, and plenty of schools await you in Birrong, making it one of the best places to raise children. There are walking trails and restaurants, cake shops that sell delicious eats, and a bowling club with a community feel. In Potts Hill there are also parks and reserves to be found. The central business district, Sydney, is 21 km away, but there are many services in the neighbouring suburb of Regents Park. In this location, there are cycle paths, reserves, and parks. You\'ll also find private schools, excellent transport that will take you into the central business district, and plenty of restaurants.', NULL, 1, NULL, NULL),
(762, '5116', 'From Evanston to Evanston Gardens, Evanston Park to Evanston South, 5116 contains rural locations and suburbs that have plenty of open green parkland. Evanston South features a wide range of services, from orthodontists to electricians to concrete gutter services. Its neighbouring suburbs, Evanston Gardens and Evanston Park are home to plenty of schools, and there is also a shopping complex in close proximity to Evanston Gardens. In Hillier, there are also many services such as gardening supplies, recycling depots, and industrial flooring services. This location is bordered by the Gawler River, which also flows into Gawler.', NULL, 1, NULL, NULL),
(763, '3756', 'Featuring various parks, including a water park that runs in the summer months as well as barbeque spaces and picnic areas, the Wallan neighbourhood is packed with things to offer. From essential amenities such as primary and secondary schools to the Wellington Square Shopping Centre and the childcare facilities in the area, there is something for everyone here in 3756. It has a community feel and if you need to venture slightly further out, the transport is good and reliable. The area has seen various housing developments and is very close to the Melbourne central business district.', NULL, 1, NULL, NULL),
(764, '5093', 'The 5093 postcode contains just two suburbs, which are Para Vista and Valley View. In Para Vista, you\'ll discover the Golding oval and a secondary school. The area boasts several small parks, including Kentish Green, and there is also a shopping centre to the north of the Para Vista suburb. In Valley View, The Thomas Turner Reserve is a notable point of interest with lush green parkland, cycle paths, walking trails, and the Dry Creek running through it. There are a huge number of convenient services in Valley View, such as pest control services, electricians, and gas plumbers. You\'re close to the central business district, but here there are plenty of amenities to enjoy as well.', NULL, 1, NULL, NULL),
(765, '5046', 'Oaklands Park and Warradale are the suburbs you\'ll find in 5046. This postcode has a little bit of everything - for everyone! Oaklands Park has the Westfield Marion Shopping Centre for convenience should you need to buy any key items. You\'ve got swimming pools, a reserve, and a recreation plaza all waiting to be discovered. And in the Oaklands reserve there are walking trails and the Sturt River. Warradale has a medical centre and several smaller park areas. There are also tennis courts in the area and a primary school.', NULL, 1, NULL, NULL),
(766, '2039', 'The only suburb you\'ll find in 2039 is the Rozelle suburb. You\'ll find cafes, walks along the waterside, a secondary college campus and a few beautiful parks here. To the east of this suburb, you\'ll find the Anzac bridge and cycle paths that cross into Rozelle over the Rozelle Bay. The Rozelle Bay itself surrounds the area on the east and western borders. Aside from the picturesque scenery, other perks include that you can make use of the convenient services in Rozelle. From building services to real estate agents, plumbers, gas fitters, and furniture movers, Rozelle Bay offers amenities, services, and attractions to be enjoyed.', NULL, 1, NULL, NULL),
(767, '5127', 'Wynn Vale is a lovely, green, tree-lined suburb in which you will discover that there are many things to do. The many services and amenities include various local shopping centres, sporting clubs, and restaurants. In addition to the nature reserves, you’ll also find many schools – both primary and secondary, and there are many cafes in which you can sip on your favourite beverage. It’s only 20km away from the Adelaide city centre, but with its community centre, tennis court, and playgrounds, you might just want to stay within the Wynn Vale suburb.', NULL, 1, NULL, NULL),
(768, '4807', 'Take the opportunity to go swimming or fishing in the waters of Lynch’s Beach – it’s a popular location in the 4807 area. Other fun and exciting activities are available to you in this neighbourhood too, including a wide range of sporting events. Touch football, soccer, golf, and tennis are often played in this suburb in the green open spaces. The Ayr location features many well-known chain stores and pubs. It has a cinema and a ten-pin bowling alley, as well as a public library. Take your pick of the many available amenities – you won’t get bored in the 4807 area.', NULL, 1, NULL, NULL);
