(769, '3143', 'Just 7km away from the central business district of Melbourne, you will find the Armadale suburb. It boasts numerous private schools and various lush green parks such as Victory Square Reserve, the Union Street Gardens, and Armadale Reserve. This location is also a place in which you can go shopping, and there are many restaurants in the area. The high street features well-known salons including Toni&Guy.', NULL, 1, NULL, NULL),
(770, '2464', 'Tourism and fishing are the pillars of 2464’s economy, perhaps owing to its proximity to the Clarence River. Also in this location, you’ll fund the Yuraygir National Park and multiple beaches, so you can take your pick! With a tranquil atmosphere, you can choose to relax in the Yamba area. But there is also the opportunity to enjoy the nightlife in the clubs or play sports in the recreation centres. Other options include dining in a local restaurant or watching a film at the cinema. From schools to churches, cafes to a golf course, there are plenty of things to keep you busy in the Yamba area.', NULL, 1, NULL, NULL),
(771, '2038', 'Annandale is only 5km away from the Sydney central business district. You will find various churches in this location as well as a few local schools. In addition to the Johnston Creek, the Annandale area is bordered by White’s Creek and Sydney Harbour. In addition to the cafes and shops, you will find that there are plenty of local restaurants in the neighbourhood should you get hungry, and with several green, leafy parks you’ll feel right at home with the whole family in this suburb.', NULL, 1, NULL, NULL),
(772, '3335', 'The Rockbank area is located just 29km away from the central business district of Melbourne. An Australian rules football team that plays in the Riddell District Football League calls the Rockbank suburb its home. There is also a primary school in the area and if you want to do some outdoor exercise such as biking or strolling, you should visit the Kororoit Creek Trail that runs alongside the Kororoit Creek. This location also features the Victoria’s Annual Olive Festival in addition to many local wineries.', NULL, 1, NULL, NULL),
(773, '3087', 'The well-connected postcode of 3087 links commuters of the Watsonia and Watsonia North suburbs to Melbourne’s bustling city centre via direct train links. Majorly residential, 3087 accommodates families of all age groups with diverse college options, a tennis sports club, plus a cricket and football stadium. Splash the cash at Watsonia shopping centre on the weekends or take a leisurely stroll through Binnak park, a vibrant picnic spot with a play area to let the kids loose on.', NULL, 1, NULL, NULL),
(774, '2871', '2871’s grand architectural buildings emit a unique charm that can be embraced at the gothic fountain located in Forbes’ town centre. Encapsulated by the banks of the Lachlan River, 2871 is home to acres of agricultural land where farmers harvest wheat and other similar crops. Forbes is a family-friendly town with a great choice of schools and plenty of parks to take the kids. 2871 is split by the A39, offering a direct route into the city of Melbourne and neighbouring suburbs. Close-knit residential areas mean you’ll never stray far from friends!', NULL, 1, NULL, NULL),
(775, '2319', 'Encompassed by the blissfully blue waters of Port Stephens lies 2319. Home to dense woodlands, Lemon Tree Passage, is a koala haven and other native wildlife. Local oyster farming industries supply delectable seafood within the small marinas along the shore. Grab a coffee before jumping on a ferry over to neighbouring Bulls Island for an exciting day out. Keep an eye out for indigenous flowers that sprout along Tanilba Bay. Residential areas sit adjacent to natural bike and trekking trails that provide an opportunity to connect with nature along the serine coastline and woods of 2319.', NULL, 1, NULL, NULL),
(776, '2070', 'You’ll have no trouble finding activities to do in 2070, situated just 13km northwest of the Sydney Central Business District. Follow the A1 Pacific Highway for a direct route into Australia’s most famous city. Discover independent coffee shops, bistros, and restaurants nestled in the suburbs of Lindfield. There are plenty of opportunities to be one with nature in East Lindfield, home of Nungara Reserve and Garigal National Park, or Lindfield’s Lane Cove National Park. 2070 is the ideal location for growing families with a good selection of schools and proximity to Sydney.', NULL, 1, NULL, NULL),
(777, '3629', 'Positioned on the banks of the Goulburn River lies 3629, a friendly rural town 112 miles away from Melbourne in Victoria. WB Ferrari park in central Mooroopna invites residents to play football and cricket on its soft grassy plains. The peaceful nature of 3629 is popular amongst retirees, 3629 is adjacent to Gemmill Swamp Wildlife Reserve, ideal for bird watching. If you’re looking for a livelier scene, you can catch the train from Mooroopna’s station located on the postcode’s border to the nearby city of Shepparton.', NULL, 1, NULL, NULL),
(778, '5049', 'The coastal region of 5049 perfectly blends residential areas filled with job opportunities with tranquil, scenic beaches. Take in the panoramic views of outstretching Southern Ocean shores that elevated Marino domains have to offer. Wear your best shoes along the cycle and walking tracks that lead to the 5049’s wine region. Seacliff Park is rich with indigenous history, celebrating its culture through the names of streets and attractions. Separated by the Ocean Boulevard, Seacliff, a neighbouring suburb, is the best place to catch an illuminating sunset or sunrise!', NULL, 1, NULL, NULL),
(779, '2064', 'Discover an abundance of opportunities in Artarmon, just 9km northwest of the Sydney central business district. Equipped with efficient public transport train, bus, and highway links to the city, 2064 is perfect for city-lovers. Clear your head while trailing along with one of Artarmon’s many cycle routes across the Reserve. During your spare time, head down to local cafes for coffee and a cake or visit one of 2064’s many restaurants for a delicious meal.', NULL, 1, NULL, NULL),
(780, '4110', 'There is so much to do in the developing suburbs of 4110 located in the city of Brisbane. If you’re aiming to keep active, head over to Acacia Ridge, home to the Iceworld Olympic ice rink and leisure centre nearby convenient shops. Residents of 4110 can easily travel abroad from Archerfield Airport, which operates around Acacia Ridge’s industrial district. Escape the hustle and bustle at one of the many parks, including Spotted Gym Street and Steelwood Street in Heathwood. Or even go for a yummy meal at Heathwood’s pizza place.', NULL, 1, NULL, NULL),
(781, '2477', 'Set Along the Scenic Eastern coast of Australia, 2477 is surrounded by both suburban life and the natural wonder of Australia’s landscapes. Containing areas such as Alstonvale, Bagotville, Dalwood, and Pearces Creek, just to name a few, 2477 is never lacking for wonderful places to call home. Local features, such as Pimlico Island and Rocky Point provide wonderful areas to explore and get in touch with nature. Connections to larger metropolitan areas such as Brisbane and the Gold Coast are also easily accessible.', NULL, 1, NULL, NULL),
(782, '2603', 'Located on the Southern wing of the heart of Canberra, one of Australia’s premiere metropolitan areas, 2603 is perfect for those looking to enjoy an exciting everyday life. Located within the Australian Capital Territory, 2603 is not lacking natural wonders alongside Canberra’s metropolitan lifestyle. Surrounded by Namadgi National Park, and Wadbilliga National Park, which is home to some of Australia’s best hiking routes, campgrounds, and wildlife preservation efforts! Local areas include Griffith, which is known for its suburban lifestyle and friendly population.', NULL, 1, NULL, NULL),
(783, '2630', 'Centralised around the suburb of Cooma, 2630 is a wonderfully situated area of Australia, with close connections to the city of Canberra, and a number of national parks and other natural attractions. Cooma, named for the Aboriginal word for ‘Big Lake’, is the central suburb of 2630, an area surrounded by wide-ranging peaks, and natural reserves. Other areas, such as Coonerang, Frying Pan, Shannons Flat, and Wambrook, just to name a few, are home to the population of over 9,000 people that call 2630 home.', NULL, 1, NULL, NULL),
(784, '2612', 'Just North of Canberra’s central hub lies 2612, home to areas such as Braddon, Campbell, Reid, and Turner. Braddon, Canberra’s most densely populated suburb, is focused on entertainment and residence, with attractions such as the Northbourne Oval, Lonsdale Street, an area comprising local restaurants, cafes, and small businesses, and Haig Park, a heritage site surrounded by tall trees. Campbell, one of Canberra’s other suburban areas, lies close to the Mount Pleasant Nature Reserve, complete with hiking paths, bike trails, and bird watching spots!', NULL, 1, NULL, NULL),
(785, '4850', 'Located towards the northwest coast of Australia, North of Queensland is the postcode of 4850. Home to suburbs such as Ingham, a small town with a population of over 4,000 friendly neighbours. The town is famous for its regional art gallery, the TYTO Regional Gallery, and its Australian-Italian Festival, which celebrates the cultural background of the local area! Not far from Ingham is the Girringun National Park, famous for its campsites, hiking paths, and amazing views from multiple lookout points!', NULL, 1, NULL, NULL),
(786, '2011', 'With excellent views of the World famous Sydney Opera House, via Garden Island, 2011 is an exciting and thriving postcode close to the heart of Australia’s most popular city! Home to Rushcutters Bay, famous for its harbourside suburbs of high-end flats, and views of countless yachts and small boats docked at the harbour, and Elizabeth Bay, famous for Elizabeth Bay House, a Regency style house that overlooks the harbour, 2011 is a wonderful mix of modern Australian life and Australian history!', NULL, 1, NULL, NULL),
(787, '3094', 'Home to the Melbourne-based suburb of Montmorency, 3094 is a highly popular place to live in Modern Australia! With a population of over 9,253, Montmorency is proving to be one of Australia’s most lively areas! Named after the local Montmorency estate, Montmorency is a suburb home to attractions such as Montmorency Park, and the Montsalvat art gallery. Many local businesses in the area incorporate ‘Monty’, a colloquial name for the suburb into their names, hence Montsalvat!', NULL, 1, NULL, NULL),
(788, '3019', 'Braybrook, a small suburb of the greater Melbourne area, is home to a population exceeding 9,000. A friendly population of neighbours, schools, and other amenities make it a wonderful place to live. With connections to the greater Melbourne area, but not completely out of reach of more rural areas, 3019 is perfect for anyone looking to live a modern Australian life. Braybrook is best known for its industrial history and the famous people that have grown up there, such as early pop singer Yvonne Barrett!', NULL, 1, NULL, NULL),
(789, '5034', 'Based close to the heart of Adelaide, one of Australia’s most well-known cities, 5034 is home to a number of suburbs such as Goodwood, which is home to a number of shops and businesses, as well as the Goodwood Primary School, Clarence Park, a welcoming community, and Kings Park, just to name a small few. 5034 has simple connections to the heart of Adelaide, and to more rural landscapes and towns, meaning a balance between modern suburban life and natural areas can be achieved easily!', NULL, 1, NULL, NULL),
(790, '2506', 'Overlooking Lake Illawarra, which reaches out into the South Pacific Ocean, lies the large suburb of Berkeley. Located on the Southern side of the city of Wollongong, and home to the largest concentrated population in the city, 2506 is a highly popular place to live, thanks to its easy metropolitan connections, and suburban lifestyles. Berkeley is famous for its dense population, owed mostly to its vast expanse of space, making accommodation easy for its still growing population!', NULL, 1, NULL, NULL),
(791, '6154', 'Featuring the suburb of Booragoon, named after the lowest parts of the Canning River, which it overlooks, 6154 is a popular part of the wider Perth area. Other areas, such as Alfred Cove and Myaree are famous for their proximity to Tompkins Park, an area that overlooks the Swan River, offering unparalleled views of the large body of water. The local population, which reaches in excess of 11,000 people, is highly warm, welcoming, and diverse, making 6154 a perfect place to call home.', NULL, 1, NULL, NULL),
(792, '3206', 'Home to the suburb of Albert Park, South of the centre of Melbourne, 3206 has become famous for its proximity to the greater Melbourne area, but also its proximity to Albert Park Circuit, which, to this day, is still the home of the Australian Grand Prix. Other local attractions at 3206 include St Kilda, a shopping esplanade, featuring dining experiences and live music, and the Southbank, a riverside complex that offers unrivalled views over the Yarra River!', NULL, 1, NULL, NULL),
(793, '6166', 'Encapsulating the Ocean facing suburbs of Lake Coogee, and Henderson, 6166 lies South West of Perth’s Central Business District, within the City of Cockburn. Other suburbs, Munster, and Wattleup are known for their suburban population, and the rich history of their local areas. With a population of over 9,000 people, 6166 is a thriving community of welcoming neighbours, who benefit from their proximity to Central Perth and the City of Cockburn, which is known for its multiple attractions, which include multiple reservation grounds and parks.', NULL, 1, NULL, NULL),
(794, '4502', 'Segmented by the major Dayboro Road, 4502 lies just North of Central Brisbane. Characterised by its two key suburbs, Frenchs Forest, and Petrie, 4502 is known for its abundant recreational facilities and natural reserves, to make staying in touch with Nature easy. 4502 also has easy access to Brisbane’s Central Business District, which makes it wonderful for striking a balance between the natural world, and Modern suburban life. Amenities, such as schools and supermarkets are easily accessible and do not detract from the natural beauty of the local area.', NULL, 1, NULL, NULL),
(795, '4802', 'With its direct views over the Coral Sea, 4802 is a wonderfully refreshing area of Australia, both to visit, and to live within! Encompassing the suburb of Airlie Beach, known for its beautiful beachfront and local restaurants and bars, where guests can look over the horizon. 4802 also encompasses the Cumberland Islands and Hook Island, which can be accessed for wonderfully relaxing beach vacations, where you can breathe in the ocean air, and enjoy the solitude that the islands offer!', NULL, 1, NULL, NULL),
(796, '5061', 'Remarkably close to Adelaide’s beating heart, 5061 is an immensely popular area for people to call home, due to its wonderful suburbs and its easy metropolitan connections. Unley, 5061’s most popular suburb, is known for being one of Adelaide’s best suburbs, due to its multiple homes and the friendly neighbours that inhabit them. Unley also has a wide variety of shops and cafes such as ‘The Pantry’, and ‘The Messy Tomato’. Unley is also home to the Goodwood Institute, built in 1928, which now hosts music and art performances!', NULL, 1, NULL, NULL),
(797, '2152', 'With friendly locals, and a perfect location to raise a family, 2152 is home to the Suburb of Northmead, itself only 26 kilometres from Sydney’s Central Business District. With multiple schools for local families to choose from, and a large number of shopping centres and shopping streets, 2152 is a wonderfully popular place to live in modern Australia, due to its suburban facilities, its urban connections, and its surrounding natural wonders, such as Bondi Beach, and the Western Sydney Parklands.', NULL, 1, NULL, NULL),
(798, '6016', 'A wonderful area to raise a family, with its abundance of local education offerings, and easy transport routes to reach the greater Perth Central Business District, 6016 lies just North West of the great city. Its two main suburbs, Glendalough and Mount Hawthorn are known for their welcoming neighbourhoods, populated by friendly and warm locals. With multiple shopping areas, cafes to unwind in, and schools to educate the local children, 6016 is proving one of the best suburbs in Perth to live!', NULL, 1, NULL, NULL),
(799, '2710', 'Located in the jurisdiction of New South Wales, directly North of the city of Melbourne, is 2710, a large collection of suburbs characterised by their proximity to vast desert landscapes reaching towards the Northern Horizon. Deniliquin, one of the most well-known suburbs, is known for its mix of suburban lifestyles and rural features, which allow locals to the neighbourhood to always feel in touch with the natural world around them. Raising a family within 2710 is also made easier, with local amenities and schools in abundance!', NULL, 1, NULL, NULL),
(800, '2028', 'Known for its central suburb, Double Bay, 2028 lies East of Sydney’s Central Business District, and looks overview of the Diendagulla. Double Bay Beach offers unrivalled views of Bradley’s Head and Clark Island. The suburb of Double Bay has easy access to Sydney, allowing for local residents to always be in touch with Australia’s most Modern offerings, but Double Bay offers a large number of entertainment facilities, as well as everyday facilities such as supermarkets, meaning that everything is always within reach!', NULL, 1, NULL, NULL),
(801, '5065', 'Within great proximity to Adelaide’s Central Business District, lying just South East, is 5065, a small area of wonderfully tight-knit suburbs. Included within these suburbs is Glenside, a beautifully kept suburb populated by a warm and welcoming community. With plenty of retirement homes and villages, fantastic shopping destinations, and easy links to Adelaide’s city centre, 5065 is a wonderful place for Australia’s aging population to occupy! Younger families can also benefit from local schools and modern facilities and entertainment to keep the whole family entertained.', NULL, 1, NULL, NULL),
(802, '2577', 'With vast expanses of nature, parks, and reserves in abundance, 2577 is a wonderful section of Australia both to visit, and to call home. Lying Towards the South of both Sydney’s Central Business District, and towards the South West of Wollongong, 2577 is home to popular suburbs such as Moss Vale and Kangaroo Valley. Kangaroo Valley is known for its surrounding hills and wide green pastures. The population of Kangaroo Valley may be small, at around 879, but the area offers a tight-knit community for new neighbors, and wonderful attractions for tourists!', NULL, 1, NULL, NULL),
(803, '6007', 'Surrounding the vast and beautiful Lake Monger Reserve is 6007, a postcode that represents the popular suburbs of Leederville and West Leederville, both divided by the Mitchell Freeway. Leederville boasts a wonderful neighbourhood with a strong community spirit, inspiring homes and gardens, multiple entertainment venues, and everyday amenities, such as supermarkets. Lying just North West of Perth’s Central Business District, Leederville and West Leederville also boasts wonderful connections to modern and metropolitan life!', NULL, 1, NULL, NULL),
(804, '7005', 'Facing over the River Derwent, which leads towards the Tasman sea, is 7005, a small collection of suburbs close to the heart of the city of Hobart in Tasmania. Suburbs like Sandy Bay boast wonderful views of the waters, and a number of high-end accommodations for a wide variety of ages, and family sizes. Being within such easy access to Hobart city makes 7005 a wonderfully modern place to live, that still offers a low-key neighbourly atmosphere!', NULL, 1, NULL, NULL),
(805, '3057', 'Brunswick East, the key suburb of 3057, which lies close to the Central Business District of Melbourne, features a striking mix of natural wonder and urban sprawl. With diverse and interesting shops, restaurants, and cafes, residents of 3057 are never at a loss for interesting things to see and do. Connections to the greater Melbourne area, also make it a wonderful area to live, as well as to visit, if you were seeking to escape the hustle and bustle of the city centre.', NULL, 1, NULL, NULL),
(806, '2025', 'Woollahra, the central suburb of 2025, lies close to the Diendagulla and the South Pacific Ocean, within reach of countless surrounding suburbs and attractions that make the most of these ocean and water views, such as the World famous Bondi Beach. Known for its village shopping centre, Woollahra is a wonderfully modern suburb, yet still surrounded by a rich history and plenty of natural grounds. 2025 lies to the East of Sydney’s Central Business District, so its urban connections are also strong.', NULL, 1, NULL, NULL),
(807, '7307', 'On the Northern Coast of Tasmania, overlooking the Bass Strait towards Australia’s mainland, is 7307, home to the suburbs of Latrobe, Harford, Shearwater, and Sassafras, just to name a few. With small, but welcoming populations, suburbs such as Latrobe have become known for being wonderful places to call home. Latrobe boasts numerous sports teams, and sports events, celebrated by the local community. Shopping is also easily within reach of residents of 7307, with a central shopping district found along Gilbert Street.', NULL, 1, NULL, NULL),
(808, '2072', 'Famed for its Golf Club, the suburb of Gordon, within the postcode of 2072, lies North of Sydney’s central business district. With a population of just over 7,000 and a wonderful suburban lifestyle to offer, thanks to its plentiful amenities, 2072 is a wonderful place to live in modern Australia. 2072 is also well within reach of multiple National parks and exciting nature reserves. As well as this, 2072 has very simple connections to the greater metropolitan areas of Sydney, making it a wonderfully situated location to call home.', NULL, 1, NULL, NULL),
(809, '5047', 'Looking out over the famous St. Vincent Gulf, and populated by suburbs such as Darlington and Seacombe Gardens, 5047 lies just South of Adelaide’s central business district. Surrounded by warm and welcoming suburbs, and not far from wonderful natural features, 5047 has proven a very popular place to live, as evidenced by its population in excess of 8,000 people. Nearby Sturt Gorge offers wonderful vistas, and recreational areas, surrounded by nature, and the easily accessible Adelaide makes metropolitan connections far easier.', NULL, 1, NULL, NULL),
(810, '4070', 'Towards the South West of Brisbane’s central business district is 4070, home to the suburbs of Moggill, Anstead, Bellbowrie, and Priors Pocket. With a population reaching well over 11,000 people, 4070 is a very popular place to call home, with much of that population represented by families, and young couples. The Suburb is within easy access to central Brisbane, but also has a selection of nature reserves and parks, making weekend getaways easier. Staying entertained in 4070 is also easy, with Bellbowrie receiving frequent visits from Brisbane’s mobile library service.', NULL, 1, NULL, NULL),
(811, '3200', 'Frankston North, a suburb on the Southern end of Melbourne, under the postcode of 3200, is commonly known to locals as ‘The Pines’, due to the famous ‘Pines Forest Estate, which formerly operated as the home of the Australian Defence Force. Frankston has a rich and vibrant history, and an excellent modern life, with wonderfully modern homes, countless sports teams and clubs, and bountiful reserves and amenities. Frankston North is also within simple reach of the Pines Flora and Fauna Reserve.', NULL, 1, NULL, NULL),
(812, '3102', 'Kew East, the central suburb of 3102, is a suburb of rich history, with a warm and welcoming population of over 7,000 people. Located close to the heart of Melbourne’s central business district, and surrounded by the Kew Golf Club, and Hay’s Paddock, themselves connected by a vast spread of natural reserves, 3102 is a wonderful area of Melbourne’s many suburbs if local people are searching for a comfortable balance between suburban, urban, and more rural lifestyles.', NULL, 1, NULL, NULL),
(813, '3089', 'Diamond Creek, a suburb represented by the postcode 3089, lies North East of Melbourne’s central business district. Diamond Creek is renowned for its rich history; in 1863, gold was discovered in the area, and mines were dug deep into the Earth to find in excess of £2,000,000 worth of Gold for the time! With a population of over 12,000, Diamond Creek has since become a popular suburb thanks to its urban connections, and suburban lifestyles.', NULL, 1, NULL, NULL),
(814, '2015', 'Just south of Sydney’s central business district is 2015, home to the suburbs of Alexandria, Beaconsfield, and Eveleigh. 2015 is blessed with a vibrant rich history, thanks to its strong connections to the greater Sydney area, and its past as a small municipality, since 1868. 2015 is blessed with a healthy and vibrant population of just under 13,000, which benefits from local amenities urban connections, and local nature reserves, such as Sydney Park.', NULL, 1, NULL, NULL),
(815, '3116', '3116 is in the locality of Ringwood, in the state of Victoria, situated around 32km northeast of Melbourne’s central business district. There are approximately 9872 people residing in Chirnside Park, which is primarily a residential area. Within 3116, there is the Chirnside Park Shopping Centre, as well as several schools. For entertainment, there are several sports clubs, as well as natural attractions Devon Peak, Killara Peak, and Cave Hill, all under 4km away, making them easily accessible.', NULL, 1, NULL, NULL),
(816, '2505', '2505 comprises the areas of Kemblewarra and Port Kembla, in the locality of Illawarra. With nearby features such as the Coomaditchy Lagoon (2.4km away) and Flinders Island (2.6km away), there are many great activities for residents and tourists alike. Illawarra is a coastal region, with beautiful natural features including mountains and lakes. Port Kembla is located 8km south of the central business district and has one of the largest industrial complexes in Australia. The name ‘Kembla’ derives from the aboriginal word meaning ‘plenty of wild fowl’.', NULL, 1, NULL, NULL),
(817, '4073', '4073 encompasses the areas of Seventeen Mile Rocks and Sinnamon Park, in the locality of Underwood central. Seventeen Mile Rocks is located around 11 kilometres from the Brisbane Central Business District (CBD), with a population of around 3000 people. Similarly, Sinnamon Park is located around 14 kilometres from the Brisbane CBD, and has a population of around 6500 people. Popular attractions in 4073 include Mount Coot-tha Park, Mount Elphinstone, and The Summit, all located under 10km away.', NULL, 1, NULL, NULL),
(818, '2446', 'Located within the Port-Macquarie council area around 19 kilometres from the centre, 2446 is a town within New South Wales. The area is known for being the location of the popular heritage theme park Timbertown, based on the logging industry that formed the early economy of 2446. There are around 7500 inhabitants and has several amenities including the Wauchope Golf Course and Country Club, a shopping centre, and a heritage building.', NULL, 1, NULL, NULL),
(819, '2481', '2481 covers areas in the state of New South Wales including Broken Head, Bryon Bay, Skinners Shoot, and Talofa. Located around 31 kilometres away from the urban centre of Lismore, there are several interesting features in the area including Moran’s Hill, Hogan’s Bluff, and Piccadilly Hill, all situated under 6 kilometres away. Broken Head is a great beach known for the long stretch ideal for walking or jogging, and great for visitors or residents.', NULL, 1, NULL, NULL),
(820, '3437', 'Covering the areas of Bullengarook, Gisborne, and Gisborne South, 3437 lies within the locality of North West Melbourne. Bullengarook has a relatively low population of just 600 people, with facilities including a fire station and a Recreation Reserve. Gisborne has a larger population of around 14,000 people and is known for its beautiful tree-lined streets, as well as its homesteads. Interesting features in the area include Mount Macedon, located 12 kilometres away, and the Pikes Creek Reservoir, located around 26 kilometres away.', NULL, 1, NULL, NULL),
(821, '2606', '2606 is a suburb that is the centre of the Woden Valley district and contains the main commercial centre. The area has a population of around 3000 people, and around half of its residential properties are flats. 2606 is named for Arthur Phillip, who was the first governor of new south wales. The area is also known for containing the Lovett Tower, which is the tallest commercial building in Canberra. The geology of 2606 is also interesting, as the rocks underneath Phillip are from the Silurian period, making them between 414 and 417 million years old!', NULL, 1, NULL, NULL),
(822, '4880', '4880 encompasses areas such as Bilwon, Chewko, Mareeba, and Maryfarms within the locality of North Queensland. Interesting local sites in the area include the Goose Swamp, Kates Sugarloaf, and the Green Swamp, all located less than 12 kilometres away. Mareeba in 4880 is named for the aboriginal word meaning ‘meeting of the waters’. 4880 has been described as having a unique lifestyle and culture, and has been described by locals as ‘living in paradise’.', NULL, 1, NULL, NULL),
(823, '4173', 'The area of 4173 is Tingalpa, which is a suburb of Brisbane, Queensland, located around 10 kilometres from Brisbane Central Business District. The area is known for its unique architectural style including post-war homes (such as weatherboard and chamfer board post-war cottages), as well as low and high set brick and tile homes. 4173 has undergone developments that have increased the median house prices. The area has a significant area of natural growth, including parks such as Minnippi Park and Meadowlands Park, situated close nearby.', NULL, 1, NULL, NULL),
(824, '2110', '2210 includes the areas of Hunters Hill, Hunters Hill West, and Woolwich, in the locality of Chatswood. Hunters Hill is situated around 9 kilometres North-West of the Sydney central business district, with a population of around 10,000 people. There are a number of heritage-listed sites in Hunters Hill, including The Garibaldi, and The Chalet. Woolwich in 2210 also includes Woolwich, which has a population of fewer than 1000 people. The area is named for the aboriginal word meaning ‘meeting of waters’.', NULL, 1, NULL, NULL),
(825, '4065', '4065 encompasses the areas of Bardon, Bardon West, Jubilee, and Rainworth in the locality of Northgate North. Situated around 5 kilometres away from the nearest urban centre of Brisbane, the area is in the state of Queensland. Interesting local areas of 4065 include The Summit, Mount Coot-tha Park, and Victoria Park, all located within 3 kilometres of the area. Bardon has a population of around 10,000 people and is known for being a leafy residential suburb. Similarly, Rainworth has a range of local amenities including a bakery, fish and chip shop, and Rainworth Park.', NULL, 1, NULL, NULL),
(826, '6012', '6012 covers Mosman Park within the locality of Curtin and has a population of around 9000 people. Mosman Park is a western suburb of Perth, known for attractions such as Mosman Bay, Buckland Hill, and Chidley point, all located just over 1 kilometre away. Previously, 6012 was an industrial centre of Perth within the 1970s but has developed to become an affluent suburb. Notable residents of 6012 include Angela Bennett, Lang Hancock, and Harriet Hooton. Transport links in the area include two railway stations, Mosman Park and Victoria Street, as well as public buses routed.', NULL, 1, NULL, NULL),
(827, '3054', 'Covering the areas of Carlton North and Princes Hill, in the locality of North West Melbourne, is 3054. Carlton North has a population of around 6000 people and contains features such as the Melbourne General Cemetery and the Princes Park. There is a significant commercial strip within the area containing amenities such as cafes, bookshops, businesses, and boutiques. Similarly, the area of Princes Hill in 3054 has around 2000 people and is named the Prince of Wales. Princes Hill has been dubbed chick city by locals due to the number of single women living there.', NULL, 1, NULL, NULL),
(828, '3909', '3909 lies within the locality of Country Victoria and encompasses areas such as Kalimna, Lake Bunga, Nungurner, and Toorloo Arm. Notable features within 3909 include Lake Tyers, Mount Nowa Nowa, and Lake King, all located within 25 kilometres of the area. Lake Bunga has been described as a great destination for tourists due to the beautiful natural scenery within the area. Areas such as Toorloo Arm have a median population age of 29, with around 300 people living there.', NULL, 1, NULL, NULL),
(829, '2021', 'Centennial Park, Moore Park, and Paddington are all within the area of 2021, in the locality of Bondi. Overall, Bondi has been described as a cosmopolitan area with frequent visitors from abroad, as travellers have stated it is a great place to return to. Rental prices in 2021 have risen, as well as the cost to buy property. Notable areas of interest within 2021 include Rushcutters Bay, Macleay Point, and Elizabeth Point, all conveniently located under 2.3 kilometres away.', NULL, 1, NULL, NULL),
(830, '4566', 'Munna Point, Noosaville, and Noosaville BC are within the location of 4566. Noosaville has been described as a laidback area, known for its beach style and subtropical climate. It is also known for having a range of beaches to suit everyone, including family beaches and surfing beaches for those looking to try the sport. 4566 also has a range of shopping facilities, cafes, and restaurants. Noosaville is affectionately known as ‘Noosa’ by locals.', NULL, 1, NULL, NULL),
