(931, '3225', 'With just one settlement area within 3225 boasting hundreds of acres, the suburbs around the region are undeniably vast, enviably beautiful, and blessed with the right amenities. Swan Island is not really a residential area for many, probably because of certain restrictions and gated communities that border the Military training grounds, and Defense departments. To the west of the island, there’s an exclusive Queenscliff golf club, and on the East, a Commonwealth protected area that preserves the natural coherence of the Island. More fun and accessible areas exist within 2191 like Swan Bay, which features fun cafes, surfing, swimming, golf courses, and tasteful wineries. Queenscliff is another coastal town south of Swan Bay and its waters run straight into Port Philip. There are twoers to climb, historical buildings to picture and an old Fort to visit.', NULL, 1, NULL, NULL),
