(938, '2429', 'Characterized with both outdoor and indoor restaurants and cafes, 2429 is an enjoyable mix of country and city life. The creeks and forests give off that traditional yet untouched feel for people looking to escape the hustle and bustle of contemporary modern cities. The rural areas like Bucca Wauka, Killiwarra, and Wingham give off that peaceful, friendly family vibe most resettlers are looking for in more country regions. Plus, the towns in 2429 have enough parks and recreational activities to keep the whole family busy. It also helps that small town like Wingham are not so far from city centres with options in regards to schools, malls and nightlife.', NULL, 1, NULL, NULL),
