(940, '2785', '2785 is stationed between Katoomba and Mount Victoria with two major towns within the area. Both Blackheath and Megalong rest near the peak of the Blue Mountains. The population isn’t so dense, and the lands are quite expansive. 2785 is also crowned with mountain peak vantage points for sightseeing and hiking tracks for leisure. From the Grand Canyon waterfalls to the Govett\'s Leap Lookout, Blackheath is a peaceful place to live in or visit. There are a good number of parks, recreational centres, and cozy country-styled homes. It may be slightly expensive because of its proximity to Sydney, and also because of all the tourists, the regions in 2785 attract.', NULL, 1, NULL, NULL),
