(942, '4067', 'The city of Brisbane is home to some riverside suburbs in 4067. This region has a mix of both highly-priced residential and commercial properties and more budget options. Suburbs and communities like St. Lucia and St.Lucia make 4067 a go-to region for developers, new/old professionals, families, and singles alike. There are a couple of standard schools and universities that also make this a choice destination for students. So don’t be surprised at how busy the roads get during peak admission seasons and school semesters. Another highlight of the 4067 regions is the fun nightlife and impressive diversity when it comes to the residents, cuisine and restaurants. It’s quite an impressive place to raise a family, create connections, tour, or just enjoy peaceful communal living.', NULL, 1, NULL, NULL),
(943, '4750', 'In the Northeastern part of Adelaide lies the picturesque towns of Bucasia and Shoal Point. These two towns serve the 4750 regions well as many tourists, visitors and new settlers troop into the area annually. Thanks to the beautiful honeymoon-worthy beaches, fascinating resorts and calm waters, 4750 enjoys a lot of praises from both residents and visitors. Bucasia Beach alone is one of the longest beaches in the Mackay region with a ton of fine accommodation spots that detail the length of the extra blue and white-sand beach.', NULL, 1, NULL, NULL),
(944, '3880', '3880 is yet another coastal region heavily endowed with beautiful blue waters, dreamy white-sand beaches, and alluring marine life. Most of the towns and localities within 3880 still have very country-styled residential areas, small pubs, and homey cafes. Places like Oceans Grange just don\'t have much land a large group of people can leverage on. Yet, this has become a popular tourist attraction within the Victoria axis. There are nice cottages and homes that sit right beside a lighthouse that watches over the vast waters. These same waters connect Lake Victoria to Ninety Mile Beach, with a neat divide that doesn’t just look good in pictures. The other areas within 3880 like Paynesville and Raymond Island are still characterised by large water. This makes the 3880 a good region to consider for ocean lovers, water-sports enthusiasts, and families who love simplicity and tranquillity.', NULL, 1, NULL, NULL),
(945, '2582', '2582 is another region that’s quite close to Sydney. It’s overrun with little rural communities and towns rich in history, wildlife, scenic spots, and expansive waters. Berremangra, Bookham, Bowning, Jerrewa, and Kangiara are just a few of the localities that exist within 2582. As you would expect, there’s still a lot of land in this region to be developed. Yet it seems most of the locals love the space, forestry and general country feeling 2582 has to it. Burrinjuk is one of the major towns in the area and does offer sight-seeing worthy places like the waters state park, Fiona-rich waters for fishing, walking tracks, and a spectacularly tall dam. 2582 does have some pre-schools and primary schools, yet some people may look to more Urban neighbouring towns like Canberra for more modern and diverse amenities.', NULL, 1, NULL, NULL),
