(947, '4205', '4205 made the top 20 list of best places to live in Queensland thanks to the calm and beautiful city of Bethania. Bethania was actually ranked the 11th best suburb to live by locals that reside across Queensland. Sure, it may not have the most thrilling nightlife, yet the tranquil settings, affordable housing, pet-friendly parks, and adequate transport systems may cover up for that. 4205 is wrapped around the almost enveloping embrace of the Logan River. This makes for nice campfires by the waters, excursions, or romantic locations for couples and families alike. Thankfully, the transport lines are efficient enough to convey people to more urban cities and towns, or maybe to even more country-side settings on the opposite end of 4205.', NULL, 1, NULL, NULL),
