(953, '4108', 'Brisbane is just 11Km away from the areas within 4108. This also means that its International Airport isn’t far from this region as well. Archerfield and Coopers Plains are the main suburbs within 4108, with Coopers Plains being home to a lot more residents than Archerfield. Both areas have become popular residential options for students, families, investors, and professionals alike. Thankfully, Coopers Plains boasts of a substantial number of amenities and services from schools, to supermarkets, transport lines, golf clubs, and other recreational spots.', NULL, 1, NULL, NULL),
