(956, '5280', '5280 sits about 52Km away from the vibrant Mount Gambier, with pleasant towns like Beachport, Tantaloona, Rendelsam, Millicent, and Hatherleigh. While some of the towns and localities in 4037 are mostly endowed with vast greenery, untouched forestry, towering trees, and fauna and flora, others are slightly more industrialized. Beachport and Millicent are certainly one of the towns that have embraced a little urbanization, yet that peaceful country vibe still prevails. From the conservation centres to the traditional beaches, caravan parks, memorials, and historical buildings, this is a culturally-rich zone to visit and settle in. The beauty and allure of the large farmlands, beaches, spectacular caves, and well-planned residential areas are just some of the reasons both families, new couples, professionals, and insightful entrepreneurs need to visit the towns in 5280.', NULL, 1, NULL, NULL),
