(958, '2050', 'Camperdown is just 4 KM southwest of the busy central district of Sydney. It’s a top region in 2050 with a good number of modern cafes, restaurants, serviced apartments, hotels and parks. You’ll certainly find more than a splash of industrialization in this cozy suburb. Plus, there are standard medical centres, eateries, parks, fitness centres, and other thrilling recreational centres. It may not be the most bustling town, yet it\'s still perfect for young professionals, singles, or students to have a riveting time.', NULL, 1, NULL, NULL),
(959, '2700', '2700 lies within the Murray region of New South Wales. It’s a populous region with a lot to offer in terms of infrastructure, services, and social amenities. Then again, there is almost an overwhelming rural community within the area, as opposed to the suburban regions. Still, towns like Narrandera and Morundah do boast of certain modern residential areas and contemporary commercial buildings. The cost of living is quite affordable too, and residents have access to good jobs and business opportunities. Additionally, 2700 does provide easily accessible schools, medical centres, as well as sporting and cultural centres. It’s certainly a decent place for large families, professionals, entrepreneurs, students and singles as well.', NULL, 1, NULL, NULL),
(960, '4390', 'When looking for a region that’s still largely untouched yet blessed with scenic views, 4390 should certainly make the list. Most of the localities in the region aren’t as urban as many city residents are used to. That’s because 4390 has a deep country feel, look and vibe. There are certainly residential areas scattered around, with vast farmlands, a lot of greenery, and natural forests. Places like Kindon, Lundavra, Wondali, and Wyaga are the more rural areas. Yet, you’ll still find decent schools, restaurants, Airbnb rentals as well as motels. Goondiwindi is certainly the suburb to look out for within 4390, you’ll find a bit more cafes, pubs, public markets, and schools. Still, for those looking for a wider range of options, you’ll have to travel about 169 Km to Toowoomba.', NULL, 1, NULL, NULL),
(961, '3807', '3807 is one of those regions that has the best of both worlds. Guys Hill embodies the more rural part of this region, while Beaconsfield is certainly more industrialised. Yet, both regions have their special appeal. With just 43Km separating Guys Hill from Melbourne, this residential area has proven to be very beneficial for both residents, retirees, and large families. There’s easy access to modern amenities in the surrounding urban towns but within the locality, you’ll find large bushlands, hidden residential gems, walking tracks, and a generally peaceful ambiance. Beaconsfield engenders a more fun and sub-city vibe. There are both public and private schools, cycling paths, a plethora of shops, recreational centres, and restaurants. In general, 3807 is a moderately priced residential area excellent for new settlers, large families, professionals, and retirees that love country living.', NULL, 1, NULL, NULL),
(962, '4107', '4107 lies to the North of Adelaide in Southern Australia. With two major areas, Salisbury and Salisbury East. Salisbury is a spirited, fast-developing yet community-centred suburb. It’s big on community events, and sustainability and promotes the peaceful co-existence of all nationalities within 4107. Community centres, libraries, and other cultural event centres are strategically positioned to maintain the vibrant community spirit. Additionally, the lively parks and recreational areas add even more colour to this dynamic town. Salisbury east is equally blessed with a good number of schools and medical centres. It boasts moderately-priced residential areas as well as peaceful neighbourhoods that are mostly inhabited by large families, retirees, singles and professionals.', NULL, 1, NULL, NULL),
(963, '3925', 'Right at the borders of Victoria lies the coastal towns of 3925. Cape Woolamia, Churchill Island, Newhaven, and San Remo are some of the most promising areas within the region. Sure, they may be more country than most are used to, still, the mega waters, lush farmlands, and historical sites make it a choice destination for new settlers and tourists alike. Discover the massive farmlands of Churchhill Island, tour the historical buildings and gardens, or look through some ancient collections on your way around. Beyond this major historical hub lies Newhaven, a coastal charm and fishing village for residents and new settlers alike. There’s a lot to do from surfing to exploring their chocolate factories or maybe simply relaxing in their tranquil serviced apartments. San Remo is the legendary gateway to Philip Island and is a lot more developed than it was years ago. The massive residential areas, restaurants, and beachside activities make it a mega settlement area for those that love modern amenities in a country setting.', NULL, 1, NULL, NULL),
