(965, '4000', 'In the suburbs within 4000, you’ll find more historic buildings and country-style residential areas. Yet, everything about the humble towns of Petrie and Spring Hills still screams luxury without compromising on the thrilling, adventurous vibes people expect from regions close to megacities like Brisbane. Petrie is surrounded by lakes, dams, and the North Pine River, this fact alone makes it a scenic attraction for recreational sports and other marine-related activities. In Spring Hills, the vibe is slightly more regal, it has that old-town look with roadside cottages and terrace-styled buildings. It’s surely a nice breather from the bristling mainlands, plus, when you get your fill, Brisbane is practically a walking distance away.', NULL, 1, NULL, NULL),
