(1114, '2911', '2911 is near the urban city of Canberra and boasts two major areas. Just 11 Km keeps the two regions apart, plus, the Canberra Train Station is also the closest railway to the 2911 regions. Crace and Mitchell also lie within the Canberra district, and they are the two major suburbs within 2911. Crace is quite a modern suburb and boasts a young population with a median age of 20 to 39. The total number of residents in the area probably exceeds 4,458, and over 68% of that number are homeowners. Both Crace ad Mitchell is excellent settlement areas for young professionals, singles, newlyweds, and families with small kids.', NULL, 1, NULL, NULL),
(1115, '2357', 'Dubbo is one of the closest urban cities to 2357. It’s about 136 KM away while Sydney lies about 345 KM far. Bugaldie, Coonabarabran, Parlewaugh, rock Glen, Ulamambri, and Yearinan are the areas that lie within the 2357 region. There’s a good mix of villages, localities, and towns, with Coonabarabran being the major town in the area. It’s known as the Astronomy Capital, thanks to the Siding Spring Observatory that keeps its eyes on the skies. Additionally, this suburb is beautifully surrounded by mountains and has a nice National Park and nature reserve. Plus, the residential areas within 2357 are largely affordable, the amenities are standard and the local shops and cafes serve lovely cuisine and beverage choices.', NULL, 1, NULL, NULL),
(1116, '2108', '2108 is one major region within Sydney popularly known for its many beaches. It’s just 31 Km off Sydney and 27 Km away from Central Coats. The LGA presiding over the region in 2108 is Warringah, the urban centre characterised by its many waters. You’ll find lovely trees lining the walking tracks leading to the beaches, a vast outline of shrubs and beautiful balancing rocks all by the waterside. There are numerous opportunities to hike through the mountains, dine at local restaurants, surf and snorkel, or just watch the sunset. With the choice of sea-view homes, lovely parks, and a friendly community, 2108 is certainly a region to consider when looking for a perfect country home.', NULL, 1, NULL, NULL),
(1117, '3113', 'In the city of Manningham lies two small towns, North Warrandyte and Warrandyte, all categorised under 3113. Both areas are largely residential, with vast shrubs, glorious greenery, and tree-lined streets. These twins lie on the northeastern fringes of Melbourne and are under the Mannington LGA. You’ll find the Yarra River sprawling through 3113, dividing North Warrandyte from Warrandyte. In North Warrandyte, the population stands at 2,956 with the median age in the town being 4o years. On the other hand, Warrandyte has a population of 5,502 and a median age of 43.', NULL, 1, NULL, NULL),
(1118, '3981', 'Bayles, Catani, Dalmoreand Koo Wee Rup are just some of the areas within 3981. The region is just 68 Km shy of Melbourne, with lots of vast lands and greenery spanning the length of its borders. Most of the regions have kept that rural/country look, so you’ll still find some dirt roads, massive green lands, and large farms scattered across 3981. Plus, even if things are slightly more modern in the contemporary suburb of Koo Wee Rup, the area still maintains its rich culture and historic background. Furthermore, the population in Koo Wee Rup stands at 3,585, with the median age being 20 to 39. Still, there’s significant land ownership in the area, and further development seems realistically inevitable.', NULL, 1, NULL, NULL),
(1119, '2714', 'Pine Lodge, Tocumwal, and Tuppal all belong to the 2714 region. The area is 71 Km close to Shepparton and 14 Km away from Boomagong Station. Other landmarks and areas proximate to 2714 include Quarry Hill, Native Dog Swamp, and Grahams Hills. However, the major region has its own striking appeal, at least enough to attract large numbers of tourists every year. Tocumwal is especially known as a holiday destination and the perfect place to raise a family. With over 23 beaches spanning the Murray River, practically all of them are not more than 5 minutes away from Tocumwal. It’s a paradise city waiting to be explored, with only 2,682 residents lucky enough to be living within its borders.', NULL, 1, NULL, NULL),
(1120, '4572', 'Just 89 KM away from Brisbane lies the scenic area that characterizes postcode 4571. It’s just made up of one major region, Alexandra Headlands. With a population of 3,958, this coastal suburb is one to look out for. First of all, it lies within the lovely Sunshine Coast region and is characterised by parks, lookouts, and beachside activities. Thanks to its position between Mooloolaba and Maroochydore, it has an inviting atmosphere with enough attractive sites to back up that vibe. Both residents and visitors love to surf, swim, or just watch the sunset in this scenic area represented by the 4572 postcodes.', NULL, 1, NULL, NULL),
(1121, '4563', 'Towering Mountains, attractive valleys, picture-perfect hills, and lovely ridges dominate the scenery within 4563. The region lies quite close to Sunshine Coast, with just 26 KM separating the two areas. It lies under the LGA of Isa, and while Brisbane is 116 KM away from most areas in 4563, it takes an hour and 30 minutes to reach Queensland\'s capital from Cooroy. Cooroy is a typical country town with standard amenities, a growing population of 3,785 and a median age of 60. The area is known for its pristine Mountain Spring Waters, and tourists equally swarm the place to explore the botanical gardens and discover more wildlife.', NULL, 1, NULL, NULL),
(1122, '4714', 'The regions in 4714 lie under the locality of Central Queensland. This area is about 493 Km away from Brisbane and 40 Km shy of Rockhampton. Some of the other areas that surround it are mostly mountains and lookouts like Sugarloaf Mountain and Mount Victoria. even more, the towns within it are largely categorised by creeks, hills, and lovely lookouts. Mount Morgan is one of the country towns within 4717, it has a population of 1,946 and an average age of 60. 69% of the inhabitants own lands within Mount Morgan, thanks to affordable housing and lovely country townhomes.', NULL, 1, NULL, NULL),
(1123, '4356', '4356 is listed under the locality of Toowoomba, which is about 45 Km away. It boasts up to 18 areas like Pittsworth, Kincora, Broxburn, and Evanslea. Most of the areas within 4356 are lightly populated and have a more rural vibe to them. However, thanks to its proximity to urban cities and even the capital of Queensland itself, development is hitting the area progressively. Pittsworth is the perfect example, this country town is known for its vast towns, lush greenery, and lovely neighbourhood vibes. Yet, what used to be a silent and somewhat dull area now has a growing population of over 3,300 residents, with 51% of them dominated by families.', NULL, 1, NULL, NULL),
(1124, '3393', 'Warracknabeal is one of the prominent areas within 3393 boasting an affluent population of 2,432. It’s surrounded by Ailsa, Aubrey, Bangerang, Kellalac, Cannum, and about five other areas. It doesn\'t necessarily have a young or middle-aged population, as the average age of the residents stands at 60. However, the Tudor-styled buildings, large farmlands, riverside trails, and historical centres still appeal to various age groups. Plus, there are sports activities to enjoy, recreational activities suitable for kids and young adults, as well as parks, pools and scenic gardens.', NULL, 1, NULL, NULL),
(1125, '4615', '4615 has over 18 areas categorised under it, with Toowamba being the district presiding over them. Brisbane lies about 139 KM away while the closest urban city is Toowoomba itself. You’ll find areas like Brooklands, Bull camp, Johnstone, Nananago, Wyalla and Tarong. Nananago is just one of the rural towns within 4615 with a population of 3,604. It’s an industrial area known for mining, agricultural, dairy and milling activities, among many others. It’s a very vibrant town knee-deep in rich culture, heritage and communal living. While everyone and anyone could probably live in this colourful town, the average age of residents stands at 60+ currently.', NULL, 1, NULL, NULL),
(1126, '3093', 'Moonee Ponds is an inner suburb city situated about 7 KM away from Melbourne’s Central Business District. It’s the only major region within 3039, with a young population of 14,268 residents. About 68% of the inhabitants are homeowners, and the area seems to have more singles than couples with children. Everything from their lakes, busy commercial streets, riverside parks, and lavish racecourses makes 3039 an attractively affluent region. There’s a good mix of historical buildings, iconic centres, and modern amenities for the average investor, family person or retiree or young professional.', NULL, 1, NULL, NULL),
(1127, '2420', 'The regions in 2420 sit very close to the urban city of Maitland with a 45 Km distance. It boasts of regions like Alison, Brookfield, Dungog and Salisbury among other areas. Towns like Dungog have a large family population, even though there are more singles living within its confines. Plus, with a total population of 2,021, the median age in Dungog stands at 6o+. Thanks to the beauty in this cozy historical town and the famous Williams River, Dungog continues to pull crowds and attract visitors, especially in the summer.', NULL, 1, NULL, NULL),
(1128, '3427', '3427 boasts a young population, out of a population of 2,756, the average age is 20 to 39. Diggers Rest, the main suburb in this region lies 21 miles northwest of Melbourne and is surrounded by Macedon Ranges. It’s one of those towns that hits the mark for being both a fast-developing area and a peaceful country town. With less than an hour\'s drive to Melbourne by train, Diggers Rest is that central town with hassle-free connections to neighbouring urban cities. It’s rich with historical and recreational centres, walking trails, flora and fauna reserves, as well as scenic parks. Furthermore, the rich communal vibe and family-friendly aura make 3427 a great settlement for families, singles, professionals, and practically anyone who loves a voguish and community-centric country town.', NULL, 1, NULL, NULL),
(1129, '4010', '4010 is quite close to the city of Brisbane with a mere 4.0 KM separating the two regions. The areas of Albion, Albion DC, and Albion BC fall under Northgate Central District and have the tributary Breakfast Creek running through their borders. Albion is one of the stand-out suburbs in 4010, with a population of over 4000 people. It’s largely residential, with most families, professionals, retirees and singles living within its borders. Additionally, the neighbourhoods are peaceful, slightly modern and homely, with parks and recreational activities nestled across the town.', NULL, 1, NULL, NULL),
(1130, '2346', '2346 lies close to Tamworth, which happens to be the nearest urban city to the areas of Halls Creek, Klori, Manilla, and Upper Manilla. Sydney sits some hours away with a 359 KM distance between the two regions. Upper Manilla has a population of around 270 people, and about 84 families make up part of that number. It may be a compact town, yet, there’s still a lot of space left untouched. Manilla seems to be the big sister that has more amenities and landmarks to boast about. It has a population of about 2,556 with a median age of 60. It’s hinged between the Manilla and Namoi Rivers and promises peaceful neighbourhoods, historical museums, and a National Park.', NULL, 1, NULL, NULL),
(1131, '6220', 'Kalgoorlie is the LGA presiding over the areas of Cookernup, Harvey, Hoffman, Myalup, Uduc and Warawarrup. Represented by 6220, the regions are close 117 KM close to Perth and lie even closer to Bunbury with just 45 KM separating them. You’ll find popular landmarks like Mount William, Dingo Knob, Seymour Falls, and Lake Preston. Harvey is one of the most populated towns within 6220, with 2,750 residents within its borders. Its lands are incredibly fertile, with lush vineyards, vast farmlands, and citrus orchards. Some of the charms of this compact town are the blissful cafes, walking trails, amphitheatres, parks, playgrounds and wineries.', NULL, 1, NULL, NULL),
(1132, '7304', '7304 has almost 30 areas within its borders, Deloraine, Brandon, Elizabeth Town and Montana are just a few examples. The region itself is 57 KM away from Launceston and 145 KM far from Hobart, Tasmania’s capital. Deloraine is one of the popular areas out of the multiple areas. The quaint suburb lies at the base of the Great Western Tiers mountain range with a population of 2,849 and an average age of 60. There are up to five schools in the area; three primary schools and two secondary schools. The residents enjoy everything from festivals, fine arts and crafts, antique shops, National Parks, distinct flora and fauna and delectable cuisines.', NULL, 1, NULL, NULL);
