(1133, '5268', 'Bangham, Bordertown, Cangara, Cannawigara and Western Flat are all areas within 5268. These regions are a few hours away from the urban city of Mount Gambier and slightly further from South Australia\'s capital, Adelaide. The nearest train station lies just 44 KM away while the Mount Gambier Airport is 155 Km far. You’ll find large farmlands scattered across the rural areas, as well as vast untouched lands. Bordertown is one of the more urban towns within 5268, it’s the gateway town to Victoria and South Australia as well. Plus, it sits on the brink of Duke’s highway. This makes most of the areas within 5268 very accessible, with functional transport lines or train services rendering standard mobility solutions in and out of the region.', NULL, 1, NULL, NULL),
(1134, '2827', 'New South Wales is home to the regions in 2827, while New Country West is the presiding locality. The area is located 351 Km away from Sydney, with Dubbo being the nearest urban area to the localities, towns and rural settlements within 2827. Bearbong, Breelong, Collie, and Curban are just some of the areas within the region, and they are highly categorised by historical centres, farmlands, vast lands, wide-stretch beaches, riverside attractions, and friendly communities.', NULL, 1, NULL, NULL),
(1135, '2549', 'Beaches, scenic hills, Lakes and peculiar bays characterize the regions within 2549. The region is listed under the locality of New Country West and has Sydney located about 367 KM away. The nearest urban centre to the regions in 2549 is Canberra, which is 195 KM away. The areas within 2549 are majorly seaside towns and rural communities with vast green lands or localities surrounded by towering trees and intimidating hills. You’ll find the Evans River snaking its way through the paths in Broadway or the Twofold bay and Aslings Beach in Nethercote. With real estate development progressively growing in the 2549 regions, these towns and rural areas are fast becoming home to more families, singles, investors, retirees and young professionals.', NULL, 1, NULL, NULL),
(1136, '4311', 'Atkinsons Dam, Brightview, Churchable, Minden, Coominya, Buaraba and Tarampa are just some of the areas within 4311. This region lies 43 KM close to Toowoomba, and 62 Km away from Brisbane. There’s also the Oakey Airport which is about an hour away from the regions in 4311. It has major natural attractions like Mount Tarampa, Atkinson\'s lagoon, Mount Mulgowie, and Lake Clarendon. Most of the region is largely residential, with vast untouched lands, overgrown greenery, with hills and mountains forming the perfect backdrop. Additionally, there are lovely riverside trails, heritage-style buildings, parks, farmlands and riverside attractions to enjoy.', NULL, 1, NULL, NULL),
(1137, '5373', 'Adelaide is the nearest urban centre to the regions within 5373. It is situated at least 75 Km away from the regions of 5373. The entire region is part of the Light Regional Council county and lies within the Mount Loft Ranges. Kapunda, one of the towns within 5357 boasts a population of 2,917 with a median age of 43. 48% are made up of families while 30% are single. Additionally, Blanchetown and other areas within 5357 have major attraction points like the natural reserves, conservation parks, the mines tourist walk and museum, and heritage trails.', NULL, 1, NULL, NULL),
(1138, '2776', 'Faulconbridge is the only area within 2776, and it is listed under the locality of Penrith. This rural town is 21 KM away from Richmond, which is also the closest urban centre to 2776. It’s characterised by old buildings, heritage-style homes, and very country-looking neighbourhoods. Additionally, the community spirit is vibrant, and the services and amenities are quite standards. You’ll find scenic natural attractions like the Clarinda falls, galleries and museums, and lush parks. Plus, any amenities not found in this picturesque town can easily be accessed in other neighbouring urban towns and cities.', NULL, 1, NULL, NULL),
(1139, '3918', '3918 lies quite close to Melbourne, with just 61 KM keeping the two regions apart. Melbourne Moorabbin Airport is equally situated a couple of minutes away from the 3918 regions. Bittern is the only major area within 3918 and is a rural town situated under the Mornington Peninsula. Bittern is a lovely quaint town with lovely trees lining the streets and neighbourhoods. Plus, it has lovely clean parks with lush greenery and other recreational centres. Thankfully, the transport system is standard as well, making it easy for residents to commute in and out of 3918 conveniently.', NULL, 1, NULL, NULL),
(1140, '5174', '5174 has just two major areas within its catchment; Sellicks Beach and Sellicks Hill. the region is 46 KM away from Adelaide, and 21 Km close to the Noarlunga Train Station. Selliucks town is a coastal suburb that overlooks scenic valleys, white sands, and extra blue waters. It has a population of 2,616 and a median age of 38, which clearly makes it a suburb with a fairly young population. You’ll mostly find retirees, young professionals, families, and beach lovers in general within the borders of Sellicks Beach. Sellicks Hill, on the other hand, features a panoramic landscape with picture-perfect nature views. The natural quarry, lengthy beach, temples, and wineries make the entire 5174 regions a go-to place for families, fun-lovers, and avid adventurers.', NULL, 1, NULL, NULL),
(1141, '4721', '4721 is categorised into these three major areas; Argyll, Clermont, and Pasha, They all belong under the LGA of Central Queensland. Some of the nearby features to 4721 include Mount Donnybrook, Dingo Range, Boomerang Waterhole, and Police Mountain. Within 4721 itself, you’ll find pretty lakes, lagoons, creek dams, historical centres and memorials, and a National Park. The population in towns like Clermont has grown over the years to over 3000. Plus, all three of these areas are highly historical, which is part of the touristic allure.', NULL, 1, NULL, NULL),
(1142, '3342', 'Ballan is a major area that lies in Moorabool Shire in South Western Victoria. It has a population of 2,976 with an average age of 40 to 59. It sits by the Werribee River about 80 KM northwest of Melbourne. Thankfully, this compact town has almost all the amenities most any town requires to function wholesomely. Healthcare services, schools, parks, fire services, ambulances, and childcare centres, are some of the basic services Ballan offers. Additionally, it’s blessed with golf courses, fishing reservoirs, tennis courts, bowling alleys, and fitness centres.', NULL, 1, NULL, NULL),
(1143, '3978', 'Cardinia, Clyde, and Clyde North constitute the areas within 3978. It’s 51 Km away from Melbourne, which is also the closest urban centre to 3978. Clyde is the most prominent suburb of the three and has a population of 2,117. It’s a largely residential area with affordable housing for young families, professionals, and retirees as well. Furthermore, there are standard schools in Clyde, yet the options are almost unlimited for parents that wish to enrol their kids in schools outside of 3978. There’s also a modern shopping centre, a tennis court, walking trails, and more. While it may not have the vibrant thrills seen in more urban areas, neighbouring towns like Berwick are just a few minutes away.', NULL, 1, NULL, NULL),
(1144, '3363', 'Mountain lookouts, scenic reserves, picnic areas, campgrounds, and water reservoirs are some of the features that typify 3363. Towns like Creswick are just 18 KM away from Ballarat and 122 Km far from Melbourne. The area lies under the Shire of Hepburn, with a population of 3,170. Creswick, as well as other areas in 3363, have undergone progressive development over the years. Investment has increased as well, with more than 78% of the residents owning their homes. Additionally, there are schools, parks, recreational centres, and childcare services perfect for families with kids, or the average adult that still loves to relax and have fun.', NULL, 1, NULL, NULL),
(1145, '2336', 'Aberdeen is one of the areas within the 2336 postcode. It’s a small town that lies in the Upper Hunter Region and oversees the New England Highway. Aberdeen is famously known for its vast green lands, massive pastures, and world-renown racehorse breeding. With a population of 1,894, its inhabitants are mostly young professionals, families, retirees, and commuters. Apart from the numerous horse studs, you’ll find delectable vineyards, expansive vineyards cheese factories, olive groves, and other farms\' fresh produce. While there aren’t many choice amenities in the area, the English Highway makes it easier for people to go to and fro to neighbouring towns like Scone for schooling, shopping, and in-depth medical checkups.', NULL, 1, NULL, NULL),
(1146, '4310', 'Allandale, Anthony, Blantyre, Woolooman, and Boonah are some of the areas within 4310. They are under the locality of Toowoomba, and this city is also the closest urban centre to the region in 4310. Brisbane equally lies about 107 KM away from towns like Boonah, while there’s the Rockbrae trains station just a few minutes away from the residential areas in 4310. Boonah is one of the rural towns in the region and has a population of 2,484. There are a good number of schools in the centre of the town, plus, the bus lines run within the town and also through Ipswich.', NULL, 1, NULL, NULL),
(1147, '2358', 'The nearest urban centre to the regions within 2358 is Tamworth, the administrative centre of the North-Western Region of NSW. it consists of areas, localities, and towns like Arding, Bakers Creek, Balala, Kingstown, and Uralla, among others. At the borders and proximities of 2358, there are other prominent landmarks like Gemini Mountain, Mount Lookout, The Pinnacle, and Mount Monopoly. These features already make the areas within 2358 very charming, especially with the backdrop of mountains guarding the various towns and localities. Uralla is one of the major towns in the region, that’s cleverly positioned at the convergence of New England Highway and Thunderbolts Way. with a population of 2,747, it’s a serene, scenic, and peaceful suburb great for retirees, families with kids, professionals and country lovers in general.', NULL, 1, NULL, NULL),
(1148, '6415', 'Goomarin, Korbel, Merredin, Nokaning, Norpa and Tandegin are the areas that constitute 6415. They lie about 246 KM away from Perth, which is also the nearest urban centre to 6415. The towns and localities are largely residential, however, Merredin happens to be the commercial and retail hub with a good number of Government agencies and services. The employment opportunities here are more extensive, plus, with just 3,370 people living in the town, it’s still quite peaceful and homely. Additionally, Merredin has more than five major transportation routes in and out of town for commuters, visitors, and tourists alike.', NULL, 1, NULL, NULL),
(1149, '7016', 'Risdon Vale is the only major area within 7016 that lies on the eastern banks of the River Derwent. It’s equally an outer suburb that’s just 9 KM away from Hobart. With a population of 2872, it’s more of a low-density suburb with vast greenery, extensive and untouched lands, and a well-planned layout. Additionally, it boasts a young population with a median age of 34, with about 30% of that number consisting of families. Furthermore, the transport routes are adequate, the cost of living is affordable and the local shops, restaurants, and cafes are more than adequate.', NULL, 1, NULL, NULL),
(1150, '5422', '5422 lies under the locality of Country South Australia. It’s about 233 Km away from Adelaide, with popular landmarks like Depot Hill, Black Rock One Tree Hill, and Aldermans Reservoir 30 minutes to an hour away. Cavenagh, Dawson, Peterborough, Parnaroo, and Ucolta are just some of the localities and towns found within the 5422 postcodes. Peterborough is one well-known suburb in the region. It boasts a population of 1,249 with an average age of 60. Furthermore, the proximity of the town to the Barriers Highway makes it easier for residents to commute in and out of town. However, being the Railway town that it is, Peterborough has some functional routes that don’t just sit as heritage monuments or historical attractions.', NULL, 1, NULL, NULL),
(1151, '4280', 'The Gold Coast serves as the county presiding over the regions in 4280. JImbooba, Maclean, North Maclean, South Maclean, and Stockleigh are the areas under this postcode and locality. The entire region lies close to, Brisbane, with just 39 Km separating the two areas. Furthermore, 4280 is quite proximate to the Greenbank Train Station, nothing more than a 10 to 15 minutes drive should get you there. Jombooba happens to be the most population-dense town within 4280, boasting a population of over 13,201. Yet, it’s still a cosy little country town with family centred values, some popular brand name stores, lovely cafes, diners and restaurants, medical and legal services, as well as standard private and public schools.', NULL, 1, NULL, NULL),
(1152, '2647', '2647 is under the locality of Canberra, and has just one region; the lake town of Mulwala. It lies across the waterways of Yarrawonga Weir and the Murray River. An extended picture-perfect bridge runs through the water of Yarrawonga and Lake Mulwala. While it has vast greenery and farmlands, 2647 is mostly known for its holiday resorts, marine activities, and retirement villas. Plus, with just three to four hours to Melbourne, it’s a lovely settlement area for young professionals, families, and singles that love the scenic country life, yet also yearn for some of the hustle and bustle of major urban centres every now and then.', NULL, 1, NULL, NULL),
(1153, '3919', 'Residents looking for the perfect blend of countryside and urban life will love the residential and industrial town of Crib Point. This suburb is the only gem in 3919, with u to 3,204 residents thriving in the area. The average age is 40 to 49, however, there are slightly more singles than families within 3919. With Melbourne just 64 KM away, it belongs to the urban enclave on the western port including Bittern, Crib Point, and Hastings. You will also find a railway station, recreation reserves, tennis courts, and a nice little shopping area. Crib Point is equally an excellent residential area for religious singles and families, as it has up to four churches, both Catholic and Protestant.', NULL, 1, NULL, NULL),
(1154, '7172', 'Tasmania is home to the regions within 7172, Sorrel, Nugent, Orielton, and Pawleena inclusive. The area is 29 KM away from Hobart, and 15 Km away from the International Airport. There are mostly rural settlements in this region, Sorrel is practically the only country town within 7172. With a population of 2,927, it’s quite a busy regional centre. Apart from being the most prominent in 7172, Sorrel is also the last big town en route to the Tasman Peninsula and the East Coast. One of the major allures of this town is its proximity to Hobart, yet beyond that, there are a lot of green fields, farmlands, historic churches and buildings, and colonial accommodations.', NULL, 1, NULL, NULL),
(1155, '3747', '3747 has up to nine areas within its borders, popular for their stellar wineries, historical buildings, virgin lands, and thick adventure forests. Baarmutha, Beechworth, Murmungee, Silver Creek, and Stanley are just some of the towns and localities within 3747. Baarmutha is known for its food and wine, Beechworth is a pristine historical town with great food, locally made wine, and maintained colonial buildings. It has a wealth of notable historical trails and gold mine sites, plus, there are lovely galleries and antique shops along with the commercial areas and neighbourhoods. This old city has a lot to offer in terms of scenic sites, lush accommodation options, rich cuisines and a lovely bar and restaurant choices.', NULL, 1, NULL, NULL),
(1156, '5117', '5117 is situated just 32 KM away from Adelaide, South Australia’s capital. It has one major area, Angle Vale, which falls under the City of Playford. It almost has that urban appeal, probably because of its proximity to Adelaide, yet it still has lush vineyards and massive farmlands. You’ll that find 93% of the 2,921 residents are homeowners, plus, there are more families in the area than singles. The median age of 40 to 39 may be a contributing factor, yet, there are still a lot of opportunities for more resettlers to nab their own acres before the prices move even higher.', NULL, 1, NULL, NULL),
(1157, '3498', 'There are many things to do in Irymple, the only major town within 3498. This Mildura suburb is situated on the Northern edge of Victoria and is about 470 KM away from Melbourne. The town lies between Mildura, which is just 6.8 KM away, and Red Cliffs near the Calder Highway. It’s a highly agricultural area, full of farmlands, vast greenery, and towering trees. Even though urban cities like Melbourne are hours away, 3498 has sufficient amenities to keep residents satisfied over time. The community college, primary schools, basketball, football, tennis, and cricket facilities, swimming pools, and public libraries can attest to that.', NULL, 1, NULL, NULL),
(1158, '4340', 'Embrace the country life in the localities and towns within 4340. With up to 18 major areas and landmarks to explore within the region, there’s a lot of greenery, and historic monuments to view while driving by. Rosewood is one of the popular suburbs within 4340, with 2,829 residents in the area, it’s very peaceful and family-friendly. Plus, it’s on the Toowoomba railway line, which makes it an easily accessible town. Furthermore, there are a good number of families and singles settled in the area, with a median age of 60. Still, there’s something for everyone to enjoy, from the tranquil parks to the historic Catholic Church, Motels, and Railway Museums.', NULL, 1, NULL, NULL),
