(1207, '3926', '3926 is home to scenic coastal towns and villages that all have diverse allures. One of the major upsides to this region is its proximity to Melbourne, with only 61 km between Victoria’s capital and the areas in 3926. Balnarring is one of the major areas among the others, with a growing population of 2,527. It’s hedged between Hastings and Flinders, in the southeastern Mornington Peninsula. There’s a lot to see from the abundant birdlife to the resident dolphins. Plus, there’s the Balnerring beach nearby with an in-land reserve, which allows residents and visitors to safely swim, or sunbathe is one of the cleanest white sands in Victoria. If you head out for a morning jog, you may just catch a glimpse of racehorses training by the beachside, or other residents taking advantage of the extended walking paths.', NULL, 1, NULL, NULL),
(1208, '2784', 'Bullaburra is the only town within 2784, yet there\'s still so much it has to offer in terms of real estate, parks and recreation, and food and beverages. The town is about 34 km shy of Richmond, with Sydney positioned at least 40 more kilometres away. With a population of 1,230, there are still a lot of virgin lands, and residential spaces to explore. One of the benefits of living in this humble country town is its proximity to the Great Western Highway which extends through to the Blue Mountains. 2784 is largely residential, so it pays to have standard transport lines running through more urban city centres or at least more modern neighbouring towns.', NULL, 1, NULL, NULL),
(1209, '5241', 'Lobethal is popular for their over the top ceremonies and festivities, communal spirit, and friendly neighbourhoods. A rich tradition that started out in the 1950s continues in the quaint country town within 5241, even to this day. With over 2,135 residents, Lobethal is burrowed between the picturesque creeks of Adelaide Hills and the borders of the valley. The streets are clean, the neighbourhoods are peaceful, and the parks are almost always vibrant. Along the streets, you’ll find lovely orchards, welcoming vineyards, and pretty heritage buildings. However, during Christmas, the streets get quite busy as plans for the Lobethal Lights festival fall into full swing.', NULL, 1, NULL, NULL),
(1210, '5461', 'About 100 km north of South Australia’s vibrant capital, the areas within 5461 lie right at the south bank of the tranquil Wakefield River. You’ll find lovely suburbs like Whitwarta and Balaklava promising rich history, heritage buildings, freshwater springs, lovely rock reserves, and thrilling marine life. Balaklava, which has a population of about 2,049 people is made up of a good number of families, professionals, retirees, and an equally significant amount of singles. Plus, while this town may have an average age of 60, there’s so much to do, regardless of the age group. Head to the 18-hole championship golf course, or peruse the exhibitions at the various galleries, head to the rocks reserve for some wall-paper-worthy views, or enjoy some of the best gliding and racing clubs 5461 has to offer.', NULL, 1, NULL, NULL),
(1211, '3793', 'Monbulk lies about 40 km away from Melbourne and south of the Silvan Reservoir. It\'s one of those laid-backcountry towns with a good communal vibe, and a couple of activities to get busy with. Plus, it is the only suburb within the 3793 postcodes and has a growing population of 3,583. It’s an old town established far back in the 1800s known for vast farmlands, berry farming, and of course, some of the tastiest jams in the area. Even more, there is a good range of old buildings and more voguish homes available in the area, with up to 83% of the residents owning their own properties. There’s also a good number of primary and secondary schools, sporting facilities, shopping hubs, cafes, wineries, and of course, naturally furnished neighbourhoods full of greenery and surrounding forests.', NULL, 1, NULL, NULL),
(1212, '2382', 'Boggabri, Wean, Maules Creek, and Willala are all areas within 2382. Maules Creek is more of a small settlement hinged at the pretty lower hills of Mt. Kaputar National Park in Narrabri. The major town within 2382 is certainly Boggabri, boasting a population of 856 residents, it’s the biggest contender for the honey capital of New South Wales. Plus, the town practically rests on an abundance of coal deposits, yet maybe more popularly known for its agricultural prowess. It’s a town for country lovers, big and small families, professionals, and retirees that crave friendly and engaging communities. Additionally, it’s easy to get busy every now and then thanks to the rich historical heritage displayed across the streets, art, and antique sheds waiting to welcome all and sundry.', NULL, 1, NULL, NULL),
(1213, '7007', 'The prestigious towns of Mount Nelson and Tolmans Hill are the only areas represented by the 7007 postcodes. The towns lie about 4.2 km up south, away from Tasmania’s capital. Plus, Mount Nelson itself is a popular natural attraction many in and around Tasmania crave to see every now and then because of the infamous lookout and overview of River Derwent. In addition to being just 10 minutes away from Hobart, the scenic Bruny Islands equally lies in view, which contributes to how much of a hot spot 7007 is. Most residences sit uphill, and the area may get a tad bit busy when visitors troop up to take in the lovely city views from the elevated vantage points. However, most homes, both old and new, promise a variety of decent-sized garden homes and large acreage blocks with an abundance of trees and greenery surrounding most neighbourhoods.', NULL, 1, NULL, NULL),
(1214, '2557', 'There are only two areas within 2557, however, the two towns are both scenic, lovely, and quite close to NSW’s capital city, Sydney. With population sizes of 1,669 and 2,286, both Catherine Field and Rossmore boast quiet neighbourhoods and peaceful living. Still, since 2557 is close to some major urban cities including Sydney, there’s easy access to modern amenities, and standard transport lines to get residents there and back. Additionally, there’s a good range of eateries, cafes, parks, recreational centres, and schools both in and around the suburbs of Catherine Field and Rossmore.', NULL, 1, NULL, NULL),
(1215, '6271', 'Hedged between Bunbury and Busselton is the quaint town of Capel, located just 212 KM away from Perth. This agriculturally rich region doesn’t just boast lovely landscapes, vast vineyards, glorious forests, and sumptuous fresh produce. It’s also popular for lovely marine activities from wading in the Ocean, thanks to River Capel, or swimming with the dolphins at the famous Bay. Visitors can also enjoy long walks across the extended jetty in South Capel or indulge in fishing, boating, surfing, or sailing. Other beachside towns or residential areas within 6271 include Peppermint Grove Beach and Forrest beach which feature lovely sea-view homes, extra white sands, and a lovely ambience many would love to wake up to every day.', NULL, 1, NULL, NULL),
(1216, '3741', 'Smoko, Mount Hotham, Freeburg, and Germantown are just some of the areas within 3741. Located in Northeastern Victoria, the entire region is known for its vibrant tourist attractions, lovely lookouts, and scenic mountainside roads naturally decorated with trees and lush greenery. Bright, one of the most popular and colourful suburbs within 3741, is certainly one of the most toured areas within the entire region. Imagine adventurous trails, swimming holes, and scenic waterfalls, all surrounded by picture-perfect rocky plains and mountains. That’s what this spirited town promises and more.', NULL, 1, NULL, NULL),
(1217, '3414', 'Antwerp, Dimboola, and Tarranyurk are the three major arrears in 3414. While Antwerp and Dimboola are more rural towns, Tarranyurk is a blossoming locality with a population of 30 people. Antwerp may be a town, however, its population has just 13 more people than Tarranyurk. It does have some pre-historical monuments and early missionary churches and the popular Wimmera River passing through the west of the town. All the areas within 3414 are surrounded by large landmasses and blessed with flourishing agricultural soil.', NULL, 1, NULL, NULL),
(1218, '4625', 'With up to 33 areas within the borders of 2297, this region is certainly not a small one. From localities to villages, and then developing quaint towns, 2297 has probably got everything the average visitor/resettler wants in a community. Most of the areas may still be rural, but that just blows over to the developing areas, maintaining the balance between the peaceful country charm and the fast-paced ease and class that comes with modernity. Gayndah, one of the popular areas within 2297, is the perfect example of what the entire region represents. It has a population of 1,968 with an average age of 60, plus a good family to singles ratio within its populace.', NULL, 1, NULL, NULL),
(1219, '2297', 'Tighes Hill is just 3.4 KM away from Newcastle, with the city of Sydney about 114.6 KM further. It’s the only area within 2297, yet this exquisite town has a lot going for it. This north-western suburb is largely a residential area, with over 64% of the 1,678 residents owning their homes. Plus, there’s been a recent influx of young professionals, and families with kids, probably because of the more moderately priced homes within 2297. Additionally, the town is close to everything, lovely beaches in the surrounding urban cities, good schools, lush restaurants, and more modern parks.', NULL, 1, NULL, NULL),
(1220, '6084', '6084 is home to Bullsbrook, Chittering, Lower Chittering, Avon Valley National Park, and Waylunga. Just 47 KM away lies Western Australia’s capital city, Perth, with other popular regions like Catambo Lake, Darling Range, Castle Hill, Mount Mambup, and Lake Pinjar equally in view. Chittering, which is just an hour\'s drive to Perth, is this lovely green town with lots of trees, layers of grass, and lovely landscapes to soak in. It’s popular for its blossoming citrus orchards, honey farms, wildflower gardens, and plush wineries. Bullsbrook is a more contemporary suburb situated in the city of Swan. You’ll find more modern neighbourhoods here, with street-side parks, lovely climb zones, the scenic National Park, and wonderful water parks suitable for kids, teenagers, young adults, and the entire family as a whole.', NULL, 1, NULL, NULL),
(1221, '5154', '5154 is admirably situated close to Adelaide, with an insignificant 16 KM separating the two regions. It’s home to the hearty town of Aldgate which has a growing population of 3,361. You’ll find leafy neighbourhoods, with tall trees, well-spaced homes, and lovely gardens. Plus, it’s suitably perched on Adelaide’s hills, with an enviable height that’s great for mountain cycling, long jogs, and energetic hikes. Along the peaceful streets, there are a good number of art galleries and craft shops available for easy perusal. Plus, more than a handful of eateries promise some of the best food South East Adelaide has to offer.', NULL, 1, NULL, NULL),
(1222, '2341', 'Tamworth is just 40 Km away from 2341 and 285 KM away from Sydney. Werris Creek is the only area within 2341, so there is a decent amount of amenities to enjoy within the quaint little suburb. With up to 1,572 residents within its borders, Werris Creek has a good number of families with kids, retirees, professionals, singles, and country lovers in general. Plus, up to 69% of the population live in their own homes, and most of the neighbourhoods have heritage-style or slightly old-looking buildings. Thankfully, most of the streets are quiet, lined with lovely trees, and a bit spacious when it comes to acreage.', NULL, 1, NULL, NULL),
(1223, '2559', '2559 is home to Blairmont and Claymore, which are both under the Campbelltown locality. Both are quaint little suburbs in New South Wales, with Sydney almost neighbouring the regions. Just 43 KM separates the areas in 2559 from NSW’s capital, and it’s obvious the ultra-modern, bustling city impresses on both Claymore and Blairmont. The latter is more of a heritage town with a vibrant horse-loving culture. Even their roads take after the majestic four-legged beast. There’s a good mix of modern and country-styled properties, standard schools, and fitness centres. Claymore brings even more to the table with lovely botanical gardens, modern art centres, mini-golf courses, large parks, and scenic water gardens.', NULL, 1, NULL, NULL),
(1224, '5244', 'Charleston, Harrogate, Inverbrackie, Mount Torrens, and Woodside are all the areas represented by 5244. With Adelaide just 31 KM away, this is surely an enviable zone to live in and visit. You’ll find quite a number of towns in the area, with modern amenities, developed neighbourhoods, lush greenery, and a region-wide country charm. Woodside is home to exquisite wineries, heritage buildings, wineries, and a good number of residential hotspots. It reflects in the number of homeowners in the town, as opposed to rentals. With a population of 2,593, at least 78% live in their own homes. You’ll also find lovely galleries, antique shops, diverse restaurants, and chocolate factories in the drive-by.', NULL, 1, NULL, NULL),
(1225, '2328', '2328 lies under the Hunter locality with Maitland being the closest urban city to the region. It has up to ten areas within its coverage, with Denman being one of the most popular small towns within the region. The area is populated with families, although there are more singles, which practically make up 53% of the 1,578 residents. It may be compact, however, this quaint town boasts lovely wineries, diverse wildlife, great food, and a pure heritage charm. There’s equally easy access to long and enjoyable cycling trails, and ridge walks, as well as scenic national reserves and modern hotels and horse studs.', NULL, 1, NULL, NULL),
(1226, '3139', 'Beenak, Don Valley, Seville, Woori Yallock, Wandin East, and Yellingbo are just some of the major areas in 3139. The entire region is about 51 KM away from Melbourne, with the locality of Ringwood presiding over the towns and settlement areas. Seville and Woori Yallock are two of the major towns within the area, and both have a lot to offer in terms of vibrant neighbourhoods, friendly communities, and parks and recreation. In Seville, you’ll find lovely luxuries like fancy wineries, vineyard garden estates, water parks, cherry farms, and nature reserves. Meanwhile, Woori Yallock is a cozy town with a population of 2,911 and 86% of those residents are homeowners. It’s popular for its railway cycling and walking trails, the mix of ultra-modern residences, and country-style buildings. Both areas are equally known for the vast farmlands, flourishing vineyards, and scenic greenery.', NULL, 1, NULL, NULL),
(1227, '3003', '3003 is enviably close to the famous capital of Victoria, Melbourne city. Just 2.8 KM separates the two regions, with equally popular areas like Coode Island, Princes Pier, Treasury Gardens, Point Ormond, and Greenvale Reservoir equally nearby. The main area itself is West Melbourne, which is actually the only suburb represented by 3003. This Inner suburb is bordered by the Yarra River, which lies in the Southern Region. With a population of about 5,515 people, the town is divided into two major zones, the west being largely dominated by shipping docks, warehouses, railway lines, and some wholesale stores. The East is a largely residential area with a good mix of old and modern buildings.', NULL, 1, NULL, NULL),
(1228, '3006', 'Southbank is under the locality of Moorabbin and is incredibly close to Melbourne, with just 1 km keeping it away from the 3006 postcodes. It’s an urban district in Melbourne, Victoria, well known for its urbane cultural centres, fancy theatres, and phenomenal recital centres. Plus, 3006 has infamous neighbours like the bordering Yarra River, with St. Kilda Road to the east. Even more, within the border of Southbank are many cultural and entertaining attractions from open-air dining, to the dynamic fleets along the Yarra River. You can choose from the plethora of fine-dining restaurants, pop-up diners, fast food kiosks, and indulgent cafes, or visit a bakery/confectionery for some sweet treats. The nightlife is brimming with vibrant activities, public art to enjoy, standard schools to enrol in, and a myriad of marine activities to enjoy.', NULL, 1, NULL, NULL),
(1229, '5260', 'Bayah and Tailem Bend are the two areas in 5260 situated close to the ever-popular Murray River. Tailem Bend is under the Coorong District Council and is just 86 km away from Adelaide. It’s majorly a cliff-top town that sits at the junction of Princes Highway and Duke, plus, because of its elevated vantage points, it promises great views of the Murray River. Even more, it has an invigorating motorsports park that attracts racers from in and out of the region to rev up the speed on the world-class tracks. If that’s not your cup of tea, there are calmer touring activities like hiking through the walking tracks, bravely exploring ghosts tours in the oldtown area, or dining at a local restaurant and enjoying good wine and lip-smacking soul food.', NULL, 1, NULL, NULL),
(1230, '3782', 'Paradise homes, rustic roads and homes, adventurous walking tracks, and thick bushlands characterize the entire region of 3782. The postcode consists of Avonsleigh, Clematis, Emerald, and Macclesfield. It lies only 45 km away from Melbourne and is also under the locality of Ferntree Gully. Avonsleigh is a compact town that has certainly held on to its old country customs. It shows in the rustic buildings, calm scenery, and small acre-homes. Avonsleigh has a population of 852, which is more than Clematis’ 350 residents. Yet, the latter town does have many lovely areas to eat, relax and shop. Even more, it’s well known for the vibrant clematis flower, which obviously inspired the name of the town.', NULL, 1, NULL, NULL),
(1231, '4106', 'Brisbane Market, Rocklea, and Rocklea DC are the three areas separated into the 4106 regions. Rocklea is a suburb with 1,595 people with an average age of 20 to 39 people. There are significantly more singles in this part of 4106 than families, yet that doesn’t limit the family-friendly amenities and activities in the area. There’s a lot of greenery to enjoy with family, alone or with pets, as well as tranquil parks and recreational centres to relax in. more importantly, Rocklea has a residential and industrial part, well kept on opposites sides of town. There’s great access to gyms, cafes, restaurants, libraries, and shops in the industrial area, and a good mix of modern and rustic homes in the residential areas.', NULL, 1, NULL, NULL),
(1232, '4156', '4156 is just 17 km away from Brisbane in Queensland. It has only two areas; Burbank and Mackenzie. Brisbane International Airport lies 20 km away while the nearest train station is just 6.6 km from 4156. Burbank is a lovely suburb in the city of Brisbane with fine natural attractions like the Koala Bushlands, memorial parks, and reservoirs. With a population of 1,061 residents and an average age of 40 to 59. It’s obvious mostly middle-aged adults with families live in the area. The neighbourhoods are clean and green, surrounded by lovely parks, and good enough amenities to keep the whole family going.', NULL, 1, NULL, NULL),
(1233, '4174', '4174 is enviably close to Brisbane, Queensland. Only 6.2 miles lie between the two regions, while the Brisbane Internation Airport and Hemmant Railway station are stationed really close as well. Doboy is yet another area that features what used to be a railway station.it also has a famous bridge, some stores, and warehouses. Hemmant, on the other hand, is a major suburb in 4174 situated between the Brisbane River and Wynnum Road. it’s a historical town with lovely monuments, heritage cemeteries, and pest-free neighbourhoods and is close to everything. Its proximity to major highways, train stations, airports, beaches, sports centres, and wildlife make it a choice location for many country lovers.', NULL, 1, NULL, NULL),
(1234, '5491', '5491 has two major areas; Belalie East and Jamestown. Jamestown is a country town in the mid-north part of South Australia. It sits on the banks of Belalie Creek and Crystal Brook-Broken Hill. You’ll find lovely monuments, a tranquil forest reserve, and a memorial park. Beyond the historical niceties of 5491, there are lovely wine bed and breakfast motels, recreational centres, commercial hotels, villas, and farm stays. Even though most of the neighbourhoods have rustic buildings or small acreage homes, there are some more voguish remodelled apartments and newer buildings that satisfy the needs of various residents.', NULL, 1, NULL, NULL),
(1235, '2365', '2365 has up to 27 areas within its borders, Backwater, Bald Blair, Glen Nevis, Georges Creek, Brockley, and South Guyra are just some of them. Guyra is just one of the many towns in 2365, and it’s situated between Armidale and Glen Innes. Its’ home to natural attractions like nature reserves lagoons, creeks, hills, mountains, and valleys. Even more, this elevated town is blessed with a lovely waterfall surrounded by shrubs and large rocky heights. There are other waterways perfect for swimming, fishing, and canoeing. There are lovely reserves excellent for birdwatching picnics and barbeques.', NULL, 1, NULL, NULL),
(1236, '5172', 'Jackson Hill, Mount Wilson, Loud Hill, Onkaparinga Gorge, and Gull Rock are just some of the scenic places that surround 5172. The actual areas within this postcode include towns and localities like Kyeema, Hope Forest, The Range, Whites Valley, and Yungi. Willunga is another major town within the 5172 catchments located in the southern part of Adelaide. It lies about 47 km away from Adelaide, and has a population of 2,319 with an average age of 40 to 59. About 85% of the residents live in their own homes, plus, the town has more families resident other than singles. Still, Willunga has a Port Willunga Beach, diverse restaurants, rustic wineries, regal cottages, and clear cycling trails to keep all age groups within the town busy.', NULL, 1, NULL, NULL),
(1237, '3114', 'Park Orchards is the only area within 3114 and it features tree-lined streets, well-planned neighbourhoods, adequate parking spaces, and minimal traffic. With a population of 3,844 residents that live in mid-range to luxury homes, it’s a largely in-demand suburb. The neighbourhoods hold large-acreage homes with modern designs and an allure that keeps attracting more investors to the area. Plus, the thick bushlands, modern amenities, and its proximity to Melbourne make it even more attractive to visitors and resettlers that want to escape the city, yet still want to enjoy the luxuries and vibrant feel in a thriving country town.', NULL, 1, NULL, NULL),
(1238, '3472', '3472 is only 52 km away from Bendigo, which happens to be the nearest urban centre to the region. It consists of areas from Bet Bet to Bromley, Eddington, Inkerman, and Mcintyre. It’s also surrounded by lovely places like Mount Moliagul, Pyrenee range, Ben More, and Mount Hooghly. Dunolly is one of the prominent areas in 3472 and has a population of 893 people. This town is a lovely and peaceful one with tree-lined streets, heritage buildings, and decently-sized homes. There’s also a lot of historical architecture on the streets and some hidden walking trails that lead thick into the rich bushes. You may also love the adventurous hide-out caves located deeper into the town, or enjoy some marine activities at Loddon River or Laanecoorie.', NULL, 1, NULL, NULL),
(1239, '3858', 'Heyfield is one of the towns in 3858 under the Country Victoria locality. It’s about 161 km away from Melbourne, with Mount Hotham Airport just 114 km near. Get ushered into the warm arms of a close-knit community, fertile lands, and country hospitality. Plus, this part of 3858 offers multi-dynamic locations from fine restaurants to romantic gateways or family holiday sites. With a population of 1,993, there’s still a lot of untouched lands in the area, which makes for blissful open spaces, a tranquil environment, and maybe even great picnic spots.', NULL, 1, NULL, NULL),
(1240, '7170', '7170 is home to the popular Seven Mile Beach, as well as Acton, Cambridge, Mount Rumney, and Roches Beach. The entire region is just 15 km away from Hobart, which makes it easy for the people in 7170 to gain access to a wider range of amenities around the state’s capital. Additionally, 7170 has two rural communities largely known for their scenic beaches; Seven Mile Beach and Roches Beach. Acton Park, on the other hand, is a largely residential rural settlement with 2078 residents. Even though Cambridge has fewer people living in the area, it still has lovely wineries, vast greenery, extensive grapevines, and rustic cottages to explore.', NULL, 1, NULL, NULL),
(1241, '4660', '4660 has about 25 areas within its borders, with lovely areas like Robinson Range, Seaview Range, Burrum Point, Cabbage Tree Mountain, and Woowoonga Range. Additionally, 4660 is close to Bundaberg, Queensland, and boasts historical, national trust towns like Childers. Childers is a country town located in Bundaberg with a population of 1,584. It’s a lovely settlement for families and has more than three schools and a number of childcare services within the town. Beyond that, this heritage town is full of rich history that carefully takes residents and visitors to the past and back. It’s categorized by rolling green hills, large farms, and lovely tree-lined neighbourhoods.', NULL, 1, NULL, NULL),
(1242, '3862', 'About 192 km east of Melbourne lies the scenic towns of 3862. Munro, Stockdale, Castleburn, Cobbannah, and Hawkhurst are just some of the rural settlements within the area. However, Stratford is more of a country town and boasts a higher population of 1950. It sits close to the Princes Highway in the Shire of Wellington. Most of all, this area is known for its vast parks, lush wineries, and nature reserves. Plus, it practically sits beside the Avon River, giving both residents and tourists some of the most picturesque views from the pathways and cycling paths that lead to the water banks.', NULL, 1, NULL, NULL),
(1243, '6333', 'West Australia is home to the 17 areas within 6333. They lie under the locality of Kalgoorlie with the nearest urban centre to 6333 being Albany. Denmark, one of the coastal towns in the region may be a more recognisable name among the many landmarks, localities, and rural areas represented by 6333. With up to five schools, 43% of families out of the 2,643 residents certainly have more choices when it comes to education. Even more, Denmark has a lot to offer in terms of recreation and sightseeing. The picture-perfect Greens Pool is certainly a must-see for most tourists. Yet, that’s not all, there’s Monkey Rock, Elephant Rocks, and the Wilson Inlet to explore. Plus, there are various beaches, the heritage rail bridge, and the Valley of Giants to enjoy.', NULL, 1, NULL, NULL),
(1244, '3797', 'Mount Towt, Red Hill, Forets Hill, and Silvian Reservoir are just some of the landmarks and natural attractions in and around 3797. The region itself is comprised of Gilderoy, Gladysdale, Powelltown, Three Bridges, and Yarra Town. Gilderoy lies on the Yarra Junction Road very close to Powelltown. It features vast, green virgin lands, lovely and peaceful neighbourhoods, as well as a growing population of 65 people. Yarra Junction has the largest population size in 3797, with 2,549 residents. Just 66 km away from Melbourne, this business town features a railway station museum, lovely vineyards, art galleries, large farms, fauna reserves, and rail trails. It’s a peaceful region perfect for families, retirees, professionals, and country lovers at large.', NULL, 1, NULL, NULL),
(1245, '2758', '2758 is enviably close to Richmond and Sydney and has up to nine areas within its borders. Towering trees, vast virgin lands, and scenic mountains surround the town of 2758, making it absolutely bearable to live in towns like Berambing in the summer. Further down the rolling green foothills of the Blue Mountains lies Kurrajong, which is a little over an hour\'s drive to Syndey. It’s categorised by cozy cafes, charming lookouts, relaxation spots, parks, and antique shops. While most of the buildings retain that old-country look, some neighbourhoods are rather modern, and more homes are being remodelled into more voguish styles.', NULL, 1, NULL, NULL),
(1246, '5277', '5277 is only 44 km away from Adelaide and is enviably surrounded by Lake Mundi, Rocky Castle Swamp, Mount McIntrye, and Lake Edward among others. The vibrant rural areas of Comaum and Glenroy are known for their standard wineries while Nangarry is more prominent for its forestry and large virgin lands. Penola is slightly more voguish, has a larger population of 1,312, and is famously known for being home to the country’s first saint, Mary McKillop. Her heritage memorial centre is still frequented by locals and tourists alike to date. Even more, there are vineyard estates to pursue through, boutique shops and markets to shop at, cafes and restaurants to excite the palette, and heritage walk to explore.', NULL, 1, NULL, NULL),
(1247, '3770', '3770 is a region popularly known for its vast grapevines and standard wineries. Coldstream, Gruyere, and Yering are the only three areas within the region and are favourably close to the city of Melbourne. Coldstream is a largely residential town with lots of farmlands and wineries. It attracts country lovers in and out of Melbourne simply because of its sophisticated country vibe, classy wine houses, and hot air balloon tours. Gruyere is stationed right behind Coldstream and Wandin. It’s categorised by the massive farmlands in the area. Apples, pears, citrus, cattle, and other farm animals are a norm in 3770, but more prominent are the many wineries around town.', NULL, 1, NULL, NULL),
(1248, '4515', 'Conondale, Jimna State Forest, and Yabba Falls are just some of the natural attractions found in 4515. With rural towns and localities like KIlcoy, Jimna, and Mount Kilcoy, there’s a lot of country life to soak in from all three areas in 4515. With Sunshine Coast lying 55 km away, and Brisbane almost 90 km close, 4515 is more or less a central area with decent access to more urban cities and towns. Jimna is a large residential area blessed with natural attractions like the fire tower, lookout tower, Conondale National Park, Jimna State Forest, and Yabba Falls. With a population of residents of less than 100, the area is still sparsely inhabited when compared to Kilcoy, which has a larger population of 1,898.', NULL, 1, NULL, NULL),
