(1339, '3221', '3221 has up to 21 areas within its borders, with Anakie, Barrabool, Batesford, and Moolap being some of the towns and localities in the region. 3221 also lies within 17 km of Geelong, which happens to be the closest urban city to the region. The twins all have something multi-dynamic about them, with some being more industrial or residential than the other. As for Moolap, one of the suburbs within 3221, it’s both a residential and industrial town that’s quite large, yet scantily populated. Its borders stretch from Point Henry to Corio Bay, all the way through Bellarine Highway and unto Reedy Lake.', NULL, 1, NULL, NULL),
(1340, '3332', 'In the beautiful capital city of Melbourne, Victoria lies the 3332 postcode, with only one area manning this region. Lethbridge is a vibrant suburb under the Country Victoria locality, very close to Geelong. It’s home to some really prominent buildings in Melbourne, which is about 75 km south of 3332. Hinged on the Midland Highway town is surrounded by greenery, lovely hilly lookouts, and vineyards. With a population of about 1,024, the town has more of a middle-aged population. However, most of the inhabitants have their own homes, with up to 90% ownership to 10% rental homes.', NULL, 1, NULL, NULL);
INSERT INTO `pin_codes` (`id`, `pin`, `description`, `state_id`, `status`, `created_at`, `updated_at`) VALUES
(1341, '3920', '3920 is a protected region under the Frankston locality in Melbourne, Victoria. It’s home to two major naval depots in Australia; Flinders Naval Depot and HMAS Cerberus. Both have become quite modern heritage sites because of the vast development carried out in the area. The world-class HMAS Cerberus is stationed adjacent to Crib Point on the Mornington Peninsula trail. With an official population of 1,040, the area has four tri-service schools, with a focus on training army and navy personnel. However, residential areas have sprung up over the years, as well as basic shops, and also fun tours and cruises that take residents to the Sydney Harbour cruise, Sub Base Platypus, and other Garden Island tours.', NULL, 1, NULL, NULL),
(1342, '3944', 'Portsea is the only area within the 3944 postcodes and is under the locality of Frankston. It’s 35 km close to Geelong, and about 61 km away from Melbourne. Some of the main attractions in and around 3944 are Timms Tunnel, London Bridge, Observatory Point, Lighthouse Point, and Lonsdale Rock. It’s quite the affluent coastal town, featuring spectacular mansions, private jetties, and perfectly serviced terrace homes by the beachfront. However, this is more than just a rich-mans club or millionaires\' hub, 3944 sits at the tip of the Mornington Peninsula and is the perfect holiday destination for newlyweds, couples, families, and professional groups as well.', NULL, 1, NULL, NULL),
(1343, '3099', 'Strathewen, Hurstbridge, Cottles Bridge, and Arthurs Creek are all towns within 3099. Three of them still have a growing population of fewer than 1000 residents and vast virgin lands that remain preserved and untouched. The only town that has more residents than all the other towns combined is Hurstbridge, which boasts 3,444 residents. Most would describe it as a tight-knit community that works vehemently towards the peace and progress of their town. It may only be about 26 km away from Melbourne, however, it’s certainly less busy, and may be seen as a slightly sleepy town compared to its urban counterparts.', NULL, 1, NULL, NULL);
